exactlyAssertedEL_next(comment, xor, "The LogicalConnective that represents exclusive-or in CycL. Unlike or, which is a VariableArityRelation, xor takes two arguments, which must be instances of ELSentence-Assertible. (xor P Q) means  one but not both of P and Q is true. (An EL formula that mentions \n  xor is translated during canonicalization into an equivalent, less compact, formula that mentions or, and, and not).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, unknownSentence, "A unary KBDependentRelation (q.v.) that takes instances of CycLSentence as arguments.  <code>(unknownSentence SENTENCE)</code> means that <code>SENTENCE</code> is not currently  \"known\" by the Cyc system to be true.  More precisely, the inference engine cannot prove <code>SENTENCE</code> <i>using only removal</i> (see CycRemovalModule) from the current state of the knowledge base.  <code>SENTENCE</code> might actually be known to be false (see the specialization contradictorySentence), or its truth-value might be simply unknown in the present sense.  \n<p>\nNote that, as a KB dependent relation, unknownSentence is notAssertible (q.v.).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, unitMultiplicationFactor, "A ternary MetaFunction predicate that relates two interconvertible UnitOfMeasures (q.v.) to the real number by which the larger unit is a multiple of the smaller.  <code>(unitMultiplicationFactor SMALLUNIT BIGUNIT N)</code> means that there are <code>N SMALLUNIT</code>s in one <code>BIGUNIT</code>.  In other words, to convert from a measure <code>BIGUNIT</code>s to a measure in <code>SMALLUNIT</code>s, multiply by <code>N</code>.\n<p>\nFor example, (unitMultiplicationFactor Inch Foot-UnitOfMeasure 12) entails that, when converting from feet to inches, one multiplies the number of feet by twelve.\n<p>\nNote that <code>SMALLUNIT</code> and <code>BIGUNIT</code> must be instances of the same InterconvertibleUnitType (q.v.), and that <code>N</code> must be greater than or equal to 1.\n<p>\nSee also QuantityConversionFn.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, trueSubL, "<code>(trueSubL SUBL)</code> states that the SubL expression <code>SUBL</code> evaluates to a value other than NIL.  This predicate allows for a procedural test for programmatic 'truth' in the implementation language to be reflected as a CycL test for logical truth in the logical language.  For example, <code>(trueSubL (ExpandSubLFn () (integerp 42)))</code> states that the SubL expression <code>(integerp 42)</code> evaluates to something other than NIL.  See ExpandSubLFn for a way to denote SubL within CycL.  See also evaluate and EvaluateSubLFn, and performSubL.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, trueSentence, "A KBDependentRelation (q.v.) and specialization of consistent (q.v.) that is used to state that a given CycL sentence is true.  <code>(trueSentence SENT)</code> means that <code>SENT</code> is true.\n<p>\ntrueSentence is a non-assertible predicate (see  notAssertible).  But this puts no real limitation on the expressive power of the Cyc system since one can assert that <code>SENT</code> is true by simply asserting <code>SENT</code> itself.  \n<p>\nMost occurrences of the expression 'trueSentence' in CycL assertions have been added by the canonicalizer, so that certain nested sentences (or variables occurring in argument-positions intended for sentences) can receive special handling during canonicalization or inference. See the accompanying cyclistNotes for details.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, trueRule, "(trueRule TEMPLATE FORMULA) states that FORMULA is both true and an instantiation of the rule template TEMPLATE.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, transitiveViaArgInverse, "A MetaPredicate used for stating that a given predicate behaves transitively, in a specified argument-place, with respect to the inverse of a given binary predicate.  <code>(transitiveViaArgInverse PRED BINPRED N)</code> means that the <code>N</code>th argument position of <code>PRED</code> is \"transitive\" with respect to the inverse of <code>BINPRED</code>.  That is, if <code>(PRED</code> ... <code>ARGN</code> ...) and <code>(BINPRED ARGN-PRIME ARGN)</code> hold, then so does <code>(PRED</code> ... <code>ARGN-PRIME</code> ...).  For example,(transitiveViaArgInverse relationAllExists genls 2) holds; thus from (relationAllExists anatomicalParts Mammal Head-AnimalBodyPart) and (genls Horse Mammal) it follows that (relationAllExists anatomicalParts Horse Head-AnimalBodyPart).  See also transitiveViaArg.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, transitiveViaArg, "A MetaPredicate used for stating that a given predicate behaves transitively, in a specified argument-place, with respect to a given binary predicate. <code>(transitiveViaArg PRED BINPRED N)</code> means that the <code>N</code>th argument position of <code>PRED</code> is \"transitive\" with respect to <code>BINPRED</code>.  That is, if <code>(PRED ... ARG-N ...)</code> and <code>(BINPRED ARG-N ARG-N-PRIME)</code> hold, then so does <code>(PRED ... ARG-N-PRIME ...)</code>.  For example, (transitiveViaArg relationAllExists genlPreds 1) holds; thus from (relationAllExists anatomicalParts Mammal Head-AnimalBodyPart) and (genlPreds anatomicalParts physicalParts) it follows that (relationAllExists physicalParts Mammal Head-AnimalBodyPart). See also transitiveViaArgInverse.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, thereExists, "An ExistentialQuantifier (q.v.) that corresponds to the standard existential quantifier of predicate calculus.  thereExists takes as its arguments an ELVariable and an ELSentence-Assertible (such that, typically, the former occurs free in the latter).  (thereExists VAR SENT) means that there is at least one thing THING such that SENT is true of it.  That is, if some given CycL term that denotes THING were substituted for each free occurrence of VAR in SENT, the result would be a true sentence.  For example, `(thereExists ?X (mother ?X GeorgeWBush))' means that George W. Bush has a (i.e. at least one) mother; and\n<p>\n(forAll ?PER\n(implies\n(isa ?PER Person)\n(thereExists ?MOM\n(mother ?MOM ?PER))))\n<p>\nmeans that every person has a mother.  Note that some existential statements can be represented more tersely in CycL using other instances of ExistentialQuantifier, such as thereExistAtMost or thereExistExactly.  Also see the cyclistNotes for thereExists.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, thereExistExactly, "An ExistentialQuantifier (q.v.) and a specialization of both thereExistAtLeast and  thereExistAtMost (qq.v.).  Compared to the standard existential quantifier thereExists, thereExistExactly has an extra argument-place for specifying exactly how many things satisfy a given condition (specified by an CycLSentence-Assertible, in which the also-specified CycLVariable will typically occur free).  A closed sentence of the form <code>(thereExistExactly NUM VAR SENT)</code> means that there are exactly<code> NUM</code> distinct things that satisfy <code>SENT</code>, i.e. that render <code>SENT</code> true when taken as the value of <code>VAR</code>.  For example, the sentence\n<p>\n<pre>\n  (thereExistExactly 7 ?X (isa ?X Sea))\n</pre>\n<p>\nmeans that there are exactly seven seas.\n<p>\nIn the degenerate case where <code>VAR</code> does not appear free in <code>SENT</code>, then <code>(thereExistExactly NUM VAR SENT)</code> is equivalent to <code>SENT</code>.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, thereExistAtMost, "An ExistentialQuantifier (q.v.) and a specialized (albeit higher arity) version of thereExists (q.v.).  Compared to the latter, standard existential quantifier, thereExistAtLeast has an extra argument-place for specifying how many things (at the most) satisfy a given condition (specified by an ELSentence-Assertible, in which the also-specified ELVariable will typically occur free).  A closed sentence of the form (thereExistAtMost NUM VAR SENT) means that there are at most NUM distinct things that satisfy SENT, i.e. that render SENT true when taken as the value of VAR.  For example, the sentence\n<p>\n<pre>\n  (thereExistAtMost 7 ?X (isa ?X Sea))\n</pre>\n<p>\nmeans that there are at most seven seas.\n<p>\nIn the degenerate case where VAR does not appear free in SENT, then (thereExistAtMost NUM VAR SENT) is equivalent to SENT.\n<p>\nSee also thereExistAtLeast, thereExistExactly.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, thereExistAtLeast, "An ExistentialQuantifier (q.v.) and a specialized (albeit higher arity) version of thereExists (q.v.).  Compared to the latter, standard existential quantifier, thereExistAtLeast has an extra argument-place for specifying how many things (at the least) satisfy a given condition (specified by an ELSentence-Assertible, in which the also-specified ELVariable will typically occur free).  A closed sentence of the form (thereExistAtLeast NUM VAR SENT) means that there are at least NUM distinct things that satisfy SENT, i.e. that render SENT true when taken as the value of VAR.  For example, the sentence\n<p>\n<pre>\n  (thereExistAtLeast 7 ?X (isa ?X Sea))\n</pre>\n<p>\nmeans that there are at least seven seas.\n<p>\nIn the degenerate case where VAR does not appear free in SENT, then (thereExistAtLeast NUM VAR SENT) is equivalent to SENT.\n<p>\nSee also thereExistAtMost, thereExistExactly.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, termOfUnit, "An InferenceRelatedBookkeepingPredicate (q.v.) that appears in system-generated assertions.  termOfUnit relates unreified reifiable non-atomic terms (\"NATs\") to indexed data structures reified by the system.  termOfUnit GAF (see CycLClosedAtomicSentence) assertions\nare added by the system when an unreified reifiable NAT first appears in a CycL sentence that is added to the knowledge base.  When such a NAT is first used in a sentence, the Cyc system automatically creates an indexed data structure to reify the NAT.  A name is automatically assigned to the new data structure by the Cyc system.  (Typically, this name is character-for-character identical to the unreified reifiable NAT itself; but one should not be misled by this into thinking that termOfUnit is a specialization of equals.)  The predicate termOfUnit relates the system-generated data structure to the original NAT.  <code>(termOfUnit DATA-STRUCTURE NAT)</code> means that the data structure <code>DATA-STRUCTURE</code> was created to reify the value of the non-atomic term <code>NAT</code>, and that <code>NAT</code> refers to <code>DATA-STRUCTURE</code>, which in turn denotes something in the range of the function in the 0th (or \"arg 0\") position of <code>NAT</code>.\n<p>\nFor example, if an assertion such as (isa (RepairingFn Automobile) ProductType) introduced the unreified reifiable NAT (RepairingFn Automobile) in the Cyc knowledge base, the system would create a data structure to reify the value of (RepairingFn Automobile).  The system would assign the name `(RepairingFn Automobile)' to the newly-created data structure.  The system would also associate the newly-reified data structure with the unreified refiable NAT by means of the termOfUnit assertion (termOfUnit (RepairingFn Automobile) (RepairingFn Automobile)).\n<p>\nNote that termOfUnit assertions are made in the BaseKB because the relation between a NAT and the data structure reified for it is meant to hold in all contexts.  \n<p>\nOne should view termOfUnit assertions as bits of bookkeeping knowledge that are very rarely, if ever, entered into the Cyc knowledge base by hand. See retainTerm -- the predicate to use to create a NART that one wishes to remain in the Cyc KB even if no substantive additional assertions are made about it. NARTs that have only termOfUnit assertions made about them are removed from the KB at build time.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, termExternalIDString, "A predicate which relates any CycLExpression to an external\nidentification string which is guaranteed to uniquely identify the\nexpression in both time and space. (termExternalIDString EXPRESSION\nID-STRING) states that the HLExternalIDString ID-STRING is the string\nrepresentation of the unique external id for the CycLExpression\nEXPRESSION. For obvious reasons, this predicate is notAssertible.\nAlso, note that this predicate is *not* a generalization of\nconstantGUID, since the latter relates a CycLConstant to an\nentirely different string.  That is to say, the termExternalIDString\nof a CycLConstant is not the same string as its constantGUID.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, termDependsOn, "(termDependsOn DEP-TERM INDEP-TERM) states that the reason for the existence of the term DEP-TERM in the Cyc knowledge base is completely dependent on the continued existence of the term INDEP-TERM.  Thus, if INDEP-TERM should ever be removed from the knowledge base, then DEP-TERM should also be immediately removed.  This relationship is automatically maintained between reified non-atomic terms (NATs) and the terms from which they are constructed.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, termChosen, "(termChosen TERM) is true for any closed Cyc TERM, and indicates that TERM has been chosen from the set of terms in the universe of discourse.  This predicate is primarily used on a variable so that the moment of choice of a particular term as the binding for that variable can be identified.  There should never be methods for generating bindings for non-closed termChosen literals.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, synonymousExternalConcept, "<code>(synonymousExternalConcept THING SOURCE STRING)</code> means that as it occurs in the external data source <code>SOURCE</code>, the string <code>STRING</code> denotes <code>THING</code>.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, substring, "A binary predicate that relates an instance of CharacterString to another intance of CharacterString. <code>(substring SUBSTRING STRING)</code> means that <code>SUBSTRING</code> is a substring of <code>STRING</code>.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, subsetOf, "This predicate relates a set or collection <code>SUB</code> to a set or collection <code>SUPER</code> whenever the extent (see extent) of <code>SUB</code> is a  subset of the extent of <code>SUPER</code>.  That is, <code>(subsetOf SUB SUPER)</code> means that  every element of (see elementOf) <code>SUB</code> is an element of <code>SUPER</code>.  subsetOf is thus a generalization both of the subset relation in set theory and of genls (q.v.); and (unlike either of those other relations) subsetOf can hold between a set and a collection, or between a collection and a set.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, skolemizeForward, "(skolemizeForward FUNC) tells the inference engine that terms should be generated for fully-bound uses of FUNC during forward inference.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, skolem, "An InferenceRelatedBookkeepingPredicate (q.v.) that appears in system-generated assertions.  skolem holds of all instances of SkolemFunction, and exists solely for internal bookkeeping purposes.  The set of supports for a skolem assertion of the form (skolem FUNCTOR) is the set of defining assertions of FUNCTOR.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, singleEntryFormatInArgs, "An instance of SpecificEntryFormatPredicate (q.v.).  <code>(singleEntryFormatInArgs PRED N)</code> means that, for any particular way of fixing the other arguments to <code>PRED</code> besides the <code>N</code>th, there is at most one thing such that, if taken as the <code>N</code>th argument, <code>PRED</code> holds of those arguments.  That is, if the sequences <code><... ARGN ...></code> and <code><... ARGN-PRIME ...></code> differ at most in their <code>N</code>th items and both <code>(PRED ... ARGN ...)</code> and <code>(PRED ... ARGN-PRIME ...)</code> hold, then <code>ARGN = ARGN-PRIME</code> (see equals).  For example, singleEntryFormatInArgs holds of biologicalMother with respect to its second argument-place, since an animal can only have one biological mother.  A predicate with a single-entry format argument-place is thus a StrictlyFunctionalPredicate (q.v.) that is \"functional\" with respect to that argument-place (see strictlyFunctionalInArgs).  Contrast with openEntryFormatInArgs.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, siblingDisjointExceptions, "A predicate that is  used to make exceptions to constraints normally imposed by some instance of SiblingDisjointCollectionType or SiblingDisjointSetOrCollectionType (qq.v.).  <code>(siblingDisjointExceptions SETORCOL1 SETORCOL2)</code> means that the pair consisting of <code>SETORCOL1</code> and <code>SETORCOL2</code> is exempt from the disjointness constraint that would otherwise be imposed because those set-or-collections are both elements of some instance of SiblingDisjointCollectionType or SiblingDisjointSetOrCollectionType.  (See these collections' comments for a full explanation of the constraints.)   \n<p>\nFor example, SensoryNerve and CranialNerve are both instances of OrganismPartType, which in turn is an instance of SiblingDisjointCollectionType.  Consequently, since SensoryNerve is not a specialization of CranialNerve (or vice versa), the two collections have a default disjointness constraint placed between them.  However, such a disjointness constraint should be blocked, since any instance of OpticNerve is an instance of both SensoryNerve and CranialNerve.  By asserting <code>(siblingDisjointExceptions SensoryNerve CranialNerve)</code>, we block the disjointness constraint between those two collections, without disturbing the constraints between each of those collections and all their other (sibling) instances of the parent collection OrganismPartType.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, sharedNotes, "A predicate-denoting constant that is an instance of DocumentationPredicate.  It is sometimes useful to include the same piece of text in the documentation of two or more constants or other CycLIndexedTerms. Rather than actually duplicating text in the Knowledge Base, one can create a SharedNote (q.v.): a piece of text that is to serve as this shared documentation, and which is itself the comment (see comment) on the SharedNote's constant.  (Thus the constants for shared-notes actually denote their own comments.)  (sharedNotes TERM NOTE) means that NOTE is a string of text (see TextString) serving as shared documentation partly about TERM.  Since SharedNotes are typically _shared_, there are likely to be one or more other indexed terms having NOTE as their shared-note as well.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, sentenceTruth, "A KBDependentRelation (q.v.) that is used to state the truth of a given CycL sentence. (sentenceTruth SENT TRUTH) means that the CycL sentence SENT has the truth value TRUTH, which is either True or False.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, sentenceImplies, "A binary predicate that represents logical entailment in CycL.  <code>(sentenceImplies ANTECEDENT CONSEQUENT)</code> means that <code>CONSEQUENT</code> can be derived from <code>ANTECEDENT</code> using purely logical transformations.  For example, this holds by double negation:\n<pre>\n  (sentenceImplies\n    (isa Muffet Poodle)\n    (not (not (isa Muffet Poodle))) .\n</pre>\nNote that there are cases in which <code>(implies ANTECEDENT CONSEQUENT)</code> is analytically true, or necessarily true in some sense of necessity weaker than logical necessity, such that <code>(sentenceImplies ANTECEDENT CONSEQUENT)</code> is false.  For example, whereas:\n<pre>\n  (implies (isa Muffet Poodle) (isa Muffet Dog))\n</pre>\nis analytically true or in some sense necessarily true,\n<pre>\n  (sentenceImplies (isa Muffet Poodle) (isa Muffet Dog))\n</pre>\nis not true, since the material conditional is not logically valid.\n<p>\nsentenceImplies also differs from implies in that whereas implies is a LogicalConnective (q.v.), sentenceImplies is merely a predicate that holds between sentences.  sentenceImplies is primarily intended to be used for rules that quantify over CycL sentences.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, sentenceEquiv, "(sentenceEquiv FORMULA-1 FORMULA-2) means that  the ELSentence-Assertible FORMULA-1 is logically equivalent to the ELSentence-Assertible FORMULA-2.  This predicate is very similar to equiv, but equiv is an instance of LogicalConnective, while sentenceEquiv is an instance of Predicate.  sentenceEquiv is primarily intended to be used for rules that quantify over CycL formulas.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, sentenceDesignationArgnum, "Used to specify which argument of a given MicrotheoryDesignatingRelation\ndesignates the CycL sentence to be interpreted in a specific microtheory.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, scopingArg, "A binary MetaRelation that relates a ScopingRelation (q.v.) to an integer indicating the argument-place of the former that takes a variable or list of variables.  (scopingArg RELN N) means that RELN's Nth argument is a variable or variable-list (see CycLVariable and CycLVariableList) such that it (they) and any other occurrences of the same variable(s) that occur free in the CycL formula serving as the \"scoped\" argument (see scopedFormulaArg) to RELN is (are) bound with respect to the entire RELN-based formula.  For example, (scopingArg thereExists 1) entails that in the sentence\n<p>\n<pre>\n  (thereExists ?KIT\n    (and\n      (isa ?KIT Cat)\n      (isa ?KIT BlackColor)))\n</pre>\n<p>\neach occurrence of the variable '?KIT' is bound by the quantifier thereExists.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, salientAssertions, "(salientAssertions TERM ASSERTION) means that ASSERTION has been deemed one of the assertions most useful to examine when one is trying to figure out the intended meaning of TERM.  Thus, ASSERTION will normally contain TERM, and should be something that has been asserted on its own in the KB as well.  Statements using salientAssertions are primarily intended for human consumption, and are not normally used by the Cyc inference engine.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, ruleTemplateDirection, "A MetaKnowledgePredicate. (ruleTemplateDirection TEMPLATE DIRECTION) states that all assertions which are instantiations of TEMPLATE should  have a direction of DIRECTION.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, ruleAfterRemoving, "Whenever a new rule is unasserted, ruleAfterRemovings are called on each literal of the rule.  The particular ruleAfterRemovings called depend on the predicate of the literal.  (ruleAfterRemoving PRED HOOK) means that HOOK will be called on each of the rule's literals whose predicate is PRED.  If the rule has multiple literals containing predicate with ruleAfterRemoving the order of execution is not guaranteed.  Also, ruleAfterRemovings are retriggered on the removal of the each argument to a rule.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, ruleAfterAdding, "Whenever a new rule is asserted, ruleAfterAddings are called on each literal of the rule.  The particular ruleAfterAddings called depend on the predicate of the literal.  (ruleAfterAdding PRED HOOK) means that HOOK will be called on each of the rule's literals whose predicate is PRED.  If the rule has multiple literals containing predicate with ruleAfterAdding, the order of execution is not guaranteed.  Also, ruleAfterAddings are retriggered on the addition of new arguments to an existing rule.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, rewriteOf, "A specialization of equals and a CycLReformulatorConstant that relates pairs of CycLClosedDenotationalTerms.   rewriteOf is, in a sense, a \"directional\" version of equals.  <code>(rewriteOf FAVORED-TERM DISFAVORED-TERM)</code> means that (1) <code>FAVORED-TERM</code> and <code>DISFAVORED-TERM</code> denote the same thing, and (2) <code>FAVORED-TERM</code> is deemed worthy of being privileged over <code>DISFAVORED-TERM</code> in the following senses: assertions made on <code>DISFAVORED-TERM</code> will be propagated to <code>FAVORED-TERM</code>, and whenever possible attempts to reason about  <code>DISFAVORED-TERM</code> will be transformed into attempts to reason about <code>FAVORED-TERM</code>.  The propagated assertions will differ from the original assertions only in that the propagated assertions will be the result of substituting <code>FAVORED-TERM</code> for <code>DISFAVORED-TERM</code> wherever <code>DISFAVORED-TERM</code> occurs in the original assertions.  Note that substitution does not happen in the opposite direction.  That is, assertions containing <code>FAVORED-TERM</code> will not propagate to <code>DISFAVORED-TERM</code>.\n<p>\nOne common use of rewriteOf is that in which <code>FAVORED-TERM</code> is a syntactically simpler term than <code>DISFAVORED-TERM</code>.  For example, <code>FAVORED-TERM</code> may contain fewer nested terms that denote Function-Denotationals than does <code>DISFAVORED-TERM</code>.  (rewriteOf UnitedStatesNavy (NavyFn UnitedStatesOfAmerica)) is a good example of this common sort of use.\n<p>\nNote that rewriteOf expresses a strictly conventional notion of \"directional\" equality. Pragmatic considerations, not ontology, will dictate which term is chosen to occur as the privileged (left-hand side) term in a rewriteOf assertion.  Thus, in the example the fact that simpler terms are generally easier to use (remember, manipulate, etc.) dictates that UnitedStatesNavy should be a rewrite of (NavyFn UnitedStatesOfAmerica), and not vice versa.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, resultQuotedIsa, "A binary MetaRelation predicate that holds between functions and expression-types. resultQuotedIsa indicates that any value returned by a given Function-Denotational is a \"quoted instance\" of a given expression-type.   More correctly, <code>(resultQuotedIsa FUNC TYPE)</code> means that, for any term-sequence <code>ARGS</code>, if the expression <code>(FUNC . ARGS)</code> is an admittedNAT (q.v.), then it is an instance of the SubLExpressionType <code>TYPE</code>.  That is, the following holds:\n<pre>\n  (quotedIsa (FUNC . ARGS) TYPE)\n</pre>\nAnd, equivalently, so does:\n<pre>\n  (isa (Quote (FUNC . ARGS)) TYPE)\n</pre>\n\nTo contrast this predicate with resultIsa: <code>(resultIsa FUNC COL)</code> holds just in case each defined term of the form <code>(FUNC . ARGS)</code> <i>denotes</i> an instance of <code>COL</code>, whereas <code>(resultQuotedIsa FUNC COL)</code> holds just in case each admitted (i.e. syntactically and semantically well-formed) term of the form <code>(FUNC . ARGS)</code> <i>is itself</i> an instance of <code>COL</code>.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, resultIsaArgIsa, "(resultIsaArgIsa FUNC INT) means that the NAT resulting from a use of FUNC is a member of the same collections that the term\nin arg position INT is a member of.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, resultIsaArg, "A MetaRelation predicate.  <code>(resultIsaArg FUNC N)</code>  means that the value returned by <code>FUNC</code> for any given sequence of arguments  is an instance of the <code>N</code>th argument in that sequence.  That is, if  <code>(FUNC ARG1 ... ARGN ...) = VALUE</code>, then <code>(isa VALUE ARGN)</code> holds.  Obviously, <code>ARGN</code> must be a collection; so <code>FUNC</code>'s <code>N</code>th argument-place is likely to be constrained (via argIsa) to be an instance of Collection or some specialization thereof.\n<p>\nFor example, (resultIsaArg The 1) entails that (The Dog) is an instance of Dog.\n<p>\nSee also resultGenlArg and resultIsa.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, resultIsa, "A binary MetaFunction that is used to indicate that any value returned by a given function (see Function-Denotational) is an instance of a given collection.  <code>(resultIsa FUNC COL)</code> means that <code>FUNC</code> returns an instance of <code>COL</code> for any sequence of arguments for which <code>FUNC</code> is defined.  That is, <code>(isa (FUNC . ARGS) COL)</code> holds for any sequence <code>ARGS</code> for which <code>FUNC</code> has a value (see valueOfFunctionForArgs and relationDomain).  \n<p>\nFor example, <code>(resultIsa PlusFn ScalarInterval)</code> holds, and it entails (e.g.) <code>(isa (PlusFn 2 2) ScalarInterval)</code>.  \n<p>\nSee also resultGenl.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, resultGenlArg, "A MetaFunction predicate that holds of certain CollectionRelatingFunctions with respect to certain argument-places.  (resultGenlArg FUNC N) means that FUNC always returns a subcollection of its own corresponding Nth-place argument, and that FUNC is \"genls preserving\" in that argument-place.  More precisely: (i) the value of FUNC for any sequence of arguments for which it is defined is a subcollection of the Nth item in that sequence (i.e. (genls (FUNC ARG1..ARGN..) ARGN)) and (ii) (preservesGenlsInArg FUNC N) holds.  For example, (resultGenlArg JuvenileFn 1) entails (genls (JuvenileFn Dog) Dog) and -- given that (genls Dog Mammal) --   (genls (JuvenileFn Dog) (JuvenileFn Mammal)).  See also resultIsaArg and resultGenl.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, resultGenl, "A MetaFunction that is used to specify that a \ngiven collection is a supercollection of any value returned by a given CollectionDenotingFunction (q.v.).  <code>(resultGenl COLFUNC COL)</code> means that when <code>COLFUNC</code> is applied to any sequence of arguments <code>ARGS</code> for which it is defined, the resulting value will be a subcollection of <code>COL</code>.  That is, <code>(genls (COLFUNC . ARGS) COL)</code> holds.  \n<p>\nFor example, <code>(resultGenl UsingAFn Action)</code> implies that the collection of acts done using any given type of object is a type of action, <code>(resultGenl AttemptingFn PurposefulAction)</code> implies that the attempts at a given type of action constitute a type of purposeful act, and <code>(resultGenl JointTypeBetweenFn Joint-Physical)</code> means that the collection of joints between two given types of things is a type of physical joint.  \n<p>\nSee also resultIsa.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, requiredArg3Pred, "A MetaPredicate for stating that every instance of a given collection is related (as the \"arg3\") to some things by a given predicate.  <code>(requiredArg3Pred COL PRED)</code>  means that for every instance <code>INST</code> of <code>COL</code>, there exists some sequence  <<code>X1</code>, <code>X2</code>,..., <code>Xn</code>> such that <code>(PRED X1 X2 INST</code> ... <code>Xn)</code> holds.  For  example, (requiredArg3Pred ConflictEvent opponentsInConflict) means that every conflict involves (at least) two opponents.  See also requiredArg1Pred and requiredArg2Pred.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, requiredArg2Pred, "A MetaPredicate for stating that every  instance of a given collection is related (as the \"arg2\") to some  thing or things by a given predicate.  (requiredArg2Pred COL PRED)  means that for every instance INST of COL, there exists some sequence  <X1, X3, ..., Xn> of such that (PRED X1 INST X3 ... Xn) holds.  For  example, (requiredArg2Pred Side objectSides) means that every  side is the side of at least one object.  See also requiredArg1Pred.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, requiredArg1Pred, "A MetaPredicate for stating that every instance of a given collection is related to some thing or things by a given predicate.  <code>(requiredArg1Pred COL PRED)</code> means that for every  instance <code>INST</code> of <code>COL</code>, there exists some sequence <code>ARGS</code> such that <code>(PRED INST . ARGS)</code> holds.  For example, (requiredArg1Pred Organization hasMembers) means that every organization has at least one member.  \n<p>\nSee also requiredArg2Pred and requiredArg3Pred.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, relationMemberInstance, "(relationMemberInstance PRED GROUP INST) states that for every MEMBER of GROUP the following is true: (PRED MEMBER INST).  This predicate enables one to make claims about the members of a group by referencing only the group itself.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, relationInstanceMember, "(relationInstanceMember PRED INST GROUP) states that for every MEMBER of GROUP the following is true: (PRED INST MEMBER).  This predicate enables one to make claims about the members of a group by referencing only the group itself.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, relationInstanceExists, "A ternary RuleMacroPredicate (q.v.) that can be used to state that a given binary predicate holds between a specified thing and some instance of a given collection.  <code>(relationInstanceExists PRED THING COL)</code> means that there exists an instance <code>INST</code> of <code>COL</code> such that <code>(PRED THING INST)</code> holds.  It is equivalent to (and can thus be used in effect as shorthand for) the more complex form:\n<p>\n<pre>\n     (thereExists ?INST\n          (and\n               (isa ?INST COL)\n               (PRED THING ?INST))) .\n</pre>\n<p>\nFor example, '(relationInstanceExists geographicalSubRegions Iran OilField)' means that there exists an oilfield in Iran.  Cf. relationExistsInstance, and see the shared NoteAboutUseOfRuleMacroPredicates.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, relationInstanceAll, "A ternary RuleMacroPredicate that is used to state that a given binary predicate holds between a given thing and all instances of a given collection. (relationInstanceAll BINPRED THING COL) means that THING bears the relation PRED to every instance INST of COL such that (BINPRED THING INST) holds.  It is equivalent to (and can thus be used in effect as shorthand for) the more complex form:\n<p>\n(implies\n(isa ?INST COL)\n(BINPRED THING ?INST)) .\n<p>\nFor example, `(relationInstanceAll geopoliticalSubdivision UnitedStatesOfAmerica State-UnitedStates)' means that each State in the Union is a subdivision of the United States.  Cf. relationAllInstance, and see NoteAboutUseOfRuleMacroPredicates.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, relationExpansion, "ARG2 is a CycL expression which indicates the meaning of expressions in which the relation ARG1 is the operator (i.e., in which ARG1 is in the 0th argument position).  In ARG2, the variables ?arg1, ?arg2, ?arg3, ?arg4, and ?arg5 correspond to the objects in the argument positions 1, 2, 3, 4, and 5, respectively, in expressions which have ARG1 as the operator.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, relationExistsMinAll, "A quaternary RuleMacroPredicate (q.v.) that can be used to state that a given binary predicate stands in a certain numerical relation with respect to two collections.  (relationExistsMinAll BINPRED COL1 COL2 N) means that for any instance INST of COL2, there are at least N instances of (INST(1), ..., INST(N)) of COL1 such that (BINPRED INST(i) INST) holds (for 1 <= i <= N).  This is equivalent to (and can thus be used in effect as shorthand for) the more complex form:\n<p>\n(implies\n(isa INST COL2)\n(thereExistAtLeast N ?INST-I\n(and\n(isa ?INST-I COL1)\n(BINPRED ?INST-I INST)))) .\n<p>\nFor example, `(relationExistsMinAll physicalParts Hand Finger 1)' means that every finger is part of at least one hand.  Cf. relationAllExistsMin, and see the shared NoteAboutUseOfRuleMacroPredicates.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, relationExistsMaxAll, "A quaternary RuleMacroPredicate (q.v.) that can be used to state that a given binary predicate stands in a certain numerical relation with respect to two collections.  <code>(relationExistsMaxAll BINPRED COL1 COL2 N)</code> means that for any instance <code>INST</code> of <code>COL2</code>, there are at most <code>N</code> instances of <code>(INST(1), ..., INST(N))</code> of <code>COL1</code> such that <code>(BINPRED INST(i) INST)</code> holds (for 1 <= <code>i</code> <= <code>N</code>).  This is equivalent to (and can thus be used in effect as shorthand for) the more complex form:\n<pre>\n  (implies\n    (isa INST COL2)\n    (thereExistAtMost N ?INST-I\n      (and\n        (isa ?INST-I COL1)\n        (BINPRED ?INST-I INST)))).\n</pre>\nFor example, <code>(relationExistsMaxAll physicalParts Hand Finger 1)</code> means that every finger is part of at most one hand.  Cf. relationAllExistsMax, and see the shared NoteAboutUseOfRuleMacroPredicates.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, relationExistsInstance, "A ternary RuleMacroPredicate (q.v.) that can be used to state that a given binary predicate holds between some instance of a given collection and a given thing.  <code>(relationExistsInstance BINPRED COL THING)</code> means that there exists an instance <code>INST</code> of <code>COL</code> such that <code>(BINPRED INST THING)</code> holds.  This is equivalent to (and can thus be used in effect as shorthand for) the more complex form:\n<p>\n<pre>\n(thereExists ?INST\n  (and\n     (isa ?INST COL)\n     (PRED ?INST THING))) .\n</pre>\n<p>\nFor example, (relationExistsInstance eventOccursAt IllegalDrugActivity Sweden) means that there exists illegal drug activity in Sweden.  See also the shared  NoteAboutUseOfRuleMacroPredicates.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, relationExistsCountAll, "A quaternary RuleMacroPredicate (q.v.) that is used to state that a given binary predicate stands in a certain numerical relationship with respect to two collections.  (relationExistsCountAll BINPRED COL1 COL2 N) means that for every instance INST of COL2 there are exactly N instances of COL1 (INST(1), ..., INST(N)) such that (BINPRED INST(i) INST) holds (for 1 <= i <= N).  It is equivalent to (and so can be used in effect as shorthand for) the more complex form:\n<p>\n<pre>\n  (implies\n    (isa ?INST COL2)\n    (thereExistExactly N ?INST-I\n      (and\n             (isa ?INST COL1)\n             (BINPRED ?INST-I ?INST)))) .\n</pre>\n<p>\nFor example, (relationExistsCountAll anatomicalParts Animal Head-AnimalBodyPart 1) means that every animal head is a part of exactly one animal.  See also relationAllExistsCount and NoteAboutUseOfRuleMacroPredicates.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, relationExistsAll, "A ternary RuleMacroPredicate (q.v.) that can be used to state that a given binary predicate stands in a certain relation to two collections.  <code>(relationExistsAll BINPRED COL1 COL2)</code> means that for any instance <code>INST2</code> of <code>COL2</code>, there exists some instance <code>INST1</code> of <code>COL1</code> such that <code>(BINPRED INST1 INST2)</code> holds.  It is equivalent to (and can thus be used in effect as shorthand for) the more complex form\n<pre>\n  (implies\n    (isa ?INST2 COL2)\n    (thereExists ?INST1\n      (and\n        (isa ?INST1 COL1)\n        (BINPRED ?INST1 ?INST2)))).\n</pre>\nFor example, <code>(relationExistsAll adjacentTo Harbor PortCity)</code> means that for every port city there exists a harbor to which the city is adjacent.  See also relationAllExists and NoteAboutUseOfRuleMacroPredicates.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, relationAllInstance, "A ternary RuleMacroPredicate that is used to state that a given binary predicate holds between all instances of a given collection and a given thing. <code>(relationAllInstance PRED COL THING)</code> means that every instance <code>INST</code> of <code>COL</code> bears the relation <code>PRED</code> to <code>THING</code> such that <code>(PRED INST THING)</code> holds.  It is equivalent to (and can thus be used in effect as shorthand for) the more complex form:\n<p>\n<pre>\n     (implies\n          (isa ?INST COL)\n          (PRED ?INST THING)) .\n</pre>\n<p>\nFor example, '(relationAllInstance maxSpeed GolfCart (MilesPerHour 15))' means that the maximum speed of every golf cart is 15 miles per hour. Cf. relationInstanceAll, and see NoteAboutUseOfRuleMacroPredicates.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, relationAllExistsMin, "A quaternary RuleMacroPredicate that can be used to state that a given binary predicate stands in a certain numerical relationship with respect to two collections.  (relationAllExistsMin BINPRED COL1 COL2 N) means that for any instance INST of COL1 there are at least N instances (INST(1), ..., INST(N)) of COL2 such that (BINPRED INST INST(i)) holds (for 1 <= i <= N).  This is equivalent to (and can thus be used in effect as shorthand for) the more complex form:\n<p>\n(implies\n(isa ?INST COL1)\n(thereExistAtLeast N ?INST-I\n(and\n(isa ?INST-I COL2)\n(BINPRED ?INST ?INST-I)))) .\n<p>\nFor example, `(relationAllExistsMin subEvents EatingEvent Swallowing 1)' means that every act of eating includes at least one swallowing. Cf. relationExistsMinAll, and see NoteAboutUseOfRuleMacroPredicates.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, relationAllExistsMax, "A quaternary RuleMacroPredicate that can be used to state that a given binary predicate stands in a certain numerical relationship with respect to two collections.  (relationAllExistsMax BINPRED COL1 COL2 N) means that for any instance INST of COL1 there are at most N instances (INST(1), ..., INST(N)) of COL2 such that (BINPRED INST INST(i)) holds (for 1 <= i <= N).  This is equivalent to (and can thus be used in effect as shorthand for) the more complex form:\n<p>\n(implies\n(isa ?INST COL1)\n(thereExistAtMost N ?INST-I\n(and\n(isa ?INST-I COL2)\n(BINPRED ?INST INST-I)))) .\n<p>\nFor example, `(relationAllExistsMax anatomicalParts Dog Leg 4)' means that all dogs have at most four legs.\n<p>\nCf. relationExistsMaxAll; also see NoteAboutUseOfRuleMacroPredicates.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, relationAllExistsCount, "A quaternary RuleMacroPredicate that is a specialization of both relationAllExistsMin and relationAllExistsMax (qq.v.).  <code>(relationAllExistsCount BINPRED COL1 COL2 N)</code> means that for any instance <code>INST</code> of <code>COL1</code> there are exactly <code>N</code> instances <code>INST1</code>, ..., <code>INSTn</code> of <code>COL2</code> such that <code>(BINPRED INST INSTi)</code> holds (for 1 <code><= i <= N)</code>. It is equivalent to (and can thus be used in effect as shorthand for) the more complex form:\n<pre>\n  (implies\n    (isa ?INST COL1)\n    (thereExistExactly N ?INST-I\n      (and\n        (isa ?INST-I COL2)\n        (BINPRED ?INST ?INST-I))))\n</pre>\n<p>\n(wherein the variable <code>?INST</code> is interpreted as if it were bound by an initial universal quantifier).\n<p>\nFor example, <code>(relationAllExistsCount anatomicalParts Dog Leg 4)</code> means that all dogs have four legs.\n<p>\nCf. relationExistsCountAll, and see the NoteAboutUseOfRuleMacroPredicates.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, relationAllExists, "A ternary RuleMacroPredicate (q.v.) that can be used to state that a given binary predicate stands in a certain relation to two collections. <code>(relationAllExists BINPRED COL1 COL2)</code> means that for any instance <code>INST1</code> of <code>COL1</code>, there exists some instance <code>INST2</code> of <code>COL2</code> such that <code>(BINPRED INST1 INST2)</code> holds.  It is equivalent to (and can thus be used in effect as shorthand for) the more complex form:\n<p>\n<pre>\n  (implies\n    (isa ?INST1 COL1)\n    (thereExists ?INST2\n      (and\n        (isa ?INST2 COL2)\n        (BINPRED ?INST1 ?INST2)))).\n</pre>\n<p>\nFor example, <code>(relationAllExists temporalBoundsContain CalendarWeek Wednesday)</code> means that every calendar week contains a Wednesday.  See also relationExistsAll and NoteAboutUseOfRuleMacroPredicates.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, relationAll, "A binary RuleMacroPredicate that relates a given unary predicate to a collection of things that the predicate holds of.  <code>(relationAll PRED COL)</code> means that, for every instance <code>INST</code> of <code>COL</code>, <code>(PRED INST)</code> holds.  Thus <code>(relationAll PRED COL)</code> is equivalent to -- and so can be used in effect as shorthand for -- (the unversal closure of) the more complex form:\n<pre>\n  (implies \n    (isa <b>?INST</b> COL) \n    (PRED <b>?INST</b>)) .\n</pre>\nFor example, <code>(relationAll knownSentence CycLAssertion)</code> means that all CycLAssertions are asserted sentences.  \n<p>\nSee also relationOnly and the shared NoteAboutUseOfRuleMacroPredicates.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, reformulatorRuleProperties, "(reformulatorRuleProperties PROP RULE) means that RULE has\nthe property PROP.  Most reformulator directives express an assertion\nof the form 'The reformulator should do X', for some X.  In contrast,\nreformulatorRuleProperties assertions are stronger, in that they\nexpress intrinsic properties of reformulator rules, and it is a\nconsequence that the reformulator should do X in order to be\ncorrect.  For example, a reformulator directive could say 'For this\nreformulator rule, if in tersification mode, the reformulator should reformulate\nthe second argument into the first argument.', whereas a reformulator\nrule property could say 'This reformulator rule's first argument is\nmore terse than its second argument.'  The latter implies the former.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, reformulatorRule, "(reformulatorRule EXPR-1 EXPR-2), asserted in the\nmicrotheory MT, means that EXPR-1 may be reformulated into EXPR-2 (or\nvice versa, based on meta-properties of this rule and what mode the\nreformulator is in) in MT\nor a specMt thereof.  Free variables in EXPR-1 and EXPR-2 are shared,\nand may bind with CycL expressions which match the template. Truth\nand semantics are not necessarily preserved (see TruthPreservingReformulation).\nUse the more specific predicates reformulatorEquiv and reformulatorEquals\nwhen applicable.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, reformulatorEquiv, "A CycLReformulationRulePredicate that relates two CycL sentences.  When asserted in a Microtheory MT, (reformulatorEquiv SENTENCE-1 SENTENCE-2) means that the CycLSentence SENTENCE-1 may be reformulated into the CycLSentence SENTENCE-2, or vice versa (based on meta-properties of this rule and what mode the reformulator is in), in any Microtheory SPEC-MT such that (genlMt SPEC-MT MT) holds.  Free variables in SENTENCE-1 and SENTENCE-2 are shared, and may bind with CycL sentences which match the template.  Note that (reformulatorEquiv SENTENCE-1 SENTENCE-2) does _not_ necessarily imply (equiv SENTENCE-1 SENTENCE-2), although this implication would hold if the reformulation is a TruthPreservingReformulation (q.v.).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, reformulatorEquals, "A CycLReformulationRulePredicate that relates two CycL denotational terms.  When asserted in a Microtheory MT, (reformulatorEquals TERM-1 TERM-2) means that the CycLDenotationalTerm TERM-1 may be reformulated into the CycLDenotationalTerm TERM-2, or vice-versa (based on meta-properties of this rule and what mode the reformulator is in), in any Microtheory SPEC-MT such that (genlMt SPEC-MT MT) holds.  Free variables in TERM-1 and TERM-2 are shared, and may bind with CycL terms which match the template.  Note that (reformulatorEquals TERM-1 TERM-2) does _not_ necessarily imply (equals TERM-1 TERM-2), although this implication would hold if the reformualtion is a TruthPreservingReformulation (q.v.).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, reformulationPrecondition, "(reformulationPrecondition DIRECTION PRECONDITION RULE), asserted in\nthe microtheory MT, means that the CycLReformulator may only use\nRULE in MT in the DIRECTION direction (reformulating the 'from' arg\ninto the 'to' arg) if PRECONDITION holds.  PRECONDITION must be a closed CycL query, which will be asked during reformulation, and either proven true or fail to be proven.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, reformulationDirectionInMode, "(reformulationDirectionInMode DIRECTION MODE RULE), when\nasserted in the microtheory MT, tells the CycLReformulator whether to use RULE\nin the forward (ReformulationForwardDirection) or backward\n(ReformulationBackwardDirection) direction when reformulating\nCycLExpressions in MT or a specMt thereof, and when operating in the mode MODE.\nIt will reformulate the 'from' arg into the 'to' arg,\nbased on DIRECTION.  ReformulationNeitherDirection\nindicates the rule is not to be used at all in this mt.\nThis concept of direction has nothing to do with the forward vs. backward rule\ndistinction in inference.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, ratioOfTo, "The predicate corresponding to QuotientFn.  (ratioOfTo NUM-1 NUM-2 NUM-3) holds just in case the ratio of NUM-1 to NUM-2 is NUM-3; that is, just in case  (QuotientFn NUM-1 NUM-2) = NUM-3.  For example, (ratioOfTo 1 2 0.5) is true because 1 divided by 2 is 0.5.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, quotedIsa, "A binary MetaLanguagePredicate (q.v.) that relates CycL expressions to the SubLExpressionTypes (q.v.) of which they are instances.  quotedIsa is thus like a restricted version of isa (q.v.), but with one important difference: the first argument-place of quotedIsa is \"implicitly quoted\" (see quotedArgument).  So a ground atomic sentence of the form <code>(quotedIsa THING EXPR-TYPE)</code> does <i>not</i> mean that <code>THING</code> itself is an instance of <code>EXPR-TYPE</code>.  Rather, such a sentence is partly self-referential, and means that the particular <i>CycL expression</i> appearing in the sentence's own first argument-position is an instance of <code>EXPR-TYPE</code>.  Thus, quotedIsa provides a convenient shorthand for stating certain things that would otherwise require explicit quotation (or some other device for naming expressions).\n<p>\nThis is better illustrated with a specific example.  Suppose we wish to state that the CycL constant <code>IndianOcean</code> is an instance of the CycL expression type PublicConstant.  We cannot express this with the straightforward isa sentence <code>(isa IndianOcean PublicConstant)</code>, as that states the falsehood that the IndianOcean itself -- which is <i>not</i> a constant but a body of water -- is a public constant.  But we can express precisely what we want like this:\n<pre>\n  (quotedIsa IndianOcean PublicConstant) .\n</pre>  \nNow quotedIsa is a MacroRelation (q.v.), and by its expansion any given quotedIsa sentence is equivalent to some isa sentence with an <i>explicitly</i> quoted first argument.  The sentence displayed above turns out to be equivalent to: \n<pre>\n  (isa (Quote IndianOcean) PublicConstant).\n</pre> \nBut the quotedIsa version has two related practical advantages over the isa version.  First, the former is syntactically simpler than the latter.  Second, the simpler syntax of the former makes it easier to browse in the Knowedge Base: while the quotedIsa version is conveniently indexed under the KB Browser page for the constant <code>IndianOcean</code>, the isa version would apparently be indexed under a separate, brand new page for the term <code>(Quote IndianOcean)</code>. Generalizing the point, quotedIsa lets us avoid having potentially to double the number of pages currently in the browser.\n<p>\nFor the semantically more complicated (but rarely encountered) case in which quotedIsa's first argument-place is filled with an <i>open</i> expression, see the accompanying cyclistNotes.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, quotedDefnSufficient, "A CycInferenceDescriptorPredicate. (quotedDefnSufficient COL TEST) means that TEST is the name of a piece of code in the SubL implementation of Cyc that specifies, and tests for, a sufficient condition for a CycL term's denoting a quoted instance of (see quotedIsa) the collection COL. If TEST returns `T' (for `True') when applied to a particular term, then that term's denotatum is considered to be a quoted instance of COL. Note that TEST isn't necessarily a necessary test for quoted membership in COL; that is, not all quoted instances of COL must pass the test, unless TEST is also a defnNecessary for COL, or the term is asserted to be a quoted instance of COL using quotedIsa. See the related predicates quotedDefnNecessary and quotedDefnIff.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, quotedDefnNecessary, "A CycInferenceDescriptorPredicate. (quotedDefnNecessary COL TEST) means that TEST is the name of a piece of code in the SubL implementation of Cyc that specifies, and tests for, a necessary condition for a CycL term's denoting a quoted instance of (see quotedIsa) the collection COL. Only if TEST returns `T' (for `True') when applied to a particular term can that term's denotatum be considered a quoted instance of COL; all terms that denote quoted instances of COL must fulfill TEST's requirements, although there may be additional requirements for denoting an instance of COL as well. However, terms asserted to be quoted instances of the collection COL using quotedIsa are exempt from fulfilling TEST's requirements. See also quotedDefnSufficient and quotedDefnIff.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, quotedDefnIff, "A CycInferenceDescriptorPredicate. (quotedDefnIff COL TEST) means that TEST is the name of a piece of code in the SubL implementation of Cyc that specifies, and tests for, a necessary and sufficient condition for a CycL term's denoting a quoted instance of (see quotedIsa) the collection COL. If and only if TEST returns `T' (for `True') when applied to a particular term can that term's denotatum be considered a quoted instance of COL; all and only terms that denote quoted instances of COL must fulfill TEST's requirements.  However, terms asserted to be quoted instances of the collection COL using quotedIsa are exempt from fulfilling TEST's requirements. See also quotedDefnNecessary and quotedDefnSufficient.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, quotedArgument, "The main (longer) comment on this predicate was written to explain the role of quotedArgument in an earlier approach for referring to CycL expressions in the CycL language that is currently (April 2002) being phased out in favor of a new approach.  Whereas the earlier approach enabled self-reference only by means of a sort of \"implicit quotation\", the new approach involves a mechanism for explicitly quoting CycL expressions (by putting them inside something analogous to quotation marks).  quotedArgument, unlike quotedCollection (q.v.), still has a role to play with respect to the new approach, and its main comment will soon revised to better explain that role.  For an explanation of the new approach to quoting, see the shared NoteAboutQuotingInCycL and the constants that share that note.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, quotedArgument, "A specialization of opaqueArgument (q.v.).  quotedArgument is a binary MetaLanguagePredicate used to state that a given argument-place of a given CycL relation-denoting expression is an <i>implicitly quoted</i> context, in the sense that a symbol appearing in that context denotes <i>itself</i> (as opposed to whatever that symbol might denote, if anything, in ordinary non-quoted contexts).  \n<p>\n<code>(quotedArgument REL N)</code> means that in a closed compound expression built from <code>REL</code> -- i.e. a ground atomic sentence (or <i>gaf</i>) if <code>REL</code> is a predicate or a closed non-atomic term (or <i>nat</i>) if <code>REL</code> is a function -- the term (i.e. the CycL expression) <code>EXPR</code> appearing in <code>REL</code>'s <code>N</code>th argument-place is taken to denote <i>itself</i> (i.e. that very expression <code>EXPR</code>).  \n<p>\nquotedArgument thus makes possible a kind of a self-reference in CycL. Relations with quoted argument-places can be used to make statements about particular CycL expressions, without quoting those expressions explicitly (cf. Quote).\n<p>\nFor example, the first argument-place of the predicate myCreator is quoted and its second argument-place is not.  Thus in the sentence <code>(myCreator PlanetEarth Maeda)</code>, the CycL constant <code>PlanetEarth</code> denotes that constant itself (and not the actual planet Earth), while the constant <code>Maeda</code> simply denotes the person Maeda (and not a CycL expression).  Hence the above sentence correctly states that Maeda created (i.e. reified) the CycL constant <code>PlanetEarth</code>; it does <i>not</i> state the absurdity that he created the planet Earth.  In ordinary non-quoted contexts, of course, <code>PlanetEarth</code> denotes the planet and not the constant.\n<p>\nSee also quotedCollection and NoteAboutUseVersusMention.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, querySentence, "querySentence is an HL level predicate that allows for special handling of a sentence (especially nested sentences) as a top level query during the process of canonicalization.  querySentence is not-assertible.  It should not be used in any assertions.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, quantitySubsumes, "A specialization of both quantityIntersects and intangibleParts, this predicate relates a given numerically measurable ScalarInterval to those scalar intervals that it subsumes or that \"fall completely inside\" it.    <code>(quantitySubsumes SUPER SUB)</code> means that both (i) the maximum (see maxQuantValue) of <code>SUPER</code> is greaterThanOrEqualTo the maximum of <code>SUB</code> and (ii) the minimum (see minQuantValue) of <code>SUPER</code> is lessThanOrEqualTo the minimum of <code>SUB</code>.\n<p>\nFor example, (Meter 2 5) -- the Distance of between 2 and 5 meters inclusive -- subsumes both (Meter 3 4) and (Meter 3 5), but not (Meter 3 6).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, quantityIntersects, "A binary predicate that relates numerically measurable ScalarIntervals (q.v.) that intersect or overlap.  <code>(quantityIntersects SCALAR1 SCALAR2)</code> means that  <code>SCALAR1</code> and <code>SCALAR2</code> intersect. More precisely: there is  some scalar interval (which might even be as small as an  instance of ScalarPointValue) that is subsumed by (see quantitySubsumes) both <code>SCALAR1</code> and <code>SCALAR2</code>.\n<p>\nFor example, (Meter 2 5) -- the Distance of between 2 and 5 meters inclusive -- intersects both (Meter 3 4) and (Meter 3 7), but does not intersect (Meter 6 7).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, prettyString, "(prettyString TERM STRING) means that STRING is the English word or expression (sequence of words) commonly used to refer to TERM.  The predicate prettyString is used by the code which generates CycL to English paraphrases, but its applicability is not restricted to this use.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, preservesGenlsInArg, "<code>(preservesGenlsInArg FUNCTION N)</code> means that the CollectionDenotingFunction <code>FUNCTION</code> has the following properties: \n<p>\n(1) argument place <code>N</code> of <code>FUNCTION</code> is constrained to instances of Collection, and <br>\n(2) if <code>COLLECTION1</code> and <code>COLLECTION2</code> can both serve as the <code>N</code>th argument of <code>FUNCTION</code>, and <code>COLLECTION2</code> is a specialization of <code>COLLECTION1</code> (so that <code>(genls COLLECTION2 COLLECTION1)</code> holds), then <code>(genls (FUNCTION ARG_1 ARG_2 ... ARG_N-1 COLLECTION2   ... ARG-M) (FUNCTION ARG_1 ARG_2 .. ARG_N-1 COLLECTION1 ... ARG-M))</code> also holds, where <code>ARG_1</code>, <code>ARG_2</code>, ..., <code>ARG_M</code> (where <code>M</code> is the arity of <code>FUNCTION</code>) are admitted arguments for <code>FUNCTION</code> (see admittedArgument).  \n<p>\nFor example, (preservesGenlsInArg GroupFn 1) holds because <code>(genls COL-2 COL-1)</code> implies <code>(genls (GroupFn COL-2) (GroupFn COL-1))</code>, for all collections <code>COL-1</code> and <code>COL-2</code> that satisfy the argument constraints for GroupFn.  \n<p>\nSimilarly, (preservesGenlsInArg SubcollectionOfByTypeFn 2) holds because <code>(genls COL-2 COL-1)</code> implies <code>(genls (SubcollectionOfByTypeFn FIXED-ARG COL-2) (SubcollectionOfByTypeFn FIXED-ARG COL-1))</code> for all collections <code>COL-1</code> and <code>COL-2</code>, and all arguments <code>FIXED-ARG</code>, that satisfy the appropriate argument constraints for SubcollectionOfByTypeFn.  See also the collection GenlsPreservingFunction.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, predicateConventionMt, "(predicateConventionMt PRED MT) means that the predicate extent of the predicate PRED, by convention, is asserted in MT.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, pragmaticRequirement, "A MetaKnowledgePredicate that is used to place a certain kind of pragmatic precondition on the use of a given asserted rule (see CycLRuleAssertion). (pragmaticRequirement SENTENCE RULE) means that SENTENCE expresses a necessary condition on RULE's being used in any proof carried out by the Cyc inference engine. The effect of asserting this is virtually the same as that of asserting (exceptWhen (unknownSentence SENTENCE) RULE): it blocks the use of RULE when SENTENCE is not currently \"known\" by the Cyc system to be true. SENTENCE should not contain disjuncts (or canonicalize into disjuncts). Upon assertion to the knowledge base, a pragmaticRequirement sentence is transformed by the canonicalizer into a rule involving pragmaticallyNormal (q.v.).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, pragmaticallyNormal, "A MetaKnowledgePredicate that is used to express that certain pragmatic preconditions on a given rule are satisfied.  The predicate takes as arguments a list of CycL variables and an asserted rule (see CycLRuleAssertion) in which those variables occur \"free\".  At the EL (\"epistemological level\"), pragmaticallyNormal sentences are not asserted as GAFs, but appear instead as the antecedents of system-generated implies rules.  For a given sequence of values for the respective variables VAR1, ..., VARn,    (pragmaticallyNormal (TheList VAR1 ... VARn) RULE) means that any pragmatic preconditions placed on RULE's being used by the Cyc inference engine (see pragmaticRequirement) are satisfied with respect to those values.\n<p>\nLet's make this more precise and explicit.  A pragmatic precondition for a rule is written like so:\n<p>\n(pragmaticRequirement CONDITION RULE)\n<p>\nand gets canonicalized into a rule involving pragmaticallyNormal like so:\n<p>\n(implies\n(pragmaticallyNormal (TheList VAR1 ... VARn) RULE)\nCONDITION),\n<p>\nwhere VAR1, ..., VARn are all and only the variables that occur free in RULE and thus include all (and possibly only) the variables that occur free in CONDITION (i.e. as RULE and CONDITION explicitly appear in the KB browser, without consideration of their having \"implicit\" initial universal quantifiers).\n<p>\nThe above pragmaticallyNormal rule is used in inference as though it were a constraint rule.  If CONDITION does not hold for a given sequence of values <VAL1, ..., VALn> for its variables <VAR1, ..., VARn>, then those values are not \"pragmatically normal\" for RULE; and hence inference will not proceed using <VAL1, ..., VALn> with RULE.\n<p>\nThe effect of the foregoing is that any asserted rule RULE is implicitly treated by the Cyc inference engine as if it had the form\n<p>\n(implies\n(pragmaticallyNormal (TheList VAR1 ... VARn) RULE)\nRULE)\n<p>\n(with VAR1, ..., VARn as described above).\n<p>\nThis convention allows the logical content of a rule to be expressed independently of any pragmatic preconditions for its being used in inference.\n<p>\nAlso see abnormal, which is syntactically similar and has a related  interpretation that makes it roughly the complement of pragmaticallyNormal.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, pointQuantValue, "A NumericComparisonPredicate and a specialization of numericallyEquals, minQuantValue, and maxQuantValue (qq.v.).  pointQuantValue is essentially the relation numericallyEquals restricted to scalar point-values, with the additional proviso that its first argument must be given using a reifiable CycL term.  Thus a sentence of the form\n<p>\n\t<code>(pointQuantValue REIFIABLE-TERM OTHER-TERM)</code>\n<p>\nis true if and only if <code>REIFIABLE-TERM</code> is a CycLReifiableDenotationalTerm (q.v.), and <code>REIFIABLE-TERM</code> and <code>OTHER-TERM</code> denote the same ScalarPointValue (q.v.).\n<p>\nThis predicate is primarily used to state the equivalence of a reified scalar-denoting term (e.g. 'Zero', 'AvogadrosNumber', 'SpeedOfLight') with an appropriate unreifiable term.  For example, both of the following sentences hold:\n<p>\n<pre>\n  (pointQuantValue Zero 0)\n</pre>\n<p>\n<pre>\n  (pointQuantValue\n    SpeedOfLight\n    (PerFn (Mile 186000) (HoursDuration 1))'  .\n</pre>", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, performSubL, "<code>(performSubL SUBL)</code> states that the SubL expression <code>SUBL</code> has been successfully evaluated for side-effect.  performSubL is evaluated as late in an inference proof as possible.  See also trueSubL which evaluates usually as soon as possible in an inference.  For example, <code>(performSubL (ExpandSubLFn () (print \"Done\")))</code> will print out the string \"Done\" as a given proof path completes.  See ExpandSubLFn for a way to denote SubL within CycL.  See also EvaluateSubLFn.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, overlappingExternalConcept, "A predicate for mapping terms from an external data source to closely related concepts represented in Cyc.  <code>(overlappingExternalConcept THING SOURCE STRING)</code> means that in the external data source <code>SOURCE</code>, the meaning of <code>STRING</code> has significant semantic overlap with THING.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, or, "A LogicalConnective that represents disjunction in CycL. It is a VariableArityRelation, taking an arbitrary number of instances of CycLSentence-Assertible as arguments.  (or P Q ... Z) is true if and only if at least one of the sentences P, Q, ..., or Z is true.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, operatorFormulas, "A non-assertible MetaLanguagePredicate and specialization of termFormulas (q.v.) that relates CycL operators to CycL formulas in which they occur as the main operator.  <code>(operatorFormulas OPERATOR FORMULA)</code> means that <code>OPERATOR</code> occurs as the main operator (i.e. in the \"arg0\" position) of <code>FORMULA</code>.  \n<p>\nNote that both argument-places of operatorFormulas are implicitly \"quoted\" (see quotedArgument). So if the above operatorFormulas sentence is closed (see CycLClosedAtomicSentence), the two CycL expressions it mentions, <code>OPERATOR</code> and <code>FORMULA</code>, actually <i>appear in</i> that sentence -- as names of themselves.  Thus, the sentence \n\n<pre>  (operatorFormulas bordersOn (bordersOn France Germany))</pre> \n\nis true, due to the manifest fact that the <i>term</i> <code>bordersOn</code> occurs as the main operator in the sentence <code>(bordersOn France Germany)</code>. \n<p>\nNote that <code>FORMULA</code> in the above need not be true (if it's a sentence) or even semantically well-formed.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, openEntryFormatInArgs, "An instance of SpecificEntryFormatPredicate (q.v.).  <code>(openEntryFormatInArgs PRED N)</code> means that, for any particular way of fixing the other arguments to <code>PRED</code> besides the <code>N</code>th, there might be any number (including zero) of things such that, if taken as the <code>N</code>th argument, <code>PRED</code> holds of those arguments.  For example, openEntryFormatInArgs holds of biologicalMother with respect to its first argument-place, since a given female animal might have any number of offspring.  \n<p>\nUnlike the other reified instances of SpecificEntryFormatPredicate, openEntryFormatInArgs actually places no restriction at all on what <code>PRED</code> might or might not hold of with respect to the specified argument-place.  But one should not infer from this that openEntryFormatInArgs assertions are pointless; for they forestall duplication of effort by serving notice that the entry-format of a given argument-place has previously been considered and openEntryFormatInArgs was deemed appropriate.  \n<p>\nopenEntryFormatInArgs is the most commonly-encountered specific entry-format in the Cyc Knowledge Base.  Contrast with singleEntryFormatInArgs.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, opaqueArgument, "A binary MetaLanguagePredicate that can be used to state that a given argument-place of a given CycL relation-denoting expression is <i>denotationally opaque</i>.  \n<p>\n<code>(opaqueArgument REL N)</code> means that if in a closed compound expression built from the CycL expression for <code>REL</code> -- i.e. a ground atomic formula (or <i>gaf</i>) if <code>REL</code> is a predicate or a closed non-atomic term (or <i>nat</i>) if <code>REL</code> is a function -- the term appearing in <code>REL</code>'s <code>N</code>th argument-place is replaced with another term having the same denotatum (or truth-value, if the term is a sentence), there is no guarantee that the resulting gaf (or nat) will itself have the same truth-value (or denotatum) as the original.  \n<p>\nMost argument-places of most relation-denoting expressions do  allow such substitutions to be made freely, and are thus <i>denotationally transparent</i>.  For example, given that (equals Cicero Tully), the truth of <code>(residesInRegion Cicero CityOfRomeItaly)</code> entails the truth of  <code>(residesInRegion Tully CityOfRomeItaly)</code>.  This shows that residesInRegion's first argument-place is denotationally transparent. On the other hand, if Caesar were seeking Cicero and found him then (<code>objectFound-Definite CaesarsSearchForCicero Caesar Cicero)</code> would be true; but <code>(objectFound-Definite CaesarsSearchForCicero Caesar Tully)</code> might nevertheless be false, because Caesar might not know that Tully is Cicero and thus might not realize that in finding Cicero he had found Tully.  Having such a realization is a necessary condition for objectFound-Definite's holding, which shows that this relation's third argument-place is denotationally opaque.  \n<p>\nAccording to one well-known semantics for denotational opacity (viz. GottlobFrege's), a term appearing in an opaque context (in most cases) denotes (not its ordinary denotatum, but) what is ordinarily its <i>intensional meaning</i> or <i>sense</i> (or <i>Sinn</i>, in Frege's native German).  \n<p>\nquotedArgument (q.v.) is a specialization of opaqueArgument, and a term appearing in a <i>quoted</i> context is interpreted as denoting <i>itself</i> (rather than its usual denotatum).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, omitArgIsa, "<code>(omitArgIsa RELN N)</code> means that the relation <code>RELN</code> is not asserted to have a non-quoted argument constraint in its <code>N</code>th argument position, due to limitations of the Cyc system.  Since every relation relates things to other things, in principle every argument position for every relation should have an argIsa constraint; however, asserting some argIsa constraints will cause certain Cyc tests to fail.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, oldConstantName, "This bookkeeping predicate relates a CycL constant to a former \"name\" of that constant.  More accurately, (oldConstantName CONSTANT STRING) means that the underlying data structure currently associated with the CycL expression CONSTANT was formerly associated instead with the SubL string STRING.  If CONSTANT has undergone multiple \"renames\", STRING will \nnormally be its most recent former \"name\".  While oldConstantName sentences \ncan be asserted and edited by hand, they are asserted automatically when a Rename is done in the Knowledge Base.", 'BookkeepingMt', vStrMon).
exactlyAssertedEL_next(comment, numericallyEquals, "A NumericComparisonPredicate that is applicable to ScalarIntervals (<i>q.v.</i>) of all sorts, including quantitative intervals (see NumericInterval and Quantity) as well as point values (see ScalarPointValue).  <code>(numericallyEquals VALUE1 VALUE2)</code> means that <code>VALUE1</code> is equal to <code>VALUE2</code> with respect to some scale that they are both on.  More precisely, there is some TotallyOrderedScalarIntervalType <code>SCALE</code> that <code>VALUE1</code> and <code>VALUE2</code> are instances of and the minimum (see minQuantValue) of <code>VALUE1</code> is equal to the minimum of <code>VALUE2</code> and the maximum (see maxQuantValue) of <code>VALUE1</code> is equal to the maximum of <code>VALUE2</code>.\n<p>\nNote that numericallyEquals is <i>not</i> a specialization of equals (<i>q.v.</i>), as numeric values of different sorts can be \"numerically  equivalent\" without being considered identical (e.g. the Integer 1 and the RealNumber 1.0).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, nthSmallestElement, "(nthSmallestElement X N SET FUNCTION) means that X is an element of SET that has precisely N-1 other elements with a smaller value for FUNCTION. For example, (nthSmallestElement RhodeIsland-State 1 State-UnitedStates (FunctionToArg 2 areaOfRegion)). Yet there may be more nthSmallestElements. For example, (nthSmallestElement ?X 3 (TheSet 1 2 3 -3) AbsoluteValueFn) is true for both 3 and -3 - when the elements in the set are ordered according to their absolute value both 3 and -3 are 3rd smallest elements. ", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, nthLargestElement, "(nthLargestElement X N SET FUNCTION) means that X is an element of SET that has precisely N-1 other elements with a larger value for FUNCTION. For example, (nthLargestElement Alaska-State 1 State-UnitedStates (FunctionToArg 2 areaOfRegion)) means that Alaska is the largest state (no elements have a larger areaOfRegion). Yet there may be more nthLargestElements. For example, (nthLargestElement ?X 1 (TheSet 1 2 3 -3) AbsoluteValueFn) is true for both 3 and -3 ; when the elements in the set are ordered according to their absolute value both 3 and -3 are largest elements. See also nthSmallestElement.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, notAssertibleMt, "(notAssertibleMt MT) states that the Microtheory MT cannot be used as the microtheory of an assertion made to the KB; i.e., MT might be a microtheory used as scaffolding or one whose assertions are known to be complete.  See also notAssertibleCollection, and notAssertible.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, notAssertibleCollection, "A UnaryPredicate used for stating a certain restriction regarding the use of a given Collection in assertions to the Cyc Knowledge Base.  (notAssertibleCollection COL) means that no ground atomic formula (or \"GAF\"; see CycLClosedAtomicSentence) whose initial (or \"0th\" argument-place) term is `isa', and whose 2nd argument-place term denotes COL, can be asserted to the KB.  See also notAssertible, which constrains predicates in a similar fashion.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, notAssertible, "A MetaPredicate for stating a certain restriction regarding the use of a given Predicate in assertions to the Cyc Knowledge Base.  (notAssertible PRED) means that no ground atomic formula (or \"GAF\"; see CycLClosedAtomicSentence) whose initial (or \"0th\" argument-place) term denotes PRED can be asserted to the KB.  In many cases, PRED will be an EvaluatablePredicate whose extent is (re)computed as necessary and never cached in the KB.  \n<p>\nSee also notAssertibleCollection, which constrains collections \nin a similar fashion.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, not, "An instance of both LogicalConnective and UnaryRelation.  which takes an instance of #CycLSentence-Assertible as its argument. (not SENT) is true if and only if SENT is false (and false if and only if SENT is true).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, nonAbducibleWithValueInArg, "A ternary predicate that is an instance of AbductionConstraintConstant (q.v.) and that can apply to a predicate and a specified value for a specified argument-place. \n<p>\n(nonAbducibleWithValueInArg PRED VALUE N) means that, if asked a query of the form (PRED ... VALUE ...), where VALUE appears in the Nth argument-position and all of the other positions (>= 1) are filled with variables, the Inference Engine cannot use abduction to hypothesize that any non-abduced terms are legitimate bindings for those variables.\n<p>\nFor example, (nonAbducibleWithValueInArg hasMembers InternationalMonetaryFund 1) holds, so Cyc cannot use abduction to hypothesize that Sealand is a member of the IMF.  (Note that this does not mean that Cyc cannot prove that some abduced term is a member of the IMF.)", 'CoreCycLMt', vStrMon).
exactlyAssertedEL_next(comment, negationPreds, "A MetaPredicate for stating that two predicates are logical \"contraries\" of one another.  <code>(negationPreds PRED1 PRED2)</code> means that if <code>PRED1</code> holds among a given sequence of things, then <code>PRED2</code> does <i>not</i> hold among that sequence (and vice versa).  Thus it is equivalent to \n\n<pre>  (not (and (PRED1 . ARGS) (PRED2 . ARGS))) .</pre>  \n\nFor example, (negationPreds owns rents) holds, as one cannot both own and rent a given thing at the same time.   \n<p>\nNote that the argument types of <code>PRED1</code> and <code>PRED2</code> need not be the same, they merely must not be disjoint.  Note also that <code>PRED1</code> and <code>PRED2</code> are constrained (see e.g. interArgIsa) either to both having the same fixed-arity (see FixedArityRelation) or to both having variable-arity (see VariableArityRelations).     \n<p>\nSee also genlPreds and negationInverse.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, negationMt, "(negationMt MT-1 MT-2) means that the domain assumptions of the Microtheory MT-1 are inconsistent with those of the Microtheory MT-2, and no lifting can occur between MT-1 and MT-2 (i.e. assertions made in one microtheory should not be made visible to the other microtheory). For cases where two microtheories differ not in domain assumptions but purely in content (assertions made within those microtheories), see the less specialized contradictoryMt.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, negationInverse, "A MetaPredicate for stating that each of two binary predicates is a logical \"contrary\" of the other's inverse. <code>(negationInverse BINPRED1 BINPRED2)</code> means that if <code>BINPRED1</code> holds between a pair <code><THING1, THING2></code>, then <code>BINPRED2</code> does <i>not</i> hold between the inverse pair <code><THING2, THING1></code> (and vice versa).  In other words, <code>(negationInverse BINPRED1 BINPRED2)</code> is equivalent to <code>(not (and (BINPRED1 ARG1 ARG2) (BINPRED2 ARG2 ARG1)))</code>.\n<p>\nNote that any AsymmetricBinaryPredicate is related to itself by negationInverse.  For example, (negationInverse subordinates subordinates) holds, since if one person is a subordinate of another, the latter person cannot at the same time also be a subordinate of the former.  See also negationPreds and genlInverse.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, nearestIsa, "A TaxonomicSlotForAnyThing, and a specialization of isa (q.v.).  (nearestIsa OBJ COL) means that COL is a \"nearest\" collection of which OBJ is an instance.  That is, (isa OBJ COL) holds, OBJ is not identical to COL, and there is no reified Collection NEARER-COL distinct from OBJ and COL such that both (isa OBJ NEARER-COL) and (genls NEARER-COL COL) hold.  Note that nearestIsa is non-assertible (see notAssertible), since its extension at any given time depends upon (and so must be recomputed from) the current state of the isa and genls hierarchy in the Cyc Knowledge Base.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, nearestGenls, "A TaxonomicSlotForCollections and a KBDependentRelation (qq.v.) that is a specialization of genls. \n<code>(nearestGenls COL NEAR-COL)</code> means that <code>NEAR-COL</code> is a \"nearest\" generalization of <code>COL</code>.  More precisely:\n<p>\n(i) <code>(genls COL NEAR-COL)</code> holds, <br>\n(ii) <code>COL</code> is not identical to <code>NEAR-COL</code>, <br>\n(iii) both <code>COL</code> and <code>NEAR-COL</code> are reified, and <br>\n(iv) there is no reified Collection <code>NEARER-COL</code> distinct from <code>COL</code> and <code>NEAR-COL</code> such that both <code>(genls COL NEARER-COL)</code> and <code>(genls NEARER-COL NEAR-COL)</code> hold.\n<p>\nNote that nearestGenls is non-assertible (see notAssertible), since its extension at any given time depends upon (and so must be recomputed from) the current state of the genls hierarchy in the Cyc Knowledge Base.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, nearestGenlPreds, "A TaxonomicSlotForPredicates and a specialization of genlPreds (q.v.).  (nearestGenlPreds PRED NEAR-PRED) means that NEAR-PRED  is a \"nearest\" generalization of PRED.  That is, (genlPreds PRED NEAR-PRED)  holds, PRED is not identical to NEAR-PRED, and there is no reified Predicate  OTHER-PRED distinct from PRED and NEAR-PRED such that both  (genlPreds PRED OTHER-PRED) and (genlPreds OTHER-PRED NEAR-PRED) hold.  Note   that nearestGenlPreds is non-assertible (see notAssertible), since its  extension at any given time depends upon (and so must be recomputed from) the  current state of the genlPreds hierarchy in the Cyc Knowledge Base.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, nearestGenlMt, "A specialization of genlMt.  (nearestGenlMt MT NEAR-MT) means that NEAR-MT is a \"nearest\" microtheory of which MT is a specialization.  That is, (genlMt MT NEAR-MT) holds, MT is not identical to NEAR-MT, and there is no reified Microtheory NEARER-MT distinct from MT and NEAR-MT such that both (genlMt MT NEARER-MT) and (genlMt NEARER-MT NEAR-MT) hold.  Note that nearestGenlMt is non-assertible (see notAssertible), since its extension at any given time depends upon (and so must be recomputed from) the current state of the genlMt hierarchy in the Cyc Knowledge Base.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, nearestDifferentIsa, "(nearestDifferentIsa OBJ-1 OBJ-2 NEAR-DIFF) means that NEAR-DIFF is a \"nearest\" collection of which OBJ-1 is an instance, but OBJ-2 is not. That is, (isa OBJ-1 NEAR-DIFF) holds, but (isa OBJ-2 NEAR-DIFF) does not, and there is no reified Collection OTHER-COL distinct from NEAR-DIFF such that (isa OBJ-1 OTHER-COL) holds, (isa OBJ-2 OTHER-COL) does not hold, and (genls OTHER-COL NEAR-DIFF) holds. Note that this predicate is notAssertible, since it must always be recomputed from the current state of the isa and genls hierarchy. For comparison, see nearestDifferentGenls.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, nearestDifferentGenls, "(nearestDifferentGenls COL-1 COL-2 NEAR-DIFF) relates collections COL-1 and COL-2 to the nearest unsubsumed collections NEAR-DIFF of which COL-1 is a subset but COL-2 is not. This predicate is notAssertible, since it  must always be recomputed from the current state of the genls heirarchy.  For comparison, see nearestDifferentIsa.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, nearestCommonSpecs, "(nearestCommonSpecs COL-1 COL-2 NEAR-SPEC) relates collections COL-1 and COL-2 to the nearest unsubsumed collections NEAR-SPEC of which are subsets of both COL-1 and COL-2. This predicate is notAssertible, since it  must always be recomputed from the current state of the genls heirarchy.  For comparison, see also nearestCommonIsa and nearestCommonGenls.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, nearestCommonIsa, "(nearestCommonIsa THING1 THING2 NEAR-COL) means that NEAR-COL is a \"nearest\" collection of which both THING1 and THING2 are instances.  That is, both (isa THING1 NEAR-COL) and (isa THING2 NEAR-COL) hold, and there is no reified Collection NEARER-COL distinct from NEAR-COL such that (isa THING1 NEARER-COL), (isa THING2 NEARER-COL) and (genls NEARER-COL NEAR-COL) all hold.  Note that this predicate is non-assertible (see notAssertible), since its extension at any given time depends upon (and so must be computed from) the current state of the isa and genls hierarchies in the Cyc Knowledge Base. See also nearestCommonGenls and nearestCommonSpecs.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, nearestCommonGenls, "A TaxonomicPredicateForCollections that relates two collections to their nearest common generalizations represented in the Cyc Knowledge Base.  <code>(nearestCommonGenls COL1 COL2 NEAREST-GENL)</code> means that (i) <code>NEAREST-GENL</code> in known in the Cyc Knowledge Base to subsume (via genls) both <code>COL1</code> and <code>COL2</code> and (ii) there is no proper specialization of <code>NEAREST-GENL</code> that is known to subsume both <code>COL1</code> and <code>COL2</code>.\n<p>\nNote that nearestCommonGenls is <i>not</i> functional with respect to its third argument, as a pair of collections might have several nearest common generalizations, all orthogonal to each other.  Note also that this predicate is notAssertible, since it must always be recomputed from the current state of the represented genls heirarchy.  \n<p>\nSee also nearestCommonIsa and nearestCommonSpecs.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, nearestCommonGenlMt, "(nearestCommonGenlMt MT-1 MT-2 NEAR-MT) relates microtheories MT-1 and MT-2 to the nearest unsubsumed microtheories NEAR-MT of which both are spec microtheories.  This predicate is notAssertible, since it must always be recomputed from the current state of the genlMt hierarchy.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, natFunction, "(natFunction NAT FUNCTION) states that FUNCTION is the function used in the non-atomic term NAT.  For example,  (natFunction (JuvenileFn Dog) JuvenileFn).  More precisely, (termOfUnit NAT (FUNCTION ...)) implies  (natFunction NAT FUNCTION).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, natArgumentsEqual, "(natArgumentsEqual NAT1 NAT2) means that the\narguments of NAT1 and NAT2 unify.  For example,  (natArgumentsEqual (FemaleFn Dog) (MaleFn Dog).  More precisely, (and (termOfUnit NAT1 (FUNCTION1 . ARGS)) (termOfUnit NAT2 (FUNCTION2 . ARGS))) implies  (natArgumentsEqual NAT1 NAT2).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, natArgument, "(natArgument NAT N TERM) means that TERM is in the Nth argument position of the non-atomic term NAT.  For example,  (natArgument (JuvenileFn Dog) 1 Dog).  Note that (termOfUnit NAT (FUNCTION ... ARGN ...)) implies  (natArgument NAT N ARGN).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, myCreator, "<code>(myCreator X Y)</code> means that <code>Y</code> is the constant representing the person who introduced the constant <code>X</code> into the Cyc vocabulary. In general, the editing interfaces to the Cyc KB only allow the KB to be modified when an instance of Cyclist is designated as the author of the changes.  See also sourceOfTerm-Person.", 'BookkeepingMt', vStrDef).
exactlyAssertedEL_next(comment, myCreationTime, "<code>(myCreationTime CONSTANT TIME)</code> means that the CycLConstant <code>CONSTANT</code> was created at <code>TIME</code>, an instance of CycUniversalDate.  The format of <code>TIME</code> is YYYYMMDD; that is, the first four digits give the year in which the constant was created, the next two digits give the month in which it was created, and the final two digits give the day of the month on which it was created. For example, 19910309 is March 9, 1991.", 'BookkeepingMt', vStrDef).
exactlyAssertedEL_next(comment, myCreationSecond, "(myCreationSecond CONSTANT SECOND) means that the CycLConstant CONSTANT was created at the CycUniversalSecond SECOND on the day CONSTANT was created (the related predicate myCreationTime (q.v.) relates a CycLConstant to the day it was created).  The format of SECOND is HHMMSS; that is, the first two digits give the hour of the day on which the constant was created, the second two digits give the minute of the hour at which the constant was created, and the last two digits give the second of the minute at which the constant was created.  For example, midnight is 000000 (or simply 0), noon is 120000, 3:42:59 pm is 154259, and 11:59:59 pm is 235959.", 'BookkeepingMt', vStrMon).
exactlyAssertedEL_next(comment, myCreationPurpose, "A BookkeepingPredicate and a DocumentationConstant that relates a CycL constant (or other reifiable denotational term) to the Cyc-based project for which the term was created.  (myCreationPurpose TERM PROJECT) means that TERM was created as part of work that was done for PROJECT, and implies that the creator of TERM (see myCreator) was working PROJECT at the time.", 'BookkeepingMt', vStrMon).
exactlyAssertedEL_next(comment, multiplicationUnits, "A ternary predicate that relates UnitOfMeasure (q.v.) functions.  <code>(multiplicationUnits UNIT1 UNIT2 PRODUNIT)</code> means that <code>PRODUNIT</code> is the unit-of-measure that always returns the product of the values returned by <code>UNIT1</code> and <code>UNIT2</code> for two respective arguments (or argument-sequences) when it is itself applied to the product of those arguments (or sequences).  That is, whenever <code>(UNIT1 . ARGS1) = VALUE1</code> and <code>(UNIT2 . ARGS2) = VALUE2</code>, then <code>(PRODUNIT (TimesFn ARGS1 ARGS2)) = (TimesFn VALUE1 VALUE2)</code>.\n<p>\nFor example, (multiplicationUnits Mile Mile SquareMile) holds, and thus (TimesFn (Mile 2) (Mile 3)) is equal to (SquareMile 6).\n<p>\nThe predicate multiplicationUnits corresponds to (see functionCorrespondingPredicate) both of the functions UnitProductFn and PerFn (qq.v.).  Thus,\n<p>\n\t<code>(multiplicationUnits UNIT1 UNIT2 PRODUNIT)</code>\n<p>\nis equivalent to\n<p>\n\t<code>(equals PRODUNIT (UnitProductFn UNIT1 UNIT2))</code>\n<p>\nis equivalent to\n<p>\n\t<code>(equals UNIT1 (PerFn PRODUNIT UNIT2))</code> .", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, mtVisible, "A unary EvaluatablePredicate that applies to a Microtheory.  <code>(mtVisible MT)</code> means that the contents of <code>MT</code> are visible in the current query context.  \n\nIn general, \n<pre>\n(genlMt MT1 MT2) \n</pre>\nentails \n<pre>\n(ist MT1 (mtVisible MT2),\n</pre>\nbut the converse does not hold.  In particular, it fails when <code>MT1</code> is a ProblemSolvingCntxt.  For example, \n<pre>\n(ist EverythingPSC (mtVisible HumanSocialLifeMt))\n</pre>\nholds (in BaseKB), but\n<pre>\n(genlMt EverythingPSC HumanSocialLifeMt)\n</pre>\ndoes not hold (in BaseKB).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, minQuantValue, "A specialization of scalarBounds (q.v.) that relates a given ScalarInterval (q.v.) to the minimum ScalarPointValue (q.v.) it subsumes (see quantitySubsumes). <code>(minQuantValue SCALAR POINT)</code> means that the lower limit of <code>SCALAR</code> is <code>POINT</code>.\n<p>\nFor example, if all mailroom employees earned from five to eight dollars per hour, <code>(minQuantValue \"MailroomPayRange\" (DollarsPerHour 5))</code> would hold.  Other examples:\n<pre>\n  (minQuantValue (Mile 15 20) (Mile 15))\n\n  (minQuantValue (Unity 6 12) 6).\n</pre>\n<p>\nSee also maxQuantValue and pointQuantValue.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, minimizeExtent, "An instance of both MetaKnowledgePredicate and MetaPredicate (qq.v.) that is used to state that the Cyc system will \"assume\" that a (sequence of) thing(s) is not in the extension (see relationExtension) of a given predicate if the CycInferenceEngine is unable to prove that it is.  \n<p>\n<code>(minimizeExtent PRED)</code> means that, for any sequence of things <code><THING1, ..., THINGn></code> such that <code>(PRED THING1 ... THINGn)</code> holds, the fact that this holds is either expressed by some GAF (i.e. a \"ground atomic formula\"; see CycLClosedAtomicSentence) that is asserted in the Cyc Knowledge Base or is deducible via the inference engine from what is in the KB.  \n<p>\nThe practical import of a minimizeExtent assertion is that it reflects an underlying assumption that if the inference engine cannot prove some given sentence of the form <code>(PRED ARG1 ... ARGN)</code>, then that fact constitutes an argument for its negation <code>(not (PRED ARG1 ... ARGN))</code>; and, if the \"negation by failure\" inference parameter is turned on, the inference engine will actually conclude that this negation is true.  Note that a minimizeExtent assertion is weaker than the corresponding completeExtentEnumerable (q.v.) assertion would be, in that the latter does not require that the inference engine attempt to deduce <code>(PRED ARG1 ... ARGn)</code> before concluding that it is not true.  See also minimizeExtentForArg and the shared NoteOnClosedWorldAssumption.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, minimize, "minimize allows Cyc to assume that a statement is not\ntrue unless it is known to be true.  Specifically, if for some\nbindings of the variables that appear in the minimized formula the\nformula with the bindings substituted in cannot be proved, then assume\nthe negation of the formula with the bindings substituted in.  From an\nexample in the KB: (minimize (disjointWith ?Collection\n?Collection)) and binding ?Collection to Poodle means if we cannot\nprove (disjointWith Poodle Poodle) assume (not (disjointWith\nPoodle Poodle, i.e. assume every Collection is nonempty unless\nwe know otherwise.  In the case where we bind ?Collection to some\nother variable ?Y and substituting in means if we cannot show\n(disjointWith ?Y ?Y) then assume the negation, (not (forAll ?Y\n(disjointWith ?Y ?Y))) which is equivalent to (thereExists ?Y\n(not (disjointWith ?Y ?Y))). This is one of the predicates that\nhas been created to allow Cyc to do negation by failure.  Other\nrelated predicates are minimizeExtent and minimizeExtentForArg. ", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, microtheoryDesignationArgnum, "Used to specify which argument of a given MicrotheoryDesignatingRelation\ndesignates the microtheory in which to interpret some formula.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, meetsPragmaticRequirement, "A MetaKnowledgePredicate that is used to express that a pragmatic precondition on a given rule is satisfied.  The predicate takes as arguments a list of CycL variables and an asserted rule (see CycLRuleAssertion) in which those variables occur \"free\".  At the EL (\"epistemological level\"), meetsPragmaticRequirement sentences are not asserted as GAFs, but appear instead as the consequents of system-generated implies rules.  For a given sequence of values for the respective variables <code>VAR1</code>, ..., <code>VARn</code>, <code>(meetsPragmaticRequirement (TheList VAR1 ... VARn) RULE)</code> means that some pragmatic precondition placed on <code>RULE</code>'s being used by the Cyc inference engine (see pragmaticRequirement) is satisfied with respect to those values.\n<p>\nLet's make this more precise and explicit.  A pragmatic precondition for a rule is written like so:\n<p>\n<pre>\n   (pragmaticRequirement CONDITION RULE)\n</pre>\n<p>\nand gets canonicalized into a rule involving meetsPragmaticRequirement like so:\n<p>\n<pre>\n   (implies\n     CONDITION\n    (meetsPragmaticRequirement (TheList VAR1 ... VARn) RULE)),\n</pre>\n<p>\nwhere <code>VAR1, ..., VARn</code> are all and only the variables that occur free in <code>RULE</code> and thus include all (and possibly only) the variables that occur free in <code>CONDITION</code> (i.e. as <code>RULE</code> and <code>CONDITION</code> explicitly appear in the KB browser, without consideration of their having \"implicit\" initial universal quantifiers).\n<p>\nThe above meetsPragmaticRequirement rule is used in inference similarly to an abnormal rule.  If <code>CONDITION</code> is not known to hold for a given sequence of values <code><VAL1, ..., VALn></code> for its variables <code><VAR1, ..., VARn></code>, then those values do not \"meet the pragmatic requirement\" for <code>RULE</code>; and hence inference will not proceed using <code><VAL1, ..., VALn></code> with <code>RULE</code>.\n<p>\nThe effect of the foregoing is that any asserted rule <code>RULE</code> is implicitly treated by the Cyc inference engine as if it had the form\n<p>\n<pre>\n (implies\n  (meetsPragmaticRequirement (TheList VAR1 ... VARn) RULE)\n   RULE)\n</pre>\n<p>\n(with <code>VAR1, ..., VARn</code> as described above).\n<p>\nThis convention allows the logical content of a rule to be expressed independently of any pragmatic preconditions for its being used in inference.  If a rule has multiple pragmatic requirements, it must meet all of them to be used in inference.\n<p>\nAlso see abnormal, which is syntactically similar and has a related  interpretation.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, means, "A MetaLanguagePredicate (q.v.) that relates SubLSExpressions to their meanings: the things in the intended model of the CycL language that those terms denote, refer to, stand for, or express. <code>(means TERM THING)</code> means that <code>TERM</code> denotes, refers to, stands for, or expresses <code>THING</code>. <code>TERM</code> will often be explicitly quoted, by being wrapped in the syncategorematic quotation symbol 'Quote'. For example, the true sentence '(means (Quote Plato) Plato)' means that the CycL term 'Plato' means (denotes) the person Plato. (Thus means's first argument-place is <i>not</i> \"implicitly quoted\"; cf. quotedArgument).\n<p>\nBut note that the first argument of means might not be quoted at all. Suppose (e.g.) that the term 'Plato' were the CycL constant most beloved of Cyclists, and that a new constant 'CyclistsFavoriteConstant' were reified and defined so as to reflect this fact. Then 'CyclistsFavoriteConstant' would denote the CycL constant 'Plato', which in turn denotes the man Plato; and so the sentence '(means CyclistsFavoriteConstant Plato)' -- which involves no quotation -- would be true.\n<p>\nNote finally that the sentence '(means Plato Plato)' is of course <i>not</i> true, as it means that the man Plato is a CycL term that denotes the man Plato, which is a patent falsehood since no man is a CycL term and no man denotes anything.\n<p>\nSee also expresses, denotes, hasDenotatum, quotedIsa, EscapeQuote, and the shared NoteAboutQuotingInCycL.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, maxQuantValue, "A specialization of scalarBounds (q.v.) that relates a given ScalarInterval (q.v.) to the maximum ScalarPointValue (q.v.) it subsumes (see quantitySubsumes). <code>(maxQuantValue SCALAR POINT)</code> means that the upper limit of <code>SCALAR</code> is <code>POINT</code>.\n<p>\nFor example, if all mailroom employees earned from five to eight dollars per hour, <code>(maxQuantValue \"MailroomPayRange\" (DollarsPerHour 8))</code> would hold.  Other examples:\n<pre>\n  (maxQuantValue (Mile 15 20) (Mile 20))\n\n  (maxQuantValue (Unity 6 12) 12).\n</pre>\n<p>\nSee also minQuantValue and pointQuantValue.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, maxQuantValue, "(maxQuantValue SCALAR POINT) means that the upper limit of the quantity SCALAR is POINT, an instance of ScalarPointValue.  SCALAR is an instance of ScalarInterval.  For example, the maxQuantValue for the pay of mail room employees might be (DollarsPerHour 6.5); e.g., (maxQuantValue `MailPay' (DollarsPerHour 6.5)).  Another example: (maxQuantValue (Unity 5 10) 10).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, knownSentence, "A KBDependentRelation (q.v.) and  specialization of trueSentence (q.v.) that is used to state  that a given sentence is \"known\" to be true to the Cyc system. More precisely, (knownSentence SENT) means that SENT is provable  by the Cyc inference engine from sentences currently in the Knowledge  Base.  knownSentence is a non-assertible predicate (see  notAssertible).  Note that this predicate is not to be confused  with knownSentence, which is used to state that a given  sentence is explicitly asserted in the KB.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, knownAntecedentRule, "A MetaKnowledgePredicate that is used to state a strong pragmatic directive to the CycInferenceEngine.  Asserting (knownAntecedentRule RULE) tells the inference engine to automatically generate a removal module to implement RULE; i.e. to solve queries unifying with the consequent of RULE by attempting to prove the substituted antecedent of RULE.  When this removal module is used during inference, it attempts to prove the substituted antecedent via removal only (see knownSentence).  It does not preclude other uses of RULE in inference.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, ist, "This predicate relates a microtheory to any sentence that is true in it.  (ist MT SENT) means that the CycL sentence SENT (or, if you prefer, the proposition SENT expresses) is true in the microtheory MT.  Note that SENT need not actually be _asserted_ in MT; MT might for example \"inherit\" SENT from a more general microtheory.  (Cf. ist-Asserted.)", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, isa, "A TaxonomicSlot (q.v.) that relates things of any  kind to collections (see Collection) of which they are instances.   <code>(isa THING COL)</code> means that <code>THING</code> is an instance of the collection <code>COL</code>.   isa is by far the most commonly-occurring predicate in the Cyc Knowledge  Base, and is one of the relations most fundamental to the Cyc ontology. An important logical feature of isa is that it \"transfers through\"  genls (q.v.): <code>(isa THING COL)</code> and <code>(genls COL SUPERCOL)</code> jointly  imply <code>(isa THING SUPERCOL)</code>.  This logical feature is expressed in a  rule that -- along with various other rules that also sanction the  derivation of isa sentences -- has been asserted to the Knowledge Base.   As a result, only a small fraction of the isa based ground atomic  formulas (or \"GAF\"s; see CycLClosedAtomicSentence) the Cyc system  \"knows\" to be true have been manually asserted; the vast majority  have been derived, or are derivable, automatically by the Cyc inference  engine via the use of such rules.  See also elementOf.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, irrelevantTerm, "A CycInferenceHeuristicRelevancePredicate. (irrelevantTerm TERM) states that the CycLClosedDenotationalTerm TERM should be heuristically considered less relevant to inferences made in the current Microtheory.  See also other instances of CycInferenceHeuristicRelevancePredicate.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, irrelevantPredAssertion, "(irrelevantPredAssertion PREDICATE ASSERTION) states that the given ASSERTION should be heuristically considered very unlikely to be relevant to inferences concluding uses of the given PREDICATE in the current mt.  See also other instances of CycInferenceHeuristicRelevancePredicate.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, irrelevantMt, "A CycInferenceHeuristicRelevancePredicate. (irrelevantMt MT) means that all assertions made in the Microtheory MT should be heuristically considered very unlikely to be relevant to inferences done in the Microtheory MT-1 in which (irrelevantMt MT) is asserted (where MT-1 and MT need not be the same).  As a consequence, note that when (irrelevantMt MT) is asserted in a Microtheory MT-1, each of the assertions in MT will be an irrelevantAssertion (q.v.) for inferences done in MT-1.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, irrelevantAssertion, "A CycInferenceHeuristicRelevancePredicate. (irrelevantAssertion ASSERTION) states that the CycLAssertion ASSERTION should be heuristically considered very unlikely to be relevant to inferences in the current Microtheory.  See also other instances of CycInferenceHeuristicRelevancePredicate.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, interArgResultIsaReln, "A quintary MetaRelation predicate for stating that a certain kind of complex, partly isa based relationship holds between a given argument to a given function and the corresponding value that is returned. (interArgResultIsaReln FUNC N RELATION RELATION-NAT-TERM-ARG RELATION-COLLECTION-ARG) means that, if there is a sentence asserted in the KB relating NAT-TERM and COLLECTION via RELATION and NAT-TERM is the RELATION-NAT-TERM-ARGth argument in the sentence and COLLECTION is the RELATION-COLLECTION-ARGth argument, then when NAT-TERM appears as the Nth argument to FUNC, then (regardless of what the other arguments to FUNC might be) the value (if any) of that function for those arguments is an instance of COLLECTION.  That is: if (RELATION ... NAT_TERM ... COLLECTION ...) or (RELATION ... COLLECTION ... NAT_TERM  ...) is an asserted sentence, and (FUNC ARG(1) ... ARG(N-1) NAT_TERM ...) = VALUE, then VALUE is an instance of COLLECTION. Obviously, COLLECTION must be a collection; so RELATION's RELATION-COLLECTION-ARGth argument-place is likely to be isa constrained (see argIsa) to Collection or some specialization thereof.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, interArgResultIsa, "A quaternary MetaRelation predicate for stating that a certain kind of complex, partly isa -based relationship holds between a given argument to a given function and the corresponding value that is returned.\n<p>\n<code>(interArgResultIsa FUNC N INDEP-ARG-COL DEP-ARG-COL)</code> means that, when an instance of <code>INDEP-ARG-COL</code> appears as the <code>N</code>th argument to <code>FUNC</code>, then (regardless of what the other arguments to <code>FUNC</code> might be) the value (if any) of that function for those arguments is an instance of <code>DEP-ARG-COL</code>.  That is: if <code>INST</code> is an instance of <code>INDEP-ARG-COL</code> and <code>(FUNC ARG1 ... ARGN-1 INST ...) = VALUE</code>, then <code>VALUE</code> is an instance of <code>DEP-ARG-COL</code>.\n<p>\nFor example, <code>(interArgResultIsa RoundUpFn 1 RealNumber Integer)</code> means that the rounding-up function RoundUpFn returns an integer whenever it is given a real number as its first (and only) argument.\n<p>\nNote that, unlike (e.g.) the InterArgTypePredicates, interArgResultIsa <i>cannot</i> be used to put semantic well-formedness constraints on functions.  See also the similar but less flexible ternary interArg1ResultIsa et al.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, interArgResultGenlReln, "A quintary MetaRelation predicate for stating that a certain  kind of complex, partly genls based relationship holds between a given  argument to a given function and the corresponding value that is returned.  (interArgResultGenlReln FUNC N RELATION RELATION-NAT-TERM-ARG RELATION-COLLECTION-ARG) means that, if there is a sentence asserted in the KB relating NAT-TERM and COLLECTION via RELATION and NAT-TERM is the RELATION-NAT-TERM-ARGth argument in the sentence and COLLECTION is the RELATION-COLLECTION-ARGth argument, then when NAT-TERM appears as the Nth argument to FUNC, then (regardless of what the other arguments to FUNC might be) the value (if any) of that function for those arguments is a subcollection of COLLECTION. That is: if (RELATION ... NAT_TERM ... COLLECTION ...) or  (RELATION ... COLLECTION ... NAT_TERM  ...) is an asserted sentence, and (FUNC ARG(1) ... ARG(N-1) NAT_TERM ...) = VALUE, then VALUE is a subcollection of COLLECTION. Obviously, COLLECTION must be a collection; so RELATION's RELATION-COLLECTION-ARGth argument-place is likely to be isa  constrained (see argIsa) to Collection or some specialization thereof.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, interArgResultGenl, "A quaternary MetaRelation predicate for stating that a certain kind of complex, partly genls based relationship holds between a given argument to a given function and the corresponding value that is returned. (interArgResultGenls FUNC N INDEPENDENT-ARG-COL DEPENDENT-ARG-COL) means that, when a subcollection of INDEPENDENT-ARG-COL appears as the Nth argument to FUNC, then (regardless of what the other arguments to FUNC might be) the value (if any) of that function for those arguments is a subcollection of DEPENDENT-ARG-COL.  That is: if INST is a subcollection of INDEPENDENT-ARG-COL and (FUNC ARG(1) ... ARG(N-1) INST ...) = VALUE, then VALUE is a subcollection of DEPENDENT-ARG-COL.  Note that, unlike (e.g.) the InterArgTypePredicates, interArgResultGenl _cannot_ be used to put semantic well-formedness constraints on functions.  See also the similar but less flexible ternary interArg1ResultGenls et al.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, interArgIsa, "A quintary instance of InterArgIsaPredicate (q.v.).   <code>(interArgIsa RELN INDEP-ARGNUM INDEP-COL DEP-ARGNUM DEP-COL)</code> means that,  when an instance of <code>INDEP-COL</code> appears as the <code>INDEP-ARGNUM</code>th argument to <code>RELN</code>,  a necessary condition for semantic well-formedness is that the <code>DEP-ARGNUM</code>th argument must be an instance of <code>DEP-COL</code>.  That is, if <code>INDEP-INST</code> is an instance of <code>INDEP-COL</code>, then <code>(RELN</code> ... <code>INDEP-INST</code> ...), where <code>INDEP-INST</code> is the <code>INDEP-ARGNUM</code>th (or \"independent\") argument to <code>RELN</code>, is semantically well-formed only if the <code>DEP-ARGNUM</code>th (or \"dependent\") argument (which is some item in the sequence <... <code>INDEP-INST</code> ...> other than the <code>INDEP-ARGNUM</code>th) is an instance of <code>DEP-COL</code>.\n<p>\nFor example, (interArgIsa performedBy 1 PurposefulAction 2 IntelligentAgent) means that, if <code>ACT</code> is a PurposefulAction, then <code>(performedBy ACT AGENT)</code> is semantically well-formed only if <code>AGENT</code> is an IntelligentAgent.\n<p>\nFor an explanation of semantic well-formedness, see CycLExpression-Assertible and its direct specializations.  For a more general explanation of independent and dependent arguments in the present sense, see InterArgConstraintPredicate.  For similar to but less flexible predicates than interArgIsa, which have already-fixed positions for the independent and dependent arguments, see the ternary interArgIsa1-2 et al.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, interArgDifferent, "A MetaRelation used for stating a certain kind of necessary condition for being an element of the domain of a given Relation (see relationDomain).  Thus (to put it in terms of the semantics of CycL expressions) interArgDifferent can be used for stating a certain kind of truth- or denotation-condition for a given relation-denoting expression.  (interArgDifferent RELN N M) means that RELN (if it is a Predicate or other TruthFunction) only holds among or (if it is a Function-Denotational) only has a value for sequences of arguments whose Nth and Mth members are distinct (see different).  That is (assuming without loss of generality that N < M): if RELN is a predicate or other \"truth-function\" then (RELN ... ARGN ... ARGM ...) holds only if ARGN and ARGM are distinct, and if RELN is a function then it is defined for (i.e. associates a value with) a sequence <THING-1, ..., THING-N, ..., THING-M, ...> only if THING-N and THING-M are distinct.  For example, (interArgDifferent opponentsInConflict 1 2) means that no-one is his or her own opponent in a conflict.\n<p>\nNote that this predicate trivially holds for any relation with respect those argument-places it has that are subject to mutually disjoint (see disjointWith and cf. cosatisfiableInArgs) argument-type constraints (see ArgTypePredicate).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, integerBetween, "A ternary IntangibleObjectRelatingPredicate that holds among Integers only.  <code>(integerBetween LOW MED HIGH)</code> means that <code>HIGH</code> is greaterThanOrEqualTo <code>MED</code>, and <code>MED</code> is greaterThanOrEqualTo <code>LOW</code>.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, instanceElementType, "A binary FirstOrderCollectionPredicate that relates types of sets to the types of elements they have in common.  More precisely, <code>(instanceElementType SETTYPE COLLECTION)</code> means that every elementOf every instance of (see isa) <code>SETTYPE</code> is an instance of <code>COLLECTION</code>.  For example, both of these hold:\n<pre>\n  (instanceElementType PointSet Point)\n\n  (instanceElementType Set-Mathematical Thing) . \n</pre>\nSee the corresponding function SetOfTypeFn, which takes a given collection to the collection of <i>all</i> sets whose elements are instances of the former.  And see typeGenls for a similar predicate that relates collections of <i>collections</i> (rather than collections of sets) to their common element types.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, indexicalReferent, "(indexicalReferent INDCONCEPT THING) means that in the context of the assertion, the IndexicalConcept INDCONCEPT has the referent THING.  This is a StrictlyFunctionalSlot, in keeping with the idea that the predicate will return one and only one 'value' for the second argument place at any given point in context space.  However, be advised that the arg2 will change from context to context.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, independentArg, "A MetaPredicate that is used to state, of a given\n(ternary) InterArgConstraintPredicate, that it is (always) used to constrain a relation in such a way that a certain specified argument-place of the relation is for the \"independent\" argument (with respect to that constraint).  (independentArg INT-ARG-PRED N) means that any sentence of the form (INT-ARG-PRED RELN ...) constrains RELN in some way that treats RELN's Nth argument as independent.  For example, (independentArg interArgIsa3-4 3) holds.  See the comment on InterArgConstraintPredicate for an explanation of what it means to be an \"independent\" argument in this sense.  Note that independentArg is contrained to apply only to _ternary_ inter-argument constraint predicates, as only they have already-fixed positions for the corresponding independent and dependent arguments; thus it cannot (on pain of semantic malformedness) be applied to the quintary inter-argument constraint predicates, such as interArgIsa.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, implies, "A binary LogicalConnective (q.v.) that corresponds to the material implication operator of propositional calculus.  The implies relation takes two CycLSentence-Assertibles as its arguments; and the syntactic result of applying the term 'implies' to two sentences is itself a sentence, called a \"conditional\" or \"implication\".  A sentence of the form (implies ANTECEDENT CONSEQUENT) is true if and only if ANTECEDENT is false or CONSEQUENT is true (or both).  Equivalently: it is not the case that ANTECEDENT is true and CONSEQUENT is false.  For example,\n<p>\n<pre>\n  (implies\n    (knows Muffet Patches-Cat)\n    (likesAsFriend Muffet Patches-Cat))\n</pre>\n<p>\nmeans that if Muffet knows Patches then she likes him.\n<p>\nCf. the predicate sentenceImplies, which is not a logical connective, and is primarily used in rules involving quantification over CycL sentences.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, hypotheticalTerm, "(hypotheticalTerm TERM) states that TERM is a term that was hypothesized.  The most common reason a term is hypothesized is to pose a hypothetical query to Cyc.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, holdsIn, "An instance of both TemporalPredicate and ModalPredicate that is used to state (in a somewhat indirect way) that a given sentence is true during a certain time period.  <code>(holdsIn TEMP SENT)</code> means that <code>SENT</code> is true at every moment in the temporalExtent (q.v.) of the TemporalThing <code>TEMP</code>.\n<p>\nFor example, the sentence <code>(holdsIn (YearFn 2003) (hasPets Curtis Patches-Cat))</code> means that throughout all of the year 2003 Curtis had Patches as a pet.  This entails (e.g.) that Curtis had Patches on 5 July 2003:\n<pre>\n  (holdsIn\n    (DayFn 5 (MonthFn July (YearFn 2003)))\n    (hasPets Curtis Patches-Cat))</code> .\n</pre>\n<p>\nSimilarly, <code>(holdsIn Patches-Cat (hasPets Curtis Patches-Cat))</code> means that Curtis has Patches as a pet for Patches's entire life.\n<p>\nSee also the more general predicate holdsSometimeDuring.\n<p>\nNote that a sentence of the form <code>(holdsIn TEMP (PRED ... ARGi ...))</code>, where <code>ARGi</code> is a TemporalThing, does <i>not</i> in general imply that <code>ARGi</code> temporally subsumes or even temporally intersects <code>TEMP</code>.  For example, <code>(holdsIn (YearFn 2003) (awareOf Curtis GeorgeWashington))</code> obviously doesn't imply that GeorgeWashington was alive in 2003.  <code>ARGi</code>'s temporally subsuming <code>TEMP</code> <i>does</i> follow, however, if <code>PRED</code> is a CotemporalPredicate that is contemporaryInArg (q.v.) in its <code>i</code>th argument-place (as hasPets is, in both argument-places).\n<p>\nNote also that there are two other ways to temporally-qualify sentences in CycL, which do not involve using holdsIn (or holdsSometimeDuring).  Both involve temporally qualifying the Microtheory in which the (otherwise unqualified) sentence is asserted, and either can be used to state something roughly equivalent to a holdsIn sentence.  Consider the first Curtis/Patches example above.  First, one could assert <code>(hasPets Curtis Patches-Cat)</code> in some microtheory <code>MT</code> such that <code>(holdsInTime-Always MT (YearFn 2003))</code>.  Second, one could assert <code>(hasPets Curtis Patches-Cat)</code> in a microtheory <code>MT'</code> such that both <code>(mtTimeIndex MT' (YearFn 2003))</code> and <code>(mtTimeParameter MT' TimePoint)</code> hold.  This later method, being the most developed and well-supported, is generally preferred over the others.\n<p>\nNote finally that it would be incorrect to assert a sentence like <code>(hasPets Curtis Patches-Cat)</code> in a non-temporally-qualified microtheory like the BaseKB, since Curtis didn't have Patches when (e.g.) he was a young boy, let alone in 3500 BCE.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, hlPrototypicalInstance, "(hlPrototypicalInstance TERM COL) means that TERM is a prototypical instance of COL at the HL.  It is assumed that TERM has only two asserted assertions on it: one hlPrototypicalInstance assertion and one assertion of the form (isa TERM COL).  The CycInferenceEngine makes use of the prototypical instance during assertions to cache the work done by forward inference.  It is used when asserting the first isa assertion on a term with no other assertions about it yet.  <b>Do not assert comments, cyclistNotes or any other assertions on prototypical instances.</b>  They are intentionally minimal.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, highlyRelevantTerm, "A CycInferenceHeuristicRelevancePredicate. (highlyRelevantTerm TERM) states that the CycLClosedDenotationalTerm TERM should be heuristically considered highly relevant to inferences made in the current Microtheory.  See also other instances of CycInferenceHeuristicRelevancePredicate.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, highlyRelevantPredAssertion, "(highlyRelevantPredAssertion PREDICATE ASSERTION) states that the given ASSERTION should be heuristically considered highly relevant to inferences concluding uses of the given PREDICATE in the current mt.  See also other instances CycInferenceHeuristicRelevancePredicate.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, highlyRelevantMt, "A CycInferenceHeuristicRelevancePredicate. (highlyRelevantMt MT) means that all assertions in the Microtheory MT should be heuristically considered highly relevant to inferences done in the Microtheory MT-1 in which (highlyRelevantMt MT) is asserted (where MT-1 and MT need not be the same).  As a consequence, note that when (highlyRelevantMt MT) is asserted in a Microtheory MT-1, each of the assertions in MT will be a highlyRelevantAssertion (q.v.) for inferences done in MT-1.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, highlyRelevantAssertion, "A CycInferenceHeuristicRelevancePredicate. <code>(highlyRelevantAssertion ASSERTION)</code> states that the CycLAssertion <code>ASSERTION</code> should be heuristically considered highly relevant to inferences that are performed in a context in which <code>(highlyRelevantAssertion ASSERTION)</code> is visible.  See also other instances of CycInferenceHeuristicRelevancePredicate.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, greaterThanOrEqualTo, "A NumericComparisonPredicate (q.v.) that is a generalization of the mathematical greater-than-or equal-to <code>(>=)</code> relation to ScalarIntervals (q.v.) of all sorts, including quantitative intervals (see NumericInterval and Quantity) as well as point values (see ScalarPointValue).  <code>(greaterThanOrEqualTo VALUE1 VALUE2)</code> means that <code>VALUE1</code> is greater than or equal to <code>VALUE2</code> with respect to some scale that they are both on.  More precisely, there is some TotallyOrderedScalarIntervalType <code>SCALE</code> that both <code>VALUE1</code> and <code>VALUE2</code> are instances of and either (i) <code>SCALE</code> is a specialization of NumericInterval (e.g. RealNumber) and the minimum (see minQuantValue) of <code>VALUE1</code> is greater than or equal to the maximum (see maxQuantValue) of <code>VALUE2</code>, (ii) <code>(followingValueOnScale VALUE2 VALUE1 SCALE)</code> holds, or (iii) <code>(equals VALUE1 VALUE2)</code> holds.\n<p>\nSee also greaterThan and lessThanOrEqualTo.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, greaterThan, "A NumericComparisonPredicate that is a generalization of the  mathematical greater-than ( > ) relation to ScalarIntervals (q.v.) of all sorts, including quantitative intervals (see NumericInterval and MeasurableQuantity) as well as point values (see ScalarPointValue).  <code>(greaterThan VALUE1 VALUE2)</code> means that  <code>VALUE1</code> is greater than <code>VALUE2</code> with respect to some scale that they  are both on.  More precisely, there is some TotallyOrderedScalarIntervalType SCALE that both <code>VALUE1</code> and <code>VALUE2</code> are instances of and either (i) <code>SCALE</code> is a specialization of  NumericInterval (e.g. RealNumber) and the minimum (see minQuantValue) of <code>VALUE1</code> is greater than the maximum (see maxQuantValue) of <code>VALUE2</code> or (ii) <code>(followingValueOnScale VALUE2 VALUE1 SCALE)</code> holds.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, genMassNoun, "(genMassNoun TERM) means that the CycLReifiableDenotationalTerm TERM should be treated as a mass noun when CycL formulae containing TERM are paraphrased into English.  See also the related predicate prettyName.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, genls, "A instance of TaxonomicSlotForCollections (q.v.) and  a specialization of generalizations.  genls relates a given collection  (see Collection) to those collections that subsume it.  More precisely, <code>(genls SUBCOL SUPERCOL)</code> means that <code>SUPERCOL</code> is a supercollection of <code>SUBCOL</code>:  anything that is an instance of (see isa) <code>SUBCOL</code> is also an instance of <code>SUPERCOL</code>.  For example, <code>(genls Dog Mammal)</code> holds.  genls is one of the most commonly-occurring predicates in the Cyc Knowledge Base, and one of  the relations most fundamental to the Cyc ontology.  See also subsetOf.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, genlRules, "(genlRules RULE-SPEC RULE-GENL) means that the set of binding tuples that satisfy the open (universally quantified) variables in the consequent of RULE-SPEC via an application of RULE-SPEC will be a subset of the set of binding tuples that satisfy the open (universally quantified) variables in the consequent of RULE-GENL via an application of RULE-GENL.  For example, the following holds\n\n<pre>\n   (genlRules\n      (ist CCFBridgingMt\n        (implies\n          (and\n           (cCFCardiacValveRepairProcedure ?CVRP Plication-ValvularProcedure)\n           (rdf-type ?PROC HeartValveRepair-SurgicalProcedure)\n           (cCF-contains ?CVD ?CVRP)\n           (cCF-contains ?PROC ?CVD))\n          (isa ?PROC Plication-ValvularProcedure)))\n      (ist CCFBridgingMt \n       (implies\n         (rdf-type ?X HeartValveRepair-SurgicalProcedure)\n         (isa ?X HeartValveRepair-SurgicalProcedure)))) </pre>\n\n\nHence, if one was looking to return instances of HeartValveRepair-SurgicalProcedure, all other things being equal, there would be no need to query using both of these rules.  The rule in arg2 of genlRules here would get a superset of the answers that the rule in arg1 would return.\n ", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, genlPreds, "A MetaPredicate for stating that one predicate is a generalization of another.  <code>(genlPreds SPEC-PRED GENL-PRED)</code> means that <code>GENL-PRED</code> is a generalization of <code>SPEC-PRED</code>.  That is, <code>(GENL-PRED ARG1..ARGN)</code> holds whenever <code>(SPEC-PRED ARG1..ARGN)</code> holds.  For example, <code>(genlPreds touches near)</code> holds, as touching something implies being near it.\n<p>\nAs for the respective arities (see arity) of <code>SPEC-PRED</code> and <code>GENL-PRED</code>, (i) both predicates might have the same fixed-arity (see FixedArityRelation), (ii) both might have variable-arity (see VariableArityRelation), or (iii) <code>SPEC-PRED</code> might have a fixed-arity and <code>GENL-PRED</code> variable-arity.  (It cannot be the case that <code>SPEC-PRED</code> has variable-arity and <code>GENL-PRED</code> has a fixed-arity.)\n<p>\nSee also negationPreds, genlInverse, and negationInverse.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, genlMt, "A reflexive and transitive BinaryPredicate that relates a Microtheory to a Microtheory.  <code>(genlMt SPEC-MT GENL-MT)</code> means that <code>SPEC-MT</code> is a specialization or extension of <code>GENL-MT</code>.  (Note that it need not be a <i>proper</i> specialization or extension.)  In particular, this entails that everything that is true in <code>GENL-MT</code> is also true in <code>SPEC-MT</code>.  This relation is sometimes expressed informally by saying that <code>SPEC-MT</code> \"sees\" <code>GENL-MT</code>.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, genlInverse, "A MetaPredicate for stating that one binary  predicate is a generalization of the <i>inverse</i> of another binary predicate.   <code>(genlInverse PRED GENL-INV-PRED)</code> means that <code>GENL-INV-PRED</code> is a  \"generalized inverse\" of <code>PRED</code>.  That is, <code>(PRED ARG1 ARG2)</code> implies  <code>(GENL-INV-PRED ARG2 ARG1)</code>.  For example, <code>(genlInverse grandchildren ancestors)</code> means that grandparents are  ancestors of their grandchildren.  See also genlPreds and negationInverse.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, genlCanonicalizerDirectives, "A transitive binary predicate that relates a given \nCanonicalizerDirective (q.v.) to more general ones.\n(genlCanonicalizerDirectives SPEC-DIRECTIVE GENL-DIRECTIVE) \nmeans that SPEC-DIRECTIVE is at least as specific a (set of) \ndirection(s) to the CycCanonicalizer as GENL-DIRECTIVE.  \nThat is, all the commands indicated by GENL-DIRECTIVE (and\npossibly others as well) are indicated by SPEC-DIRECTIVE.  \nFor example, (genlCanonicalizerDirectives\nLeaveSomeTermsAtELAndAllowKeywordVariables \nAllowKeywordVariables) holds.", 'CoreCycLImplementationMt', vStrMon).
exactlyAssertedEL_next(comment, genKeyword, "An NLGenerationPredicate that\nrelates a given CycL denotational term to the SubL keyword \nthat is used to represent it in generating natural language \nfrom CycL.  (genKeyword CYCL-TERM KEYWORD) means that \nKEYWORD represents CYCL-TERM in the generation of natural \nlanguage paraphrases of CycL expressions, e.g. in genFormat \n(q.v.) assertions.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, genFormat, "The Common Lisp format string ARG2 can be applied to the argument list ARG3 to generate pseudo-English for the Cyc Relation ARG1", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, forwardNonTriggerLiteral, "An HLPredicate that is used to state which literals in a forward rule should not be allowed to re-trigger forward inference.  This is useful for placing pragmatic restrictions on the applicability of forward rules.  It is only useful when used via pragmaticRequirement on a forward rule.\n<p>\nA pragmatic requirement of the form\n<pre>\n(pragmaticRequirement (forwardNonTriggerLiteral FORMULA) RULE),\n</pre>\nwhere <code>FORMULA</code> is a literal in the antecedent of <code>RULE</code>, ensures that new assertions that are instantiations of <code>FORMULA</code> do not trigger <code>RULE</code>.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, formulaArity, "(formulaArity FORMULA INTEGER) means that the CycL formula FORMULA contains INTEGER arguments. See also FormulaArityFn.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, forAll, "A binary Quantifier that corresponds to the standard universal quantifier of predicate calculus.  The relation forAll takes as its arguments a variable (ELVariable) and a sentence (ELSentence-Assertible) in which, typically, that variable occurs free.  A closed formula (see CycLClosedFormula) of the form (forAll VAR SENT) is a \"universally quantified\" sentence that states (roughly) that every thing in the universe of discourse satisfies SENT.  For example,\n<p>\n<pre>\n  (forAll ?THING (isa ?THING Individual))\n</pre>\n<p>\nmeans that everything is an individual.  And the sentence\n<p>\n<pre>\n  (forAll ?X\n    (implies\n      (isa ?X Cat)\n      (eatsWillingly ?X Grass-Plant)))\n</pre>\n<p>\nmeans that all cats eat grass.\n<p>\nA more precise definition of forAll is as follows.  Any occurence of VAR that is free in SENT is bound in (forAll VAR SENT).  If VAR is the only variable free in SENT, then (forAll VAR SENT) is a closed sentence that is true if and only if every thing that meets all of the argument-type constraints (see ArgTypePredicate) to which the position(s) in SENT occupied by VAR is (are) subject to satisfies SENT. If the variable VAR does _not_ occur free in SENT, then (forAll VAR SENT) is equivalent to SENT (and the 'forAll' is said to be \"vacuous\").  If variables other than VAR occur free in SENT, then (forAll VAR SENT) is an open sentence in which those other variables are still free.\n<p>\nNote that, for the sake of convenience and readability, universally quantified assertions (i.e. \"rules\") in the Cyc Knowledge Base appear in the KB browser -- and may be asserted to the KB -- without (any of) their initial 'forAll's.  Such assertions are considered to be \"implicitly quantified\": they are interpreted by the system just as if their initial quantifiers were explicitly present.  Thus the above sentence about cats would actually appear in the KB as:\n<p>\n<pre>\n  (implies\n    (isa ?X Cat)\n    (eatsWillingly ?X Grass-Plant)) .\n</pre>\n<p>\nNote also that certain RuleMacroPredicates (e.g. those with 'All' in their names) can be used to abbreviate universally quantified sentences.  Thus the same statement about cats can be even more tersely expressed with the atomic sentence\n<p>\n<pre>\n  (relationAllInstance eatsWillingly Cat Grass-Plant) .\n</pre>\n<p>\nCf. the existential quantifier thereExists.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, followingValue, "An instance of both OrderingPredicate and ComparisonPredicate (qq.v.), and a specialization of both colinearQuantities and lessThan (qq.v.).  followingValue is simply the restriction of the very general lessThan relation to colinear Quantity[ies] (q.v.).  <code>(followingValue LO-QUANT HI-QUANT)</code> means that <code>LO-QUANT</code> and <code>HI-QUANT</code> are colinear quantities such that <code>HI-QUANT</code> is a higher or greater value than <code>LO-QUANT</code>.  It follows that there is some (unspecified) linear ordering (see TotallyOrderedQuantityType) to which both <code>LO-QUANT</code> and <code>HI-QUANT</code> belong.\n<p>\nNote that the above sentence would typically be asserted only if one or both of <code>LO-QUANT</code> and <code>HI-QUANT</code> are instances of GenericQuantity (or the more general NonNumericScalarQuantity), and -- as is usually the case -- they are not grounded in numerically-quantifiable units of measure (see NoteAboutGivingGenericValueFunctionsNumericValues).  If <code>LO-QUANT</code> and <code>HI-QUANT</code> <i>do</i> have numerical grounding, a followingValue assertion is unnecessary since numericallyEquals, greaterThanOrEqualTo, and greaterThan are automatically computable using arithmetic relations holding between the respective minimums and maximums (see minQuantValue and maxQuantValue) of <code>LO-QUANT</code> and <code>HI-QUANT</code>.  For example, one might well use followingValue to state that (HighAmountFn Glamour) is more glamorous than (LowAmountFn Glamour); but it is unnecessary to make a followingValue assertion about (MilesPerHour 5) and (MilesPerHour 25 35), since greaterThan is automatically computable in that case.\n<p>\nSee also GenericValueFunction and followingValueOnScale.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, fanOutArg, "<code>(fanOutArg PRED N)</code> means that transitively-related assertions using <code>PRED</code> usually \"fan out\" in the direction of argument position <code>N</code>.  For example, (fanOutArg geographicalSubRegions 2) means that usually a geographical region has more direct sub-regions than super-regions, so for any region <code>REG</code> there will likely be more assertions of the form <code>(geographicalSubRegions REG SUB)</code> than there are assertions of the form <code>(geographicalSubRegions SUPER REG)</code>.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, extentCardinality, "<code>(extentCardinality SETORCOL N)</code> means that there are <code>N</code> terms in the currently represented extent of SetOrCollection <code>SETORCOL</code>.  See also cardinality.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, extConceptOverlapsColAndReln, "(extConceptOverlapsColAndReln COL RELN SOURCE STRING) means\nthat the external structured data source SOURCE variously uses the term\nnamed by STRING as a value that semantically maps to the Cyc Collection\nCOL, and as a slot that maps to the Cyc BinaryPredicate RELN.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, expresses, "A MetaLanguagePredicate (q.v.) and a specialization of means (q.v.) that relates a CycL sentence to the Proposition (if any) it expresses with respect to the intended model of the CycL language.  <code>(expresses SENTENCE PROPOSITION)</code> means that <code>SENTENCE</code> expresses, or has as its <i>intensional</i> meaning, <code>PROPOSITION</code>.\nIn order to express a proposition (see CycLPropositionalSentence), a CycL sentence must at the very least be closed and obey the arity of its main operator.\n<p>\nFor example, the sentence\n<pre>\n  (likesAsFriend Muffet Murray)\n</pre>\nexpresses the proposition that Muffet likes Murray, and we can represent that fact as follows:\n<pre>\n  (expresses\n    (Quote (likesAsFriend Muffet Murray))\n    (ThatFn (likesAsFriend Muffet Murray)))\n</pre>\nNow the above sentence is of course nearly trivial, given the intimate connection that exists between the function ThatFn and the expresses relation.  But, as we shall see, not all <code>expresses</code> sentences are trivial.\n<p>\nAs the example illustrates, the first argument-term in an <code>expresses</code> statement might consist of a particular CycL sentence wrapped with <code>Quote</code>.  But note that this need not be the case.  Suppose the above <code>likesAsFriend</code> sentence happened to be the first CycL assertion made by Muffet.  We might then reify a constant named <i>MuffetsFirstCycLAssertion</i> to denote that sentence.  Then we could say:\n<pre>\n  (expresses\n    MuffetsFirstCycLAssertion\n    (ThatFn (likesAsFriend Muffet Murray)))\n</pre> \nAs the example also illustrates, the second argument-term in an <code>expresses</code> statement might consist of a non-atomic term formed by applying the functor <code>ThatFn</code> to a particular CycL sentence.  But this also need not be the case.  Suppose the proposition that Muffet likes Murray happened to be Murray's favorite proposition.  We might then reify a constant named <i>MurraysFavoriteProposition</i> to denote that proposition.  Then we could say:\n<pre>\n  (expresses\n    MuffetsFirstCycLAssertion\n    MurraysFavoriteProposition)\n</pre> \nSee also denotes.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, expansionDefn, "(expansionDefn <Relation> <Symbol>) denotes that during canonicalization\nthe subl function definition of <Symbol> is used to transform an EL expression\n(<Relation> . <args>) into the appropriate HL formula.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, expansion, "Some relations (namely, instances of MacroRelation (q.v.)) can be defined in terms of more basic or primitive constructs. <code>(expansion RELATION FORMULA)</code> associates <code>RELATION</code> with the <code>FORMULA</code> that defines it. The arg2 is allowed to reference generic-argument keywords, such as :ARG1 :ARG2 which represent respectively the arg1 and the arg2 within uses of <code>RELATION</code>.  For example, <code>(expansion genls (implies (isa ?object :ARG1) (isa ?object :ARG2)))</code> indicates that the gaf <code>(genls Poodle Dog)</code> is defined as <code>(implies (isa ?object Poodle) (isa ?object Dog)))</code>. Importantly, the expansion-formula arg2 must be necessary and sufficient; it denotes the definition of the uses of relation arg1; there can be only one expansion for any relation.  Furthermore, no two relations can share a common expansion; thus, there can be only one possible contraction from a formula that corresponds to an expansion into a compact form that references expandable relations.  For example, <code>(implies (isa ?object Poodle) (isa ?object Dog)))</code> has the unambiguous contraction of <code>(genls Poodle Dog)</code>. The expansion arg2 can (and should when possible) make use of relations that have expansions.  Note that the example above references implies which would itself have the expansion <code>(or (not :ARG1) :ARG2)</code>.  Thus, the full expansion of a relation can involve recursive expansions.  For example, the full expansion of genls would be <code>(or (isa ?object :ARG1) (not (isa ?object :ARG2))))</code>.  No relation may reference itself (either directly or indirectly via recursion) in its expansion (or in its full recursive expansion).  See ELRelation, TermMacroFunction, expansionAxiom.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, exceptWhen, "A binary ExceptionPredicate that relates a general CycLAssertion to a condition (specified by a CycLSentence-Assertible) under which the assertion fails to hold, and thus under which the assertion should not be used as justification for other inferences.  <code>(exceptWhen EXCEPTION ASSERTION)</code> means that <code>ASSERTION</code> fails to hold in the case of <code>EXCEPTION</code>.  A default assumption is that <code>ASSERTION</code> <i>does</i> hold for all cases other than those covered by <code>EXCEPTION</code> (or by any other exception assertions there might be on <code>ASSERTION</code>).  For example, \n<pre>\n  (exceptWhen\n    (spatiallySubsumes NorthPoleOfEarth ?THING)\n    (implies \n      (isa ?THING GeographicalThing) \n      (thereExists ?OTHER \n        (northOf ?OTHER ?THING)))\n</pre>\t\nmeans that every geographical thing has something to the north of it, except when the former is spatially subsumed by the North Pole.  \n<p>\nNormally, as in the foregoing example, the <code>ASSERTION</code> is an (implicitly) universally quantified sentence, and the <code>EXCEPTION</code>, in effect, places a restriction on the range of values (for the universally quantified variables in <code>ASSERTION)</code> for which <code>ASSERTION</code> is true.  Since implicit universal quantification is always interpreted as having the widest possible scope, in the above example the occurrence of the variable <code>?THING</code> in the exception-giving sentence is interpreted as if it were bound by the same wide-scope universal quantifer that binds the two occurrences of <code>?THING</code> in the implies rule.\n<p>\nA common special case of exceptWhen is handled by exceptFor (q.v.).  \n<p>\nNote that assertions made at the EL level with exceptWhen are canonicalized into statements that do not contain exceptWhen, but instead contain the predicate abnormal (q.v.).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, exceptMt, "(exceptMt MT) means that (except ASSERTION) is true for all ASSERTIONs asserted in MT. In other words, in the current microtheory ASSERTION is not known to be true.  If ASSERTION is a rule, it will not fire.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, exceptFor, "A binary ExceptionPredicate that relates a general CycLAssertion to a thing (specified by a CycLReifiableDenotationalTerm) for which the assertion fails to hold, and thus under which the assertion should not be used as justification for other inferences.  <code>(exceptFor TERM ASSERTION)</code> means that <code>ASSERTION</code> fails to hold for the denotatum of <code>TERM</code>.  A default assumption is that <code>ASSERTION</code> <i>does</i> hold for everything other than the denotatum of <code>TERM</code> (or any other known exceptions there might be on <code>ASSERTION</code>).  For example,\n<pre>\n     (exceptFor\n      Taiwan-RepublicOfChina\n      (implies\n        (isa ?X ChineseProvince)\n        (geopoliticalSubdivision China-PeoplesRepublic ?X)))\n</pre>\nmeans that Taiwan-RepublicOfChina is an exception to the rule that every Chinese province is a geo-political subdivision of the People's Republic of China.\n<p>\nexceptFor is a special case of exceptWhen (q.v.), and is only applicable when <code>ASSERTION</code> has exactly one (implicitly) universally quantified variable.  <code>(exceptFor TERM ASSERTION)</code> prevents <code>TERM</code> from binding to that variable, thereby blocking any conclusions about the denotatum of <code>TERM</code> that Cyc might otherwise draw from <code>ASSERTION</code>.\n<p>\nNote that assertions made at the EL level with exceptFor are canonicalized into statements that do not contain exceptFor, but instead contain the predicate abnormal (q.v.).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, except, "(except ASSERTION) means that there is an exception to ASSERTION in the current microtheory such that ASSERTION is not known to be true.  If ASSERTION is a rule, it will not fire.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, exampleAssertions, "(exampleAssertions TERM ASSERTION) means that the CycLAssertion ASSERTION provides a good example of how to use the CycLReifiableDenotationalTerm TERM.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, exactlyAssertedEL_next, "A KBDependentRelation (q.v.) and specialization of knownSentence (q.v.) that is used to state that a given CycLSentence-Assertible has been asserted in the KB (in some accessible Microtheory). More exactly, (exactlyAssertedEL_next SENT) is true in microtheory MT precisely when SENT canonicalizes without commutative handling of the sentence args into a set of clauses of the same form as the canonicalized form of some assertion in a microtheory accessible to MT. (The predicate is thus true both of assertions entered into the KB by hand and assertions deduced by Cyc from forward rules.)\n<p>\nThis predicate enables Cyc to select a subset of information when answering queries, filtering out more generic (asserted-without-commutative-canonicalization) information. Thus, for example, the query:\n<p>\n(knownSentence (bordersOn CentralUSATimeZone EasternUSATimeZone))\n<p>\nwill return True (in appropriate microtheories), whereas:\n<p>\n(exactlyAssertedEL_next (bordersOn CentralUSATimeZone EasternUSATimeZone))\n<p>\nwill not.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, evaluationResultQuotedIsa, "A binary MetaRelation that holds between relations and collections. evaluationResultQuotedIsa is primarily used to indicate that any value returned by a given evaluatable function is a quoted instance of a given collection. Where FUNC is a Function-Denotational, (evaluationResultQuotedIsa FUNC COL) means that FUNC returns a quoted instance of COL for any sequence of arguments for which FUNC is defined. That is, (quotedIsa (FUNC ARG1 ... ARGn) COL) holds for any sequence <ARG1, ..., ARGN> for which FUNC has a value. For example, '(evaluationResultQuotedIsa SubstringFn SubLString)' holds, and it entails (e.g.) '(quotedIsa (SubstringFn \"ABC\" 1 2) SubLString)'.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, evaluationDefn, "A CycInferenceDescriptorPredicate and InferenceRelatedBookkeepingPredicate that is used to relate an Cyc-evaluatable function or predicate to the name of the piece of code that is used to evaluate it.  (evaluationDefn RELN NAME) means that the SubLSymbol NAME is the name of a piece of Heuristic Level (SubL) code in the Cyc system that is used to compute the value of closed CycL formulas built from (the CycL name of) the EvaluatableRelation RELN.  For example, the sentence '(evaluationDefn MinusFn CYC-MINUS)' is asserted in the Knowledge Base.'", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, evaluateImmediately, "(evaluateImmediately FUNCTION) means that the canonicalizer will translate each non-atomic term (see the collection CycLNonAtomicTerm) whose initial (or \"0th\" argument-place) term denotes FUNCTION into the value to which the non-atomic term evaluates.  For example, if (evaluateImmediately PlusFn) held, then the non-atomic term `(PlusFn 2 3 4)' would canonicalize as `9'.  Note that a non-atomic term containing a nested non-atomic term whose initial term denotes another instance of EvaluatableFunction (call that instance OTHER-FUNCTION) will not canonicalize in this way, unless (evaluateImmediately OTHER-FUNCTION) is also true.  For example, `(PlusFn 2 (DifferenceFn 3 4))' would not canonicalize as `1' unless    \n(evaluateImmediately DifferenceFn) were also true.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, evaluateAtEL, "(evaluateAtEL FUNCTION) means that the canonicalizer will translate each non-atomic term (see the collection CycLNonAtomicTerm) whose  initial (or \"0th\" argument-place) term denotes FUNCTION into the value to which the non-atomic term evaluates.  For example, if (evaluateAtEL PlusFn) holds in  a Microtheory MT, then the non-atomic term `(PlusFn 2 3 4)' will canonicalize as `9' in that MT.  Note that a non-atomic term containing a nested non-atomic term whose initial term denotes another instance of EvaluatableFunction (call that instance OTHER-FUNCTION) will not canonicalize in this way, unless (evaluateAtEL OTHER-FUNCTION) is also true in MT.  For example, `(PlusFn 2 (DifferenceFn 3 4))' will not canonicalize as `1' in MT unless    \n(evaluateAtEL DifferenceFn) is also true in MT.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, evaluate, "A binary MetaLanguagePredicate that relates a thing to a thing that is known to denote it.  <code>(evaluate THING TERM)</code> means that <code>TERM</code> evalutes to <code>THING</code>: the Cyc system \"knows\" that <code>TERM</code> denotes <code>THING</code>.\n<p>\nNote that evaluate is notAssertible (q.v.).  Its most common uses are in rules or queries, with its first argument-place filled (syntactically speaking) with a variable.  In a query, evaluate is typically used to establish a binding between such a variable and an evaluatable expression.  If VAR is a variable, a literal of the form <code>(evaluate VAR TERM)</code> is satisfied by an HL module that evaluates <code>TERM</code> and binds <code>VAR</code> to the result.  For example, the literal '<code>(evaluate ?SUM (PlusFn 1 2))</code>' would bind '<code>?SUM</code>' to 3.  If evaluate's arg1 position is filled instead with a closed expression, then the HL module checks to see if the arg2 term evaluates to the denotatum of that arg1 expression.  For example, if asked the sentence '<code>(evaluate 3 (PlusFn 1 2))</code>' the system will return 'True'.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, equiv, "A LogicalConnective that represents bi-directional implication in CycL.  It takes two arguments, each of which must be an instance of ELSentence-Assertible. (equiv FORMULA-1 FORMULA-2) means that FORMULA-1 is true precisely when FORMULA-2 is true; in other words, FORMULA-1 is true if and only if FORMULA-2 is true.  (An EL equiv formula is translated during canonicalization into an equivalent, less compact, conjunction of implies formulas.) See also the predicate sentenceEquiv.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, equalSymbols, "A binary MetaPredicate and a specialization of equals, both of whose arguments are quotedArguments (q.v.), that can be used to make identity assertions about symbols.  Stated loosely,  <code>(equalSymbols X Y)</code> means that <code>X</code> and <code>Y</code> are one and the same symbol.  Given that the arguments are \"quoted\", however, it is more accurate to say: A closed atomic formula consisting of the expression <code>equalSymbols</code> followed by CycL expressions <code>A</code> and <code>B</code> (all enclosed within a pair of parentheses) is true if and only if <code>A</code> and <code>B</code> are (two occurrences of) the same expression.\n<p>\nNote that this is stronger than merely saying that <code>A</code> and <code>B</code> denote the same thing.  As an example (using English expressions for convenience), the name 'Bertrand Russell' and the description 'the author of \"On Denoting\"' are two different expressions, even though they both denote the same person.  Two symbols can even share the same intensional meaning and still be different symbols; e.g. 'bachelor' and 'unmarried male'.  The relation equalSymbols <i>does</i> hold, however, between 'bachelor' and 'bachelor' (at least if we pretend that 'bachelor' is a CycL expression), as it does between the CycL constant <code>BertrandRussell</code> and the CycL constant <code>BertrandRussell</code>.\n<p>\nSee also differentSymbols.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, equals, "The binary identity relation.  <code>(equals THING1 THING2)</code> means that <code>THING1</code> and <code>THING2</code> are \"numerically\" (as opposed to \"qualitatively\") identical, i.e. they are one and the same thing.  A sentence of the above form is true if and only if the terms occupying the two argument-places of 'equals' denote the same thing.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, ephemeralTerm, "(ephemeralTerm TERM) states that TERM is a term that only has meaning in this particular copy of the knowledge base.  A such, it can be viewed as an ephemeral concept which could likely be forgotten at some future point in time, perhaps by an explicit 'forgetting' process.  See also termDependsOn.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, elInverse, "A binary RuleMacroPredicate and a specialization of genlInverse that relates a binary EL-only (see ELRelation-OneWay) predicate with its non-EL-only \"inverse correlate\".   (elInverse PRED EL-PRED) means that whenever a sentence of the form (EL-PRED ARG1 ARG2) is used to make an assertion, the CycCanonicalizer \"transforms\" it into the logically equivalent form (PRED ARG2 ARG1), and the latter is what actually gets stored in the Knowledge Base.\n<p>\nFor example, (genlInverse genls specs) entails that if I assert the sentence '(specs Animal Cat)', what gets stored in the KB is the sentence '(genls Cat Animal)'.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, elementOf, "A very general binary predicate that relates a thing to any set or collection (see SetOrCollection) that it is a member or element of. <code>(elementOf THING SETORCOL)</code> means that <code>THING</code> is an element of <code>SETORCOL</code>.  \n<p>\nelementOf is a more general relation than isa.  Whereas isa is used exclusively to talk about membership in Collections,  elementOf can also be used to talk about membership in mathematical sets (see Set-Mathematical).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, distributesOutOfArg, "(distributesOutOfArg <reln> <pred> <n>) is a directive to the canonicalizer that relation <reln> distrbutes out of a predicate <pred> when it appears as the top-most relation in the predicate's arg <n>.  Specifically, it denotes (distributesOutOfArg <reln> <pred> <n>) denotes that the canonicalizer will translate\n<p>\n(<pred> <arg-1> ... <arg-n-1> (<reln> <arg-n1> <arg-n2> ... <arg-nm>) <arg-n+1> ..)\n<p>\ninto\n<p>\n(<reln> (<pred> <arg-1> ... <arg-n-1> <arg-n1> <arg-n+1> ...)\n(<pred> <arg-1> ... <arg-n-1> <arg-n2> <arg-n+1> ...)\n...\n(<pred> <arg-1> ... <arg-n-1> <arg-nm> <arg-n+1> ...))", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, disjointWith, "A TaxonomicSlot predicate that relates Collections  (q.v.) that have no instances in common. <code>(disjointWith COL1 COL2)</code> means that <code>COL1</code> is disjoint with <code>COL2</code>: nothing is an instance of both. That is, there is no <code>THING</code> such that both <code>(isa THING COL1)</code> and <code>(isa THING COL2)</code> hold. For example, <code>(disjointWith Herbivore Carnivore)</code> holds because no animal is both a herbivore and a carnivore. Note that disjointWith is <b>not</b> irreflexive (see IrreflexiveBinaryPredicate): it is possible for a collection to be disjoint with itself, though only if it is empty (i.e. has no instances). Thus, for example, <code>(disjointWith Nothing Nothing)</code> holds.  Cf. intersectsWith.\n<p>\nAlso note that it is quite possible for two second (or higher) order collections to be disjoint even if an instance of one collection and an instance of the other collection themselves share instances.  Consider, for example, the disjoint collections SpatialThingTypeByShape and SpatialThingTypeByDimensionality.  RoundObject is an instance of the first and ThreeDimensionalThing is an instance of the second; and any solid spherical object is an instance of both of these latter collections.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, differentSymbols, "This variable-arity predicate (see VariableArityRelation), all of whose argument-places are quotedArguments (q.v.), is used to make non-identity statements about two or more symbols. Stated loosely, (differentSymbols X1 X2 ... Xn) means that each of the Xi is a symbol that is different from all of the others.  Given that the arguments are \"quoted\", however, it is more accurate to say: A ground atomic formula (or \"GAF\"; see CycLClosedAtomicSentence) consisting of the expression `differentSymbols' followed by the CycL expressions E1, ..., En (all enclosed within a pair of parentheses) is true if and only if each Ei is a different expression from all of the others.  Note that two symbols can denote the same thing (in ordinary circumstances) and still be different symbols.  As an example (using English expressions for convenience), the proper name `Bertrand Russell' and the descriptive phrase `the author of \"On Denoting\"' are two different expressions, even though they both denote the same person. Two symbols can even share the same intensional meaning and yet be different symbols; e.g. `bachelor' and `unmarried man'.  The sentence `(differentSymbols BertrandRussell BertrandRussell)', on the other hand, is false.  See also equalSymbols and different.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, different, "A variable-arity predicate (see VariableArityRelation) that is used to state the non-identity of two or more things. <code>(different THING1..THINGn)</code> means that for any <code>THING</code>i and <code>THING</code>j (where 0 <= i <= n, 0 <= j <= n, and i =/ j), <code>THING</code>i is not identical with <code>THING</code>j.  That is, each of <code>THING</code>1, ..., <code>THING</code>n is distinct from all of the others.  Cf. equals.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, denotes, "A MetaLanguagePredicate (q.v.) that relates CycLDenotationalTerm to their denotata: the things in the intended model of the CycL language that those terms denote or stand for.  <code>(denotes TERM THING)</code> means that <code>TERM</code> denotes <code>THING</code>.  <code>TERM</code> will often be explicitly quoted, by being wrapped in the syncategorematic quotation symbol 'Quote'.  For example, the true sentence '(denotes (Quote Plato) Plato)' means that the CycL term 'Plato' denotes the person Plato.  (Thus denotes's first argument-place is <i>not</i> \"implicitly quoted\"; cf. quotedArgument).\n<p>\nBut note that the first argument of denotes might <i>not</i> be quoted at all.  Suppose (e.g.) that the term 'Plato' were the CycL constant most beloved of Cyclists, and that a new constant 'CyclistsFavoriteConstant' were reified and defined so as to reflect this fact.  Then 'CyclistsFavoriteConstant' would refer to the CycL constant 'Plato', which in turn denotes the man Plato; and so the sentence '(denotes CyclistsFavoriteConstant Plato)' -- which involves no quotation -- would be true.\n<p>\nNote also that not all CycL terms denote, not even all CycLClosedDenotationalTerms (q.v.).  For example, the term '(BorderBetweenFn Canada Mexico)' fails to denote anything (except perhaps in certain counterfactual contexts).\n<p>\nNote finally that the sentence '(denotes Plato Plato)' is of course <i>not</i> true, as it means that the man Plato is a CycL term that denotes the man Plato, which is a patent falsehood since no man is a CycL term and no man denotes anything.\n<p>\nSee also means, expresses, hasDenotatum, quotedIsa, EscapeQuote, and the shared NoteAboutQuotingInCycL.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, defnSufficient, "A CycInferenceDescriptorPredicate.  (defnSufficient COL TEST) means that TEST is the name of a piece of code in the SubL implementation of Cyc that specifies, and tests for, a sufficient condition for a CycL term's denoting an instance of (see isa) the collection COL.  If TEST returns `T' (for `True') when applied to a particular term, then that term's denotatum is considered to be an instance of COL.  Note that TEST isn't necessarily a necessary test for membership in COL; that is, not all instances of COL must pass the test, unless TEST is also a defnNecessary for COL.  See the related predicates defnNecessary and defnIff.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, defnNecessary, "A CycInferenceDescriptorPredicate.  \n(defnNecessary COL TEST) means that TEST is the name of a piece \nof code in the SubL implementation of Cyc that specifies, and tests \nfor, a necessary condition for a CycL term's denoting an instance of \n(see isa) the collection COL.  Only if TEST returns `T' (for \n`True') when applied to a particular term can that term's \ndenotatum be considered an instance of COL; all terms that denote \ninstances of COL must fulfill TEST's requirements, although there \nmay be additional requirements for denoting an instance of COL as \nwell.  See also defnSufficient and defnIff.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, defnIff, "A CycInferenceDescriptorPredicate.  (defnIff COL TEST) means \nthat TEST is the name of a piece of code in the SubL implementation \nof Cyc that specifies, and tests for, a necessary and sufficient \ncondition for a CycL term's denoting an instance of (see isa) the \ncollection COL.  If and only if TEST returns `T' (for `True') when \napplied to a particular term can that term's denotatum be considered \nan instance of COL; all and only terms that denote instances of COL \nmust fulfill TEST's requirements.  See also defnNecessary and \ndefnSufficient.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, definingMt, "(definingMt TERM MT) states that TERM only begins to have semantic meaning in microtheory MT. In microtheories in which MT is not  accessible, TERM is undefined. Additionally,  (termDependsOn TERM MT).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, defaultReformulatorModePrecedence, "(defaultReformulatorModePrecedence PRIMARY-MODE\nSECONDARY-MODE TERTIARY-MODE ...), asserted in the microtheory MT,\nmeans that in MT or a specMt thereof (unless overridden),\nthe CycLReformulator will use PRIMARY-MODE as its primary mode,\nSECONDARY-MODE as its secondary mode, etc.  This helps the\nreformulator establish precedence of CycLReformulatorDirectives.\nDo not specify both tersify and verbosify.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, defaultReformulationDirectionInModeForPred, "If the CycLReformulator is operating in MT in the mode MODE, and it\nencounters a reformulation rule with no reformulationDirectionInMode\nmeta-assertion for MODE stated in MT or a genlMt thereof, the extent of this\npredicate will be used to determine the reformulation direction of the\nrule.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, decontextualizedPredicate, "(decontextualizedPredicate PRED) states that PRED is a predicate which is context-independent.  In effect, any use of PRED can be lifted into any microtheory.  Predicates which are labelled with decontextualizedPredicate typically have an argument which either implicitly or explicitly provides the implied context.  A good example of such a predicate is ist.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, decontextualizedCollection, "(decontextualizedCollection COL) states that COL is a collection in which membership is context-independent.  In effect, any instance of COL is an instance of COL in every microtheory.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, cycTransformationProofRule, "(cycTransformationProofRule PROOF RULE) means that RULE is the rule used by PROOF to prove its proven query.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, cycTransformationProofBindings, "(cycTransformationProofBindings TRANSFORMATION-PROOF BINDING) means that BINDING is an InferenceBinding (using the appropriate variable from the transformation rule for TRANSFORMATION-PROOF) proven by TRANSFORMATION-PROOF.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, constraint, "(constraint RULE) labels a given RULE assertion as a constraint.  Constraints are typically used to verify that a given logical expectation is already true, rather than to deduce (and then add) a new formula which would satisfy the expectation.  In other words, if a rule (implies P(?X) Q(?X)) is labelled as a constraint, then when P(?X) is determined to be true, we verify that Q(?X) is already true rather than add a new argument for Q(?X) using the rule and P(?X) as justification.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, constrainsArg, "A MetaRelation predicate for stating that a given meta-relation is used to put an argument-type or format constraint (see e.g. ArgConstraintPredicate) on a given argument-place of a relation. (constrainsArg METARELN N) means that METARELN is always used to put a constraint on a relation's Nth argument-place.  For example, (constrainsArg arg2Isa 2) holds.  A slight deviation from the above occurs when N is 0: we take (constrainsArg METARELN 0) to mean that METARELN is used to constrain _all_ of a relation's argument-places; see e.g. argsIsa and argsGenl.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, constantName, "(constantName CONSTANT STRING) means that the SubLString STRING is the \"name\" for the CycLConstant CONSTANT.  That is, STRING is the string of characters that make up CONSTANT, minus the initial \"#\" and the following \"$\".", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, constantID, "A predicate which relates each Cyc constant to an internal identification number for it. This number is unique within any given image, though not necessarily across images (for that, see constantGUID). <code>(constantID CONSTANT ID)</code> states that the NonNegativeInteger <code>ID</code> is the unique internal id for the CycLConstant <code>CONSTANT</code> (in the current image). For obvious reasons, this predicate is notAssertible.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, constantGUID, "A strictly functional slot used to associate CycL constants with the GUID strings they are assigned. <code>(constantGUID CONSTANT GUID-STR)</code> means that the CycLConstant <code>CONSTANT</code> is associated with the GUIDString <code>GUID-STR</code>.  The arg1 position of this predicate is \"quoted\", so, for example, (constantGUID Dog  \"bd58daa0-9c29-11b1-9dad-c379636f7270\") means that the constant \"Dog\" itself, not the collection of dogs, is associated with the GUIDString \"bd58daa0-9c29-11b1-9dad-c379636f7270\".", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, consistent, "A predicate which asserts of sentences that they do not contradict currently known facts. (consistent SENTENCE) means that the CycLSentence-Assertible SENTENCE is consistent with assertions known in the current context.  Consequently, (consistent SENTENCE) holds in a Microtheory MT just in case, for any assertion ASSERT that holds in MT, SENTENCE does not imply the negation of ASSERT.  Note that this predicate is notAssertible. See also inconsistentWithMt.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, conceptuallyRelated, "This predicate is used to state the fact of a conceptual link between two things, where a very complex sentence would be required in order to describe the precise nature of this link explicitly.  Examples of such conceptually-linked couples include PublicTransportationDevice / PublicTransportationScheduleDocument and Dog / DogFood.  The rationale for having such a predicate as conceptuallyRelated is similar to that behind many RuleMacroPredicates (q.v.).  Having complex relationships represented -- possibly redundantly -- in a more compact fashion makes for faster retrieval. Because things can be conceptually related in many different ways, no explicit definition for this predicate is provided.  Note that conceptuallyRelated is _not_ a SymmetricBinaryPredicate (q.v.); but see conceptuallyCoRelated for a specialization of this predicate that is symmetric.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, completelyEnumerableCollection, "A unary InferenceCompletenessPredicate that is a specialization of completelyDecidableCollection (qq.v.).  <code>(completelyEnumerableCollection COL)</code> means that the CycInferenceEngine can generate a list of all of (and only) the instances of <code>COL</code>.  More precisely: given a query of the form <code>(isa VAR COL)</code>, the Inference Engine can (without using transformations) return a list of terms -- bindings for the variable <code>VAR</code> -- such that every instance (and no non-instance) of the collection <code>COL</code> is denoted by some binding on the list.\n<p>\nFor example, SkolemFunction is a completely enumerable collection.  (But note that SkolemFunction does <i>not</i> satisfy the more specialized completelyAssertedCollection (q.v.), as most of its instances are only asserted to be instances of one of its specializations, such as FixedAritySkolemFunction.)\n<p>\nSee also completeExtentEnumerable, which applies to Predicates.", 'CoreCycLMt', vStrMon).
exactlyAssertedEL_next(comment, completelyDecidableCollection, "A unary InferenceCompletenessPredicate (q.v.) that applies to collections.  <code>(completelyDecidableCollection COL)</code> means that the CycInferenceEngine can determine if any given thing is an instance of <code>COL</code>.  More precisely: for any given instance <code>INST</code> whatsoever (and for no non-instances) of <code>COL</code>, there is a CycL term <code>INST-TERM</code> that denotes <code>INST</code> such that (without using transformations) the Inference Engine, given a query of the form <code>(isa INST-TERM COL)</code>, will return the answer <code>True</code>.\n<p>\nFor example, the collection Integer is completely decidable. Given any integer <code>INT</code>, the Cyc query <code>(isa INT Integer)</code> -- wherein <code>INT</code> is given its standard base-10 arabic numeral representation -- will come back <code>True</code>.\n<p>\nIf <code>COL</code> is completely decidable and Cyc fails to return <code>True</code> for some query <code>(isa TERM COL)</code>, that fact consitutes a strong argument for the truth of its negation <code>(not (isa TERM COL))</code>.  But note that it is not a conclusive argument: the normally-reliable \"unique name assumption\" might fail here, and the term <code>TERM</code> could conceivably denote something that Cyc can prove to be an instance of <code>COL</code> only under some <i>other</i> CycL name it has.  For suppose Pace's favorite number happens to be 3, but nobody has told that to Cyc.  Cyc can prove the sentence <code>(isa 3 Integer)</code>; but it might nevertheless fail to prove the equally true sentence\n<pre>\n  (isa (<b>FavoriteNumberOfFn</b> Pace) Integer) .\n</pre>\nSee also the more specific predicates completelyEnumerableCollection and completelyAssertedCollection.  And see completeExtentDecidable, which applies to Predicates.", 'CoreCycLMt', vStrMon).
exactlyAssertedEL_next(comment, completeExtentEnumerableViaBackchain, "A unary InferenceCompletenessPredicate and a specialization of  minimizeExtent (qq.v.) that applies to predicates whose entire extents can be enumerated by reference to the transformation rules currently asserted on it.  For example, surgicalIncisionEmployed is completeExtentEnumerableViaBackchain in the context of certain medical domain microtheories because the pair of rules on it are sufficient to completely generate its entire extent within those microtheories.", 'CoreCycLMt', vStrMon).
exactlyAssertedEL_next(comment, completeExtentEnumerableForValueInArg, "A ternary InferenceCompletenessPredicate and a specialization of completeExtentDecidableForValueInArg (q.v.) that can apply to a predicate and a specified value for a specified argument-place.  <code>(completeExtentEnumerableForValueInArg PRED VALUE N)</code> means that the CycInferenceEngine can enumerate every sequence in the extent of <code>PRED</code> whose <code>N</code>th item is <code>VALUE</code>.  In practical terms this means that, if asked a query of the form <code>(PRED ... VALUE ...)</code>, where <code>VALUE</code> appears in the <code>N</code>th argument-position and all of the other positions (>= 1) are filled with variables, the Inference Engine can return an extensionally complete list of binding-sequences for those variables.  That is, for every sequence <code>SEQ</code> in <code>PRED</code>'s extension whose <code>N</code>th member is <code>VALUE</code> (and for nothing else), the returned list contains a sequence of bindings (i.e. CycL terms) whose members denote, pointwise, the members of <code>SEQ</code> excepting <code>VALUE</code>.\n<p>\nFor example, (completeExtentEnumerableForValueInArg hasMembers InternationalMonetaryFund 1) holds, as Cyc can enumerate all the members of the International Monetary Fund.\n<p>\nIf PRED's extent is completely enumerable for <code>VALUE</code> in the <code>N</code>th argument and a given sequence of bindings <<code>TERM1</code>, ..., <code>TERM(N-1)</code>, <code>TERM(N+1)</code>, ...> (whose length matches the arity of <code>PRED</code>, if fixed) is <i>not</i> returned for the above query, that fact consitutes a strong argument for the truth of the negation (not <code>(PRED TERM1 ... TERM(N-1) VALUE TERM(N+1) ...))</code>.  But note that it is not a conclusive argument: the normally-reliable \"unique name assumption\" might fail here, and a term <code>TERM</code>i could conceivably denote something that Cyc can prove a member of a sequence in the extent of <code>PRED</code> only under some <i>other</i> CycL name it has.  For suppose Pace resides in Texas, but nobody has told that to Cyc.  Cyc can return the binding 'Texas-State' for the query '(cityInState CityOfDallasTX ?X)'; but it might nevertheless fail to return the equally correct binding '(StateOfResidenceFn Pace)'.\n<p>\nSee also the specialization completeExtentAssertedForValueInArg and see completeExtentEnumerableForArg.", 'CoreCycLMt', vStrMon).
exactlyAssertedEL_next(comment, completeExtentEnumerableForArg, "A binary InferenceCompletenessPredicate (q.v.) that can apply to a predicate and a specified argument-place.  (completeExtentEnumerableForArg PRED N) means that, for any given thing ARGN, the CycInferenceEngine can enumerate every sequence in the extent of PRED whose Nth item is ARGN (see relationExtension and relationHoldsAmong).  In practical terms this means that, if asked a query of the form (PRED ... ARGN ...), where all of PRED's argument-places save the Nth are filled with variables, the Inference Engine can return an extensionally complete list of binding-sequences for the other (i.e. non-Nth) arguments.  That is, for every sequence SEQ in PRED's extension whose Nth member is ARGN (and for nothing else), the returned list contains a sequence of bindings (i.e. CycL terms) whose members denote, pointwise, the members of SEQ excepting ARGN.\n<p>\nFor example, (completeExtentEnumerableForArg cityInState 1) holds: given any city, Cyc can return a list of all the states (i.e. the one state, if any) in which it is located.\n<p>\nIf PRED's extent is completely enumerable for the Nth argument and a given sequence of bindings <TERM1, ..., TERM(N-1), TERM(N+1), ...> (whose length matches the arity of PRED, if fixed) is not returned for the above query, that fact consitutes a strong argument for the truth of the negation (not (PRED TERM1 ... TERM(N-1) ARGN TERM(N+1) ...)).  But note that it is not a conclusive argument: the normally-reliable \"unique name assumption\" might fail here, and a term TERMi could conceivably denote something that Cyc can prove a member of a sequence in the extent of PRED only under some _other_ CycL name it has.  For suppose Pace resides in Texas, but nobody has told that to Cyc.  Cyc can return the binding 'Texas-State' for the query '(cityInState CityOfDallasTX ?X)'; but it might nevertheless fail to return the equally correct binding '(StateOfResidenceFn Pace)'.\n<p>\nSee also completeExtentEnumerable and completeExtentEnumerableForValueInArg).", 'CoreCycLMt', vStrMon).
exactlyAssertedEL_next(comment, completeExtentEnumerableForArg, "(completeExtentEnumerableForArg PRED ARGNUM) means that when the CycInferenceEngine   is asked a query of the form (PRED ... ARG ...) where ARG is any closed term in the                  ARGNUMth position, it can completely enumerate all possible bindings for the other argument          positions.                                                                                           This means that for any arguments (PRED ... NOT-ARGi ... ARG ... NOT-ARGj) for which the             NOT-ARGs are not a member of the enumerated bindings,                                                (not (PRED ... NOT-ARGi ... ARG ... NOT-ARGj)) is true.", 'CoreCycLMt', vStrMon).
exactlyAssertedEL_next(comment, completeExtentEnumerable, "A unary InferenceCompletenessPredicate and a specialization of completeExtentDecidable and minimizeExtent (qq.v.) that applies to predicates whose entire extents can be enumerated by the CycInferenceEngine.  <code>(completeExtentEnumerable PRED)</code> means that the Inference Engine can, without using transformations, generate a list of all of (and only) the sequences of things among which <code>PRED</code> holds (see relationExtension and relationHoldsAmong).\n<p>\nFor example, (completeExtentEnumerable knownSentence) holds, as the Inference Engine could, if asked, list all of the assertions in the Knowledge Base.  Conversely, although the Inference engine could correctly determine if any given CycL sentence is in the extent of knownSentence (i.e completeExtentDecidable holds of knownSentence), it could not generate a list of all CycL sentences in the extent of knownSentence.\n<p>\nThe practical import of completeExtentEnumerable can be stated more precisely as follows.  Let's say that an N-length sequence of terms \"pointwise-denotes\" an N-length sequence of things just in case each term in the former denotes the corresponding item in the latter.  Suppose <code>(completeExtentEnumerable PRED)</code> holds.  If <code>PRED</code> is a FixedArityRelation of arity N and <code>VAR1...VARN</code> are N distinct CycLVariables, then, given a query of the form <code>(PRED VAR1 ... VARN)</code>, the Inference Engine can, without the use of Transformation Modules, return a list of N-length sequences of terms -- each sequence consisting of bindings for the respective variables <code>VAR1-VARN</code> -- such that every sequence in <code>PRED</code>'s extent (and nothing else) is pointwise-denoted by some term-sequence on the list.   If <code>PRED</code> is a VariableArityRelation, it is the same, except the given query should then have the form <code>(PRED . VARS)</code>, and there might be no constant length N shared by all of the term-sequences in the returned list.\n<p>\nIf <code>PRED</code>'s extent is completely enumerable and a given term-sequence <code><TERM-1, ..., TERM-N></code> is <i>not</i> in the list returned for the above query, that fact consitutes a <i>strong argument</i> for the truth of the negation <code>(not (PRED TERM-1 ... TERM-N))</code>, assuming that it's semantically well-formed.  But note that it is <i>not a conclusive argument</i>: the normally-reliable \"unique name assumption\" might fail here, and some term <code>TERM-I</code> could conceivably denote something that Cyc can prove to be a member of something in the extent of <code>PRED</code> only under some <i>other</i> CycL name it has.  For suppose Pace was also denoted by the (imaginary) CycL term <code>ErasmusCAnderson</code>, but Cyc did not know that Pace and Erasmus C. Anderson are the same person.  Cyc will return the term-sequence <<code>Pace, GeneralCycKE</code>> for the query <code>(cyclistPrimaryProject ?X ?Y)</code>; but it might nevertheless <i>fail</i> to return the sequence <<code>ErasmusCAnderson, GeneralCycKE</code>>, even though the sentence\n<pre>\n  (cyclistPrimaryProject ErasmusCAnderson GeneralCycKE)\n</pre>\nwas in fact true.", 'CoreCycLMt', vStrMon).
exactlyAssertedEL_next(comment, completeExtentDecidableForValueInArg, "(completeExtentDecidableForValueInArg PRED VALUE ARGNUM) means that when the            CycInferenceEngine                                                                                 is asked a closed query of the form (PRED ... VALUE ...) where VALUE appears in the                  ARGNUMth position, either it can prove (PRED ... VALUE ...) without transformation,                  or (not (PRED ... VALUE ...)) is true.", 'CoreCycLMt', vStrMon).
exactlyAssertedEL_next(comment, completeExtentDecidable, "A unary InferenceCompletenessPredicate (q.v.) that applies to predicates.  <code>(completeExtentDecidable PRED)</code> means that the CycInferenceEngine can determine if any given sequence of things is in the extent of <code>PRED</code> (see relationExtension and relationHoldsAmong).  More precisely: for any given n-length sequence <code>SEQ</code> among which <code>PRED</code> holds (and for nothing else), there are CycL terms <code>TERM<sub>1</sub></code>, ..., <code>TERM<sub>N</sub></code> that denote the respective items in <code>SEQ</code> such that (without using transformations) the Inference Engine, given a query of the form <code>(PRED TERM<sub>1</sub> ... TERM<sub>N</sub>)</code>, will return the answer <code>True<code>.\n<p>\nFor example, <code>(completeExtentDecidable integerBetween)</code> holds, as the Inference engine can correctly determine if any given triple of integers is such that the second member is numerically between the first and third.  Conversely, the extent of likesAsFriend is not decidable, as many of the friendships in the world are beyond Cyc's ken.\n<p>\nIf <code>PRED</code>'s extent is completely decidable and there are CycL terms <code>TERM<sub>1</sub>, ..., TERM<sub>N</sub></code> such that the sentence <code>(PRED TERM<sub>1</sub> ... TERM<sub>N</sub>)</code> is semantically well-formed but <i>not</i> provable by the Inference Engine, that fact consitutes a strong argument for the truth of its negation <code>(not (PRED TERM<sub>1</sub> ... TERM<sub>1</sub>))</code>.  But note that it is not a conclusive argument: the normally-reliable \"unique name assumption\" might fail here, and some <code>TERM<sub>I</sub></code> could conceivably denote something that Cyc can prove to be a member of a sequence in the extent of <code>PRED</code> only under some <i>other</i> CycL name it has.  For suppose Pace's favorite number happens to be 3, but nobody has told that to Cyc.  Cyc can prove the sentence <code>(integerBetween 1 2 3)</code>; but it might nevertheless fail to prove the equally true sentence\n<pre>\n  (integerBetween 1 2 (FavoriteNumberOfFn Pace)) .\n</pre>\nSee also the more specific predicates completeExtentEnumerable and completeExtentAsserted.  And see completelyDecidableCollection.", 'CoreCycLMt', vStrMon).
exactlyAssertedEL_next(comment, completeExtentAssertedForValueInArg, "A ternary InferenceCompletenessPredicate and a specialization of completeExtentEnumerableForValueInArg (q.v.) that can apply to a predicate and a specified value for a specified argument-place.  (completeExtentAssertedForValueInArg PRED VALUE N) means that for every sequence of arguments that PRED holds of and whose Nth member is VALUE, there is an explicit assertion to that effect in the Cyc Knowledge Base.  Thus, if asked a query of the form (PRED ... VALUE ...), where VALUE appears in the Nth argument-position and all of the other positions (>= 1) are filled with variables, the Inference Engine -- simply via lookup of assertions in the KB -- can return an extensionally complete list of binding-sequences for those variables.  That is, for every sequence SEQ in PRED's extension whose Nth member is VALUE (and for nothing else), the returned list contains a sequence of bindings (i.e. CycL terms) whose members denote, pointwise, the members of SEQ excepting VALUE.\n<p>\nFor example, (completeExtentAssertedForValueInArg hasMembers InternationalMonetaryFund 1) holds, as all the members of the International Monetary Fund are asserted to be such in the KB.\n<p>\nIf PRED's extent is completely asserted for VALUE in the Nth argument and a given sequence of bindings <TERM1, ..., TERM(N-1), TERM(N+1), ...> (whose length matches the arity of PRED, if fixed) is not returned for the above query, that fact consitutes a strong argument for the truth of the negation (not (PRED TERM1 ... TERM(N-1) VALUE TERM(N+1) ...)).  But note that it is not a conclusive argument: the normally-reliable \"unique name assumption\" might fail here, and a term TERMi could conceivably denote something that Cyc can prove a member of something in the extent of PRED only under some _other_ CycL name it has.  For suppose Pace resides in Texas, but nobody has told that to Cyc.  The KB contains the assertion '(cityInState CityOfDallasTX Texas-State)'; but it might nevertheless fail to contain the equally true sentence '(cityInState CityOfDallasTX (StateOfResidenceFn Pace))'.\n<p>\nSee also completeExtentAsserted.", 'CoreCycLMt', vStrMon).
exactlyAssertedEL_next(comment, completeExtentAsserted, "A unary InferenceCompletenessPredicate and a specialization of completeExtentEnumerable (q.v.) that applies to predicates whose entire extents are explicitly asserted in the Cyc Knowledge Base.  <code>(completeExtentAsserted PRED)</code> means that, for every sequence <code><THING1,..., THING<sub>N</sub>></code> that satisfies <code>PRED</code>, <code>(PRED THING1 ... THING<sub>N</sub>)</code> is asserted in the Knowledge Base.  That is, for each such sequence, there are reified CycL terms <code>PRED-NAME</code>, <code>TERM1</code>, ..., <code>TERM<sub>N</sub></code> -- which denote <code>PRED</code>, <code>THING1</code>, ..., <code>THING<sub>N</sub></code>, respectively -- such that the sentence <code>(PRED-NAME TERM1 ... TERM<sub>N</sub>)</code> built from those terms is an assertion in the KB.\n<p>\nIf completeExtentAsserted is true of <code>PRED</code>, then the CycInferenceEngine, when asked a query of the form <code>(PRED <b>. VARS</b>)</code>, can return a complete set of bindings for the variables in <code>VARS</code> simply via a lookup of assertions in the KB.  By a \"complete set of bindings\" is meant a set of sequences of terms such that, for each sequence <code><THING1, ..., THING<sub>N</sub>></code> in the extent of <code>PRED</code>, there is a corresponding sequence of terms <code><TERM1, ..., TERM<sub>N</sub>></code> returned wherein each <code>TERM<sub>I</sub></code> denotes <code>THING<sub>I</sub></code> (for 1 <= <code>I</code> <= <code>N</code>).\n<p>\nFor example, (completeExtentAsserted hourOfDayIndex-24Hour) holds.  Thus, the sentence <code>(hourOfDayIndex-24Hour TimeOfDay-1AM 1)</code> is one of twenty-four similar ground-atomic sentences asserted in the KB.  Conversely, (completeExtentAsserted argN) does <i>not</i> hold.  Thus, while the Inference Engine could generate the set of all true <code>argN</code> based ground-atomic sentences (i.e. completeExtentEnumerable holds of argN), the members of this set are not all asserted in the KB.\n<p>\nSee also completelyAssertedCollection, which applies to collections rather than predicates.", 'CoreCycLMt', vStrMon).
exactlyAssertedEL_next(comment, commutativeInArgsAndRest, "A variable-arity MetaRelation used for \nstating that a given PartiallyCommutativeRelation (q.v.) is \"commutative\" \nwith respect to two or more argument-places, including all argument-places that \ncome after the ordinally highest one that is explicitly specified.  \n(commutativeInArgsAndRest RELN ARGNUM-1 ARGNUM-2 ... ARGNUM-N) means that \nRELN is commutative in its ARGNUM-1th, ARGNUM-2th, ..., and ARGNUM-Nth \narguments-places, along with any of its argument-places whose ordinal positions \nare greater than the greatest of the ARGNUM-i.  Thus RELN admits unrestricted \npermutation among any of these arguments.  More precisely (and assuming without \nloss of generality that ARGNUM-N is the numerically greatest of the ARGNUM-i):  \n(i) if RELN is a Predicate that holds of a given argument-sequence SEQ, then \nRELN also holds of any other sequence SEQ-PERMUTE obtainable from SEQ by \npermuting some or all of SEQ's ARGNUM-1th, ARGNUM-2th, ..., ARGNUM-Nth, and \nsubsequent items (while leaving all of SEQ's other items unchanged).  \n(ii) if RELN is a Function-Denotational that associates a given \nargument-sequence SEQ with the value VALUE, then RELN also associates any \nsequence SEQ-PERMUTE (as described above) with VALUE.  For example, \n(commutativeInArgsAndRest commutativeInArgsAndRest 2) \nhas as a consequence that whenever a sentence of the form \n(commutativeInArgsAndRest RELN 2 3 5) holds, so do the corresponding \nsentences (commutativeInArgsAndRest RELN 2 5 3), \n(commutativeInArgsAndRest RELN 3 2 5), and so on.  Note that since RELN \nis an instance of PartiallyCommutativeRelation, it must have at \nleast two argument-places that are commutative with each other and at \nleast one that is _not_ commutative with any other argument-place.  See\nalso commutativeInArgs.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, commutativeInArgs, "A variable-arity MetaRelation used for stating that a given PartiallyCommutativeRelation (q.v.) is \"commutative\" with respect to two or more specified argument-places.\n<p>\n<code>(commutativeInArgs RELN ARGNUM-1 ... ARGNUM-N)</code> means that  <code>RELN</code> is commutative in its <code>ARGNUM-1</code>th, ..., and <code>ARGNUM-N</code>th arguments.  Thus <code>RELN</code> admits unrestricted permutation among  these arguments.  More precisely: (i) if <code>RELN</code> is a Predicate that  holds of a given argument-sequence <code>SEQ</code>, then <code>RELN</code> also holds of any other sequence <code>SEQ-PERMUTE</code> obtainable from <code>SEQ</code> by permuting some or all of <code>SEQ</code>'s <code>ARGNUM-1</code>th, ..., and <code>ARGNUM-N</code>th items (while leaving all of <code>SEQ</code>'s other items unchanged).  (ii) if <code>RELN</code> is a Function-Denotational that associates a given argument-sequence <code>SEQ</code> with the value <code>VALUE</code>, then <code>RELN</code> also associates any sequence <code>SEQ-PERMUTE</code> (as described above) with <code>VALUE</code>.\n<p>\nFor example, <code>(commutativeInArgs formsBorderBetween 2 3)</code> has as a consequence that whenever a sentence of the form <code>(formsBorderBetween BORDER REG1 REG2)</code> holds, so does the corresponding sentence  <code>(formsBorderBetween BORDER REG2 REG1)</code>.\n<p>\nIf <code>RELN</code> is commutative in at least two argument-places it is an AtLeastPartiallyCommutativeRelation.  If <code>RELN</code> is commutative in <i>all</i> argument-places it is, more specifically, a CommutativeRelation.  If <code>RELN</code> is commutative in at least two, but <i> not all</i>,\nargument-places it is, instead, a PartiallyCommutativeRelation.\n<p>\nNote that the fact that each argument-place of a given relation commutes with some other argument-place is not sufficient for its being fully commutative.  For example, a partially-commutative quaternary relation might be such that its first and third places commute with each other and its second and fourth places commute with each other.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, comment, "A DocumentationPredicate (q.v.) that is used to relate a CycLIndexedTerm (usually a CycLConstant) to a SubLString containing an English explanation of the term's meaning and use, as an aid to humans (whether Cyclists or not) browsing the Cyc Knowledge Base.  <code>(comment TERM STRING)</code> means that <code>STRING</code> is a piece of Cyc documentation that explains the meaning and use of <code>TERM</code>.  For example, the passage you are reading now is the comment for the CycL constant `comment'.  See also cyclistNotes.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, collectionIsaBackchainRequired, "<code>(collectionIsaBackchainRequired COLLECTION)</code>\n<p>\nmeans that rules that conclude\n<p>\n<code>(isa <anything> COLLECTION)</code>\n<p>\nmust be used in order to prove literals of the form\n<p>\n<code>(isa <anything> COLLECTION)</code>.\n<p>\nThis directs the inference engine to use such rules even if HL predicate transformation is disabled.  See also backchainRequired for the analogue of this predicate applicable to predicates rather than collections.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, collectionIsaBackchainEncouraged, "<p>\n(collectionIsaBackchainEncouraged COLLECTION)\n<p>\nmeans that rules that conclude\n<p>\n(isa <anything> COLLECTION)\n<p>\nare most likely going to have to be used in order to prove literals of the form\n<p>\n(isa <anything> COLLECTION).\n<p>\nThis directs the inference engine to use such rules even if HL predicate transformation is disabled.  Note that it will not necessarily use rules of the form\n<p>\n(isa <anything> <variable>)\n<p>\nwhere <variable> might bind to COLLECTION, and it will not necessarily use rules of the form\n<p>\n(isa <anything> SPEC),\n<p>\nwhere (genls SPEC COLLECTION).\n<p>\nSee also backchainEncouraged for the analogue of this predicate applicable to predicates rather than collections.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, collectionGenlsBackchainRequired, "<code>(collectionGenlsBackchainRequired COLLECTION)</code>\n<p>\nmeans that rules that conclude\n<p>\n<code>(genls <anything> COLLECTION)</code>\n<p>\nmust be used in order to prove literals of the form\n<p>\n<code>(genls <anything> COLLECTION)</code>.\n<p>\nThis directs the inference engine to use such rules even if HL predicate transformation is disabled. See also backchainRequired for the analogue of this predicate applicable to predicates rather than collections.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, collectionGenlsBackchainEncouraged, "<p>\n(collectionGenlsBackchainEncouraged COLLECTION)\n<p>\nmeans that rules that conclude\n<p>\n(genls <anything> COLLECTION)\n<p>\nare most likely going to have to be used in order to prove literals of the form\n<p>\n(genls <anything> COLLECTION).\n<p>\nThis directs the inference engine to use such rules even if HL predicate transformation is disabled.  Note that it will not necessarily use rules of the form\n<p>\n(genls <anything> <variable>)\n<p>\nwhere <variable> might bind to COLLECTION, and it will not necessarily use rules of the form\n<p>\n(genls <anything> SPEC),\n<p>\nwhere (genls SPEC COLLECTION).\n<p>\nSee also backchainEncouraged for the analogue of this predicate applicable to predicates rather than collections.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, collectionExpansion, "(collectionExpansion COL FORMULA) states that membership\nof a term in the collection COL is equivalent to FORMULA involving\nthat term being true.  The meta-variable :ARG1 is used to stand for\nthe term in FORMULA, and the meta-variable :ARG2 is used to stand for\nthe collection in FORMULA.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, collectionConventionMt, "(collectionConventionMt COL MT) means that assertions of the form (isa INS COL), for any INS, are by convention asserted in MT.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, collectionCompletelyEnumerableViaBackchain, "A unary InferenceCompletenessPredicate.  <code>(collectionCompletelyEnumerableViaBackchain COL)</code> means that the CycInferenceEngine can generate a list of all of (and only) the instances of <code>COL</code> by appeal to isa consequent rules.  For example, in certain medical domain microtheories, MazeProcedure-SurgicalProcedure is collectionCompletelyEnumerableViaBackchain because backchaining on its single rule is sufficient to generate all the relevant instances in those microtheories.", 'CoreCycLMt', vStrMon).
exactlyAssertedEL_next(comment, collectionBackchainRequired, "<code>(collectionBackchainRequired COLLECTION)</code>\n<p>\nmeans that rules that conclude\n<p>\n<code>(isa <anything> COLLECTION)</code>\n<p>\nmust be used in order to prove literals of the form\n<p>\n<code>(isa <anything> COLLECTION)</code>\n<p>\nand rules that conclude\n<p>\n<code>(genls <anything> COLLECTION)</code>\n<p>\nmust be used in order to prove literals of the form\n<p>\n<code>(genls <anything> COLLECTION)</code>.\n<p>\nThis directs the inference engine to use such rules even if HL predicate transformation is disabled.  See also backchainRequired for the analogue of this predicate applicable to predicates rather than collections.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, collectionBackchainEncouraged, "<p>\n(collectionBackchainEncouraged COLLECTION)\n<p>\nmeans that rules that conclude\n<p>\n(isa <anything> COLLECTION)\n<p>\nare most likely going to have to be used in order to prove literals of the form\n<p>\n(isa <anything> COLLECTION),\n<p>\nand rules that conclude\n<p>\n(genls <anything> COLLECTION)\n<p>\nare most likely going to have to be used in order to prove literals of the form\n<p>\n(genls <anything> COLLECTION).\n<p>\nThis directs the inference engine to use such rules even if HL predicate transformation is disabled. Note that it will not necessarily use rules of the form\n<p>\n([isa|genls] <anything> <variable>)\n<p>\nwhere <variable> might bind to COLLECTION, and it will not necessarily use rules of the form\n<p>\n([isa|genls] <anything> SPEC), where (genls SPEC COLLECTION).\n<p>\nSee also backchainEncouraged for the analogue of this predicate applicable to predicates rather than collections.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, coExtensional, "A TaxonomicSlotForCollections (q.v.) that holds between collections whose extents (see extent) are exactly the same. (coExtensional COL1 COL2) means that COL1 and COL2 have all their elements in common: every instance of (see isa) one is an instance of the other.  Note that since collections (see Collection), unlike mathematical sets (see Set-Mathematical), are \"intensionally defined\", two collections can be coextensional without thereby being identical (see equals).  See also \ncoextensionalSetOrCollections.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, canonicalizerDirectiveForArgAndRest, "A  CanonicalizerDirectivePredicate (q.v.) used (in conjunction with a  CanonicalizerDirective) to control the behavior of the CycCanonicalizer. (canonicalizerDirectiveForArgAndRest RELN N DIRECTIVE) means that  the CycCanonicalizer obeys DIRECTIVE when canonicalizing the Nth and subsequent (i.e. (N+1)th, (N+2)th, ...) arguments of any CycLFormula  whose main (or \"0th place\") operator denotes RELN.  See the instances  of CanonicalizerDirective for more information on how particular  directives affect canonicalization.  Also see canonicalizerDirectiveForArg and canonicalizerDirectiveForAllArgs.", 'CoreCycLImplementationMt', vStrMon).
exactlyAssertedEL_next(comment, canonicalizerDirectiveForArg, "A CanonicalizerDirectivePredicate  (q.v.) used (in conjunction with a CanonicalizerDirective) to control the  behavior of the CycCanonicalizer.  (canonicalizerDirectiveForArg RELN  N DIRECTIVE) means that the CycCanonicalizer obeys DIRECTIVE when  canonicalizing the Nth argument of a CycLFormula whose main (or \"0th place\") operator denotes RELN.  See the instances of CanonicalizerDirective  for more information on how particular directives affect canonicalization. Also see canonicalizerDirectiveForArgAndRest and  canonicalizerDirectiveForAllArgs.", 'CoreCycLImplementationMt', vStrMon).
exactlyAssertedEL_next(comment, canonicalizerDirectiveForAllArgs, "A  CanonicalizerDirectivePredicate (q.v.) used (in conjunction with a  CanonicalizerDirective) to control the behavior of the CycCanonicalizer. (canonicalizerDirectiveForAllArgs RELN DIRECTIVE) means that the  CycCanonicalizer obeys DIRECTIVE when canonicalizing any argument of a  CycLFormula whose main (or \"0th place\") operator denotes RELN.  See the  instances of CanonicalizerDirective for more information on how particular  directives affect canonicalization.  Also see canonicalizerDirectiveForArg and canonicalizerDirectiveForArgAndRest.", 'CoreCycLImplementationMt', vStrMon).
exactlyAssertedEL_next(comment, backchainRequired, "(backchainRequired PREDICATE) means that rules that conclude PREDICATE must be used in order to prove literals involving PREDICATE.  In other words, when performing inferences, all literals involving PREDICATE must be eliminated using rules since there won't be any other way to prove them.  See also backchainEncouraged, backchainDiscouraged, and backchainForbidden.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, backchainForbiddenWhenUnboundInArg, "backchainForbiddenWhenUnboundInArg is a predicate that\nallows users to prevent the inference engine from backchaining on a\nliteral when one or more of its arguments are unbound. That is, if\nPRED is a Predicate, N a positive integer less than or equal to the\narity of PRED, then (backchainForbiddenWhenUnboundInArg PRED N) that\nno rules concluding to a positive literal with PREDICATE as the arg0\n(in other words, no implies assertions in which a literal with\nPREDICATE as the arg0 appears in the consequent) will be used when\nattempting to prove (non-negated) literals with PREDICATE as the arg0\n*unless* argN in the literal is fully bound. For instance, the sentence\n<pre>\n(backchainForbiddenWhenUnboundInArg interestingSentence 1)\n</pre>\nprevents the inference engine from applying any rule concluding\ninterestingSentence, such as \n<pre>\n(implies\n  (maleficiary ?PROGRAM ?AGENT) \n  (interestingSentence ?AGENT (maleficiary ?PROGRAM ?AGENT)))\n</pre>\nunless and until <code>?AGENT</code> is bound.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, backchainForbidden, "backchainForbidden is a predicate that allows users to cut down on the number of rules used to prove certain literals, and thus to increase the speed of inferences that involve proving those literals.  <code>(backchainForbidden PREDICATE)</code> means that no rules containing a positive literal with <code>PREDICATE</code> as the arg0 (in other words, no implies assertions in which a literal with <code>PREDICATE</code> as the arg0 appears in the consequent) will be used when attempting to prove (non-negated) literals with <code>PREDICATE</code> as the arg0.  Asserting <code>(backchainForbidden PREDICATE)</code> is useful when all (non-negated) literals with <code>PREDICATE</code> as the arg0 are expected to be solvable by lookup of ground atomic formulas (GAF's) already in the KB, and so rules won't be needed to prove them.  However, asserting <code>(backchainForbidden PREDICATE)</code> is usually counter-productive in contexts where some literals with <code>PREDICATE</code> as the arg0 are expected to be proven via backchaining on rules containing a positive literal with <code>PREDICATE</code> as the arg0.  See also the related predicates backchainRequired, backchainEncouraged, and backchainDiscouraged.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, assertionUtility, "A CycInferenceHeuristicRelevancePredicate. (assertionUtility ASSERTION NUM) states that the CycLAssertion ASSERTION should be heuristically considered of utility NUM to inferences made in the current Microtheory. NUM should be a RealNumber between 1 and -1, with 1 indicating maximum utility, -1 indicating minimum utility, and 0 being agnostic with respect to utility.  (assertionUtility ASSERTION 1) is equivalent to (highlyRelevantAssertion ASSERTION). (assertionUtility ASSERTION -1) is equivalent to (irrelevantAssertion ASSERTION).  See also other instances of CycInferenceHeuristicRelevancePredicate.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, assertionDirection, "An AssertionDescriptorPredicate that \nis used to state that a given CycLAssertion has a certain inference \n\"direction\", which indicates something about how and when the assertion \ncan be used in inferences by the Cyc system. (assertionDirection ASSERTION DIRECTION) means that ASSERTION has DIRECTION as its CycLAssertionDirection (q.v.).  DIRECTION is normally Backward-AssertionDirection (q.v.) when \nASSERTION is a rule and Forward-AssertionDirection (q.v.) when ASSERTION is \na ground atomic formula (or \"GAF\"; see CycLClosedAtomicSentence).  Note \nthat a CycL sentence is given a direction at the time of its assertion to the \nKnowledge Base, and this fact _need_not_ in general be reflected in another, \nassertionDirection GAF's being asserted (as that would of course lead to an infinite regress).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, assertedTermSentences, "(assertedTermSentences THING SENTENCE) means that SENTENCE has been asserted to the Cyc Knowledge Base (and is thus a  CycLAssertion) and that THING is mentioned in SENTENCE.  More precisely, and assuming the assertedTermSentences formula contains no free variables (and \nis thus a \"ground atomic formula\" or \"GAF\"): the CycL term immediately following the constant `assertedTermSentences' in the formula occurs in SENTENCE.  For example, (assertedTermSentences France (bordersOn France Germany)) holds.  See also knownSentence and assertedPredicateArg for related predicates about assertions; and see termFormulas for a more general predicate that does not entail that SENTENCE has been asserted.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, knownSentence, "A KBDependentRelation (q.v.) and specialization of knownSentence (q.v.) that is used to state that a given CycLSentence-Assertible has been asserted in the KB (in some accessible Microtheory). More exactly, (knownSentence SENT) is true in microtheory MT precisely when SENT canonicalizes into a set of clauses of the same form as the canonicalized form of some assertion in a microtheory accessible to MT. (The predicate is thus true both of assertions entered into the KB by hand and assertions deduced by Cyc from forward rules.) For the more specific claim that SENT is asserted <b>in MT</b>, see the predicate ist-Asserted.\n<p>\nThis predicate enables Cyc to select a subset of information when answering queries, filtering out more generic (inferrable-but-not-asserted) information. Thus, for example, the query:\n<p>\n(genls Dog Thing)\n<p>\nwill return True (in appropriate microtheories), whereas:\n<p>\n(knownSentence (genls Dog Thing))\n<p>\nwill not.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, assertedPredicateArg, "(assertedPredicateArg OBJ N PREDICATE) means that a ground atomic formula (or \"GAF\"; see CycLClosedAtomicSentence) whose initial (or \"0th\" argument-place) term denotes PREDICATE, and whose Nth argument-place term denotes OBJ, is asserted in the Cyc Knowledge Base. Note that this predicate is itself notAssertible (q.v.), since it must be computed from the state of the knowledge base.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, arityMin, "A MetaRelation for specifying the minimum number\nof arguments a given VariableArityRelation must take if the resulting formula is to be semantically well-formed.  <code>(arityMin RELN N)</code> means that semantic well-formedness requires that <code>RELN</code> take at least <code>N</code> arguments at a time.  More precisely: a formula <code>(RELN ARG<sub>1</sub> ... ARG<sub>M</sub>)</code> is semantically well-formed only if <code>M</code> is greater than or equal to <code>N</code>.  For example, the minimum-arity of any instance of UnitOfMeasure is 1.  Note that full semantic well-formedness requires obeying argument-type constraints (see ArgTypePredicate) as well as arity constraints. For a general explanation of semantic well-formedness, see CycLExpression-Assertible.  See also arityMax and arity.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, arityMax, "A MetaRelation for specifying the maximum number\nof arguments a given VariableArityRelation can take if the \nresulting formula is to be semantically well-formed.  <code>(arityMax RELN N)</code> means \nthat semantic well-formedness requires that <code>RELN</code> take at most <code>N</code> arguments at \na time.  More precisely: a formula <code>(RELN ARG<sub>1</sub> ... ARG<sub>M</sub>)</code> is semantically \nwell-formed only if <code>M</code> is less than or equal to <code>N</code>.  For example, the \nmaximum-arity of any instance of UnitOfMeasure is 2.  Note that full semantic \nwell-formedness requires obeying argument-type constraints (see \nArgTypePredicate) as well as arity constraints.  For a general explanation \nof semantic well-formedness, see CycLExpression-Assertible.  See also \narityMin and arity.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, arity, "A MetaRelation used for stating that a given  relation takes a specified number of arguments.  <code>(arity RELN N)</code>  means that that semantic well-formedness requires that <code>RELN</code> take  exactly <code>N</code> arguments at a time.  That is, a formula  <code>(RELN ARG<sub>1</sub> ... ARG<sub>M</sub>)</code> is semantically well-formed only if <code>M</code> = <code>N</code>.\n<p>\nFor example, the arity of any instance of BinaryPredicate is 2.\n<p>\nNote that full semantic well-formedness requires obeying argument-type constraints (see ArgTypePredicate) as well as arity constraints.  For a general explanation of semantic well-formedness, see CycLExpression-Assertible.  See also CycLExpression-Askable.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, argsQuotedIsa, "A binary ArgQuotedIsaPredicate (q.v.) that is used to put a specified quoted-isa based argument-type constraint on all of a given relation's argument-places at once. (argsQuotedIsa RELN COL) means that semantic well-formedness requires that each argument to which RELN is applied (regardless of argument-place) be a quoted instance of COL. For example, '(argsQuotedIsa and CycLSentence-Assertible)' means that the relation and must only be applied to assertible CycL sentences. argsQuotedIsa is particularly useful for constraining (any and all of) the arguments of a VariableArityRelation (the preceding example being a case in point); though argQuotedIsa may be applied to fixed-arity relations as well. For an explanation of semantic well-formedness, see CycLExpression-Assertible and its immediate specializations.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, argSometimesIsa, "(argSometimesIsa RELATION POSITIVE-INTERGER-N COLLECTION) means that semantic\nwell-formedness requires that anything given as the Nth argument to RELN must be\nan instance of COL at sometime or other.  More precisely, if (argSometimesIsa RELATION POSITIVE-INTERGER-N COLLECTION) then in order to assert: (RELATION ARG-N ... OTHER-ARGS)<MT TIME PAR>, it must be the case that there exists some time interval, t, such that (isa ARG-N COLLECTION)<MT t PAR>.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, argsIsa, "A binary ArgIsaPredicate (q.v.) that is used to put a specified isa based argument-type constraint on all of a given relation's argument-places at once.  (argsIsa RELN COL) means that semantic well-formedness requires that each argument to which RELN is applied (regardless of argument-place) be an instance of COL.  For example, '(argsIsa PlusFn ScalarInterval)' means that the function PlusFn must only be applied to scalar intervals.   argsIsa is particularly useful for constraining (any and all of) the arguments to a VariableArityRelation (the preceding example being a case in point); though argsIsa may be applied to fixed-arity relations as well.  For an explanation of semantic well-formedness, see CycLExpression-Assertible and its immediate specializations.  See also argsGenl.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, argsGenl, "A binary ArgGenlPredicate (q.v.) that is used to put \na specified genls based argument-type constraint on all of a given relation's \nargument-places at once.  (argsGenl RELN COL) means that semantic well-formedness requires that each argument to which RELN is applied (regardless of argument-place) be an subcollection of COL.  For example, `(argsGenl PerformSimultaneouslyFn Event)' means that the function PerformSimultaneouslyFn must only be applied to types of events.  argsGenl is particularly useful for constraining (any and all of) the arguments to a VariableArityRelation (the preceding example being a case in point); though argsGenl may be applied to fixed-arity relations as well.  For an explanation of semantic well-formedness, see CycLExpression-Assertible and its immediate specializations.  See also argsIsa.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, argQuotedIsa, "A ternary Predicate (argQuotedIsa RELN N COL) means that semantic well-formedness requires that the term given as the Nth argument to RELN must be an instance of the SubLExpressionType COL. That is, (RELN ... ARGN ...) is semantically well-formed only if (quotedIsa ARGN COL) holds. For example, (argQuotedIsa examplePredSentences 1 CycLSentence) holds. ", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, argIsa, "A ternary ArgIsaPredicate (q.v.).  <code>(argIsa RELN N COL)</code> means that semantic well-formedness requires that anything given as the <code>N</code>th argument to <code>RELN</code> must be an instance of <code>COL</code>.  That is, <code>(RELN ... ARG<sub>N</sub> ...)</code> is semantically well-formed only if <code>(isa ARG<sub>N</sub> COL)</code> holds.  For example, <code>(argIsa mother 1 Animal)</code> and <code>(argIsa argIsa 3 Collection)</code> both hold.  For an  explanation of semantic well-formedness, see CycLExpression-Assertible and its specializations.  For similar but less flexible binary predicates, see arg1Isa et al. See also argGenl.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, argAndRestQuotedIsa, "A ternary ArgQuotedIsaPredicate (q.v.) used to place a specified quoted isa based argument-type constraint on a given VariableArityRelation (q.v.) with respect to any of its argument-places whose ordinal position is greater than or equal to a specified number. (argAndRestQuotedIsa RELN N COL) means that, as a necessary condition for semantic well-formedness, anything given as the Nth or greater argument to RELN must be a quoted instance of COL. Thus a closed formula (RELN ARG1..ARG(N)..ARG(N+1)..) is well-formed only if each of ARG(N)..ARG(N+1).. is a quoted instance of COL. See also argsQuotedIsa.", 'BookkeepingMt', vStrMon).
exactlyAssertedEL_next(comment, argAndRestIsa, "A ternary ArgIsaPredicate (q.v.) used to \nplace a specified isa based argument-type constraint on a given \nVariableArityRelation (q.v.) with respect to any of its argument-places \nwhose ordinal position is greater than or equal to a specified number.\n(argAndRestIsa RELN N COL) means that, as a necessary condition for \nsemantic well-formedness, anything given as the Nth or greater argument \nto RELN must be an instance of COL.  Thus a closed formula\n(RELN ARG1..ARG(N)..ARG(N+1)..) is well-formed only if each of ARG(N)..ARG(N+1).. is an instance of COL.  See also argsIsa and argAndRestGenl.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, argAndRestGenl, "A ternary ArgGenlPredicate (q.v.) used to \nplace a specified genls based argument-type constraint on a given \nVariableArityRelation (q.v.) with respect to any of its argument-places \nwhose ordinal position is greater than or equal to a specified number.\n(argAndRestGenl RELN N COL) means that, as a necessary condition for \nsemantic well-formedness, anything given as the Nth or greater argument \nto RELN must be an specialization of COL.  Thus a closed formula \n(RELN ARG1..ARG(N)..ARG(N+1)..) is well-formed only if each of ARG(N)..ARG(N+1).. is an instance of COL.  See also argsGenl and argAndRestIsa.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, arg6SometimesIsa, "An ArgSometimesIsaPredicate and ArgTypeBinaryPredicate, <code>(arg6SometimesIsa\nRELATION COLLECTION)</code> means that semantic well-formedness requires that\nanything given as the sixth argument to <code>RELATION</code> must be an\ninstance of <code>COLLECTION</code> at some time.  More precisely, if\n<code>(arg6SometimesIsa RELATION COLLECTION)</code> holds then in order to\nassert <code>(RELATION ... ARG6 ...)</code>, it must only be the case that there\nexists some time interval (including Always-TimeInterval) in which\n<code>(isa ARG6 COLLECTION)</code> holds.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, arg6QuotedIsa, "A binary Predicate (arg6QuotedIsa RELN COL) means that semantic well-formedness requires that the term given as the sixth argument to RELN must be an instance of the SubLExpressionType COL. That is, (RELN ARG1 ARG2 ARG3 ARG4 ARG5 ARG6 ...) is semantically well-formed only if (quotedIsa ARG6 COL) holds.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, arg6Isa, "A binary ArgIsaPredicate (q.v.).  <code>(arg6Isa RELN COL)</code>  means that semantic well-formedness requires that anything given as the sixth argument to <code>RELN</code> must be an instance of <code>COL</code>.  That is,  <code>(RELN ARG1 ARG2 ARG3 ARG4 ARG5 ARG6 ...)</code> is semantically well-formed only if  <code>(isa ARG6 COL)</code> holds.  For an explanation of semantic well-formedness, see  CycLExpression-Assertible and its specializations.  See argIsa for a similar but more flexible ternary predicate.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, arg6Genl, "A binary ArgGenlPredicate (q.v.).  <code>(arg6Genl RELN COL)</code>  means that semantic well-formedness requires that anything given as the sixth argument to <code>RELN</code> must be a subcollection of <code>COL</code>.  That is,  <code>(RELN ARG1 ARG2 ARG3 ARG4 ARG5 ARG6 ...)</code> is semantically well-formed only if <code>(genls ARG6 COL)</code> holds.  For an explanation of semantic well-formedness, see  CycLExpression-Assertible and its specializations.  See argGenl for a  similar but more flexible ternary predicate.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, arg6Format, "An instance of ArgFormatPredicate (q.v.) used to place a particular Format (q.v.) constraint on the sixth (or \"arg6\") argument-place of a given predicate.  (arg6Format PRED FORMAT) means that PRED's arg6 is constrained to FORMAT.  See the reified instances Format for\nfurther details.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, arg5SometimesIsa, "An ArgSometimesIsaPredicate and ArgTypeBinaryPredicate, <code>(arg5SometimesIsa\nRELATION COLLECTION)</code> means that semantic well-formedness requires that\nanything given as the fifth argument to <code>RELATION</code> must be an\ninstance of <code>COLLECTION</code> at some time.  More precisely, if\n<code>(arg3SometimesIsa RELATION COLLECTION)</code> holds then in order to\nassert <code>(RELATION ... ARG5 ...)</code>, it must only be the case that there\nexists some time interval (including Always-TimeInterval) in which\n<code>(isa ARG5 COLLECTION)</code> holds.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, arg5QuotedIsa, "A binary Predicate (arg5QuotedIsa RELN COL) means that semantic well-formedness requires that the term given as the fifth argument to RELN must be an instance of the SubLExpressionType COL. That is, (RELN ARG1 ARG2 ARG3 ARG4 ARG5 ...) is semantically well-formed only if (quotedIsa ARG5 COL) holds.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, arg5Isa, "A binary ArgIsaPredicate (q.v.).  <code>(arg5Isa RELN COL)</code>  means that semantic well-formedness requires that anything given as the fifth argument to <code>RELN</code> must be an instance of <code>COL</code>.  That is,  <code>(RELN ARG1 ARG2 ARG3 ARG4 ARG5</code> ...) is semantically well-formed only if  <code>(isa ARG5 COL)</code> holds.  For an explanation of semantic well-formedness, see  CycLExpression-Assertible and its specializations.  See argIsa for a  similar but more flexible ternary predicate.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, arg5Genl, "A binary ArgGenlPredicate (q.v.).  <code>(arg5Genl RELN COL)</code>  means that semantic well-formedness requires that anything given as the fifth argument to <code>RELN</code> must be a subcollection of <code>COL</code>.  That is,  <code>(RELN ARG1 ARG2 ARG3 ARG4 ARG5 ...)</code> is semantically well-formed only if <code>(genls ARG5 COL)</code> holds.  For an explanation of semantic well-formedness, see  CycLExpression-Assertible and its specializations.  See argGenl for a  similar but more flexible ternary predicate.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, arg5Format, "An instance of ArgFormatPredicate (q.v.) used to place a particular Format (q.v.) constraint on the fifth (or \"arg5\") argument-place of a given predicate.  (arg5Format PRED FORMAT) means that PRED's arg5 is constrained to FORMAT.  See the reified instances Format for\nfurther details.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, arg4SometimesIsa, "An ArgSometimesIsaPredicate and ArgTypeBinaryPredicate, <code>(arg4SometimesIsa\nRELATION COLLECTION)</code> means that semantic well-formedness requires that\nanything given as the fourth argument to <code>RELATION</code> must be an\ninstance of <code>COLLECTION</code> at some time.  More precisely, if\n<code>(arg3SometimesIsa RELATION COLLECTION)</code> holds then in order to\nassert <code>(RELATION ... ARG4 ...)</code>, it must only be the case that there\nexists some time interval (including Always-TimeInterval) in which\n<code>(isa ARG4 COLLECTION)</code> holds.", 'UniversalVocabularyMt', vStrMon).
