exactlyAssertedEL_next(comment, arg4Isa, "A binary ArgIsaPredicate (q.v.).  <code>(arg4Isa RELN COL)</code>  means that semantic well-formedness requires that anything given as the fourth argument to <code>RELN</code> must be an instance of <code>COL</code>.  That is,  <code>(RELN ARG1 ARG2 ARG3 ARG4</code> ...) is semantically well-formed only if  <code>(isa ARG4 COL)</code> holds.  For an explanation of semantic well-formedness, see  CycLExpression-Assertible and its specializations.  See argIsa for a  similar but more flexible ternary predicate.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, arg4Genl, "A binary ArgGenlPredicate (q.v.).  <code>(arg4Genl RELN COL)</code>  means that semantic well-formedness requires that anything given as the fourth argument to <code>RELN</code> must be a subcollection of <code>COL</code>.  That is,  <code>(RELN ARG1 ARG2 ARG3 ARG4 ...)</code> is semantically well-formed only if  <code>(genls ARG4 COL)</code> holds.  For an explanation of semantic well-formedness, see  CycLExpression-Assertible and its specializations.  See argGenl for a  similar but more flexible ternary predicate.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, arg4Format, "An instance of ArgFormatPredicate (q.v.) used to place a particular Format (q.v.) constraint on the fourth (or \"arg4\") argument-place of a given predicate.  (arg4Format PRED FORMAT) means that PRED's arg4 is constrained to FORMAT.  See the reified instances Format for\nfurther details.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, arg3SometimesIsa, "An ArgSometimesIsaPredicate and ArgTypeBinaryPredicate, <code>(arg3SometimesIsa\nRELATION COLLECTION)</code> means that semantic well-formedness requires that\nanything given as the third argument to <code>RELATION</code> must be an\ninstance of <code>COLLECTION</code> at some time.  More precisely, if\n<code>(arg3SometimesIsa RELATION COLLECTION)</code> holds then in order to\nassert <code>(RELATION ... ARG3 ...)</code>, it must only be the case that there\nexists some time interval (including Always-TimeInterval) in which\n<code>(isa ARG3 COLLECTION)</code> holds.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, arg3QuotedIsa, "A binary Predicate (arg3QuotedIsa RELN COL) means that semantic well-formedness requires that the term given as the third argument to RELN must be an instance of the SubLExpressionType COL. That is, (RELN ARG1 ARG2 ARG3 ...) is semantically well-formed only if (quotedIsa ARG3 COL) holds.", 'UniversalVocabularyMt', vStrMon).
