exactlyAssertedEL_next(comment, arg2SometimesIsa, "An ArgSometimesIsaPredicate and ArgTypeBinaryPredicate, <code>(arg2SometimesIsa\nRELATION COLLECTION)</code> means that semantic well-formedness requires that\nanything given as the second argument to <code>RELATION</code> must be an\ninstance of <code>COLLECTION</code> at some time.  More precisely, if\n<code>(arg2SometimesIsa RELATION COLLECTION)</code> holds then in order to\nassert <code>(RELATION ... ARG2 ...)</code>, it must only be the case that there\nexists some time interval (including Always-TimeInterval) in which\n<code>(isa ARG2 COLLECTION)</code> holds.", 'UniversalVocabularyMt', vStrMon).
