exactlyAssertedEL_next(comment, arg1SometimesIsa, "An ArgSometimesIsaPredicate and ArgTypeBinaryPredicate, <code>(arg1SometimesIsa RELATION\nCOLLECTION)</code> means that semantic well-formedness requires that anything\ngiven as the first argument to <code>RELATION</code> must be an instance of\n<code>COLLECTION</code> at some time.  More precisely, if\n<code>(arg1SometimesIsa RELATION COLLECTION)</code> holds then in order to\nassert <code>(RELATION ARG1 ...)</code>, it must only be the case that there\nexists some time interval (including Always-TimeInterval) in which\n<code>(isa ARG1 COLLECTION)</code> holds.", 'UniversalVocabularyMt', vStrMon).
