exactlyAssertedEL_next(comment, arg1Format, "An instance of ArgFormatPredicate (q.v.) used to place a particular Format (q.v.) constraint on the first (or \"arg1\") argument-place of a given predicate.  (arg1Format PRED FORMAT) means that PRED's arg1 is constrained to FORMAT.  See the reified instances Format for\nfurther details.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, and, "A LogicalConnective that represents conjunction in CycL. It is a VariableArityRelation, taking an arbitrary number of ELSentence-Assertibles as arguments.  <code>(and P Q ... Z)</code> is true if and only if all of the sentences <code>P</code>, <code>Q</code>, ..., and <code>Z</code> are true.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, afterRemoving, "When a gaf is unasserted, afterRemovings are called on the gaf dependent on the predicate of the gaf.  (afterRemoving PRED HOOK) means that HOOK will be called on gaf whose predicate is PRED.  If the gaf predicate has multiple afterRemovings, the order of execution is not guaranteed.  Also, afterRemovings are retriggered on the removal of each of the arguments to a gaf.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, afterAdding, "Whenever a gaf is asserted, afterAddings are called on the gaf dependent on the predicate of the gaf.  (afterAdding PRED HOOK) means that HOOK will be called on gaf whose predicate is PRED.  If the gaf predicate has multiple afterAddings, the order of execution is not guaranteed.  Also, afterAddings are retriggered on the addition of new arguments to an existing gaf.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, admittedSentence, "(admittedSentence SENTENCE) states that SENTENCE is a CycLSentence which is both syntactically and semantically well-formed with respect to argument constraints only.  For example, (admittedSentence (bordersOn Canada France)) is true in WorldGeographyDualistMt, but not in WorldGeographyMt, since Canada and France are known to be instances of GeographicalRegion in the former microtheory, but not in the latter microtheory.  See also admittedArgument.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, admittedNAT, "(admittedNAT NAT) states that NAT is a CycLNonAtomicTerm which is both syntactically and semantically well-formed wrt arg constraints.  For example, (admittedNAT (MotherFn Muffet)) is true precisely in those mts in which Muffet satisfies all the applicable arg1 constraints imposed by MotherFn.  See also admittedSentence.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, admittedArgument, "A ternary MetaRelation predicate that is used to state that a given thing meets the argument-type constraints on a given argument-place of a given relation. <code>(admittedArgument THING ARGNUM RELN)</code> means that <code>THING</code> satisfies all of the (single-argument) argument-type constraints (see ArgIsaPredicate and ArgGenlPredicate) for the <b><code>ARGNUM</b>-th</code> argument position of <code>RELN</code>.  \n<p>\nFor example, both of the following sentences hold:\n<pre>  (admittedArgument AbrahamLincoln 1 wife)\n\n  (admittedArgument Cougar 1 JuvenileFn) .</pre>\nSee also admittedAllArgument and admittedSentence.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, admittedAllArgument, "A ternary MetaRelation predicate that relates a Collection to an integer (representing an argument-place) to a Relation such that every instance of the collection is an admittedArgument (q.v.) to the specified argument-place of the relation.  <code>(admittedAllArgument COL ARGNUM RELN)</code> means that every instance of <code>COL</code> satisfies all of the (single-argument) argument-type constraints (see ArgIsaPredicate and ArgGenlPredicate) for the <code>ARGNUM</code>th argument position of <code>RELN</code>.  Note that <code>COL</code> is required <i>not</i> to be an  EmptyCollection.\n<p>\nFor example, <code>(admittedAllArgument FemaleHuman 1 spouse)</code> and <code>(admittedAllArgument PersonTypeByActivity 1 JuvenileFn)</code> both hold.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, abnormal, "A binary MetaKnowledgePredicate that is used to state exceptions to a given general CycLAssertion.  Typically, an abnormal assertion will be the result of the CycCanonicalizer having \"transformed\" a sentence asserted at the EL level that was built from an ExceptionPredicate (i.e. exceptWhen or exceptFor).  While perhaps less common-sensically intuitive than exceptWhen or exceptFor, abnormal facilitates an efficient and uniform handling of exceptions.\n<p>\nHere, in more detail, is how abnormal is used.  Every default rule in our system, schematically:\n<p>\nP[X1 ... Xn] -> Q[X1 ... Xn]\n<p>\n(with X1, ..., Xn free in both P and Q) is implicitly treated as\n<p>\n(not (\"abnormal-for-this-rule\" X1 ... Xn)) & (P[X1 ... Xn] -> Q[X1 ... Xn]) .\n<p>\nThus rules without exceptions need never incur the overhead of default reasoning.  Since a different \"abnormality\" relation would otherwise be needed for every default rule in the system, we use instead a single predicate -- abnormal -- which takes the rule in question as an argument.  And the other argument to abnormal is a List of variables (or of a single closed term) over which abnormality is computed; this allows abnormal to be binary rather than variable-arity.  Hence a sentence of the form\n<p>\n(exceptWhen EXCEPTION RULE) ,\n<p>\nin which each of the variables X1, ..., Xn occurs free in both EXCEPTION and RULE, gets canonicalized to an implies rule that concludes to an abnormal sentence:\n<p>\n<pre>\n(implies\n  EXCEPTION\n  (abnormal (TheList X1 .... Xn) RULE)) .\n</pre>\n<p>\nAnd a sentence of the form\n<p>\n(exceptFor TERM RULE) ,\n<p>\nin which exactly one variable X occurs free in RULE, gets canonicalized to a sentence of the form\n<p>\n(abnormal (TheList TERM) RULE) .\n<p>\nSee also pragmaticallyNormal.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'WFFSupportedTerm', "The collection of all CycLTerms that have some kind of special support in the CycWellFormednessChecker.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'WFFSupportedPredicate', "The collection of all Predicates that are supported in some way by the CycWellFormednessChecker, either to satisfy, impose, or relax well-formedness constraints.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'WFFDirectivePredicate', "The collection of all Predicates which can affect what WFF standards to impose on a given sentence.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'WFFConstraintSatisfactionPredicate', "The collection of all Predicates which can satisfy well-formedness constraints.  More specifically, only assertions of the form (PRED . ARGS), where PRED is an instance of WFFConstraintPredicate, can directly satisfy a well-formedness constraint, i.e. cause any previously ill-formed sentence to become well-formed, given the same WFF standards.  Any assertion could _indirectly_ satisfy a well-formedness constraint, for instance by triggering a forward rule or an afterAdding.  A common case of this is the afterAddings on spec-preds of isa and genls.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'WFFConstraintPredicate', "The collection of all Predicates which can impose well-formedness constraints.  More specifically, only assertions of the form (PRED . ARGS), where PRED is an instance of WFFConstraintPredicate, can directly impose a well-formedness constraint, i.e. cause a previously well-formed sentence to become ill-formed, given the same WFF standards.  Any assertion could _indirectly_ impose a well-formedness constraint, for instance by triggering a forward rule or an afterAdding.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'Wednesday', "A collection of CalendarDays and an \ninstance of DayOfWeekType.  Wednesday is the collection of all \n(and only) wednesdays.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'VariableAritySkolemFunction', "The subcollection of SkolemFunctions with variable arity. These are only created when a sequence variable is in the scope of the skolem.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'VariableAritySkolemFuncN', "The subcollection of SkolemFuncNs with variable arity. These are only created when a sequence variable is in the scope of  a bounded existential.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'VariableArityRelation', "A specialization of Relation.  Each instance of VariableArityRelation is a relation that can take a variable number of arguments. The degree of variability for a given such relation can be constrained using the predicates arityMin and arityMax. Examples of VariableArityRelations include the predicate different and the function PlusFn.  Thus the terms '(PlusFn 1 2)' and '(PlusFn 1 2 3)' are both well-formed. Cf. FixedArityRelation.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'UnreifiableFunction', "A specialization of Function-Denotational instances of which are such  that their values are not reified in the Cyc system.  More precisely, an instance of UnreifiableFunction is such that closed \"NATs\" (see  CycLNonAtomicTerm) built from its standard CycL name are _not_ instances of  HLReifiedDenotationalTerm.   Constrast with ReifiableFunction.  Usually it is more efficient to make functions reifiable; but it is not desirable  to reify every non-atomic term, such as those built from (names of)  instances of FunctionFromQuantitiesToQuantities.  For example, it would be cumbersome to reify every term of the form (Inch N) that happened to appear in a CycL assertion.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'Unknown-HLTruthValue', "An instance of CycHLTruthValue. Unknown-HLTruthValue is the attribute of being neither known to be true nor known to be false.", 'BaseKB', vStrDef).
exactlyAssertedEL_next(comment, 'UniversalVocabularyMt', "This is the microtheory which contains the 'definitional' assertions about everything in Cyc's universe of discourse.  Definitional assertions about a concept are those which are intrinsic to the concept's nature and cannot be violated in any context.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'UniversalVocabularyImplementationMt', "This is the microtheory which contains the assertions about CycL terms which are necessary for Cyc's inference engine to reason about those terms.", 'BaseKB', vStrMon).
exactlyAssertedEL_next(comment, 'Unity', "An instance of ZeroDimensionalUnitOfMeasure (q.v.) that takes one or two numbers or other NumericIntervals (q.v.) as argument(s) and returns the continuous numeric-interval that spans between and includes those arguments.  Given one argument, Unity behaves like an identity function.\n<p>\nMore precisely: for any numeric-interval <code>NUM</code>, <code>(Unity NUM)</code> = <code>NUM</code>; and for any two numeric-intervals <code>LO</code> and <code>HI</code> such that <code>(greaterThanOrEqualTo HI LO)</code>, <code>(Unity LO HI)</code> is the numeric-interval that ranges from the least point-value (see Number-General) subsumed by (see quantitySubsumes) <code>LO</code> to the greatest point-value subsumed by <code>HI</code>.\n<p>\nIn practice, <code>LO</code> and <code>HI</code> will typically be two distinct RealNumbers, and <code>(Unity LO HI)</code> will be the continuous ProperIntervalOnNumberLine that ranges from <code>LO</code> to <code>HI</code>.  For example, (Unity 1 10) is the interval from 1 to 10 inclusive.  But note that <code>LO</code> and/or <code>HI</code> might themselves be proper intervals: (Unity (Unity 7 9) 11) is thus the interval from 7 to 11 inclusive.\n<p>\nUnity is classified as a UnitOfMeasure mainly in order to simplify the application of quasi-mathematical operations (e.g. PerFn, UnitProductFn) to units-of-measure generally.  For example, TimesPerDay is defined as the result of \"dividing\" (via PerFn) Unity by DaysDuration.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'UnitProductFn', "A binary UnitOfMeasureDenotingFunction that takes two UnitOfMeasure (q.v.) functions and returns the unit-of-measure function whose value for any given argument is the multiplicative \"product\" of the respective values yielded by the first two units, when one unit is applied to that same argument and the other unit is applied to 1.  That is, <code>(UnitProductFn UNIT1 UNIT2)</code> is the function <code>PRODUCT-FN</code> such that, for any number or other NumericInterval <code>NUM</code>, <code>(PRODUCT-FN NUM)</code> = <code>(TimesFn (UNIT1 NUM) (UNIT2 1))</code>.\n<p>\nFor example, (UnitProductFn Meter Meter) is SquareMeter; and (e.g.) (SquareMeter 5) is equal to (TimesFn (Meter 5) (Meter 1)). Also, (UnitProductFn  Kilowatt HoursDuration) is KilowattHour.\n<p>\nSee also PerFn.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'UnitOfMeasure', "A specialization of ScalarDenotingFunction (q.v.).  Each instance of UnitOfMeasure is a function that takes one or two numbers or other NumericIntervals as arguments, and returns as value a MeasurableQuantity (q.v.), such as a Distance or a Speed or a Volume.  If a unit of measure is applied to one number (see Number-General) the result is a precise quantity that is a ScalarPointValue; if applied to two (different) numbers -- or to one (or two) ProperIntervalOnNumberLine(s) -- the result is a closed-interval quantity that is a ScalarProperInterval.  For example, (Meter 5) is the distance five meters and (Meter 5 10) is the distance \"five to ten meters (inclusive)\".\n<p>\n(A partial exception to the above is the unit-of-measure Unity (q.v.), which always returns a NumericInterval rather than a MeasurableQuantity.)\n<p>\nSpecializations of UnitOfMeasure grouped by what they measure include UnitOfTime, UnitOfSpeed, and UnitOfVolume.  Other specializations are OneDimensionalUnitOfMeasure, MultiDimensionalUnitOfMeasure, UnitOfMeasureWithPrefix and UnitOfMeasureNoPrefix.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'UncanonicalizerAssertionFn', "UncanonicalizerAssertionFn is used by the CycUncanonicalizer and should rarely (if ever) need to be seen by users or referenced in assertions entered at the EL level.  It is used by the uncanonicalizer to denote an CycLAssertion after it is transformed to its canonical EL formula.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'UnaryRelation', "The collection of all fixed-arity relations of arity 1 (see arity).  The most notable specializations of UnaryRelation are UnaryPredicate and UnaryFunction (qq.v.).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'UnaryPredicate', "A specialization of both UnaryRelation and Predicate.  UnaryPredicate is the collection of all predicates whose arity (see arity) is 1.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'UnaryFunction', "A specialization of both FixedArityFunction and UnaryRelation (qq.v.).  Each instance of UnaryFunction is a function that always takes a single argument, i.e. has an arity (see arity) of 1.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'Tuesday', "A collection of CalendarDays and an \ninstance of DayOfWeekType.  Tuesday is the collection of all \n(and only) tuesdays.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'TruthValue', "TruthValue is a collection of mathematical objects; it contains the abstract, logical objects True and False.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'TruthFunction', "A major subcollection of Relation that subsumes the collections Predicate, LogicalConnective, and Quantifier (qq.v.). Truth-functions, or rather the expressions that represent or denote them, are used to form sentences.  More precisely, any CycL expression that denotes an instance of TruthFunction (and only such an expression) can appear in the \"0th\" argument-position (i.e. as the term immediately following the opening parenthesis) of a CycLSentence.  \n<p>\nThe name 'TruthFunction' derives in part from the fact that the sentences thus formed (if semantically well-formed and quantificationally closed; see CycLSentence-Assertible and CycLClosedSentence) are the kind of expression that can be true or false (with respect to a given context and interpretation). Though not really functions (cf. Function-Denotational), many TruthFunctions are \"truth-functional\" in the sense that the truth-value of a (closed, semantically well-formed) sentence <code>(RELN ARG1..ARGN)</code> built using a truth-function <code>RELN</code> is uniquely determined (with respect to a given context) by <code>RELN</code> together with the argument(s) <code>ARG1..ARGN</code> to which it is applied.  For example, the sentence <code>(mother ChelseaClinton HillaryClinton)</code> is made true (in the actual world) by the fact that Chelsea Clinton's mother is Hillary Clinton.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'True', "An instance of TruthValue (q.v.).  True is the logical notion of truth.  That is, the term 'True' is used as a sentential constant of CycL that is true under every model theoretic interpretation.  For example, (booleanResult T/F True) means that the result obtained from the true-or-false test T/F is True.  Cf. False.", 'BaseKB', vStrDef).
exactlyAssertedEL_next(comment, 'TransitiveBinaryPredicate', "A BinaryPredicateTypeByLogicalFeature and thus a specialization of BinaryPredicate.  A binary predicate <code>PRED</code> is an instance of TransitiveBinaryPredicate only if it has the following property: For any <code>THING1</code>, <code>THING2</code>, and <code>THING3</code>, if both of these hold:\n<pre>\n  (PRED THING1 THING2)\n  (PRED THING2 THING3)\n</pre>\nThen so does this:\n<pre>\n  (PRED THING1 THING3) .\n</pre>\nNote that a necessary condition on <code>PRED</code>'s being transitive is that its two argument-places must be co-satisfiable; see cosatisfiableInArgs and NoteOnArgumentCosatisfiabilityRequirement.\n<p>\nInstances of TransitiveBinaryPredicate include greaterThan,\ngeographicalSubRegions, and cotemporal.  \n<p>\nCf. QuasiTransitiveBinaryPredicate and AntiTransitiveBinaryPredicate.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'TransformationModuleSupportedPredicate', "The collection of all Predicates which are supported by some CycTransformationModule.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'TransformationModuleSupportedCollection', "The collection of all Collections which are supported by some CycTransformationModule.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'TLVariableFn', "Denotes HL variables at the TL: arg1 is the HL index of the variable; arg2 is the EL string name of the variable.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'TLReifiedNatFn', "Denotes a reified nat term at the TL: arg1 is the formula of the nat.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'TLAssertionFn', "Denotes HL assertion terms at the TL (e.g., assertions appearing as terms within meta-assertions): arg1 is the mt of the assertion; arg2 is the formula of the assertion.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'TimesFn', "A VariableArityRelation that represents multiplication in CycL. (TimesFn MULT1 MULT2 ...) yields a quantity which is the result of multiplying MULT1 MULT2 (...) together. All arguments to TimesFn must be instances of ScalarInterval, as is its result. Thus (TimesFn 2 3 4) returns 24; (TimesFn Pi-Number E-LogarithmBase) returns pi times e. For division see QuotientFn.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'Thursday', "A collection of CalendarDays and an  instance of DayOfWeekType.  Thursday is the collection of all  (and only) thursdays.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'Thing', "Thing is the \"universal collection\": the collection which, by definition, contains everything there is.  Every thing in the Cyc ontology -- every Individual (of any kind), every Set-Mathematical, and every Collection -- is an instance of (see isa) Thing.  Similarly, every collection is a subcollection of (see genls) Thing.  Trivially, Thing is both an instance of and a subcollection of itself, and is not a subcollection of any other collection.  (Note that the above reference to \"every thing in the Cyc ontology\" is <i>not</i> meant to be limited to things actually <i>reified</i> in the Cyc system, but includes (e.g.) every instance -- reified or not, known or not -- of every collection recognized by Cyc.)", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'TheUser', "TheUser denotes the `current user' of an individual, running Cyc image.  Note that at any moment there may actually be many current users of an image, communicating with it through various sorts of API: HTML-based browser, telnet API connection, etc. TheUser serves as a placeholder allowing Cyc to keep track of relevant characteristics (including authorization, sophistication level) of each distinct user.", 'BaseKB', vStrDef).
exactlyAssertedEL_next(comment, 'TheTerm', "A special kind of term that allows back-reference to any individual thing that satisfies the constraints on the TheTerm.  E.g., 'Suppose a cat walks into a fish store.  The cat is likely to get into a lot of trouble.'  'The cat' in the second sentence refers back to 'a cat' in the first; i.e., any cat that walks into a fish store.  In Cyc, the constraints for a TheTerm in a given context are given by use of the predicate theTermConstraints on the unit representing that context.  In lifting assertions out of that context, the constraints are added as antecedents.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'TheSetOf', "A binary SetDenotingFunction and ScopingRelation that takes a variable and an open sentence to a set, where the open sentence specifies a necessary and sufficient membership condition for the set.  If <code>SENT</code> is an open CycLSentence-Assertible in which <code>VAR</code> is the only variable occuring free, (TheSetOf <code>VAR SENT</code>) is the Set-Mathematical of exactly those things that satisfy <code>SENT</code>.  For example, (TheSetOf ?X (and (isa ?X Dog) (mainColorOfObject ?X BlackColor))) is the set of black dogs.\n<p>\nNote that if <code>VAR</code> does not occur free in <code>SENT</code>, or is not the only variable occuring free in <code>SENT</code>, the term <code>(TheSetOf VAR SENT)</code> will be itself be open (see CycLOpenNonAtomicTerm) and thus will not denote anything.  Given that a true sentence is satisfied by <i>everything</i>, we stipulate that <code>(TheSetOf VAR SENT)</code> is undefined whenever <code>SENT</code> is closed in order to avoid commitment to a \"universal set\". \n<p>\nSee also TheSet, which is used to specify a set by enumerating its elements.  And see TheCollectionOf.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'TheSet', "A variable-arity SetDenotingFunction that is used to specify a set by enumerating its elements.  For any finite sequence <code>THING1,...,THING<sub>N</sub></code> (<code>N</code> >= 1), (TheSet <code>THING1...THING<sub>N</sub>)</code> is the Set-Mathematical whose elements (see elementOf) are precisely <code>THING1,...,THING<sub>N</sub></code>.  For example, (TheSet SonnyBono Cher) is the set whose only elements are Sonny and Cher.  \n<p>\nNote that in the degenerate case where <code>N</code> is zero, (TheSet) is TheEmptySet.  \n<p>\nSee also the related function TheSetOf, which is used to specify a set by giving a necessary and sufficient membership condition.  And see TheList and TheCollection.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'TheList', "TheList is a function that combines its arguments into a list.  For any ITEM(1), ..., ITEM(n), each of which is an instance of Thing, (TheList ITEM(1) ... ITEM(n)) gives the instance of List-Extensional whose first member is ITEM (1), ..., and whose last member is ITEM(n). Note that in general ITEM(1), ..., ITEM(n) do not have to be distinct, though they do if (TheList ITEM(1) ... ITEM(n)) is an instance of ListWithoutRepetition.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'TheEmptySet', "TheEmptySet is the empty (or \"null\") set: the unique set that has no elements.  Note that TheEmptySet is an instance of Set-Mathematical and thus _not_ an instance of Collection.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'TheEmptyList', "An instance of ListWithoutRepetition. TheEmptyList is a list that has no members (see listMembers).  Note that any list that has no members is identical with TheEmptyList; thus TheEmptyList is the only list whose length is 0.  Note also that TheEmptyList is a sublist (see subLists) of every list.  Note finally that TheEmptyList is not the same as TheEmptySet (q.v.).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'TheCollectionOf', "A collection denoting function that takes a CycL variable and an open formula with exactly one free variable to the collecion of things satisfying that formula.", 'BaseKB', vStrDef).
exactlyAssertedEL_next(comment, 'TernaryRelation', "The collection of all fixed-arity relations of arity 3 (see arity).  The most notable specializations of TernaryRelation are TernaryPredicate and TernaryFunction (qq.v.).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'TernaryPredicate', "A specialization of both TernaryRelation and Predicate.  TernaryPredicate is the collection of all predicates whose arity (see arity) is 3.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'TernaryFunction', "A specialization of FixedArityFunction and TernaryRelation.  An instance FUNC of FixedArityFunction is an instance of TernaryFunction if and only if FUNC has an arity of three.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'TemporaryEnglishParaphraseMt', "This is a temporary MT for holding paraphrase assertions prior to review, after which time they will be moved to EnglishParaphraseMt", 'BaseKB', vStrDef).
exactlyAssertedEL_next(comment, 'SymmetricBinaryPredicate', "A specialization of both BinaryPredicate and CommutativeRelation (qq.v.).  A binary predicate <code>PRED</code> is an instance of SymmetricBinaryPredicate if and only if (i) for any things <code>X</code> and <code>Y</code>, if <code>(PRED X Y)</code> then <code>(PRED Y X)</code> and (ii) the single-argument argument type constraints (see argIsa and argGenls) on <code>PRED</code>'s two argument-places are co-satisfiable (see cosatisfiableInArgs and NoteOnArgumentCosatisfiabilityRequirement).  Note that if <code>PRED</code> satisfies condition (i), then it also satisfies condition (ii) as long as <code>(PRED A B)</code> holds for some <code>A</code> and <code>B</code>.\n<p>\nInstances of SymmetricBinaryPredicate include siblings, teammates, connectedTo, and bordersOn.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'Sunday', "A collection of CalendarDays and an  instance of DayOfWeekType.  Sunday is the collection of all  (and only) sundays.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'substring-CaseInsensitive', "<code>(substring-CaseInsensitive SUBSTRING STRING)</code> means that the <code>CharacterString SUBSTRING</code> is a substring of the <code>CharacterString STRING</code> with case ignored in both <code>SUBSTRING</code> and <code>STRING</code>. For case-sensitive tagging use the more specialized predicate, <code>substring</code>.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'SubLSymbol', "The collection of all SubLAtoms that are also \"symbols\" in the SubL language.  That is, each instance of SubLSymbol satisfies the defnIff SYMBOLP.  Note that `symbol' has a very specific, technical meaning in SubL.  Save for those that are variables (see SubLVariable), SubLSymbols are rarely used in CycL assertions, except within those built with certain CycInferenceDescriptorPredicates like defnIff. Examples of SubL symbols include the symbols 'GENLS' and 'CYC-SYSTEM-NON-VARIABLE-SYMBOL-P'. Note also that SubLSymbol is a \"quoted-collection\" (see quotedCollection).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'SubLString', "A subcollection of SubLAtomicTerm (q.v.) whose instances can be used to denote character-strings.  In the SubL language (as in English), one can refer to a particular character-string by simply putting a pair of quotation marks around it.  Semantically, what this amounts to is using a certain character-string to denote itself.  \n<p>\nMore precisely: a given SubLString STRING is a character-string such that, when it appears inside a pair of double-quotation marks, STRING is interpreted as denoting itself (i.e. STRING).  The surrounding quotation-marks are <i>not</i> considered to be parts of STRING; rather, they are syncategorematic symbols whose role is merely to indicate that a string is being referred to.  Thus, in the context of the sentence '(firstName Lenat \"Doug\")', the four-character string 'Doug' denotes itself: the string `Doug'.  \n<p>\nNote that <i>not</i> every CharacterString is a SubLString: there are some restrictions on what characters a SubL-string can contain. Note also that SubLStrings are <i>atomic</i> terms (see SubLAtomicTerm and CycLAtomicTerm), as they cannot be constructed out of other SubL (or CycL) terms via the syntax (grammar) of SubL (or CycL).  Thus although the string 'hotdog' can indeed be obtained from 'hot' and 'dog' via concatenation (see ConcatenateStringsFn), the <i>syntax</i> of SubL (or CycL) itself contains no rule that licenses such a construction (see e.g. the comments on SubLSExpression, CycLExpression, CycLTerm, CycLFormula, and various subcollections thereof).  Note finally that SubLString is a \"quoted-collection\" (see quotedCollection).  Thus the sentence '(isa \"hotdog\" SubLString)' means, just as one would expect, that the six-character string 'hotdog' (not the eight-character quote-inclusive '\"hotdog\"'; see above) is an instance of SubLString.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'SubLSExpression', "The collection of all expressions of the SubL language.  SubL is the implementation language of the Cyc system, and it subsumes the CycL language.  The CycL grammar is more strict than the SubL grammar. Thus, while every CycLExpression is a SubLSExpression, the converse is not true. Examples of SubLSExpressions that are not CycLExpressions include Arabic decimal numeric expressions such as '123', expressions like '(1 2 3)' that denote lists of numbers, and \"dotted pair\" expressions like '(Cat . Dog)'.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'SubLRealNumber', "The collection of all number-denoting expressions in the CycL language that are _not_ CycL constants or NATs, but are terms of SubL, the underlying implementation language of the Cyc system. SubLRealNumbers are numeric strings of the Arabic decimal system, including the decimal point and scientific notation.  Examples include the terms `212' and `3.14159d0'.  Non-examples include the expressions `One', `(Meter 6)', `(Unity 3)', `:34', `PlusInfinity', and `Avogadro's number'.  Note that this collection, like most instances of CycLExpressionType, is \"quoted\" (see quotedCollection).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'SubLQuoteFn', "<code>(SubLQuoteFn SUBL-EXPRESSION)</code> is one of exactly two escapes to SubL from CycL, the other being ExpandSubLFn.  These are the only two ways to represent arbitrary SubL in CycL.  SubLQuoteFn encapsulates <code>SUBL-EXPRESSION</code> such that it will not be rejected by the CycL wff-checker as ill-formed CycL.  For example, <code>(SubLQuoteFn (+ 1 2))</code>, which <i>is</i> a CycLExpression, denotes the SubLSExpression (+ 1 2), which itself is <i>not</i> a CycLExpression.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'SubLPositiveInteger', "The collection of all positive-integer-denoting expressions in the CycL language that are <i>not</i> CycL constants or NATs, but are terms of SubL, the underlying implementation language of the Cyc system.  SubLPositiveIntegers  are numeric strings of the Arabic decimal system (not including the decimal point or scientific notation).  Examples include the expressions '2', '12', and '4'.  Non-examples include '0', '4.012', '(Meter 6)', '(Unity 3.3)', ':34', and 'PlusInfinity'.  Note that SubLPositiveInteger is a \"quoted-collection\" (see quotedCollection); thus the sentence '(isa 12 SubLPositiveInteger)' means that the expression '12' (not the number 12) is an instance of SubLPositiveInteger.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'SubLNonVariableSymbol', "The collection of all SubLSymbols except SubLVariables (qq.v.); a subcollection of CycLClosedAtomicTerm.  Note that `symbol' has a very specific, technical meaning in SubL; SubLNonVariableSymbols are rarely used in CycL assertions, except within those built with certain CycInferenceDescriptorPredicates like defnIff and those whose arguments are KeywordVariableTemplates (qq.v.). Examples of SubL non-variable symbols include the symbols `GENLS', `:ARG1', and `CYC-SYSTEM-NON-VARIABLE-SYMBOL-P'.  Note that this collection, like most instances of CycLExpressionType, is \"quoted\" (see quotedCollection).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'SubLNonVariableNonKeywordSymbol', "The collection of all SubLSymbols except SubLVariables (q.v.) and SubLKeywords (q.v.); a subcollection of CycLClosedAtomicTerm.  Note that `symbol' has a very specific, technical meaning in SubL; SubLNonVariableNonKeywordSymbols are rarely used in CycL assertions, except within those built with certain CycInferenceDescriptorPredicates like defnIff. Examples of SubL non-variable non-keyword symbols include the symbols `GENLS' and `CYC-SYSTEM-NON-VARIABLE-NON-KEYWORD-SYMBOL-P'.  Note that this collection, like most instances of CycLExpressionType, is \"quoted\" (see quotedCollection).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'SubLNonNegativeInteger', "The collection of all non-negative-integer-denoting expressions in the CycL language that are _not_ CycL constants or NATs, but are terms of SubL, the underlying implementation language of the Cyc system.  SubLNonNegativeIntegers \nare numeric strings of the Arabic decimal system (not including the decimal point or scientific notation).  Examples include the expressions `0', `12', and `4'.  Non-examples include `4.012', `(Meter 6)', `(Unity 3.3)', `:34', and `PlusInfinity'.  Note that SubLNonNegativeInteger is a \"quoted-collection\" (see quotedCollection); thus the sentence `(isa 12 SubLNonNegativeInteger)' means that the expression `12' (and not \nthe number 12) is an instance of SubLNonNegativeInteger.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'SubLList', "A collection of list-denoting expressions that are not represented in CycL (i.e. they are not CycLConstants or CycLNonAtomicTerms) but are represented in SubL, the underlying implementation language of the Cyc system.  Each instance of SubLList is a sequence of SubLListOrAtoms (q.v.) enclosed in parentheses.  SubL lists are those things that pass the defnIff LISTP. Note that this collection is \"quoted\" (see quotedCollection).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'SubLKeyword', "The subcollection of SubLSymbol consisting of all SubL keywords.  Instances include the symbols `:KEYWORD', `:OBJECT', and `:PLURAL'.  Every instance of SubLKeyword satisfies (in the sense relevant to defnIff) `KEYWORDP'.  Note that SubLKeyword, like most instances of CycLExpressionType, is \"quoted\" (see quotedCollection).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'SubLInteger', "The collection of all integer-denoting expressions in the CycL language that are _not_ CycL constants or NATs, but are terms of SubL, the underlying implementation language of the Cyc system.  SubLIntegers  are numeric strings of the Arabic decimal system (including the negative-value symbol `-', but _not_ the decimal point or scientific notation) that denote integers.  Examples include the expressions `0', `12', and `-4' (which denote the integers 0, 12, and -4, respectively).  Non-examples include `4.012', `(Meter 6)', `(Unity 3.3)', `:34', and `PlusInfinity'.  Note that SubLInteger is a \"quoted-collection\" (see quotedCollection). Thus the sentence `(isa 12 SubLInteger)' means that the expression `12' (and not the number 12) is an instance of SubLInteger.  Similarly, the assertion `(genls SubLInteger Integer)' means (not that each SubL integer is an integer, but) that each  instance of SubLInteger _denotes_ an instance of Integer (see the shared NoteAboutUseVersusMention).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'SubLExpressionType', "A collection of collections.  Each instance of SubLExpressionType is a type (i.e. a subcollection) of SubLSExpression.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'SubLCharacter', "The collection of all character-denoting terms in the CycL language that are SubLAtomicTerms (q.v.). (SubL, which subsumes CycL, is the underlying implementation language of the Cyc system.)  A given SubLCharacter CHAR-TERM is itself a string consisting of the hash-symbol (`#'), followed by the backslash (`\\'), followed (in most cases) by the character CHAR that CHAR-TERM denotes.  For example, the SubLCharacter `#\\A'\ndenotes the character `A'.  (An exception to the above is when CHAR is a non-printing or control character, in which case a specially-designated string\nappears after the `#\\'.)", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'SubLAtomicTerm', "The collection of all atomic denotational terms in the CycL language that are not explicitly represented in CycL (i.e. they are neither CycLConstants nor CycLVariables) but are represented in SubL, the underlying implementation language of the Cyc system.  \"Atomic\" here means not constructable from other terms via the SubL syntax.  Examples include the terms '212', ':NOUN', '#x', and 'VARIABLE-P'. Do not confuse this collection with SubLAtom, most of whose instances, while they are expressions of SubL, are <i>not</i> part of CycL.  Note that this collection, like most instances of CycLExpressionType, is \"quoted\".", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'SubLAtom', "A collection of SubLExpressions that are atomic: they cannot be decomposed into other SubL expressions. Save for certain variables (see SubLVariable), instances of SubLAtom are rarely used in CycL assertions (other than assertions built with certain CycInferenceDescriptorPredicates like defnIff). Many SubL atoms are not even CycLExpressions.  Do not confuse this collection with SubLAtomicTerm, which is a CycLExpressionType (though its instances are neither CycL constants nor CycL variables).  Note that SubLAtom is a \"quoted-collection\" (see quotedCollection).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'SkolemFunctionFn', "SkolemFunctionFn is used by the CycCanonicalizer and should rarely (if ever) need to be seen by users or referenced in assertions entered at the EL level.  It is used by the canonicalizer to denote a skolem function before it is reified, when the skolem is derived from a formula asserted at the EL level that uses thereExists. Its arity is 3: the first argument is a list of the term variable arguments of the denoted skolem function, (term variables which are in the scope of the existential), the second argument is a variable which uniquely identifies the existentially quantified variable by which the denoted skolem will be represented in the canonical version of the formula, and the third is  a sequence variable if there is a sequence variable argument of the denoted skolem function (which there will be iff there is a sequence variable in the scope of the existential), and NIL otherwise.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'SkolemFunction', "A specialization of IndeterminateTermDenotingFunction and ReifiableFunction (qq.v.).  SkolemFunction is a collection of system-generated functions that implement existential quantification in Cyc.  Whenever someone asserts to the Knowledge Base a sentence that contains 'thereExists' (in an arg0 position), Cyc automatically creates a new instance of SkolemFunction and rewrites the assertion using that Skolem function.\n<p>\nFor example, suppose we want Cyc to know that every animal has a birth date.   So we assert the following sentence:\n<p>\n<pre>\n  (implies\n    (isa ?X Animal)\n    (thereExists ?Y\n      (birthDate ?X ?Y))) .\n</pre>\n<p>\nIn response, Cyc automatically reifies a new unary instance of SkolemFunction (call it 'BirthDateFn') that takes any given animal to its date of birth, and then rewrites our rule using BirthDateFn instead of thereExists, as\n<p>\n<pre>\n  (implies\n    (and\n      (isa ?X Animal)\n      (termOfUnit ?Y (BirthDateFn ?X)))\n    (birthDate ?X ?Y)) .\n</pre>\n<p>\nNote that actual Cyc-generated Skolem function names currently (02/04) consist of the prefix 'SKF-' follow by a numeral.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'SkolemFuncNFn', "SkolemFuncNFn is used by the CycCanonicalizer and should rarely\n(if ever) need to be seen by users or referenced in assertions entered\nat the EL level.  It is used by the canonicalizer to denote a skolem\nfunction before it is reified, when the skolem is derived from a formula\nasserted at the EL level that uses thereExistAtLeast,\nthereExistAtMost, or thereExistExactly.  Its arity is 4: the first\nargument is a list of the term variable arguments of the denoted skolem function,\n(term variables which are in the scope of the bounded existential).\nThe second argument is a variable which uniquely identifies the\nexistentially quantified variable by which the denoted skolem will\nbe represented in the canonical version of the formula.\nThe third is a sequence variable if there is a sequence variable\nargument of the denoted skolem function (which there will be iff there\nis a sequence variable in the scope of the bounded existential), and NIL otherwise.\nThe fourth is an interval specifying the number of things which may satisfy the formula.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'SkolemFuncN', "SkolemFuncN is a collection of Cyc system-generated functions that partially implement existential quantifications in Cyc.  Whenever someone asserts to Cyc an expression that contains a 'thereExistAtLeast', a 'thereExistAtMost', or a 'thereExistExactly' quantifier, Cyc automatically creates a new instance of SkolemFuncN and rewrites the assertion using this skolem function instead of that existential quantifier.  See also termOfUnit. At this time (3/98), skolem functions are automatically named by the Cyc system using the prefix 'SKF-' followed by a number.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'SingleEntry', "An instance of Format (q.v.) that can be specified to hold of a given predicate with respect to a given argument-place (see argFormat).  (argFormat PRED N SingleEntry) means that, for any particular way of fixing the other arguments to PRED besides the Nth, there is at most one thing such that, if taken as the Nth argument, PRED holds of those arguments.  That is, if the sequences <... ARGN ...> and <... ARGN-PRIME ...> differ at most in their Nth items and both (PRED ... ARGN ...) and (PRED ... ARGN-PRIME ...) hold, then ARGN = ARGN-PRIME (see equals).  For example, the format of biologicalMother's second argument-place is single-entry, since an animal can only have one biological mother.  A predicate with a single-entry format argument-place is thus a StrictlyFunctionalPredicate (q.v.) that is strictly functional with respect to that argument-place (see strictlyFunctionalInArgs).  Contrast with SetTheFormat.", 'BaseKB', vStrDef).
exactlyAssertedEL_next(comment, 'SiblingDisjointCollectionType', "A KBDependentCollection of collections of  collections (and thus an instance of CollectionTypeType and a specialization of CollectionType).  A sibling-disjoint collection type is such that its known  (i.e. KB-represented) instances are collections that -- save for any that are related to each other by  genls and any that are explicitly asserted to be exceptions (see  siblingDisjointExceptions) -- are disjoint from each other. \n<p>\nMore precisely, each instance <code>SIB</code> of SiblingDisjointCollectionType is a collection of collections that has the following KB-dependent property: \n<p>\nFor any two known instances <code>COL1</code> and <code>COL2</code> of   <code>SIB</code>, at least one of the following is known to hold: \n<pre>\n  (a) (genls COL1 COL2)\n  (b) (genls COL2 COL1)\n  (c) (siblingDisjointExceptions COL1 COL2)\n  (d) (disjointWith COL1 COL2)\n</pre>  \nMoreover, note that if <code>MT</code> is a context (see Microtheory) in which (i) both <code>(isa COL1 SIB)</code> and <code>(isa COL2 SIB)</code> hold and (ii)  neither <code>(genls COL1 COL2)</code> nor <code>(genls COL2 COL1)</code> nor <code>(siblingDisjointExceptions COL1 COL2)</code> is known to hold (see knownSentence), then \n<code>(disjointWith COL1 COL2)</code> holds by default in <code>MT</code>.   \n<p>\nFor example, in BiologyMt both Person and Dog are instances of the  sibling-disjoint collection type BiologicalSpecies, while neither  (genls Person Dog) nor (genls Dog Person) nor  (siblingDisjointExceptions Person Dog) is known to hold in that  context; consequently, (disjointWith Person Dog) holds by default  in BiologyMt.  Instances of SiblingDisjointCollectionType include  BiologicalTaxon (and its specializations), OrganismPartType, and RelationshipTypeByArity.\n<p>\nSee the generalization SiblingDisjointSetOrCollectionType.  Also cf. the stronger notion of DisjointCollectionType.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'SiblingDisjointAttributeType', "A collection of collections.  Each instance of SiblingDisjointAttributeType is a collection of quantities.  If COL is such a collection, then nothing can have two instances of COL as quantities unless those two instances are related in a quantitySubsumes relationship to each other.  See also SiblingDisjointCollectionType.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'SetTheFormat', "An instance of Format (q.v.) that can be specified to hold of a given predicate with respect to a given argument-place (see argFormat).  (argFormat PRED N SetTheFormat) means that, for any particular way of fixing the other arguments to PRED besides the Nth, there might be any number (including zero) of things such that, if taken as the Nth argument, PRED holds of those arguments.  For example, the format of biologicalMother's first argument-place is SetTheFormat, since a female animal might have any number of offspring.  Unlike the other reified instances of Format, SetTheFormat actually places no restriction at all on what PRED might or might not hold of with respect to the relevant argument-place.  But one should not infer from this that entry-format assertions using SetTheFormat are pointless; for they forestall duplication of effort by serving notice that the entry-format of a given argument-place has previously been considered and SetTheFormat was deemed the appropriate format.  SetTheFormat is the most commonly-encountered format in the Cyc Knowledge Base.  Contrast with SingleEntry.", 'BaseKB', vStrDef).
exactlyAssertedEL_next(comment, 'SetOrCollection', "A specialization of MathematicalThing.  Something is an instance of SetOrCollection just in case it is a collection (i.e. an instance of Collection) or a mathematical set (i.e. an instance of Set-Mathematical).  Instances of Set-Mathematical and instances of Collection (and thus instances of SetOrCollection) share some basic common features.  All instances of Collection and all instances of Set-Mathematical (and thus all instances of SetOrCollection) are abstract entities, lacking spatial and temporal properties.  Nearly all instances of Collection (except \"empty\" collections) and nearly all instances of Set-Mathematical (except the empty set; see TheEmptySet) have \"elements\" (i.e. instances or members; see elementOf); hence set-or-collections may stand to one another in generalized set-theoretic relations such as subsetOf and disjointWith (qq.v.).  (It is this shared feature of having elements that provides the basic rationale for reifying the collection SetOrCollection.)  Nevertheless, sets and collections differ in two important ways.  First, each collection is intrinsically associated with an intensional criterion for membership -- a more or less natural property (or group of properties) possessed by all of (and only) its elements.  Collections are thus akin to kinds.  In contrast, the elements of a set are not required to be homogeneous in any respect: any things whatsoever may together constitute the elements of a set.  The second major difference between sets and collections is that no two distinct sets can be coextensional (i.e. have exactly the same elements; see coExtensional).  Sets can thus be identified purely on the basis of their extensions (see extent).  Collections, on the other hand, are individuated by their intensional criteria for membership.  So collections that have exactly the same elements might nevertheless be distinct, differing in their respective membership criteria.  (Note that the general relationship between collections and their \"intensional criteria for membership\" in the above sense is not something that is currently represented explicitly in the Knowledge Base (though this seems a worthwhile area for future work); still the comment and other \"definitional\" assertions on a given collection should ideally convey a reasonably clear and precise idea of its associated membership criterion.)", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'Set-Mathematical', "A specialization of SetOrCollection (q.v.); the collection of mathematical sets.  An instance of Set-Mathematical can be any arbitrary set of Things.  A good way to explain this notion with respect to the Cyc ontology is to contrast Set-Mathematical with Collection (q.v.).  First, while the instances of a given collection all have some more-or-less significant (often \"natural\") property or properties in common, the elements (see elementOf) in a given set might have nothing in common (besides membership in that set).  Second, while it is in principle possible for two distinct collections to have exactly the same elements (with respect to a given context), this cannot happen in the case of sets, which are individuated strictly in terms of their extensions (see extent).  Third (and specifically regarding their expression in the CycL language), unlike with collections, rarely will it be desirable to create a new constant to denote a particular set.  Instead, a set will often be either (a) intensionally specified by a defining property via TheSetOf (q.v.), as in `(TheSetOf ?X (and (isa ?X Integer) (greaterThan ?X 42)))', or (b) extensionally specified by enumerating its elements via TheSet (q.v.), as in `(TheSet 3 4 5)'; see also ThePartition and TheCovering.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'September', "A specialization of CalendarMonth.  Each instance of September is the ninth month of a particular year in the GregorianCalendar (q.v.).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'SententialRelation', "A collection of mathematical objects.  Each instance of SententialRelation is by definition either a LogicalConnective or a Quantifier.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'ScopingRelation', "A specialization of Relation whose instances are used to determine a \"scope\" with respect to one or more variables and to bind any free occurrences of those variables that are inside that scope.  Each instance of ScopingRelation takes as its arguments (at least) a variable or list of variables (see CycLVariable and CycLVariableList) and a formula (see CycLExpression-Assertible).  The former argument is the scoping relation's \"scoping\" argument (see scopingArg), and the latter its \"scoped formula\" argument (see scopedFormulaArg).\n<p>\nSyntactically, the formula (SCOPINGRELN VAR SENT) might either be a sentence or a non-atomic term (see CycLNonAtomicTerm), depending on which ScopingRelation it is built from.  Suppose for simplicity that the sentence SENT itself contains no ScopingRelation expressions, so that any variables occurring in SENT are not bound (i.e. they are _free_).  Then, in the formula (SCOPINGRELN VAR SENT), the _scope_ of the occurrence of the term SCOPINGRELN is SENT, and any free occurrence of the variable VAR in SENT is said to be _bound_ by that occurrence of SCOPINGRELN, and thus is bound (and hence not free) with respect to the entire formula.  (The occurrence of VAR immediately to the right of SCOPINGRELN is also considered bound with respect to the entire formula.)\n<p>\nSemantically, if the formula (SCOPINGRELN VAR SENT) is _closed_ (i.e. if it contains no free occurrence of any variable), then it will in some sense be \"about\" the value(s) of VAR that satisfy SENT.  That is, if (SCOPINGRELN VAR SENT) is a closed sentence it will state something about those values, while if (SCOPINGRELN VAR SENT) is a closed NAT it will (purport to) denote something related to those values.  For an example of the former case see thereExists; for the latter case see TheSetOf.  (If there are no free occurrences of VAR inside SENT, then (SCOPINGRELN VAR SENT) is a \"vacuous\" application of SCOPINGRELN that means exactly what SENT means.)\n<p>\nInstances of ScopingRelation include all of the Quantifiers and Lambda.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'ScalarPointValue', "A specialization of ScalarInterval (q.v.).  Each instance of ScalarPointValue is a specific number or quantity, as opposed to a range of numbers or quantities (cf. ScalarProperInterval).  Instances of ScalarPointValue include all reals numbers and other Number-Generals (q.v.), as well as specific instances of Quantity such as (Meter 3) and (SecondsDuration 10).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'ScalarInterval', "A specialization of TupleOfIntervals (q.v.).  Roughly put, this is the collection of all things that can be ranked according to some one-dimensional scale.  Instances of ScalarInterval are numbers or quantities possessing only sign and magnitude.  They are construed as <i>one-tuples</i> (see Tuple) of intervals.  They are to be contrasted with VectorIntervals (q.v.), which possess a direction as well as a magnitude, and are construed as two-membered tuples of intervals.\n<p>\nScalarInterval is partitioned into the two collections NumericInterval (which is the collection of numbers and number-ranges of all kinds) and Quantity (qq.v).  A Quantity is usually specified with a numeric-interval, as with (Meter 3)), but it might also be given in a generically-ranked way, as with (HighAmountFn Happiness); see the specializations MeasurableQuantity and NonNumericQuantity.  The magnitude of a scalar might be given by a specific number (see ScalarPointValue) or by a proper range of numbers (see ScalarProperInterval).\n<p>\nNote that the instances of MathematicalFunctionOnScalars (q.v.), which include artithmetic functions such as addition (see PlusFn) and division (see QuotientFn), are defined broadly so as to apply not only to numbers, but to (numerically-measured) scalar intervals generally.  Thus (PlusFn (Meter 3) (Meter 5)) is equal to (Meter 8).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'ScalarIntegralValue', "A specialization of ScalarPointValue (q.v.).  Each instance of ScalarIntegralValue is either an Integer or a MeasurableQuantity  (q.v.) that is the value returned when some UnitOfMeasure (q.v.) function is applied to an Integer.  In the latter case, the quantity is said to be \"integral with respect to\" that unit-of-measure (see integralWRTUnit).\n<p>\nFor example, both 6 and (Inch 6) are scalar integral values.  The latter is integral with respect to Inch.\n<p>\nScalarIntegralValues are the admitted arguments for, and the values returned by, GreatestCommonDivisorFn and LeastCommonMultipleFn (qq.v.).\n<p>\nNote that, despite appearances to the contrary, (Foot-UnitOfMeasure 0.5) is a scalar integral value that is integral with respect to Inch, as it is equal to the scalar integral (Inch 6).  It might even be argued that, in principle, <i>every</i> MeasurableQuantity is integral with respect to some (reified or not) unit-of-measure or other.  But that is a contentious issue on which we need not take sides.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'Saturday', "A collection of CalendarDays and an \ninstance of DayOfWeekType.  Saturday is the collection of all \n(and only) saturdays.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'RuleTemplate', "Terms denoting formulas (typically without support for efficient inference) that can be (partially) instantiated as Cyc assertions (typically with support for efficient inference); see trueRule and ruleTemplateAssertion.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'RoundUpFn', "An instance of EvaluatableFunction.  When applied to an instance INTERVAL of ScalarInterval, RoundUpFn returns an instance ROUNDED-INTERVAL of ScalarInterval in which the minimum and maximum ranges of INTERVAL have been rounded upwards to integer values.  For example, (RoundUpFn (Meter 2.5 5.2)) is (Meter 3 6).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'RoundDownFn', "(RoundDownFn QUANTITY) converts QUANTITY into one where the maximum and minimum ranges have been rounded downwards to integer values.  For example, (RoundDownFn (Meter 2.5)) denotes (Meter 2).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'RoundClosestFn', "(RoundClosestFn QUANTITY) converts QUANTITY into one where the maximum and minimum ranges have been rounded to the closest integer values.  For example,  (RoundClosestFn (Meter 2.41)) denotes (Meter 2),  (RoundClosestFn (Meter 2.7)) denotes (Meter 3), and (RoundClosestFn (Meter 1.6 4.2)) denotes  (Meter 2 4). If QUANTITY is exactly between two integers (that is, in the form integer+0.5), then it is rounded to the one that is even. So, (RoundClosestFn (Meter 2.5)) denotes (Meter 2), and (RoundClosestFn (Meter 7.5)) denotes (Meter 8). See also RoundUpFn, RoundDownFn.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'RemovalModuleSupportedPredicate-Specific', "The collection of all Predicates which are supported by some CycRemovalModule-Specific.  Sentences of the form (PRED . ARGS), where PRED is an instance of RemovalModuleSupportedPredicate-Specific, have special inference support.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'RemovalModuleSupportedPredicate-Generic', "The collection of all Predicates which are supported by some CycRemovalModule-Generic.  An assertion of the form (PRED . ARGS), where PRED is an instance of RemovalModuleSupportedPredicate-Generic, may affect the provability of sentences other than just sentences whose predicate is PRED.  This is what is meant by 'generic' in this sense.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'RemovalModuleSupportedCollection-Generic', "The collection of all Collections which are supported by some CycRemovalModule-Generic.  An assertion of the form (isa INS COL), where COL is an instance of RemovalModuleSupportedCollection-Generic, may affect the provability of sentences that do not mention COL explicitly.  In particular, it may affect the provability of sentences mentioning INS.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'RelaxArgTypeConstraintsForVariables', "A CanonicalizerDirective  (q.v.) that directs the CycCanonicalizer (specifically, the  CycWellFormednessChecker) to relax the argument-type constraints it usually imposes on variables.  For example, this canonicalizer directive  would allow the sentence `(and (isa ?X Collection) (isa ?X Individual))'  to be admitted, though it would otherwise be rejected as ill-formed due to  the mutually disjoint argument-type constraints (see ArgTypePredicate) on the positions occupied by the two occurrences of the variable `?X'.", 'CoreCycLImplementationMt', vStrDef).
exactlyAssertedEL_next(comment, 'RelationInstanceExistsFn', "(relationInstanceExists PRED THING COLL) says that THING stands in the relation PRED to some (not necessarily known) instance of the Collection COLL. (RelationInstanceExistsFn PRED THING COLL) denotes this instance of COLL.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'RelationExistsInstanceFn', "(relationExistsInstance PRED COLL THING) says that some (not necessarily known) instance INS of the Collection COLL stands in the relation PRED to THING. (RelationExistsInstanceFn PRED COLL THING) denotes INS.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'RelationExistsAllFn', "The predicate relationExistsAll states that for every instance of a collection, some other term exists in a certain relationship.  An arbitrary such term is a function of the instance, the predicate, the collection, and the type of the other term.  (RelationExistsAllFn TERM PRED DEP-COL INDEP-COL) allows one to denote this `arbitrary such term that so exists' in a named fashion.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'RelationAllExistsFn', "An IndeterminateTermDenotingFunction (q.v.) that is closely related to relationAllExists.  If both (relationAllExists PRED INDEP-COL DEP-COL) and (isa INDEP-INS INDEP-COL) hold,  then (PRED INDEP-INS (RelationAllExistsFn INDEP-INS PRED INDEP-COL DEP-COL) also holds.  Thus the term '(RelationAllExistsFn INDEP-INS PRED INDEP-COL DEP-COL)' \"indeterminately denotes\" some instance of DEP-COL that is related to INDEP-INS by PRED.  For instance, since (relationAllExists citizens Country Person) and (isa Malaysia Country) both hold, so does (citizens Malaysia (RelationAllExistsFn Malaysia citizens Country Person)).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, tRelation, "A specialization of MathematicalObject and the collection of all relations.  Each instance of Relation is a relation that can hold among one or more things, depending on whether the relation is unary, binary, ternary, or whatever (see arity and relationalArity).  A unary relation (such as unknownSentence) is a sort of degenerate case that holds of  certain individual things (in this case, all sentences that are unknown to Cyc).  A binary relation (such as likesAsFriend) relates one thing to another (in this case, it relates one sentient animal to another just in case the first likes the second).  A ternary relation relates certain triples of things.  And so on.  There are also relations of no particular fixed arity; see VariableArityRelation.\n<p>\nNames of relations can be used to construct sentences and other formulas.  More precisely, CycL terms that denote Relations can appear in the \"0th\" argument (or \"arg0\") position of a CycLFormula (q.v.), i.e. as the term immediately following the formula's opening parenthesis.\n<p>\nAn important subcollection of Relation is TruthFunction (q.v.), whose instances are intimately related to truth-values, as reflected in the fact that the CycL expressions that denote truth-functions can appear in the arg0 position of a CycLSentence; and a sentence (if quantificationally closed; see CycLClosedSentence), will generally be either true or false (with respect to a given context or interpretation).  The major subcollections of TruthFunction are Predicate, LogicalConnective, and Quantifier (qq.v.).\n<p>\nAnother important subcollection of Relation is Function-Denotational (q.v.), the collection of all functions.  A CycL term that denotes a function can appear in the arg0 position of a CycLNonAtomicTerm (q.v.).\n<p>\nSee also relationExtension and relationHoldsAmong.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'ReifiableFunction', "A specialization of Function-Denotational.   Each instance of ReifiableFunction is denoted by a CycL constant that can stand in the 0th (or \"arg0\") position in a CycLReifiableNonAtomicTerm  (q.v.).  For example, GovernmentFn is a reifiable function, so the term  `(GovernmentFn France)' is a reifiable non-atomic term (or \"NAT\").   And since this particular term actually _is_ reified in the Cyc Knowledge  Base, it is, more specifically, a CycLNonAtomicReifiedTerm (or \"NART\").   The NART `(GovernmentFn France)' is treated more or less the same as if  it were a CycL constant (named, say, `GovernmentOfFrance').  Similary, the constant for GovernmentFn can be applied to the constant (or other  reified or reifiable term) for _any_ instance of GeopoliticalEntity to form a reifiable NAT that denotes that region's government; and should this NAT appear in a sentence that is asserted to the KB, it will thereby become a NART. Note, however, that not all NATs are such that it is desireable that  they should become reified (i.e. become NARTs) if they appear in  assertions; for more on this see UnreifiableFunction.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'ReformulatorIrrelevantFORT', "The collection of Cyc FORTs that are not relevant to the reformulator.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'ReformulatorHighlyRelevantFORT', "The collection of Cyc FORTs that are highly relevant to the reformulator.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'ReformulatorHighlyRelevantFORT', "The collection of Cyc FORTs that are highly relevant to the reformulator.           An example of such a FORT would be one that is referenced in a large           number of reformulator rules in the KB (see intances of            CycLReformulationRulePredicate).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'ReformulatorDirectivePredicate', "The collection of Predicates which can affect the\nbehaviour of the CycLReformulator or its submodules.  When\nreformulator directive GAFs are asserted, they are only relevant to\nthe reformulator when it is reformulating expressions in the\nmicrotheory in which the directive is asserted, or a specMt thereof.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'ReformulationNeitherDirection', "A meta-property of a CycLReformulatorDirective,\nmeaning that no arg is to be interpreted as either the 'from' or 'to' arg.\nSee reformulationDirectionInMode for how this\ndirection can be used.", 'BaseKB', vStrMon).
exactlyAssertedEL_next(comment, 'ReformulationForwardDirection', "A meta-property of a CycLReformulatorDirective, meaning\nthat there exist two arguments in the directive such that the\nlower-numbered arg (e.g. arg1 for a binary predicate) is the 'from'\narg, the input to the reformulator, and that the higher-numbered arg\n(e.g. arg2 for a binary predicate) is the 'to' arg, the output of the\nreformulator.  Its semantics are more fully determined by context.\nThis is the default preferredReformulationDirection for\nreformulatorRules.  See reformulationDirectionInMode for how this\ndirection can be used.", 'BaseKB', vStrMon).
exactlyAssertedEL_next(comment, 'ReformulationBackwardDirection', "A meta-property of a CycLReformulatorDirective, meaning\nthat there exist two arguments in the directive such that the\nhigher-numbered arg (e.g. arg2 for a binary predicate) is the 'from'\narg, the input to the reformulator, and that the lower-numbered arg\n(e.g. arg1 for a binary predicate) is the 'to' arg, the output of the\nreformulator.  Its semantics are more fully determined by context.\nSee reformulationDirectionInMode for how this\ndirection can be used.", 'BaseKB', vStrMon).
exactlyAssertedEL_next(comment, 'ReflexiveBinaryPredicate', "The specialization of BinaryPredicate whose instances are reflexive relations.  A reflexive binary predicate relates anything that meets the predicate's argument constraints to that thing itself.  Typically, a reflexive predicate has precisely the same constraints on both of its argument-places.\n<p>\nMore precisely: a binary predicate <code>PRED</code> is an instance of ReflexiveBinaryPredicate if and only if both (i) for every <code>X</code> that satisfies the constraints on (i.e is an admittedArgument for) <i>both</i> argument-places of <code>PRED</code>, <code>(PRED X X)</code> holds and (ii) <code>PRED</code>'s two argument-places are \"co-satisfiable\" with respect to their (single-argument) type constraints (see cosatisfiableInArgs and NoteOnArgumentCosatisfiabilityRequirement).\n<p>\nInstances of ReflexiveBinaryPredicate include physicalParts, inRegion, genls, and equals.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'RealNumber', "The collection of real numbers; a specialization of both  IntervalOnNumberLine and ScalarPointValue (qq.v.).  Each  instance of RealNumber is a single point on the real number  line, which has no upper or lower bounds.  Specializations  of this collection include Integer, RationalNumber, and  NegativeNumber.  Note that RealNumber is also a specialization  of ComplexNumber (q.v.), and any instance of the former  constitutes a degenerate case of the latter, in that the value  along the real's \"imaginary axis\" is zero (cf. ImaginaryNumber).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'QuotientFn', "An instance of both BinaryFunction and EvaluatableFunction.  When applied to an instance DIVIDEND of ScalarInterval and an instance DIVISOR of ScalarInterval, QuotientFn returns an instance of ScalarInterval that is the result of dividing DIVIDEND by DIVISOR.  For example, (QuotientFn 24 6) is 4, (QuotientFn (Meter 3) (SecondsDuration 2)) is (MetersPerSecond 1.5) (i.e., 1.5 meters per second), and (QuotientFn (SecondsDuration 2) (Meter 3)) is ((PerFn SecondsDuration Meter) 0.6666666666666666) (i.e., 0.6666666666666666 seconds per meter).  Note that (QuotientFn DIVIDEND 0) is undefined for any instance DIVIDEND of ScalarInterval.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'Quote', "The symbol 'Quote' is used in CycL as a device for referring to particular CycL expressions, in much the same way that quotation marks are often used in English in order to \"mention\" (rather than simply \"use\") an English word or phrase.  (And in much the same way that single-quotes are used in the preceding sentence in order to refer to a particular CycL symbol.)  If <code>EXPR</code> is a CycL expression, the term <code>(Quote EXPR)</code> -- formed by writing 'Quote' followed by <code>EXPR</code> and enclosing the result in parentheses -- is interpreted as denoting <code>EXPR</code> itself, as opposed to whatever it is (if anything) that <code>EXPR</code> ordinarily denotes (i.e. what it denotes when not inside the scope of <code>Quote</code> or in a quotedArgument position).  For example, while the CycL constant <code>Plato</code> denotes a certain Greek philosopher, the compound expression <code>(Quote Plato)</code> denotes the term <code>Plato</code> itself.  Similarly, the expression <code>(Quote <b>?X</b>)</code> denotes the variable <code><b>?X</b></code>, and the expression <code>(Quote (isa Plato Philosopher))</code> denotes the sentence <code>(isa Plato Philosopher)</code>.\n<p>\n<code>Quote</code> is also used in conjunction with the symbol <code>EscapeQuote</code> (q.v.), as a device for making <i>general</i> statements about CycL expressions.  Let <code>EXPR = (E<sub>1</sub>...E<sub>n</sub>)</code> be a well-formed CycL expression whose <b>n</b> immediate constituents are the CycL expressions <code>E<sub>1</sub></code>, ..., and <code>E<sub>n</sub></code> (where <b>n</b> >= 1).  The expression \n<pre>\n  (Quote EXPR) = (Quote (E<sub>1</sub>...E<sub>n</sub>))\n</pre> \n-- consisting of the symbols <code>Quote</code>, <code>EXPR</code>, and a surrounding pair of parentheses -- is a term that denotes <code>EXPR</code>.  The expression (call it <i><b>EQ</b></i>) \n<pre>\n  (Quote (E<sub>1</sub>...(EscapeQuote E<sub>i</sub>) ...E<sub>n</sub>)\n</pre> \n(where 1 <= <b>i <= n</b>) is a term whose meaning is similar to <code>(Quote EXPR)</code>, except that any free occurrence of a variable in <code>E<sub>i</sub></code> remains free with respect to <b>EQ</b> as a whole.  If <code>E<sub>i</sub></code> contains no free variables, then <b>EQ</b> is a closed term (see CycLClosedDenotationalTerm) that denotes <code>EXPR</code>, and is equivalent to <code>(Quote EXPR)</code>.  If <code>E<sub>i</sub></code> does contain free variables, then <b>EQ</b> is an open term (see CycLOpenDenotationalTerm) in which exactly the same variables occur free; and any closed instantiation of <b>EQ</b> denotes the corresponding instantiation of <code>EXPR</code>.  (A <i>closed instantiation</i> of an open expression is any <i>closed</i> expression that results from simultaneously replacing each free occurrence of a variable in the open expression with some closed term, replacing any two occurrences of the same variable by the same closed term.)\n<p>\nFor a simple example, the variable <code><b>?X</b></code> occurs free in the term\n<pre>\n  (Quote (EscapeQuote (MotherFn <b>?X</b>)) ;\n</pre>\nand one instantiation of this is the closed term\n<pre>\n  (Quote (EscapeQuote (MotherFn Plato)) ,\n</pre>\nwhich denotes the non-atomic term <code>(MotherFn Plato)</code>.  \n<p>\nFor a more interesting example, consider a case where <i>some but not all</i> of the free variables in a term are quoted.  In the expression\n<pre>\n  (Quote (loves (EscapeQuote <b>?X</b>) <b>?Y</b>))\n</pre>\nonly <code><b>?X</b></code> occurs free -- the <code><b>?Y</b></code> is quoted. Thus this instantiation of the above:\n<pre>\n  (Quote loves (EscapeQuote Plato) <b>?Y</b>)\n</pre>\nis a closed term that denotes the <i>open</i> formula <code>(loves Plato <b>?Y</b>)</code>.  \n<p>\nNote that the sort of quotation done in the first example above can also be done -- and done more elegantly -- using just QuasiQuote instead of Quote and EscapeQuote.  But the sort of quotation done in the second example cannot be accomplished with QuasiQuote.\n<p>\nSee also QuasiQuote, EscapeQuote, denotes, quotedIsa, quotedArgument, NoteAboutQuotingInCycL, and NoteAboutSyncategorematicSymbols.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'QuintaryRelation', "The collection of all fixed-arity relations of arity 5 (see arity).  The most notable specializations of QuintaryRelation are QuintaryPredicate and QuintaryFunction (qq.v.).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'QuintaryPredicate', "A specialization of Predicate and QuintaryRelation.  QuintaryPredicate is the collection of all predicates whose arity (see arity) is 5.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'QuintaryFunction', "A specialization of both QuintaryRelation and Function-Denotational. An instance of Function-Denotational FUNC is an instance of QuintaryFunction if and only if FUNC has an arity of 5.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'QueryMt', "The instance of IndexicalConcept used specifically for referring to 'the microtheory in which this particular query is being run'.  This allows for a certain amount of reflection in queries, since it allows one to pose a query about the Microtheory of the very same Ask.  It is useful for cases where one wants to obtain certain facts about the context of an Ask without specifying anything more about that context.", 'BaseKB', vStrMon).
exactlyAssertedEL_next(comment, 'QuaternaryRelation', "The collection of all fixed-arity relations of arity 4 (see arity).  The most notable specializations of QuaternaryRelation are QuaternaryPredicate and QuaternaryFunction (qq.v.).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'QuaternaryPredicate', "A specialization of both QuaternaryRelation and Predicate.   QuaternaryPredicate is the collection of all predicates whose arity (see arity) is 4.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'QuaternaryFunction', "A specialization of both FixedArityFunction and QuaternaryRelation (qq.v.).  Each instance of QuaternaryFunction is a function that always takes four arguments at a time, i.e. has the arity (see arity) 4.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'QuasiQuote', "A quotation device for making general statements about CycL expressions.  QuasiQuote allows for any free variables occurring inside an expression to which it is applied to \"escape\" (i.e. remain free with respect to) the quotation.  It is thus similar in function to, though less flexible than, the combination of Quote and EscapeQuote (qq.v.).\n<p>\nTo be more precise: the syncategorematic symbol <code>QuasiQuote</code> is a device for allowing genuinely free variables to occur inside quoted expressions, in order that one may meaningfully \"quantify into\" such expressions and thereby <i>generalize</i> over them.  It can thus be instructively compared to the symbol <code>Quote</code> (q.v.), which is used to make statements about <i>particular</i> CycL expressions.  Let <code>EXPR</code> be a well-formed CycL expression.  The expression <code>(Quote EXPR)</code> -- consisting of the symbols <code>Quote</code>, <code>EXPR</code>, and a surrounding pair of parentheses -- is a term that denotes <code>EXPR</code>.  The expression <code>(QuasiQuote EXPR)</code> is a term whose meaning is similar to <code>(Quote EXPR)</code>, except that any free occurrence of a variable in <code>EXPR</code> remains free with respect to <code>(QuasiQuote EXPR)</code> as a whole.  If <code>EXPR</code> contains no free variables, then <code>(QuasiQuote EXPR)</code> is a closed term (see CycLClosedDenotationalTerm) that denotes <code>EXPR</code>, and is equivalent to <code>(Quote EXPR)</code>.  If <code>EXPR</code> contains any free occurrences of variables, then <code>(QuasiQuote EXPR)</code> is an open term (see CycLOpenDenotationalTerm) in which exactly the same variables occur free; and any closed instantiation of <code>(QuasiQuote EXPR)</code> denotes the corresponding instantiation of <code>EXPR</code>.  (A <i>closed instantiation</i> of <code>EXPR</code> is any closed expression that results from replacing each free occurrence of a variable in <code>EXPR</code> with some closed term, and replacing any two occurrences of the same variable by the same closed term.)\n<p>\nFor an example, the variable <code>?X</code> occurs free in the term\n<pre>\n  (QuasiQuote (MotherFn ?X)) ;\n</pre>\nand one instantiation of this is the closed term\n<pre>\n  (QuasiQuote (MotherFn Plato)) ,\n</pre>\nwhich denotes the non-atomic term <code>(MotherFn Plato)</code>.  And the (implicitly quantified) rule\n<pre>\n  (isa (QuasiQuote (MotherFn ?X)) CycLNonAtomicTerm)\n</pre>\nmeans, in effect, that any closed instantiation of the open term <code>(MotherFn ?X)</code> -- e.g. <code>(MotherFn Plato)</code> -- is a non-atomic term of CycL.\n<p>\nSee also denotes, quotedIsa, quotedArgument, NoteAboutQuotingInCycL, and NoteAboutSyncategorematicSymbols.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'QuantityConversionFn', "(QuantityConversionFn UNIT QUANTITY) converts QUANTITY into an equivalent quantity expressed using UNIT as the unit of measure.  For example, (QuantityConversionFn Inch (Foot-UnitOfMeasure 2)) denotes (Inch 24).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'Quantifier', "A specialization of SententialRelation and ScopingRelation (qq.v.).  Each instance of Quantifier takes as its arguments (at least) a variable (see CycLVariable) and a sentence (see CycLSentence-Assertible), and is used to make a certain kind of generic quantitative statement regarding the things that satisfy the sentence.  Typically, the variable VAR will occur free in the sentence SENT, and in the quantified sentence (QUANT VAR SENT ...) these occurrences of VAR are bound by that occurrence of QUANT.  (If VAR does not occur free in SENT, then the quantified sentence is a \"vacuous quantification\" that is equivalent to SENT by itself.  For the definitions of 'free' and 'bound' occurrences of variables, see ScopingRelation.)  For example, '(thereExists ?X (isa ?X Dog))' means that there exists at least one dog.  Other instances of Quantifier are forAll, thereExistExactly, thereExistAtLeast, and thereExistAtMost.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'ProblemSolvingCntxt', "A specialization of Microtheory.\nProblemSolvingCntxts are microtheories that are used to reason about \nparticular situations.  Queries posed in ProblemSolvingCntxts are\nexpected to draw -- via the genlMt relation -- on a large number\nof other microtheories.  A ProblemSolvingCntxt is usually created \nfor temporary use with a problem at hand, and is discarded after the \nproblem is dealt with.  In contrast, a GeneralMicrotheory (q.v.), e.g., \nis created for lasting use.  Specializations of ProblemSolvingCntxt \ninclude ParsingContext and ScenarioTestingMicrotheory.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'prettyString-Canonical', "(prettyString TERM STRING) means that STRING is the English word or expression (sequence of words) commonly used to refer to TERM.  The predicate prettyString is used by the code which generates CycL to English paraphrases, but its applicability is not restricted to this use.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'PredicateTypeByArity', "A collection of collections.  Each instance of PredicateTypeByArity is a collection of Predicates having the same arity.  Instances include UnaryPredicate, BinaryPredicate, and TernaryPredicate.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, tPred, "A specialization of TruthFunction (q.v.).  Each instance of Predicate is either a property of things (see UnaryPredicate) or a relationship holding between two or more things.  Like other truth-functions, predicates, or rather the expressions that represent or denote them, are used to form sentences.  More precisely, any CycL expression that denotes an instance of Predicate (and only such an expression) can appear in the \"0th\" (or \"arg0\") position (i.e. as the term following the opening parenthesis) of a CycLAtomicSentence (q.v.).  Important specializations of Predicate include UnaryPredicate, BinaryPredicate, TernaryPredicate, QuaternaryPredicate, and QuintaryPredicate.  Note that, despite its name, Predicate is a collection of <i>relations</i>, and not a collection of expressions that represent or denote such relations.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'PositiveInteger', "A specialization of Integer.  An instance INT of Integer is an instance of PositiveInteger just in case INT is an integer greater than 0.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'PlusFn', "A variable-arity MathematicalFunctionOnScalars that is an extension of the arithmetical operation of addition to measurable ScalarIntervals (q.v.) generally.  Where  <code>ADDEND1</code>, ..., and <code>ADDENDn</code> are pairwise numericallyComparable (q.v.), <code>(PlusFn ADDEND1 ... ADDENDn)</code> is the arithmetic sum of <code>ADDEND1</code>, ..., and <code>ADDENDn</code>.  For example, (PlusFn 2 3 4) is 9, and (PlusFn (Meter 1.5) (Meter 0.7)) is (Meter 2.2).\n<p>\nNote that the term <code>(PlusFn ADDEND1 ... ADDENDn)</code> is undefined if there are <code>ADDENDi</code> and <code>ADDENDj</code> (1 <code><= i,j <= n)</code> that are not comparable.  For example, <code>(PlusFn (MinutesDuration 1) (Meter 3))</code> is undefined, since (MinutesDuration 1) is a Time-Quantity and (Meter 3) is a Distance, and time-quantities are not comparable with distances.\n<p>\nFor subtraction, see DifferenceFn.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'PlusAll', "A NumericQuantifier function that takes a SetOrCollection and a UnaryFunction as its arguments. (PlusAll <b>SETORCOL FUNC</b>) is the result of adding up the results of successively applying <b>FUNC</b> to each element of <b>SETORCOL</b>.  For example:\n<pre>\n    (PlusAll (TheSet 4 9) SquareRootFn)\n  = (PlusFn (SquareRootFn 4) (SquareRootFn 9))\n  = (PlusFn 2 3)\n  = 5.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'PerFn', "A binary UnitOfMeasureDenotingFunction (q.v.) that takes two UnitOfMeasure (q.v.) functions and returns a UnitOfRatio (q.v.) composed of them.  <code>(PerFn UNIT1 UNIT2)</code> is a unit <code>RATIO-FN</code> for measuring the ratio of <code>UNIT1</code> units to <code>UNIT2</code> units.   That is, for any number or other NumericInterval <code>NUM</code>, <code>(RATIO-FN NUM)</code> = <code>(QuotientFn (UNIT1 NUM) (UNIT2 1))</code>.\n<p>\nFor example, (PerFn Meter SecondsDuration) is a UnitOfSpeed function that measures meters-per-second.  When applied to (e.g.) the integer 20, this unit-of-speed returns the particular Speed equal to\n<pre>\n  (QuotientFn (Meter 20) (SecondsDuration 1))\n</pre>\nor 20 meters-per-second.\n<p>\nNote that <code>UNIT1</code> and <code>UNIT2</code> must <i>not</i> be interconvertibleUnits (q.v.), or <code>(PerFn UNIT1 UNIT2)</code> is undefined.  Otherwise, <code>UNIT1</code> and <code>UNIT2</code> would effectively \"cancel each other out\", and the value returned by PerFn for those arguments would not be a UnitOfRatio.\n<p>\nSee also UnitProductFn.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'Percent', "A variable-arity MathematicalFunctionOnScalars (q.v.).  When applied to a number or other NumericInterval (pair of numeric-intervals), Percent returns the instance of IntervalOnNumberLine that is its argument (the interval between its two arguments) divided by 100.  For example (Percent 110) is 1.1, and (Percent 10 20) is (Unity 0.1 0.2): the interval between 0.1 and 0.2 inclusive.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'PartiallyCommutativeRelation', "An instance of RelationTypeByLogicalFeature (q.v.) and a specialization of AtLeastPartiallyCommutativeRelation.  Each instance  of PartiallyCommutativeRelation <code>PARTCOMRELN</code> is a predicate or function that is commutative in some, but not all, of its argument-places (see  commutativeInArgs).  More precisely, suppose for example that <code>PARTCOMRELN</code> is a predicate (function) that is commutative only in its odd-numbered  argument-places, and that <code>PARTCOMRELN</code> holds among (has the value <code>VAL</code> for) a given sequence of arguments <code>SEQ</code>.  It follows that <code>PARTCOMRELN</code> also holds among (has the same value <code>VAL</code> for) any other sequence <code>SEQ-PRIME</code> obtainable from <code>SEQ</code> by permuting some or all of the odd-numbered members of <code>SEQ</code> while keeping all of its even-numbered members fixed.\n<p>\nNote that <code>PARTCOMRELN</code> must  have an arity (see arity) of at least three and <i>cannot</i> be an instance of CommutativeRelation (as any instance of the latter is commutative in <i>all</i> of its argument-places).\n<p>\nInstances of PartiallyCommutativeRelation include pathsJoinAt, formsBorderBetween, and BlockOfStreetBetweenFn.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'October', "A specialization of CalendarMonth.  Each instance of October is the tenth month of a particular year in the GregorianCalendar (q.v.).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'November', "A specialization of CalendarMonth. Each instance of November is the eleventh month of a particular year in the GregorianCalendar (q.v.).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'NonNegativeScalarInterval', "A specialization of ScalarInterval.  An instance INTERVAL of ScalarInterval is also an instance of NonNegativeScalarInterval just in case INTERVAL is a non-negative number or quantity.  Instances of NonNegativeScalarInterval include all instances of NonNegativeNumber (q.v.), as well as non-negative quantities such as (Meter 212), (Kilogram 5), and (SecondsDuration 0).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'NonNegativeInteger', "NonNegativeInteger is the sub-collection of Integer that excludes the negative integers.  Each instance of NonNegativeInteger is a whole number greater than or equal to zero -- for example, 0, 1, 2, 3, ....", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'Multigraph', "An instance of PathSystemType-Structural and a subcollection of PathSystem.  Each instance of Multigraph is an instance of PathSystem in which the only points are nodes in the system and all paths are made of links (i.e., no intermediate points along links). Sometime such a system is called a graph or multi-graph in graph theory.  A Multigraph consists of nodes interconnected by links, with loops on single nodes allowed, and with multiple links between the same two nodes also allowed.  (For a graph with no parallel links and no loops, see SimpleGraph-GraphTheoretic.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'MtUnionFn', "(MtUnionFn . MTS) denotes the ProblemSolvingCntxt where each of MTS and all of their genlMts are relevant.  This microtheory effectively contains all of the assertions from all of MTS, regardless of any contradictions.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'MtTimeWithGranularityDimFn', "An unreifiable BinaryFunction that takes a TimeInterval and a TimeParameter and returns a TemporalMicrotheory.  <code>(ist (MtTimeWithGranularityDimFn INTERVAL PAR) ASSERTION)</code> holds just in case <code>ASSERTION</code> holds at <code>INTERVAL</code> to granularity <code>PAR</code>.  See also MtTimeDimFn.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'MtTimeDimFn', "An unreifiable UnaryFunction that takes a TimeInterval and returns a TemporalMicrotheory.  <code>(ist (MtTimeDimFn INTERVAL) ASSERTION)</code> holds just in case <code>ASSERTION</code> holds at <code>INTERVAL</code> to granularity Null-TimeParameter.  See also MtTimeWithGranularityDimFn.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'MtSpace', "(MtSpace MT-1 ... MT-N) denotes the microtheory whose set of domain assumptions is the union of the assertions true in each of MT-1 ... MT-N. Consequently, (MtSpace MT-1 ... MT-N) has each of MT-1 ... MT-N as one of its genlMts. Typically, but not always, there will be assertions true in (MtSpace MT-1 ... MT-N) that are not true in any of its genlMts. For example,\n<p>\n(MtSpace WorldHistoryMt (MtDim mtTimeIndex (YearFn 1790)))\n<p>\ndenotes the microtheory whose domain assumption are precisely those of the WorldHistoryMt (whose basic assumption is that we are in the context of actual world history) and those of the microtheory (MtDim mtTimeIndex (YearFn 1790)) (whose basic assumption is that 1790 is the present year -- see MtDim). The conjunction of these domain assumptions implies everything that is true in real world history in the year 1790. For example, these domain assumptions imply that (president UnitedStatesOfAmerica GeorgeWashington) is true. Consequently, this assertion is true in (MtSpace WorldHistoryMt (MtDim mtTimeIndex (YearFn 1790))).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'MonthOfYearType', "A collection of Collections.\nInstances of MonthOfYearType are the canonical subcollections of CalendarMonth.  There are twelve of these in the JulianCalendar; for example, September is the collection of all Septembers.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'MonotonicallyTrue', "An instance of CycHLTruthValue.  MonotonicallyTrue is the attribute of being indefeasibly true.", 'BaseKB', vStrDef).
exactlyAssertedEL_next(comment, 'MonotonicallyFalse', "An instance of CycHLTruthValue.  MonotonicallyFalse is the attribute of being indefeasibly false.", 'BaseKB', vStrDef).
exactlyAssertedEL_next(comment, 'Monday', "A collection of CalendarDays and an \ninstance of DayOfWeekType.  Monday is the collection of all \n(and only) mondays.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'ModuloFn', "A binary function that takes a scalar and a comparable (non-null) point-value scalar to another comparable scalar, ModuloFn is a generalization of a basic notion of modular arithmetic, broadened to apply to ScalarIntervals of all sorts.\n<p>\n(ModuloFn <code>SCALAR BASE</code>) is the value of <code>SCALAR</code> modulo <code>BASE</code>, determined as follows.  (i) If <code>SCALAR</code> and <code>BASE</code> are both positive or both negative values, <code>SCALAR-MOD-BASE</code> is the remainder left when <code>BASE</code> is successively subtracted from <code>SCALAR</code> (zero or more times) until the result is a value that is closer to the comparable null-value (see ScalarNullValue) than <code>BASE</code> is.  (ii) If <code>SCALAR</code> and <code>BASE</code> differ in their numeric signs, <code>SCALAR-MOD-BASE</code> is the remainder left when <code>BASE</code> is successively <i>added</i> to <code>SCALAR</code> (zero or more times) until the result is a value <i>whose numeric sign agrees with that of</i> <code>BASE</code> or is null, and which is closer to the comparable null-value than <code>BASE</code> is.  (iii) If <code>SCALAR</code> is already a null-value, <code>SCALAR-MOD-BASE</code> is just <code>SCALAR</code> itself.  \n<p>\nFor example, (ModuloFn 8 3) = 2, (ModuloFn (Meter 9) (Meter -4)) = (Meter -3), and (ModuloFn (Inch -12) (Inch -4)) = (Inch 0).\n<p>\nNote that in case (i) above, if the absolute value of <code>SCALAR</code> is any value lessThan the absolute value of <code>BASE</code>, <code>SCALAR-MOD-BASE</code> is equal to <code>SCALAR</code>.  In all cases, if <code>SCALAR</code> numericallyEquals <code>BASE</code>, <code>SCALAR-MOD-BASE</code> is the comparable null-value.  In all cases, the numeric sign of the returned value <code>SCALAR-MOD-BASE</code> agrees with that of <code>BASE</code> (unless the returned value is null).  Also note that <code>(ModuloFn SCALAR BASE)</code> is undefined if <code>SCALAR</code> and <code>BASE</code> are not numericallyComparable (q.v.), or if <code>BASE</code> is null. \n<p>\nIn practice, <code>BASE</code> will usually be a positive integral value, and both <code>SCALAR</code> and the returned value will often be integral as well (see ScalarIntegralValue).  Note that if <code>SCALAR</code> and <code>BASE</code> are given in <i>different</i> (but comparable) UnitOfMeasures (e.g. Meter and (Centi Meter)), the result returned by Cyc will be given in the same units as <code>BASE</code>.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'MinRangeFn', "An instance of both VariableArityRelation and EvaluatableFunction.  When applied to instances <code>QUANTITY1</code>, ..., <code>QUANTITYN</code>  of ScalarInterval, MinRangeFn yields an instance of ScalarInterval that is the largest interval subsumed by each of <code>QUANTITY1</code> through <code>QUANTITYN</code>.  \n<p>\nFor example, (MinRangeFn  (Meter 1 3) (Meter 2 4)) is (Meter 2 3). \n<p>\nNote that if one of the instances <code>QUANTITY1</code>, ..., <code>QUANTITYN</code> fails to intersect with at least one of the other instances, then the result of applying MinRangeFn to <code>QUANTITY1</code>, ..., <code>QUANTITYN</code> is undefined (for example, both (MinRangeFn (Meter 1 1.5) (Meter 2 4) (Meter 0 5)) and (MinRangeFn (SecondsDuration 3 5) (Meter 1 4)) are undefined).  See also MaxRangeFn.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'Minimum', "Computes the minimum of a unary function's values over all elements in a given set or collection.  That is, (Minimum SETORCOL FUNC) denotes the value of FUNC for the element ELEM of SETORCOL taken as argument (if any) such that (FUNC ELEM) is less than or equal to (FUNC OTHER) for any element OTHER of SETORCOL other than ELEM.  Note that (Minimum SETORCOL IdentityFn) denotes the minimum element of SETORCOL itself.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'MicrotheoryDesignatingRelation', "The collection of Relations which specify that a ELSentence-Assertible is to be interpreted in a given Microtheory.  It will be canonicalized and checked for well-formedness with respect to that microtheory. Each microtheory-designating relation has an argument which denotes a microtheory, and another argument which denotes a ELSentence-Assertible.  It may have other arguments as well. Use microtheoryDesignationArgnum and sentenceDesignationArgnum to specify these argument positions for each microtheory-designating relation.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'Microtheory', "A specialization of AspatialInformationStore and AbstractIndividual (qq.v.).  Each instance of Microtheory is an atemporal, aspatial, informational thing that represents a context in Cyc.  Each microtheory (or 'mt') serves to group a set of assertions together that share some common assumptions; the assertions in an mt constitute the content of that mt.  Note that each assertion in the Cyc knowledge base must be explicitly stated to be true in at least one microtheory.  Assertions stated to be true in one mt will also be true  (by inference) in more specialized mts that depend on the content of that mt.  For example, if something is true in the HumanSocialLifeMt (q.v.), then it should by default be true in the more specialized UnitedStatesSocialLifeMt (q.v.).  Specialized microtheories are related to the more general microtheories on which they depend by the predicate genlMt (q.v.).  Note that every query is made in some mt, and the answer one gets to a query depends on the mt in which it is asked, since the only assertions which can be used to answer a query in an mt are those  explicitly stated to be true in that mt, or in some more general mt.  See also the predicate ist, which is used to relate an assertion to the microtheories in which it is true.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'MeaningInSystemFn', "A reifiable BinaryFunction that returns the meaningful entities indexed by a particular character string in a Cyc-external information source. More precisely, (MeaningInSystemFn INFOSOURCE STRING), applied to the CharacterString STRING and the IndexedInformationSource INFOSOURCE, returns whatever is indexed by STRING in that system.  For example, (MeaningInSystemFn WordNet-1997Version \"N03585958\") returns the WordNet `synset' (`synonym set') represented by (rampart|bulwark|wall), meaning \"an embankment built around a space for defensive purposes\".\n<p>\nSTRING can have any format chosen by the person who builds the representation of the external system.  In addition, STRING may contain arbitrary further characters or information, depending on how the external information is selected and processed.  This function makes it possible to relate a concept in an external system to an arbitrarily complicated expression composed of Cyc concepts.  If the external concept has a direct, exact mapping to a single Cyc constant, then use the predicate synonymousExternalConcept rather than this function.  If there is correspondence only to one Cyc constant, but it is only approximate, use overlappingExternalConcept.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'May', "A specialization of CalendarMonth. Each instance of May is the fifth month of a particular year in the GregorianCalendar (q.v.).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'MaxRangeFn', "<code>(MaxRangeFn QUANTITY<sub>1</sub> ... QUANTITY<sub>N</sub>)</code> denotes a quantity which subsumes each of <code>QUANTITY<sub>1</sub></code> through <code>QUANTITY<sub>N</sub></code>.  For example, <code>(MaxRangeFn (Meter 1 3) (Meter 2 4))</code> denotes (Meter 1 4).  See also MinRangeFn.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'Maximum', "A NumericQuantifier.  Used to denote the maximum quantity which results from applying the function specified in the second argument to all of the elements of the set expression which appears in the first argument.--Rode 3/15/98", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'March', "A specialization of CalendarMonth. Each instance of March is the third month of a particular year in the GregorianCalendar (q.v.).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'LogicalTruthMt', "This is a microtheory which contains only the assertions required to represent the logical system used in the Cyc knowledge base.  In other words, these are the assertions in CycL which must be present in order to use CycL to represent logical truths.", 'BaseKB', vStrMon).
exactlyAssertedEL_next(comment, 'LogicalTruthImplementationMt', "This is a microtheory which contains only the assertions required for the Cyc theorem prover and its underlying HL representation of the EL to function properly.  In other words, these are the assertions in CycL which are required by Cyc in order to perform any logical inferences using CycL formulas.", 'BaseKB', vStrMon).
exactlyAssertedEL_next(comment, 'LogicalConnective', "A collection of mathematical objects, including the basic logical connectives.  Each instance of LogicalConnective is a Relation which takes one or more truth-valued expressions (sentences) as arguments and returns a truth-valued sentence.  The instances of LogicalConnective include and, or, not, and implies.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'LogFn', "A unary EvaluatableFunction that returns the natural logarithm of the number taken as its argument.  (LogFn NUM) is the exponent to which e is raised to get NUM (where e is E-LogarithmBase). Its inverse (cf. inverseQuantFunctions-Nonsymmetric) is ExpFn.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'List', "A specialization of Tuple.  Each instance of List is a  finite sequence of things with a first and last member-position, with each member-position other than the last having a successor member-position.   As with tuples generally, lists allow for repetition of their members, so that the same item can appear at multiple member-positions in the same list.  A list can be represented formally as a function from a finite index set of counting numbers, beginning with one, into the domain of all Things (but note that Lists are _not_ explicitly represented as functions in the Cyc ontology).  Unlike an instance of Series (q.v.), a list is purely abstract (i.e. both aspatial and atemporal), and the only implied relation between an item and its successor in a list is the successor relation of the list itself.  Technically, List is more specific than Tuple only in that the index set (see tupleIndexSet) for a given list must be the counting numbers in their usual order (or some initial segment thereof), whereas the index set for a tuple, generally speaking, might be any set whatsoever.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'LeaveVariablesAtEL', "A CanonicalizerDirective (q.v.) that directs the canonicalizer to refrain from canonicalizing ELVariables into HLVariables.\nA consequence of this is that any CycLAssertion that contains no HL variables, regardless of its form, will be treated by the canonicalizer as if it were a GAF (see CycLClosedAtomicSentence) as opposed to a rule.  Note that this will inhibit nat reification if there are variables within the scope of the reifiable function.", 'CoreCycLImplementationMt', vStrMon).
exactlyAssertedEL_next(comment, 'LeaveSomeTermsAtELAndAllowKeywordVariables', "A CanonicalizerDirective which combines the directives LeaveSomeTermsAtEL and AllowKeywordVariables.", 'CoreCycLImplementationMt', vStrMon).
exactlyAssertedEL_next(comment, 'LeaveSomeTermsAtELAndAllowKeywordVariables', "A  CanonicalizerDirective (q.v.) that is a specialization (see  genlCanonicalizerDirectives) of both LeaveSomeTermsAtEL and  AllowKeywordVariables (qq.v.), and thus combines the commands of both of those directives.", 'CoreCycLImplementationMt', vStrMon).
exactlyAssertedEL_next(comment, 'LeaveSomeTermsAtEL', "A CanonicalizerDirective (q.v.) that combines the following three commands:\n<p>\n(1) Do not canonicalize ELVariables into HLVariables.\n(2) Do not expand CycLFormulas whose operators are instances of ELRelation.\n(3) Do not reify CycLReifiableNonAtomicTerms.\n<p>\nA consequence of (1) is that any CycLAssertion that contains no HL variables, regardless of its form, will be treated by the canonicalizer as if it were a GAF (see CycLClosedAtomicSentence) as opposed to a rule.", 'CoreCycLImplementationMt', vStrMon).
exactlyAssertedEL_next(comment, 'KnowledgeBase', "A specialization of Database-AbstractContent. Each instance of KnowledgeBase is a database (considered as an abstract repository of information rather than a physical storage device) containing knowledge about at least part of the world.  A notable specialization of KnowledgeBase is CycKB, the collection of all Cyc knowledge bases.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'Kappa', "A binary PredicateDenotingFunction and a ScopingRelation (qq.v.), Kappa is used to define a predicate on the basis of a sentence (see CycLSentence-Assertible) and a list of variables (see CycLVariableList) some or all of which typically occur free in the sentence.  The resulting predicate holds of just those sequences that would make the sentence true.\n<p>\nMore precisely, if <code>VAR1,...,VAR<sub>N</sub></code> include all of the CycLVariables that occur free in <code>SENT</code>, then the term\n<pre>\n  (Kappa (VAR1 ... VAR<sub>N</sub>) SENT)\n</pre>\ndenotes the <code>N</code>-ary relation (i.e. the Predicate) that holds of any admitted sequence of arguments <code>ARG1...ARG<sub>N</sub></code> if and only if <code>SENT[ARG<sub>I</sub>/VAR<sub>I</sub>]</code> is true, where <code>SENT[ARG<sub>I</sub>/VAR<sub>I</sub>]</code> is the result of simultaneously replacing each free occurrence of <code>VAR<sub>I</sub></code> in <code>SENT</code> with a CycL name of the corresponding <code>ARG<sub>I</sub></code> (for 1 <= <code>I</code> <= <code>N</code>). \n<p>\n(With respect to the above, <code>ARG1...ARG<sub>N</sub></code> is an <i>admitted sequence of arguments</i> to <code>(Kappa (VAR1 ... VAR<sub>N</sub>) SENT)</code> just in case (i) each <code>ARG<sub>I</sub></code> satisfies any argument-type constraints applicable to the position(s) occupied by <code>VAR<sub>I</sub></code> in <code>SENT</code> and (ii) if any two variables <code>VAR<sub>I</sub></code> and <code>VAR<sub>J</sub></code> are the same then the corresponding sequence-members <code>ARG<sub>I</sub></code> and <code>ARG<sub>J</sub></code> are identical.)\n<p>\nA few examples.  (Kappa (<code>?X</code>) (greaterThan <code>?X</code> 1)) is a unary predicate that holds of all numbers greater than 1. (Kappa (<code>?X ?Y</code>) (greaterThan <code>?X</code> 1)) is a binary predicate that holds of any ordered pair of argument values whose first member is a number greater than 1. (Kappa (<code>?X</code>) (greaterThan 2 1)) is a unary predicate that holds of any thing.  (Kappa (<code>?X</code>) (greaterThan 1 2)) is a unary predicate that holds of no thing.  (Kappa (<code>?X ?X</code>) (greaterThan <code>?X 1</code>)) is a binary predicate that holds of any ordered pair of numbers whose first and second members are the same number <b>K</b>, where <b>K</b> is greater than 1.\n<p>\nMost of the above examples are uses of Kappa that have little utility.  The first example, however, is an example of a common and important use of Kappa, which is to reduce the arity of a predicate by fixing the value for one or more of its arguments. For example, (Kappa (<code>?COUNTRY ?RATE</code>) (exportRate <code>?COUNTRY</code> Oil <code>?RATE</code>)) defines a binary predicate that relates a country to its export rate of oil, whereas (Kappa (<code>?COUNTRY</code>) (exportRate <code>?COUNTRY</code> Oil (MillionBarrelsPerDay 2)))</code> defines a unary predicate that holds of any country that exports oil at the rate of two million barrels per day.\n<p>\nThe sentence that is an argument to Kappa may be arbitrarily complex.  For example, it may be an existentially quantified conjunction.  Thus,\n<pre>\n   (Kappa (?PERSON ?NAME)\n    (thereExists ?FATHER\n      (and\n        (isa ?PERSON Person)\n        (father ?PERSON ?FATHER)\n        (lastName ?FATHER ?NAME))\n</pre>\n<p>\nreturns a predicate that holds of any ordered pair <b><PERSON, NAME></b>, such that <b>PERSON</b> is a person whose father's last name is <b>NAME</b>.\n<p>\nSometimes it is useful to construct an expression of the form <code>(Kappa LIST SENT)</code> where some variables that occur free in <code>SENT</code> do <i>not</i> occur in <code>LIST</code>.  For example, <code>(Kappa (?X) (greaterThan ?X ?Y))</code> might be used in a context where the <code>?Y</code> appears within the scope of a quantifier that occurs outside of the Kappa expression.\n<p>\nKappa is a cousin of the function Lambda (q.v.), which is used to define a <i>function</i> on the basis of a list of variables and a non-logical term.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'June', "A specialization of CalendarMonth.  Each instance of June is the sixth month of a particular year in the GregorianCalendar (q.v.).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'July', "The collection of all Julys,\n the seventh month of the year in the GregorianCalendar.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'January', "A specialization of CalendarMonth.  Each instance of January is the first month of a particular year in the GregorianCalendar (q.v.).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'ist-Asserted', "A MicrotheoryDesignatingPredicate that is used to relate CycL sentences to microtheories in which they are explicitly asserted. (ist-Asserted MT SENT) states that there is a CycLAssertion for SENT in the Microtheory MT.  This predicate is therefore a more specialized form of ist (q.v.) with the additional requirement that there be an actual assertion for SENT in MT.\n<p>\nNote that the above is also more precise than (ist MT (knownSentence SENT)), which states that there is an assertion for SENT in some microtheory visible from (see genlMt) MT.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'IrreflexiveBinaryPredicate', "The collection of BinaryPredicates that are irreflexive.  A binary predicate <code>PRED</code> is an instance of IrreflexiveBinaryPredicate only if, for every <code>THING</code> that satisfies the single-argument type-constraints (i.e. argIsa and argGenls; see admittedArgument) on both of <code>PRED</code>'s argument-places, <code>(not (PRED THING THING))</code> holds.\n<p>\nTo rule out \"vacuous\" cases, there is an additional necessary condition for irreflexivity:  the constraints on <code>PRED</code>'s two argument-places must be co-satisfiable (see cosatisfiableInArgs).  Without this requirement, any binary predicate whose arguments were constrained in mutually-disjoint ways would trivially (and counterintuitively) count as irreflexive.  See NoteOnArgumentCosatisfiabilityRequirement\n<p>\nExamples of irreflexive binary predicates include spouse, causes-ThingProp, northOf, and temporallyDisjoint.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'IntervalMinFn', "<code>(IntervalMinFn SCALAR)</code> returns an interval of the same type as <code>SCALAR</code> whose minimum value is the minimum value of <code>SCALAR</code> and whose maximum value is PlusInfinity.  For example, (IntervalMinFn (Mile 3)) is the same as `the interval from three miles to an infinite number of miles', in other words, `at least three miles'.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'IntervalMaxFn', "<code>(IntervalMaxFn SCALAR)</code> returns an interval of the same type as <code>SCALAR</code> whose maximum value is the maximum value of <code>SCALAR</code> and whose minimum value is minus infinity.  For example, (IntervalMaxFn (Mile 3)) is the same as `the interval from negative infinity miles to three miles'. [Technical Note: if that expression were to denote a strictly absolute, as opposed to a relative-or-absolute, distance, then it would mean `the interval from 0 miles to 3 miles'.]   (IntervalMaxFn (Unity 1)) is the same as `the interval from negative infinity to 1', in other words, `no greater than one'.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'IntervalEntry', "An instance of Format (q.v.) that can be specified to hold of a given predicate with respect to a given argument-place (see argFormat), where the argument-place in question is one constrained (via argIsa) to instances of ScalarInterval.   (argFormat PRED N IntervalEntry) means that, for any particular way of fixing the other arguments to PRED besides the Nth, there may be more than one instance of ScalarInterval such that, if taken as the Nth argument, PRED holds of those arguments.  However, if there is more than one instance of ScalarInterval taken as the Nth argument in such a situation, it must be the case that each of the instances of ScalarInterval intersect one another (see quantityIntersects).  That is, if the sequences <... ARGN-1 ...>, <... ARGN-2 ...>, ..., <... ARGN-M ...> differ at most in their Nth items and each of (PRED ... ARGN-1 ...), (PRED ... ARGN-2 ...), ..., (PRED ... ARGN-M ...) holds, then for any distinct ARGN-K and ARGN-L, where K and L are greater than or equal to 1, and less than or equal to M, (quantityIntersects ARGN-K ARGN-L). For example, the format of volumeOfObject's second argument-place is IntervalEntry.", 'BaseKB', vStrDef).
exactlyAssertedEL_next(comment, 'InterArgIsaPredicate', "The subcollection of both InterArgTypePredicate and ArgIsaPredicate (qq.v.) whose instances are used to put conditional isa based argument-type constraints on polyadic relations in regards to two of their argument-places.  Each instance of InterArgIsaPredicate specifies, with respect to a given Relation, that one of its arguments (the \"dependent\" one) must be an instance of (isa) a certain collection, contingent upon another of its argument's (the \"independent\" one's) being an instance of a certain (possibly different) collection.  An inter-argument-isa predicate PRED has argument-places for designating the relation and the two collections serving as argument-types; the (numerically-specified) identities of the relation's corresponding dependent and independent arguments is in most cases fixed (as in interArgIsa1-2), but is in some cases variable and specified via two additional argument-places of PRED's (as in interArgIsa).  In cases of the former sort, where the relation's argument-places are fixed, PRED is a TernaryPredicate that takes as it first argument (or \"arg1\") a relation, as its arg2 the type specified for the relation's independent argument, and as its arg3 the type specified (contingently) for the dependent argument.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'interArgIsa5-4', "A ternary instance of InterArgIsaPredicate (q.v.).   (interArgIsa5-4 RELN INDEPENDENT-ARG-COL DEPENDENT-ARG-COL) means that,  when an instance of INDEPENDENT-ARG-COL appears as the fifth argument to RELN,  a necessary condition for semantic well-formedness is that the fourth argument  must be an instance of DEPENDENT-ARG-COL.  That is, if INST is an instance of INDEPENDENT-ARG-COL, then  (RELN ARG1 ARG2 ARG3 ARG4 INST ... ARGN) is semantically  well-formed only if ARG4 is an instance of DEPENDENT-ARG-COL.  For an explanation  of semantic well-formedness, see CycLExpression-Assertible and its direct  specializations.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'interArgIsa5-3', "A ternary instance of InterArgIsaPredicate (q.v.).   (interArgIsa5-3 RELN INDEPENDENT-ARG-COL DEPENDENT-ARG-COL) means that,  when an instance of INDEPENDENT-ARG-COL appears as the fifth argument to RELN,  a necessary condition for semantic well-formedness is that the third argument  must be an instance of DEPENDENT-ARG-COL.  That is, if ARG-INST is an instance of INDEPENDENT-ARG-COL, then  (RELN ARG1 ARG2 ARG3 ARG4 INST ... ARGN) is semantically well-formed  only if ARG3 is an instance of DEPENDENT-ARG-COL.  For an explanation of semantic  well-formedness, see CycLExpression-Assertible and its direct specializations.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'interArgIsa5-2', "A ternary instance of InterArgIsaPredicate (q.v.).   (interArgIsa5-2 RELN INDEPENDENT-ARG-COL DEPENDENT-ARG-COL) means that,  when an instance of INDEPENDENT-ARG-COL appears as the fifth argument to RELN,  a necessary condition for semantic well-formedness is that the second argument  must be an instance of DEPENDENT-ARG-COL.  That is, if INST is an instance of INDEPENDENT-ARG-COL, then  (RELN ARG1 ARG2 ARG3 ARG4 INST ... ARGN) is semantically well-formed  only if ARG2 is an instance of DEPENDENT-ARG-COL.  For an explanation of semantic  well-formedness, see CycLExpression-Assertible and its direct specializations.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'interArgIsa5-1', "A ternary instance of InterArgIsaPredicate (q.v.).   (interArgIsa5-1 RELN INDEPENDENT-ARG-COL DEPENDENT-ARG-COL) means that,  when an instance of INDEPENDENT-ARG-COL appears as the fifth argument to RELN,  a necessary condition for semantic well-formedness is that the first argument  must be an instance of DEPENDENT-ARG-COL.  That is, if INST is an instance of INDEPENDENT-ARG-COL, then  (RELN ARG1 ARG2 ARG3 ARG4 INST ... ARGN) is semantically  well-formed only if ARG1 is an instance of DEPENDENT-ARG-COL.  For an explanation  of semantic well-formedness, see CycLExpression-Assertible and its direct  specializations.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'interArgIsa4-5', "A ternary instance of InterArgIsaPredicate (q.v.).  \n(interArgIsa4-5 RELN INDEPENDENT-ARG-COL DEPENDENT-ARG-COL) means that, \nwhen an instance of INDEPENDENT-ARG-COL appears as the fourth argument to RELN, \na necessary condition for semantic well-formedness is that the fifth argument \nmust be an instance of DEPENDENT-ARG-COL.  That is, if INST is\nan instance of INDEPENDENT-ARG-COL, then \n(RELN ARG1 ARG2 ARG3 INST ARG5 ... ARGN) is semantically \nwell-formed only if ARG5 is an instance of DEPENDENT-ARG-COL.  For an explanation \nof semantic well-formedness, see CycLExpression-Assertible and its direct \nspecializations.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'interArgIsa4-3', "A ternary instance of InterArgIsaPredicate (q.v.).  \n(interArgIsa4-3 RELN INDEPENDENT-ARG-COL DEPENDENT-ARG-COL) means that, \nwhen an instance of INDEPENDENT-ARG-COL appears as the fourth argument to RELN, \na necessary condition for semantic well-formedness is that the third argument \nmust be an instance of DEPENDENT-ARG-COL.  That is, if INST is\nan instance of INDEPENDENT-ARG-COL, then \n(RELN ARG1 ARG2 ARG3 INST ... ARGN) is semantically well-formed only \nif ARG3 is an instance of DEPENDENT-ARG-COL.  For an explanation of semantic \nwell-formedness, see CycLExpression-Assertible and its direct specializations.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'interArgIsa4-2', "A ternary instance of InterArgIsaPredicate (q.v.).   (interArgIsa4-2 RELN INDEPENDENT-ARG-COL DEPENDENT-ARG-COL) means that,  when an instance of INDEPENDENT-ARG-COL appears as the fourth argument to RELN,  a necessary condition for semantic well-formedness is that the second argument  must be an instance of DEPENDENT-ARG-COL.  That is, if INST is an instance of INDEPENDENT-ARG-COL, then  (RELN ARG1 ARG2 ARG3 INST ... ARGN) is semantically well-formed only  if ARG2 is an instance of DEPENDENT-ARG-COL.  For an explanation of semantic  well-formedness, see CycLExpression-Assertible and its direct specializations.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'interArgIsa4-1', "A ternary instance of InterArgIsaPredicate (q.v.).  \n(interArgIsa4-1 RELN INDEPENDENT-ARG-COL DEPENDENT-ARG-COL) means that, \nwhen an instance of INDEPENDENT-ARG-COL appears as the fourth argument to RELN, \na necessary condition for semantic well-formedness is that the first argument \nmust be an instance of DEPENDENT-ARG-COL.  That is, if INST is\nan instance of INDEPENDENT-ARG-COL, then \n(RELN ARG1 ARG2 ARG3 INST ... ARGN) is semantically well-formed only \nif ARG1 is an instance of DEPENDENT-ARG-COL.  For an explanation of semantic \nwell-formedness, see CycLExpression-Assertible and its direct specializations.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'interArgIsa3-5', "A ternary instance of InterArgIsaPredicate (q.v.).  \n(interArgIsa3-5 RELN INDEPENDENT-ARG-COL DEPENDENT-ARG-COL) means that, \nwhen an instance of INDEPENDENT-ARG-COL appears as the third argument to RELN, \na necessary condition for semantic well-formedness is that the fifth argument \nmust be an instance of DEPENDENT-ARG-COL.  That is, if INST is\nan instance of INDEPENDENT-ARG-COL, then \n(RELN ARG1 ARG2 INST ARG4 ARG5 ... ARGN) is semantically \nwell-formed only if ARG5 is an instance of DEPENDENT-ARG-COL.  For an explanation \nof semantic well-formedness, see CycLExpression-Assertible and its direct \nspecializations.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'interArgIsa3-4', "A ternary instance of InterArgIsaPredicate (q.v.).  \n(interArgIsa3-4 RELN INDEPENDENT-ARG-COL DEPENDENT-ARG-COL) means that, \nwhen an instance of INDEPENDENT-ARG-COL appears as the third argument to RELN, \na necessary condition for semantic well-formedness is that the fourth argument \nmust be an instance of DEPENDENT-ARG-COL.  That is, if INST is\nan instance of INDEPENDENT-ARG-COL, then \n(RELN ARG1 ARG2 INST ARG4 ... ARGN) is semantically well-formed only \nif ARG4 is an instance of DEPENDENT-ARG-COL.  For an explanation of semantic \nwell-formedness, see CycLExpression-Assertible and its direct specializations.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'interArgIsa3-2', "A ternary instance of InterArgIsaPredicate (q.v.).   (interArgIsa3-2 RELN INDEPENDENT-ARG-COL DEPENDENT-ARG-COL) means that,  when an instance of INDEPENDENT-ARG-COL appears as the third argument to RELN,  a necessary condition for semantic well-formedness is that the second argument  must be an instance of DEPENDENT-ARG-COL.  That is, if INST is an instance of INDEPENDENT-ARG-COL, then  (RELN ARG1 ARG2 INST ... ARGN) is semantically well-formed only  if ARG2 is an instance of DEPENDENT-ARG-COL.  For an explanation of semantic  well-formedness, see CycLExpression-Assertible and its direct specializations.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'interArgIsa3-1', "A ternary instance of InterArgIsaPredicate (q.v.).   (interArgIsa3-1 RELN INDEPENDENT-ARG-COL DEPENDENT-ARG-COL) means that,  when an instance of INDEPENDENT-ARG-COL appears as the third argument to RELN,  a necessary condition for semantic well-formedness is that the first argument  must be an instance of DEPENDENT-ARG-COL.  That is, if INST is an instance of INDEPENDENT-ARG-COL, then  (RELN ARG1 ARG2 INST ... ARGN) is semantically well-formed only  if ARG1 is an instance of DEPENDENT-ARG-COL.  For an explanation of semantic  well-formedness, see CycLExpression-Assertible and its direct specializations.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'interArgIsa2-5', "A ternary instance of InterArgIsaPredicate (q.v.).  \n(interArgIsa2-5 RELN INDEPENDENT-ARG-COL DEPENDENT-ARG-COL) means that, \nwhen an instance of INDEPENDENT-ARG-COL appears as the second argument to RELN, \na necessary condition for semantic well-formedness is that the fifth argument \nmust be an instance of DEPENDENT-ARG-COL.  That is, if INST is\nan instance of INDEPENDENT-ARG-COL, then \n(RELN ARG1 INST ARG3 ARG4 ARG5 ... ARGN) is semantically \nwell-formed only if ARG5 is an instance of DEPENDENT-ARG-COL.  For an explanation \nof semantic well-formedness, see CycLExpression-Assertible and its direct \nspecializations.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'interArgIsa2-4', "A ternary instance of InterArgIsaPredicate (q.v.).  \n(interArgIsa2-4 RELN INDEPENDENT-ARG-COL DEPENDENT-ARG-COL) means that, \nwhen an instance of INDEPENDENT-ARG-COL appears as the second argument to RELN, \na necessary condition for semantic well-formedness is that the fourth argument \nmust be an instance of DEPENDENT-ARG-COL.  That is, if INST is\nan instance of INDEPENDENT-ARG-COL, then \n(RELN ARG1 INST ARG3 ARG4 ... ARGN) is semantically well-formed only \nif ARG4 is an instance of DEPENDENT-ARG-COL.  For an explanation of semantic \nwell-formedness, see CycLExpression-Assertible and its direct specializations.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'interArgIsa2-3', "A ternary instance of InterArgIsaPredicate (q.v.).  \n(interArgIsa2-3 RELN INDEPENDENT-ARG-COL DEPENDENT-ARG-COL) means that, \nwhen an instance of INDEPENDENT-ARG-COL appears as the second argument to RELN, \na necessary condition for semantic well-formedness is that the third argument \nmust be an instance of DEPENDENT-ARG-COL.  That is, if INST is\nan instance of INDEPENDENT-ARG-COL, then \n(RELN ARG1 INST ARG3 ... ARGN) is semantically well-formed only \nif ARG3 is an instance of DEPENDENT-ARG-COL.  For an explanation of semantic \nwell-formedness, see CycLExpression-Assertible and its direct specializations.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'interArgIsa2-1', "A ternary instance of InterArgIsaPredicate (q.v.).   <code>(interArgIsa2-1 RELN INDEPENDENT-ARG-COL DEPENDENT-ARG-COL)</code> means that,  when an instance of <code>INDEPENDENT-ARG-COL</code> appears as the second argument to <code>RELN</code>,  a necessary condition for semantic well-formedness is that the first argument  must be an instance of <code>DEPENDENT-ARG-COL</code>.  That is, if <code>INST</code> is an instance of <code>INDEPENDENT-ARG-COL</code>, then <code>(RELN ARG1 INST ... ARGN)</code>  is semantically well-formed only if <code>ARG1</code> is an instance of <code>DEPENDENT-ARG-COL</code>. For an explanation of semantic well-formedness, see CycLExpression-Assertible  and its direct specializations.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'interArgIsa1-5', "A ternary instance of InterArgIsaPredicate (q.v.).  \n(interArgIsa1-5 RELN INDEPENDENT-ARG-COL DEPENDENT-ARG-COL) means that, \nwhen an instance of INDEPENDENT-ARG-COL appears as the first argument to RELN, \na necessary condition for semantic well-formedness is that the fifth argument \nmust be an instance of DEPENDENT-ARG-COL.  That is, if INST is\nan instance of INDEPENDENT-ARG-COL, then \n(RELN INST ARG2 ARG3 ARG4 ARG5 ... ARGN) is semantically \nwell-formed only if ARG5 is an instance of DEPENDENT-ARG-COL.  For an explanation \nof semantic well-formedness, see CycLExpression-Assertible and its direct \nspecializations.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'interArgIsa1-4', "A ternary instance of InterArgIsaPredicate (q.v.).  \n(interArgIsa1-4 RELN INDEPENDENT-ARG-COL DEPENDENT-ARG-COL) means that, \nwhen an instance of INDEPENDENT-ARG-COL appears as the first argument to RELN, \na necessary condition for semantic well-formedness is that the fourth argument \nmust be an instance of DEPENDENT-ARG-COL.  That is, if INST is\nan instance of INDEPENDENT-ARG-COL, then \n(RELN INST ARG2 ARG3 ARG4 ... ARGN) is semantically well-formed only \nif ARG4 is an instance of DEPENDENT-ARG-COL.  For an explanation of semantic \nwell-formedness, see CycLExpression-Assertible and its direct specializations.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'interArgIsa1-3', "A ternary instance of InterArgIsaPredicate (q.v.).  \n(interArgIsa1-3 RELN INDEPENDENT-ARG-COL DEPENDENT-ARG-COL) means that, \nwhen an instance of INDEPENDENT-ARG-COL appears as the first argument to RELN, \na necessary condition for semantic well-formedness is that the third argument \nmust be an instance of DEPENDENT-ARG-COL.  That is, if INST is\nan instance of INDEPENDENT-ARG-COL, then \n(RELN INST ARG2 ARG3 ... ARGN) is semantically well-formed only \nif ARG3 is an instance of DEPENDENT-ARG-COL.  For an explanation of semantic \nwell-formedness, see CycLExpression-Assertible and its direct specializations.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'interArgIsa1-2', "A ternary instance of InterArgIsaPredicate (q.v.).  <code>(interArgIsa1-2 RELN INDEPENDENT-ARG-COL DEPENDENT-ARG-COL)</code> means that, when an instance of <code>INDEPENDENT-ARG-COL</code> appears as the first argument to <code>RELN</code>, a necessary condition for semantic well-formedness is that the second argument must be an instance of <code>DEPENDENT-ARG-COL</code>.  That is, if <code>INST</code> is an instance of <code>INDEPENDENT-ARG-COL</code>, then <code>(RELN INST ARG2 ... ARGN)</code> is semantically well-formed only if <code>ARG2</code> is an instance of <code>DEPENDENT-ARG-COL</code>.\n<p>\nFor example, (interArgIsa1-2 performedBy PurposefulAction IntelligentAgent) means that, if <code>ACT</code> is a purposeful action, then (performedBy <code>ACT AGENT</code>) is semantically well-formed only if <code>AGENT</code> is an intelligent agent.  For an explanation of semantic well-formedness, see  CycLExpression-Assertible and its direct specializations.  See interArgIsa for a similar but more general predicate that is quintary, allowing the user to specify the positions of the independent and dependent arguments.\n<p>\nUse interArgCondIsa1-2 to conclude that arg2 is an instance of <code>DEPENDENT-ARG-COL</code> instead of having that as a constraint.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'interArgGenl1-2', "(interArgGenl1-2 REL INDEPENDENT-COL DEPENDENT-COL) means that, when a spec of INDEPENDENT-COL appears as the first argument to REL, the second argument is constrained to be a spec of DEPENDENT-COL.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'InterArgFormatPredicate', "The subcollection of both InterArgConstraintPredicate and ArgFormatPredicate (qq.v.) whose instances are used to specify, for a given predicate PRED, a certain Format requirement on one of PRED's arguments (the \"dependent\" one), contingent upon one (usually, but not always, a different one) of PRED's arguments (the \"independent\" one) being an instance of (isa) a certain collection.  Currently, each instance of InterArgFormatPredicate is ternary, where its first argument (or \"arg1\") is the predicate PRED upon which the constraint is being placed, its arg2 the collection serving as the isa condition on PRED's independent argument, and its arg3 the Format that PRED's dependent argument is (conditionally) constrained to have.  The (numerically-specified) identities of the arguments of PRED's that are to serve as the independent and dependent arguments are fixed for each instance of \nInterArgFormatPredicate.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'interArgFormat1-2', "An instance of InterArgFormatPredicate (q.v.).\n(interArgFormat1-2 PRED COL FORMAT) means that FORMAT is a Format (q.v.)\nrequirement for the second argument-place of PRED when PRED's first argument\nis an instance of COL.  That is, with respect to a sentence of the form \n(PRED ARG1 ARG2 ... ARGN) in which ARG1 is an instance of COL, PRED's arg2\nposition (i.e. the position occupied by the metavariable `ARG2' in the \npreceding sentence-form) is subject to FORMAT.  See Format and its instances \nfor further explanation.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'Integer', "A specialization of RationalNumber.  Each instance of Integer is a whole number with no fractional remainder.  An integer may be positive (e.g. 42), zero, or negative (e.g. -42).\n<p>\nNote that, in the KB browser, a fixed- or floating-point number representation such as `42.00' should not be assumed to refer to the integer 42. For it might only appear to correspond to that integer within the tolerance of its representation, and might in fact be an approximation to a non-integer number such as 42.0003.\n<p>\nAlso note that, unlike Integer, SubLInteger (q.v.) is a collection of integer-denoting expressions in the SubL programming language rather than a collection of integers themselves. Still, (genls SubLInteger Integer) holds, but only under a special interpretation of genls forced by the fact that SubLInteger is a quotedCollection (q.v).)", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'InferenceSupportedTerm', "The collection of all CycLTerms that are supported in some way by the CycInferenceEngine.  This support may be provided by, for example, a CycHLModule or an evaluationDefn.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'InferenceSupportedPredicate', "The collection of all Predicates that are supported in some way by the CycInferenceEngine.  This support may be provided by, for example, a CycHLModule or an evaluationDefn.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'InferenceSupportedFunction', "The collection of all Function-Denotationals that are supported in some way by the CycInferenceEngine.  This support may be provided by, for example, an evaluationDefn.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'InferenceSupportedCollection', "The collection of all CycL terms that denote collections, where these terms are supported in some way by the CycInferenceEngine.  If a term T denoting the collection COL is an InferenceSupportedCollection, this means that the inference engine treats instances of COL specially.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'InferenceRelatedBookkeepingPredicate', "A collection of predicates.  Each instance of InferenceRelatedBookkeepingPredicate is a predicate involved in assertions used by the Cyc application to direct inferencing.  Examples: defnIff, defnSufficient, termOfUnit, afterAdding.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'InferencePSC', "A problem solving context in which all assertions in the entire KB are initially visible.  However, down each inference path, the chain of microtheories used is required to have some common descendent microtheory which is capable of inheriting all of the microtheories in the chain.  Thus, queries made in InferencePSC in effect compute locations in the space of microtheories in which the query is satisfiable.  This context is used internally by the inference engine for certain recursive calls to itself, including forward inference.  See also EverythingPSC.", 'BaseKB', vStrMon).
exactlyAssertedEL_next(comment, 'Individual', "Individual is the collection of all individuals:  things that are <i>not</i> sets or collections.  Individuals might be concrete or abstract, and include (among other things) physical objects, events, numbers,  relations, and groups.  An instance of Individual might have parts or  structure (including discontinuous parts); but <i>no</i> individual has elements  or subsets (see elementOf and subsetOf). Thus, an individual that has parts (e.g. physicalParts or groupMembers) is <i>not</i> the same thing as either the set or the collection containing those same parts.  For example, your car is an individual, but the collection of all the parts of your car is not an individual but an instance of Collection.  This collection (unlike the car itself) is abstract: it doesn't have a location, mass, or a top speed; but it does have instances, subcollections, and supercollections.  In partial contrast, the Group (q.v.) of parts of your car (while also not the same thing as the car itself) <i>is</i> an individual that has location and mass.  Another example: A given company, the group consisting of all the company's employees, the collection of those employees, and the set of those employees are four distinct things, and only the first two are individuals.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'IndeterminateTermDenotingFunction', "IndeterminateTermDenotingFunction is the collection of all functions that denote indeterminate terms.  See also IndeterminateTerm, SkolemTerm, and SkolemFunction.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'IndeterminateTerm', "A specialization of CycLClosedDenotationalTerm.  Each instance of IndeterminateTerm is a CycL symbol for which, in oreder to establish its denotation, it is not sufficient to establish every aspect of the context of its use.\n<p>\nIn other words, instances of this collection are terms used to denote something which is known or assumed to exist, but whose precise identity -- i.e. which particular thing or things it is -- is unknown (unless, of course, the term is known to satisfy equals with another term whose precise identity is known).\n<p>\nFor instance, if Cyc knows (relationAllExists physicalExtent University SchoolCampus), and (isa MelbourneUniversity University), then Cyc knows that there is at least one instance of SchoolCampus, <i>IndeterminateCampus</i>, for which (physicalExtent MelbourneUniversity <i>IndeterminateCampus</i>) is true. This campus (or these campuses, if there happens to be more than one) would be denoted in CycL using the IndeterminateTerm:\n<p>\n(RelationAllExistsFn MelbourneUniversity physicalExtent University SchoolCampus).\n<p>\nAnalogously, instances of SkolemTerm are also instances of IndeterminateTerm, as are terms built from SomeFn, GenericInstanceFn, ArbitraryInstanceFn, et al (see the specialization NonSkolemIndeterminateTerm).", 'BaseKB', vStrMon).
exactlyAssertedEL_next(comment, 'HypotheticalContext', "A MicrotheoryType.  Each instance of  HypotheticalContext consists of assertions that are posited strictly for the purpose of exploring their consequences, without alleging their actual truth.   A hypothetical context can be used to analyze hypothetical outcomes of actions or to examine the hypothetical consequences of assuming some theory to be true.  Also, various alternative choices might be asserted, each in its own hypothetical context, so their ramifications can be generated and compared.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'HumanCyclist', "A specialization of Cyclist and Person.  Each instance of  HumanCyclist is a person who is entitled to inspect and modify the Cyc knowledge base.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'HLPrototypicalTerm', "The collection of all CycLTerms that are the hlPrototypicalInstance of some collection.  All HLPrototypicalTerms are IndeterminateTerms.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'HLExternalIDString', "HLExternalIDString is the collection of all SubLStrings\nwhich represent valid external ID strings for CycLExpressions.\nMembership in this collection is determined for given strings by\nevaluation of the underlying SubL code which implements the object to\nID mapping.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'Guest', "An instance of HumanCyclist.  A Cyc user logged in                            \nas `Guest' will be able to browse the Cyc knowledge base to some extent, but will not have full rights to inspect and modify it.", 'BaseKB', vStrDef).
exactlyAssertedEL_next(comment, 'genls-SpecDenotesGenlInstances', "An instance of TaxonomicSlotForCollections (q.v.) and a specialization of generalizations. genls-SpecDenotesGenlInstances relates a collection (see Collection) to those collections which denote instances of it. More precisely, (genls-SpecDenotesGenlInstances SUBCOL SUPERCOL) means that SUPERCOL is a quoted supercollection of SUBCOL: anything that is quoted instance of (see quotedIsa) SUBCOL is an instance (see isa) of SUPERCOL. For example, (genls-SpecDenotesGenlInstances List-Extensional List) holds.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'genls-GenlDenotesSpecInstances', "A instance of TaxonomicSlotForCollections (q.v.) and a specialization of generalizations. genls-GenlDenotesSpecInstances relates a given SubLExpressionType collection (see Collection) to those collections whose instances it denotes. More precisely, (genls-GenlDenotesSpecInstances SUBCOL SUPERCOL) means that SUBCOL is a quoted subcollection of SUPERCOL: anything that is an instance of (see quotedIsa) SUBCOL is a quoted instance (see isa) of SUPERCOL.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'FunctionToArg', "A binary FunctionDenotingFunction (q.v.) that takes as argument a FunctionalPredicate (and an integer indicating an argument-place in which that predicate is functional) and returns the corresponding function (whose value is always equal to the predicate's corresponding argument in the indicated place).\n<p>\nMore precisely: if <code>PRED</code> is an <code>N</code>-ary functional predicate that is functional in its <code>M</code>th argument (see functionalInArgs), then <code>(FunctionToArg M PRED)</code> is the (<code>N</code>-1)-ary function <code>FUNC-TO-ARGM</code> such that <code>(PRED ARG(1) ... ARG(N))</code> holds if and only if <code>(FUNC-TO-ARGM ARG(1) ... ARG(M-1) ARG(M+1) ... ARG(N)) = ARG(M)</code>.  If <code>PRED</code> is not functional in its <code>M</code>th argument, then <code>(FunctionToArg PRED M)</code> is undefined.\n<p>\nFor example, (FunctionToArg 2 age) is the function that returns the age of a given person.  Thus ((FunctionToArg 2 age) GeorgeWBush) = (YearsDuration 50) just in case (age GeorgeWBush (YearsDuration 50)) is true.\n<p>\nSee also Lambda and Kappa.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, tFunction, "A specialization of Relation (q.v.) and the collection of all functions.  Each instance of Function-Denotational is a many-one relation that represents, with respect to any given context, a mapping from one set of things (the function's relationDomain) to another set of things (its relationRange).  As a many-one relation, a function maps each thing in its domain to exactly one thing in its range.  A function might be unary, binary, ternary, etc. (see arity; but cf. relationalArity), depending on whether the members of its domain are singletons, ordered pairs, ordered triples, etc.  In general, the domain of an N-ary function with respect to a given context is a set of ordered N-tuples (construed in CycL as Lists of length N).  The function is said to take the items from any of these N-tuples as its N <i>arguments</i> and to return a member of its range as its corresponding <i>value</i> (see valueOfFunctionForArgs).  There are also functions that are not of any particular fixed arity; see VariableArityFunction.\n<p>\nFor example, GovernmentFn is the unary function that takes each GeopoliticalEntity to its RegionalGovernment, and PlusFn is the variable-arity function that takes any sequence of two or more ScalarIntervals\n(q.v.) to their arithmetic sum.\n<p>\nNote that the domain and range (i.e. the extension) of a given function might vary from context to context.  For example, as the government of a country can change over time, GovernmentFn will in such cases map the same country to different governments with respect to different times.  Thus, an instance of Function-Denotational is closer to what is sometimes called a \"function-in-intension\" than to the purely set-theoretical notion of a \"function-in-extension\".\n<p>\nCycL terms that denote functions can be used to form non-atomic terms (or \"NATs\"; see CycLClosedNonAtomicTerm).  Specifically, when such a function-denoting expression is appropriately combined with other expressions (i.e. the former is in the 0th argument position and the latter are of the correct number and type) the resulting expression is a new CycL term (a NAT) that may then freely appear as a component in other CycL expressions.  The NAT will itself denote the value (if any) of the function denoted by the former expression for the sequence of arguments denoted, respectively, by the latter expressions.  For example, GovernmentFn is a unary function, and so the CycL constant 'GovernmentFn' requires one syntactic argument (such as the constant 'France') to form a NAT (in this case, the expression '(GovernmentFn France)').  This NAT, which denotes the government of France, can in turn serve as a syntactic argument in any CycL expression in which a term for an instance of RegionalGovernment can legally occur.\n<p>\nImportant subcollections of Function-Denotational include IndividualDenotingFunction (whose instances always return instances of Individual), CollectionDenotingFunction, SetDenotingFunction, and FunctionDenotingFunction (which is itself a subcollection of the first).  NATs formed using terms that denote instances of FunctionDenotingFunction denote instances of Function-Denotational themselves.  Thus, like most other things, functions can be denoted in CycL either by constants  (e.g. 'GovernmentFn') or -- although this is less common -- by NATs (e.g.  '(FunctionToArg 2 biologicalMother)').\n<p>\nAn important partition of Function-Denotational is into TotalFunction and PartialFunction (qq.v.).\n<p>\nNote that Function-Denotational does not include any of the so-called TruthFunctions (q.v.): Predicates, Quantifiers, or LogicalConnectives. For these relations (as construed in CycL) are not really functions at all, even though it can be heuristically useful to think of them as if they were functions from sequences of arguments to truth values.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'Friday', "A collection of CalendarDays and an \ninstance of DayOfWeekType.  Friday is the collection of all \n(and only) fridays.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'Forward-AssertionDirection', "An instance of CycLAssertionDirection (q.v.).  A CycL assertion that\nhas the Forward-AssertionDirection can be used in inferences carried \nout at the time the assertion is added to the Knowlege Base as well as \nthose carried out at when a query is asked.  This is the default direction \nfor ground atomic assertions (see CycLClosedAtomicSentence).  Contrast \nwith Backward-AssertionDirection and Code-AssertionDirection.  Also \nsee assertionDirection.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'FormulaArityFn', "An instance of EvaluatableFunction.  When applied to a CycLFormula FORM, FormulaArityFn returns the number of arguments given to the relation (an instance of Relation (q.v.)) appearing in the initial (\"arg0\") argument place of FORM.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'FormulaArgSetFn', "(FormulaArgSetFn RELATION-EXPRESSION) denotes\na set of the arguments of the given CycLFormula RELATION-EXPRESSION.  For example, (FormulaArgSetFn (genls Dog Animal)) denotes (TheSet Dog Animal).  See also FormulaArgFn and FormulaArityFn.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'FormulaArgListFn', "(FormulaArgListFn RELATION-EXPRESSION) denotes a list of the arguments in RELATION-EXPRESSION.  For example, (FormulaArgListFn (genls Dog Animal)) denotes (TheList Dog Animal).  See also FormulaArgFn and FormulaArityFn.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'FormulaArgFn', "A binary function that returns an instance of CycLTerm when given an instance of NonNegativeInteger and an instance of CycLFormula as arguments.  (FormulaArgFn N RELATION-EXPRESSION) denotes the term appearing as the Nth argument within RELATION-EXPRESSION. (Note that RELATION-EXPRESSION may be a sentence or a NAT). For example:\n<p>\n(FormulaArgFn 2 (loves Gilbert Muffet)) and\n(FormulaArgFn 1 (BirthFn Muffet))\n<p>\nboth denote Muffet. Cf. ArgPositionFn.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'Format', "A collection of argument entry-formats that can be  specified for Predicates with respect to particular argument-places (see argFormat).  An argument entry-format is a kind of restriction on  a predicate regarding how many things, or the range of things, that the  predicate holds of with respect to a given one of its argument-places.  More  precisely: given any particular way of fixing the arguments in the rest of  the predicate's argument-places, the entry-format tells us something about  the number of different things, or the range of things, that can occupy the  given argument-place such that the relation holds of those arguments.  That is, supposing the given argument-place is the Nth, the entry-format tells us  something about the number or range of different sequences of arguments  of which the predicate holds and that differ from each other only in their Nth items.  For example, the format SingleEntry (q.v.) is used to state  that in every case there is at most only one such sequence, the format  SetTheFormat (q.v.) to state that there is no particular (upper or lower)  limit to the number of such sequences that applies to every case, and the  format IntervalEntry (q.v.) to state that the Nth items of any two such  sequences must be ScalarIntervals that \"intersect\" (see quantityIntersects). Thus, the first argument-place of biologicalMother has the format (see  arg1Format) SetTheFormat, since a given female animal might have any  number (including zero) of offspring; but the second argument-place of  this predicate has (see arg2Format) SingleEntry format, since any  given animal has at most (in fact, exactly) one biological mother.  And  the format of the second argument-place of bodyTemperature is IntervalEntry because, while a given creature (at a given moment in time) has a single  exact (see ScalarPointValue) body temperature, we want the predicate bodyTemperature to be flexible enough to allow us to specify this  temperature with varying degrees of precision (e.g. as \"98.6 degrees Fahrenheit\" or as \"between 98 and 99 degrees\" or as \"less than 100 degrees\").  See the various instances of Format for further details.  See also ArgFormatPredicate.  Note that, in contrast with what ArgTypePredicates  are used for, specifying an argument entry-format for a predicate does  _not_ impose any sort of necessary condition for semantic well-formedness.   A violation of a legitimate entry-format constraint necessarily involves  two or more statements, and at least one them must be _untrue_;  but there is no implication that any of them is malformed.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'FOL-TermFn', "(FOL-TermFn TERM) denotes a first-order constant symbol\nbased on the CycL term TERM.  For example, (FOL-TermFn Dog)\ndenotes a first-order term based on the collection Dog,\n(FOL-TermFn 212) denotes a first-order term based on the integer\n212, and (FOL-TermFn isa) denotes a first-order term based on the\npredicate isa.  See also (FOL-PredicateFn isa 2) for the\nfirst-order binary predicate based on isa.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'FOL-PredicateFn', "(FOL-PredicateFn TERM ARITY) denotes a predicate that has\narity ARITY in the first-order projection of CycL based on the CycL\nterm TERM, which must be either a predicate or a collection.  For\nexample, (FOL-PredicateFn eventOccursAt 2) denotes the binary\nfirst-order predicate associated with eventOccursAt,\n(FOL-PredicateFn different 2) denotes the first-order binary\nversion of the predicate different, and (FOL-PredicateFn Date 1)\ndenotes the unary first-order predicate associated with Date", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'FOL-FunctionFn', "(FOL-FunctionFn FUNC ARITY) denotes a function that has\narity ARITY in the first-order projection of CycL based on the CycL\nfunction FUNC.  For example, (FOL-FunctionFn YearFn 1) denotes the\nunary first-order function associated with YearFn, and\n(FOL-FunctionFn PlusFn 2) denotes the first-order binary function\nassociated with PlusFn", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'FixedAritySkolemFunction', "The subcollection of SkolemFunctions whose arity is fixed. This is the most common type of skolem function, since variable- arity skolem functions are only created when a sequence variable is in the scope of the skolem.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'FixedAritySkolemFuncN', "The collection of SkolemFuncNs (q.v.) whose arity is fixed.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'FixedArityRelation', "A specialization of Relation.  A Relation is an instance  of FixedArityRelation just in case it takes a fixed number  of arguments.  Most relations reified in the Cyc ontology are  of fixed arity.  For example, likesAsFriend always takes two  arguments and pointOfContact three.  This collection is  disjoint with VariableArityRelation.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'February', "The collection of all Februaries,  the second month of the year in the GregorianCalendar.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'False', "An instance of TruthValue (q.v.).  False is the logical notion of falsehood.  That is, the term 'False' is used as a sentential constant of CycL that is false under every model theoretic interpretation.  For example, (booleanResult T/F False) means that the result obtained from the true-or-false test T/F is False.  Cf. True.", 'BaseKB', vStrDef).
exactlyAssertedEL_next(comment, 'ExpFn', "A unary EvaluatableFunction that is the CycL version of the exponential operator. It takes instances of ComplexNumber and returns instances of ComplexNumber. (ExpFn NUM) is e^NUM, i.e. e raised to the power of NUM (where e is E-LogarithmBase).  When NUM is a RealNumber, (ExpFn NUM) is necessarily a PositiveNumber. In particular, (ExpFn 1) is e.  The inverse of this function (cf. inverseQuantFunctions-Nonsymmetric\n) is LogFn. Note that although the arg constraint for ExpFn is ComplexNumber, its evaluationDefn only evaluates to a value when NUM is a RealNumber. See also ExponentFn, a binary function which returns the result of raising a specified number to a specified exponent.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'ExpandSubLFn', "<code>(ExpandSubLFn PARAMETERS SUBL-TEMPLATE)</code> denotes the SubL expression resulting from expanding the SubL template <code>SUBL-TEMPLATE</code> once all <code>PARAMETERS</code> are known.  For example, <code>(ExpandSubLFn (?X) (+ 1 ?X))</code> will denote the SubL expression <code>(+ 1 2)</code> when the parameter <code>?X</code> is bound to 2.  See also EvaluateSubLFn, trueSubL and performSubL.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'ExistentialQuantifier-Bounded', "A specialization of ExistentialQuantifier (q.v.).  Each instance of ExistentialQuantifier-Bounded is a ternary relation that can be used to make a certain kind of statement about the existence of a given bounded quantity of things meeting a given criterion.  For example, '(thereExistAtLeast 9 ?X (isa ?X Cat))' means that there exist at least nine cats.  What distinguishes _bounded_ existential quantifiers from existential quantifiers generally is that the former require one to specify explicitly (at least a boundary for) how many things exist that meet the specified criterion.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'ExistentialQuantifier', "A specialization of Quantifier (q.v.).  Each instance of ExistentialQuantifier can be used to make a certain kind of assertion regarding the existence of some thing(s) meeting a specified criterion.  For example, `(thereExistAtLeast 9 ?X (isa ?X Cat))' means that there exist at least nine cats.  Other instances of this collection are thereExists and thereExistExactly.  Cf. forAll.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'ExceptionPredicate', "A collection of mathematical objects, which are the LogicalConnectives used to express exceptions to rules.  Elements include exceptWhen and exceptFor.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'EverythingPSC', "A problem solving context in which all assertions in the entire KB are visible.  This context is only appropriate for use in queries which do not care about the consequences of possible contradictions due to conflicting information from mutually inconsistent microtheories.  See also InferencePSC.", 'BaseKB', vStrMon).
exactlyAssertedEL_next(comment, 'EvaluateSubLFn', "<code>(EvaluateSubLFn SUBL)</code> denotes the SubL term resulting from the invocation of the SubL EVAL facility on the expression <code>SUBL</code>.  For example, <code>(EvaluateSubLFn (ExpandSubLFn () (+ 1 2)))</code> evaluates to 3.  See ExpandSubLFn for a way to denote SubL within CycL.  See also trueSubL.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'EvaluatableRelation', "A specialization of Relation.  Each instance of EvaluatableRelation is\na function or predicate for which there is some piece of system code that \ncan be invoked to evaluate (i.e. to determine the denotation or truth-value\nof) a closed expression built from that function or predicate (i.e. a closed \nexpression that has the constant that denotes that function or predicate in \nits initial or \"0th\" argument-place).  An evaluation of this sort is carried \nout, for example, when the system is queried using an evaluate (q.v.) \nsentence.  As one might expect, most evaluatable relations are mathematical \nor syntactic in nature; for numbers, sets, lists, and strings are the sorts \nof things that are related in various ways that can be calculated \nalgorithmically.  Examples include PlusFn, greaterThan, JoinListsFn, \nand substring.  In the case of a function that is evaluatable (see \nEvaluatableFunction), the practical result of evaluating the relevant \nexpression is another _term_ -- one that has the same denotatum as the \noriginal expression, but that is syntactically simpler and constitutes a \nmore straightforward way of referring to that denotatum.  For example, \nthe term `(PlusFn (Inch 3) (Inch 1))', when evaluated, results in \nthe term `(Inch 4)'.  So if a query using the open sentence\n`(evaluate ?X (PlusFn (Inch 3) (Inch 1)))' is asked, the answer \n(or \"binding\" for the variable `?X') returned will be the term `(Inch 4)'.  \nEvaluating a sentence built from (a constant that denotes) an \nEvaluatablePredicate, on the other hand, yields a _truth-value_.  For \nexample, the sentence `(greaterThan (Inch 3) (Inch 1))' evaluates \nto (and so if used to ask a query will return the answer) `True'.  The \npredicate evaluationDefn (q.v.) is used to specify the name of the piece \nof system code used to evaluate expressions formed with a given \nevaluatable relation.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'EvaluatablePredicate', "A specialization of both EvaluatableRelation and Predicate (qq.v.).   Each instance of EvaluatablePredicate is a  predicate associated (via evaluationDefn) with a piece of HL (\"heuristic level\") code that computes the resulting truth-value when the predicate is applied to legal \narguments. These truth-values can, of course, be computed only when all of the predicate's argument positions are bound: thus Cyc inference will not generate viable inference tactics for non-fully-bound literals with evaluatable predicates in the arg 0 position.  As one might expect, most evaluatable predicates are mathematical or syntactic in nature; for numbers, sets, lists, and strings are the sorts of things that are related in various ways that can be calculated \nalgorithmically.  Examples include greaterThan and substring. Thus the sentence `(greaterThan 3 1)' evaluates to (and so if used to ask a query will return the answer) `True'.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'EvaluatableFunction', "A specialization of both EvaluatableRelation and Function-Denotational (qq.v.).  Each instance of EvaluatableFunction is a function that is associated (via evaluationDefn) with a piece of HL (\"heuristic level\") code that computes the result of applying the function to arguments for which that function is defined.  An evaluation of this sort is carried out, for example, when the system is queried using an evaluate (q.v.) sentence.  As one might expect, most evaluatable functions are mathematical or syntactic in nature; for, unlike with functions generally, operations on numbers, sets, lists, and strings can in many cases be calculated algorithmically.  Examples include PlusFn and JoinListsFn.  The practical result of evaluating a term built from (a constant that denotes) an evaluatable function is another _term_ -- one that has the same denotatum as the former term, but that is syntactically simpler and constitutes a more straightforward way of referring to that denotatum.  For example, the term '(PlusFn 2 3 4)', when evaluated, results in the term '9'.  So if a query using the open sentence '(evaluate ?X (PlusFn 2 3 4))' is asked, the answer (or \"binding\" for the free variable '?X') returned will be the term `9'.  By way of contrast, consider the non-evaluatable function BorderBetweenFn and the following arbitrarily-chosen non-atomic term built with its CycL name: '(BorderBetweenFn France Germany)'.  As there is no general algorithm for finding simpler or \"standard\" terms for given geographical borders, it is not possible for the Cyc system to \"evaluate\" non-atomic terms like this one.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'EscapeQuote', "A quotation-related device for making general statements about CycL expressions.  EscapeQuote is used to allow certain free variables occurring inside an expression that is quoted to \"escape\" (i.e. remain free with respect to) the quotation.  It is thus similar in function to, though more flexible than, QuasiQuote (q.v.).\n<p>\nTo be more precise: the syncategorematic symbol <code>EscapeQuote</code> is used in conjunction with the special quotation symbol <code>Quote</code> (q.v.) as a device for allowing genuinely free variables to occur inside quoted expressions, in order that one may meaningfully \"quantify into\" such expressions and thereby generalize over them.  Thus, <code>EscapeQuote</code> is used to indicate that the free variables occurring within its scope (which is itself inside the wider scope of an occurrence of <code>Quote</code>) are <i>not</i> themselves to be interpreted as being quoted.\n<p>\nThe syntax of <code>EscapeQuote</code> is such that it can only be used in conjunction with <code>Quote</code>.  For any CycL expression <code>EXPR</code>, <code>(EscapeQuote EXPR)</code> is not by itself a syntactically well-formed CycL expression; but the latter can appear as <i>part of</i> a well-formed expression, subject to the following restrictions.  (i) Any occurrence of <code>EscapeQuote</code> in a CycL expression must itself be inside the scope of an occurrence of <code>Quote</code>.  (ii) One occurrence of <code>EscapeQuote</code> can be inside the scope of another only if there is an intermediate occurrence of <code>Quote</code> (i.e. one whose scope subsumes that of the former and is subsumed by that of the latter).\n<p>\nThe semantics of <code>EscapeQuote</code> is such that a formula <code>(Quote ... (EscapeQuote EXPR) ...)</code> that contains only one occurrence of <code>EscapeQuote</code> means just what the corresponding formula <code>(Quote ... EXPR ...)</code> means, except that any free occurrence of a variable in <code>EXPR</code> is to be interpreted as still being genuinely free with respect to <code>(Quote ... (EscapeQuote EXPR) ...)</code>.  In <code>(Quote ... EXPR ...)</code>, by contrast, any such variables are taken to be regular quoted constituents of a quoted compound expression; thus they do not function there as variables, but as <i>quoted-names of</i> variables -- i.e. as terms that denote variables.  \n<p>\nFor example, while the term <code>(Quote (isa ?X Cat))</code> simply denotes the open sentence <code>(isa ?X Cat)</code>, the expression\n<pre>\n  (Quote (EscapeQuote (isa ?X Cat)))\n</pre>\nis itself an open term in which <code>?X</code> occurs free; it thus does not denote in its own right, though many <i>instantiations</i> of it do denote.  E.g. the instantiation <code>(Quote (EscapeQuote (isa Patches-Cat Cat)))</code> denotes the sentence <code>(isa Patches-Cat Cat)</code>).\n<p>\nThe foregoing explanation generalizes to cases where multiple occurrences of <code>EscapeQuote</code> are within the scope of the same <code>Quote</code>.  For example, in the expression\n<pre>\n  (Quote (loves (EscapeQuote ?X) (EscapeQuote ?Y)))\n</pre>\n-- which is equivalent to <code>(Quote (EscapeQuote (loves ?X ?Y)))</code> -- both <code>?X</code> and <code>?Y</code> occur free.\n<p>\nAs mentioned above, the purpose of the <code>EscapeQuote</code> device is to enable \"quantifying into\" quoted contexts: to provide a coherent interpretation of formulas in which an occurrence of a Quantifier (or other ScopingRelation) that is outside the scope of a given occurrence of <code>Quote</code> can be viewed as binding occurrences of variables that are <i>inside</i> the scope of that <code>Quote</code>.  For example, the sentence\n<pre>\n  (thereExists ?X\n    (and\n      (isa ?X Cat)\n      (isa (Quote (EscapeQuote ?X)) CycLAtomicTerm)))\n</pre>\nsays that there is at least one cat that is denoted by a CycL atomic term.  Without the <code>EscapeQuote</code> wrapper, the second conjunct of the above would be a <i>closed</i> sentence, and the entire quantified sentence would express the far less interesting claim that there exists at least one cat and the expression <code>?X</code> is an atomic term of CycL.\n<p>\nNote that the above (interesting) existential claim could be expressed more tersely using QuasiQuote.  EscapeQuote is indispensible only in cases where one wants to allow <i>some but not all</i> of the free variables in a given expression to escape quotation.  For example, in the (implicitly quantified) rule\n<pre>\n  (isa\n    (Quote (loves ?X (EscapeQuote ?Y))) \n    CycLOpenSentence)\n</pre>\nonly the variable <code>?Y</code> occurs free; the <code>?X</code> is part of what gets quoted (and thus functions like a closed term that <i>denotes</i> the CycL variable <code>?X</code>).  What the rule says, in effect, is that any well-formed expression built with the predicate-expression <code>loves</code> followed by the variable <code>?X</code> followed by a CycL term is an open sentence of CycL.\n<p>\nFor more on the use of EscapeQuote and Quote for quantifying into quoted contexts, see the shared NoteAboutQuotingInCycL. See also denotes, quotedIsa, quotedArgument, and NoteAboutSyncategorematicSymbols.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'equalStrings-CaseInsensitive', "(equalStrings-CaseInsensitive STRING1 STRING2) means that the CharacterStrings STRING1 and STRING2 contain the same characters in the same order, although some of the characters in STRING1 may differ in case from some of the characters in STRING2.  For example, (equalStrings-CaseInsensitive \"Foo\" \"fOo\") holds.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'EnglishParaphraseMt', "An instance of both ParaphraseDataMicrotheory and GeneralMicrotheory.  EnglishParaphraseMt is the default context used for generating English paraphrases for CycL expressions.  Many of the assertions required for English paraphrase generation, including those with the predicates genFormat and genPhrase (qq.v.), can be found in this context.", 'BaseKB', vStrDef).
exactlyAssertedEL_next(comment, 'ELRelation-Reversible', "A specialization of ELRelation (q.v.) instances of which appear only at the \"epistemological level\" (or EL) of the Cyc system, but whose original forms, or logically equivalent variants thereof, are retrievable via the CycUncanonicalizer.  Each instance of ELRelation-Reversible is associated, via the expansion (q.v.) or expansionDefn relation, to a sentence template to which the former is essentially equivalent and for which the former serves as a convenient alternative.  Furthermore, each instance of ELRelation-Reversible is also associated with a piece of code which can perform the inverse transformation.  Since each instance of ELRelation-Reversible requires special code support, this is a notAssertibleCollection.  More precisely:  A GAF (see CycLClosedAtomicSentence) whose main functor (or \"0th argument\") is a term that denotes a reversible EL relation can occur only at the EL, and not at the underlying HL (\"heuristic level\") of the system.  Thus, although one can use an EL-relation-based GAF to make an assertion to the system, the GAF that actually gets stored as an assertion in the Cyc Knowledge Base is a different (though logically equivalent) one that is related to the first via the expansion or expansionDefn assertion on the EL relation.  Upon assertion, the first GAF is transformed into the second GAF by the CycCanonicalizer.  Upon presentation to the user, the second GAF is transformed back into the first GAF, or a GAF which is logically equivalent, by the CycUncanonicalizer.  For example, willAlwaysBe is a reversible EL relation whose expansionDefn and associated piece of uncanonicalization code perform the following transformation:\n<p>\n(ist (MtSpace (MtTimeDimFn TIME) OTHER-DIMS) (willAlwaysBe P)\n<==>\n(ist (MtSpace (MtTimeDimFn (IntervalStartedByFn TIME)) OTHER-DIMS) P)\n<p>\nSo if one makes an assertion into an MT with time index T using the sentence `(willAlwaysBe P)', the assertion that actually shows up in the KB is `P' in an MT with time index (IntervalStartedByFn T).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'ELRelation-OneWay', "A specialization of ELRelation (q.v.) instances of which appear only when input at the \"epistemological level\" (or EL) of the Cyc system, and whose original EL form is thereafter irretrievable.  Each instance of ELRelation-OneWay is associated, via the expansion or expansionDefn relation, to a sentence template to which the former is essentially equivalent and for which the former serves as a convenient alternative.  More precisely: A GAF (see CycLClosedAtomicSentence) whose main  functor (or \"0th argument\") is a term that denotes a one-way EL relation can  occur only at the EL, and not at the underlying HL (\"heuristic level\") of the system.  Thus, although one can use a one-way-EL-relation-based GAF to make an assertion to the system, the GAF that actually gets stored as an assertion in the Cyc Knowledge Base is a different (though logically  equivalent) one that is related to the first via the expansion assertion  on the EL relation.  Upon assertion, the first GAF is \"transformed into\" the second GAF by the CycCanonicalizer.  For example, lessThan is a one-way EL relation whose expansion correlate is the template (greaterThan :ARG2 :ARG1).  So if one makes an assertion using the sentence `(lessThan 1 2)', the assertion that actually shows up in the KB is `(greaterThan 2 1)'.  Note that terms for one-way EL relations _do_ appear in stored assertions in which  they occur in argument places other than the 0th; e.g. the sentence `(isa lessThan OrderingPredicate)' is in the KB.  One-way EL relations afford cyclists the convenience of having alternative forms of expression, while their expansions serve to minimize redundancy in the types of GAFs that the system has to store and reason with.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'ELRelation', "A specialization of MacroRelation (q.v.) instances of which appear only at the \"epistemological level\" (or EL) of the Cyc system.  Each instance of ELRelation is associated, via the expansion or expansionDefn relation, to a sentence template to which the former is essentially equivalent and for which the former serves as a convenient alternative.  Some assertions using instances of ELRelation are irretrievable after being input to the Cyc System (ELRelation-OneWay), and others' EL forms are reconstructed dynamically by the system (ELRelation-Reversible).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'DontReOrderCommutativeTerms', "A CanonicalizerDirective (q.v.) that directs the CycCanonicalizer not to re-order commutative terms that appear in the CycL assertions.", 'CoreCycLImplementationMt', vStrMon).
exactlyAssertedEL_next(comment, 'DocumentationPredicate', "A PredicateType whose instances are Predicates specifically designed for in-KB documentation purposes, such as  facilitating Cyclists in their understanding of the Cyc system, tracking knowledge representation work being done in the Cyc Knowledge Base, or noting cleanup work to be done.  \n<p>\nNote that documentation predicates are usually not involved in inference.  They may be excluded from knowledge bases in which available memory is a premium without affecting the performance of applications. DocumentationPredicate is used in code to determine which documentation to show to the user when they request to see documentation for a first-order reified term (or \"FORT\").", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'DocumentationConstant', "A collection of CycL constants whose purpose is to facilitate users in their understanding of the system, tracking knowledge representation work being done, noting cleanup work to be done, etc. Documentation constants are usually not involved in inference.  Instances may be excluded from versions of the knowledge base in which available memory is a premium without affecting the performance of applications.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'DistributingMetaKnowledgePredicate', "A subcollection of MetaKnowledgePredicate (q.v.).  Each instance of DistributingMetaKnowledgePredicate is a meta-knowledge predicate that can be used to make meta-assertions (i.e it can take a CycLAssertion as an argument) and is such that, when applied to an EL-level assertion that polycanonicalizes (i.e. gets transformed by the Cyc canonicalizer into multiple HL-level assertions), it is automatically \"distributed\" over each of the multiple assertions resulting from the polycanonicalization.\n<p>\nLet METAPRED be an instance of DistributingMetaKnowledgePredicate. Suppose that one asserts <code>(METAPRED ASSERTION FOO)</code> and that <code>ASSERTION</code> polycanonicalizes into <code>ASSERTION1</code> and <code>ASSERTION2</code>.  Then <code>(METAPRED ASSERTION1 FOO)</code> and <code>(METAPRED ASSERTION2 FOO)</code> will both be asserted to the Knowledge Base automatically.\n<p>\nFor example, if I assert this at the EL-level:\n<pre>\n  (comment\n    (and (isa Muffet Dog) (likesAsFriend Muffet Patches-Cat))\n    \"Muffet digs Patches.\"),\n</pre>\n<p>\nboth of these will automatically be asserted a the HL-level:\n<p>\n\t<code>(comment (isa Muffet Dog) \"Muffet digs Patches.\")</code>\n<p>\n\t<code>(comment (likesAsFriend Muffet Patches-Cat) \"Muffet digs Patches.\")</code> .\n<p>\nSee also the shared note MetaAssertionsForPolycanonicalizingAssertions.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'DisjointCollectionType', "A collection of collections of collections and a specialization of SiblingDisjointCollectionType (q.v.).  A disjoint collection type is such that its instances are collections that are all disjoint from one another.  That is, each instance <code>DISCOLTYPE</code> of DisjointCollectionType is a collection whose instances are mutually disjoint collections: no two instances of <code>DISCOLTYPE</code> have any instances in common.  Instances of DisjointCollectionType include BiologicalSpecies and SportsTeamTypeBySport.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'DirectedMultigraph', "A specialization of both DirectedPathSystem and Multigraph.  Each instance of DirectedMultigraph is a multigraph in which every link has one direction.  Note that there can be loops and multiple links between a pair of nodes in a given instance of DirectedMultigraph.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'DifferenceFn', "A binary MathematicalFunctionOnScalars and an extension of the arithmetic subtraction operation to ScalarIntervals (q.v.) generally.  When applied to two arithmetically-comparable scalars, MINUEND and SUBTRAHEND, DifferenceFn yields the scalar that is the result of subtracting SUBTRAHEND from MINUEND.  For example, (DifferenceFn 88 11) is 77 and (DifferenceFn (Kilogram 4.2) (Kilogram 3)) is (Kilogram 1.2).\n<p>\nNote that when MINUEND and SUBTRAHEND are not arithmetically-comparable, (DifferenceFn MINUEND SUBTRAHEND) is undefined.  For example, (DifferenceFn (MinutesDuration 1) (Meter 3)) is undefined, since (MinutesDuration 1) is a Time-Quantity and (Meter 3) is a Distance, and time-quantities are not comparable with distances.\n<p>\nFor addition, see PlusFn.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'DefaultTrue', "An instance of CycHLTruthValue.  DefaultTrue is the attribute of being assumed true unless otherwise known to be false.", 'BaseKB', vStrDef).
exactlyAssertedEL_next(comment, 'DefaultMonotonicPredicate', "A collection of predicates.  Each instance of DefaultMonotonicPredicate is a predicate whose use as the predicate of a locally asserted ground formula causes that formula to be entered, by default, as :MONOTONIC.  Examples: isa, genls, disjointWith, equals, arity, arg1Isa.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'DefaultFalse', "An instance of CycHLTruthValue.  DefaultFalse is the attribute of being assumed false unless otherwise known to be true.", 'BaseKB', vStrDef).
exactlyAssertedEL_next(comment, 'December', "A specialization of CalendarMonth.  Each instance of December is the twelth and final month of a particular year in the GregorianCalendar (q.v.).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'DayOfWeekType', "A collection of collections and a specialization of WeeklyTemporalObjectType.\nEach instance of DayOfWeekType is a collection of CalendarDays, all of\nwhose instances correspond to the same particular \"day of the week\" in \nthe respective weeks in which they occur.  For example, Monday -- the \ncollection of all mondays -- is an instance of DayOfWeekType.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'DateEncodeStringFn', "(DateEncodeStringFn TEMPLATE DATE) returns a string encoding of DATE (an instance of Date) in the format described by the TEMPLATE string.  For example,    (DateEncodeStringFn 'MM/DD/YYYY'      (DayFn 20 (MonthFn July (YearFn 1969))))  would return '07/20/1969'.  See also DateDecodeStringFn.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'DateDecodeStringFn', "(DateDecodeStringFn TEMPLATE DATE-STRING) returns a Date which is the result of decoding DATE-STRING by the format described by the TEMPLATE string.  For example,   (DateDecodeStringFn 'MM/DD/YYYY' '07/20/1969') would return (DayFn 20 (MonthFn July (YearFn 1969))).   See also DateEncodeStringFn.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'CycTransformationProof', "The nearestGenls of CycProof each of whose instances uses a CycLRuleAssertion to prove a query.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, ftVar, "The collection of all variables in the CycL language.\nA CycLVariable is a character string consisting of a question mark '?' (as its initial character) followed by one or more characters, where each of these latter characters is either an (upper- or lower-case) Roman letter, an Arabic numeral (i.e. '0' through '9'), a hyphen ('-'), an underscore ('_'), or another question mark.  (The letters occurring in a CycL variable used in an actual assertion will typically be all uppercase; but this convention is not enforced in any formal way.)  Examples: '?WHAT', '?OBJ-TYPE', and '?var0'.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLTruthValueSentence', "A collection of CycL sentences containing only the CycL sentences <code>True</code> and <code>False</code>, both of which are sentential constants.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'CycLTerm', "The collection of all syntactically well-formed   expressions in the CycL language that can be used as terms, i.e. that can be combined with other expressions to form non-atomic terms or formulas.  Since the grammar of the CycL language allows any CycL expression to be used as a term, CycLTerm and CycLExpression are coextensional collections.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLSentence-ClosedPredicate', "The subcollection of CycLSentences whose arg0 does not contain a free variable although free variables may occupy other argument positions.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'CycLSentence-Assertible', "An instance of CycLExpressionType and a specialization of CycLExpression-Assertible and CycLSentence-Askable.  This is the collection of all CycL sentences that could be asserted to the Cyc Knowledge Base.  More precisely, each instance of CycLSentence-Assertible is a CycL sentence that is both syntactically and semantically well-formed.  By definition, any CycL sentence is syntactically well-formed.  To be semantically well-formed, a CycL sentence must be constructible via the syntax of CycL without violating any applicable arity or argument-type constraints (see arity and ArgTypePredicate).  A CycL sentence must be semantically well-formed in order to be interpretable as having a \"semantic value\", which for sentences means having a truth value.  Note that being \"assertible\" in the present sense does not require a sentences's actually being asserted in the KB.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLSentence-Askable', "The collection of CycLSentences that are askable as queries to the Cyc system.  More precisely, each  instance of CycLSentence-Askable is a CycL sentence that is  constructible via the syntax of CycL without violating any applicable  arity constraints (see arity).  Note that askable CycL sentences do  not necessarily obey other semantic constraints beyond arity, such as  argument-type constraints (see ArgTypePredicate); thus they are  not always semantically well-formed in the fullest sense (cf.  CycLSentence-Assertible).  The idea behind this criterion of  \"askability\" is that such a sentence, even if it isn't true or false (which it can't be unless it also obeys all argument-type  constraints), at least \"makes enough sense\" to be asked as a query  to the Cyc system.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLSentence', "The collection of syntactically well-formed sentences of the CycL language.  Each instance of CycLSentence consists of a CycL expression denoting an instance of TruthFunction (e.g. an instance of Predicate or SententialRelation) followed by one or more CycL terms (see CycLTerm), with the entire sequence enclosed in parentheses.  \n<p>\nFor example, (isa Collection Thing) and (genls ?FOO SpatialThing) are both CycL sentences.  Note that CycLSentences <i>need not</i> obey arity constraints (see arity) or other semantic constraints (such as argument type constraints; see ArgTypePredicate).  Thus, for example, (genls ?FOO SpatialThing EiffelTower) is a CycL sentence.\n<p>\nCycLSentences are also called \"logical formulas\", and are to be distinguished from \"denotational formulas\" (which are also known as \"NAT\"s; see CycLNonAtomicTerms).  Note that this notion of a CycL sentence is broader than the notion of \"sentence\" standardly used in formal logic, where a sentence is defined as a <i>closed</i> well-formed formula: CycL sentences may be <i>open</i> (i.e. they may contain free variables; see the specialization CycLOpenSentence).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLRuleAssertion', "The subcollection of semantically well-formed CycLAssertions whose formulas are rules.\nMore precisely, the formulas are not\nGAFs (see CycLGAFAssertion), so they either have more than one literal (and therefore are\nnon-atomic) or they quantify over some free variables (and therefore are non-ground).\nAny free variables are implicitly universally quantified.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLRepresentedTerm', "The collection of all denotational terms that are represented in the CycL language, instead of being defined in SubL, the underlying implementation language used by Cyc.  That is, each instance of CycLRepresentedTerm is either (i) an atomic term, and thus also an instance of CycLRepresentedAtomicTerm (q.v.), or (ii) a non-atomic term (or \"NAT\"), and has a CycLRepresentedTerm as its arg0 functor (the other arguments in the NAT\nneed not be CycL represented terms).  Thus CycLRepresentedTerm has as instances all CycLConstants, all CycLVariables, and all CycLNonAtomicTerms.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLRepresentedAtomicTerm', "A specialization of CycLAtomicTerm.  An instance ATOM of CycLAtomicTerm is also an instance of CycLRepresentedAtomicTerm just in case ATOM is explicitly represented in the CycL language (as opposed to being represented in SubL, the underlying implementation language of the Cyc system).  Important specializations of CycLRepresentedAtomicTerm include CycLVariable and CycLConstant.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLReifiedDenotationalTerm', "The collection of denotational terms in the CycL language which are\nreified in the KB.  Examples include Muffet and (JuvenileFn Dog); a\ncounterexample would be (JuvenileFn Platypus) because that term is not\ncurrently reified in the KB.  These are often called 'FORTs', which stands for\n'first-order reified terms'", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLReifiableNonAtomicTerm', "A collection of Cyc terms that are NATs (CycLNonAtomicTerms; see\nFunction-Denotational) whose functor is an instance of\nReifiableFunction. E.g., since GovernmentFn is an instance of\nReifiableFunction, it is true that (GovernmentFn France) is a\nCycLReifiableNonAtomicTerm.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLReifiableDenotationalTerm', "A subcollection of both CycLClosedDenotationalTerm and CycLIndexedTerm (qq.v.).  CycLReifiableDenotationalTerm is the collection of all CycL terms that both may be reified and may denote something in the universe of discourse. It thus includes all instances of CycLConstant as well as any NAT (see CycLNonAtomicTerm) whose main functor denotes an instance of ReifiableFunction.\n<p>\nFor example, the NAT '(GovernmentFn France)' is a CycLReifiableDenotationalTerm, since GovernmentFn is a ReifiableFunction.  Similarly,  '(JuvenileFn Platypus)' is a CycL reifiable denotational term; although it is not currently reified in the KB, it is reifiable and denotational (see CycLClosedDenotationalTerm).  Finally, '(BorderBetweenFn Canada Mexico)' is a CycL reifiable denotational term; although it happens not to denote anything in the universe of discourse, it is nonetheless the kind of NAT that can and usually does denote.\n<p>\nNote that CycLVariables are not considered reifiable terms.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLReformulationRulePredicate', "The collection of Predicates which may appear as the operator in a CycLReformulatorRule.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLPropositionalSentence', "The collection of CycL sentences that express propositions (see Proposition).  Two necessary conditions for a CycL sentence's expressing a proposition is that it be closed (see CycLClosedSentence) and not violate any applicable arity constraints (see CycLSentence-Askable).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLOpenSentence', "A specialization of both CycLOpenExpression and CycLSentence. The collection of CycL sentences that contain one or more free variables.  Note that those CycL sentences that are treated (in the context of representing assertions in the Cyc Knowledge Base) as implicitly containing initial universal quantifiers are in fact CycLOpenSentences.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLOpenNonAtomicTerm', "The collection of denotational CycLNonAtomicTerms that have free variables. Examples: `(JuvenileFn ?X)', `(JuvenileFn ?X ?Y ?Z)'.  Counterexample: `(TheSetOf ?X (objectHasColor ?X GreenColor))'.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLOpenFormula', "A specialization of both CycLOpenExpression and CycLFormula (qq.v.).  The collection of compound CycL expressions that contain one or more free variables.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLOpenExpression', "A specialization of CycLExpression.  The collection of CycL expressions that contain one or more free variables.  A CycLVariable VAR occurs _free_ in an expression EXPR if and only if there is an occurrence of VAR in EXPR that is not bound by another term in EXPR that denotes a Quantifier or other ScopingRelation (q.v.).  For example, the expression `(isa ?X Cat)' is open, but `(thereExists ?X (isa ?X Cat))' is not.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLOpenDenotationalTerm', "The collection of all open denotational terms in the CycL language.  An expression is \"open\" if it contains one or more free variables (see CycLOpenExpression).  A CycL term is said to be \"denotational\" if it is the right sort of term to have a denotation (or value) in the universe of discourse (see CycLDenotationalTerm).  Each instance of CycLOpenDenotationalTerm is either a CycLOpenNonAtomicTerm (i.e. a \"NAT\" with a free variable) or a CycLVariable itself.  Examples include `?X', `(JuvenileFn ?X)', and `(JuvenileFn isa ?X genls JuvenileFn)' (even though the latter is semantically ill-formed).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLNonAtomicTerm-ClosedFunctor', "The subcollection of denotational CycLNonAtomicTerms which have no free variable in the arg0 position.\nExamples: (JuvenileFn Platypus), (JuvenileFn isa genls), (TheSetOf ?X (colorOfType ?X GreenColor)), (JuvenileFn ?X).  Counterexample: (?SOMEFN Gold) ((USDollarFn ?YEAR) 5).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'CycLNonAtomicTerm-Assertible', "A CycLExpressionType and a specialization of both CycLExpression-Assertible and CycLNonAtomicTerm (qq.v.).  The collection of all CycL non-atomic terms that could appear within a sentence that could be asserted to the Cyc Knowledge Base.  More precisely, each instance of CycLNonAtomicTerm-Assertible is a non-atomic term that is both syntactically and semantically well-formed.  By definition, any CycL non-atomic term is syntactically well-formed.  To be semantically well-formed, a non-atomic term sentence must be constructible via the syntax of CycL without violating any applicable arity or argument-type constraints (see arity and ArgTypePredicate).  A CycL term must be semantically well-formed in order to be interpretable as having a \"semantic value\", which for terms means having a denotation.  Note that being \"assertible\" in the present sense does not require a sentence's actually being asserted in the KB.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLNonAtomicTerm-Askable', "The collection of CycLNonAtomicTerms\nthat can appear within sentences that are askable as queries to the Cyc system\n(see CycLSentence-Askable).  More precisely, each instance of \nCycLNonAtomicTerm-Askable is a CycL non-atomic term that is constructible via \nthe syntax of CycL without violating any applicable arity constraints (see \narity).  Note that askable CycL non-atomic terms do not necesarily obey other \nsemantic constraints beyond arity, such as argument-type constraints (see \nArgTypePredicate); thus they are not always semantically well-formed in \nthe fullest sense (cf. CycLNonAtomicTerm-Assertible).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLNonAtomicTerm', "A CycLExpressionType and a specialization of both CycLFormula \nand CycLRepresentedTerm (qq.v.).  CycLNonAtomicTerm is the \ncollection of non-atomic denotational terms in the CycL language.  \nA CycL term is _non-atomic_ if it is constructible from other CycL \nterms via the syntax of CycL.  A CycL term is said to be \n\"denotational\" if it is the type of term that can have a \ndenotatum (or assigned value; see CycLDenotationalTerm).  \nCycLNonAtomicTerm thus includes all CycL denotational terms \nexcept constants and variables.  A CycL non-atomic term (or \"NAT\") \nconsists of a CycL expression denoting a Function-Denotational \nfollowed by one or more CycL terms, with the entire sequence \nenclosed in parentheses.  The NAT itself denotes the value (if any) \nof this function for the denotations of the other terms taken as \narguments.  (If there is no such value then the NAT has no denotatum;\nsee undefined.)  NATs are also known as \"denotational formulas\", \nin contrast to \"logical formulas\" (i.e. sentences).  Currently, \nthere are two main types of NAT: (i) HLNonAtomicReifiedTerms (or \n\"NART\"s), which are a type of HLReifiedDenotationalTerm and are \nimplemented with data structures that have indexing that enables all \nuses of the NAT to be retrieved, and (ii) ELNonAtomicTerms (or \n\"NAUT\"s), which have no such indexing and remain in the \nform of an EL expression in the assertions in which\nthey occur.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLNonAtomicReifiedTerm', "The subcollection of CycLReifiableNonAtomicTerms that are reified in the KB. Example: (JuvenileFn Dog).  Counterexample: (JuvenileFn Platypus), because that term is not currently reified in the KB.  These are often called NARTs, which stands for 'non-atomic reified term'.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CyclistDefinitionalMt', "The microtheory in which instances of Cyclist are defined.  Assertions about them belong in CyclistsMt.", 'BaseKB', vStrMon).
exactlyAssertedEL_next(comment, 'Cyclist', "A specialization of IndividualAgent. Each instance of Cyclist is an agent (usually a person) entitled to inspect and modify the Cyc knowledge base.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLIndexedTerm', "The collection of indexed or indexable terms in the CycL language.\nThis includes reified HL terms as well as reifiable EL NATs and assertions.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLGenericRelationFormula', "A subcollection of CycLFormula (q.v.).  Each instance of that CycLGenericRelationFormula is a CycL formula that begins (immediately after the opening parenthesis) with a variable or other open expression (see CycLOpenExpression); i.e. it has an open expression in its \"0th\" or \"arg0\" position.  A CycL generic relation formula thus consists \nof an open expression followed by some number of terms, with the entire sequence \nenclosed in parentheses.  But note that the open expression in the formula's \narg0 position must be such that, given the syntax and intended semantics of CycL, it could conceivably have a Relation -- i.e. a Function-Denotational or a TruthFunction (such as a Predicate or LogicalConnective) -- as its semantic value.  Hence the arg0 open expression might be a variable, as in the generic relation formula `(?RELATION Muffet Dog)'; or it might be an appropriate open non-atomic term (or \"NAT\"; see CycLNonAtomicTerm), as in \n`((Kappa (?ARG1) (knows ?ARG1 ?ARG2)) Muffet)'; or it might itself be \na generic relation formula, as in `((?REL ?ARG1 Dog) Muffet)'.  On the \nother hand, `((BorderBetweenFn ?ARG1 ?ARG2) Muffet Dog)' is not a \nCycLGenericRelationFormula, since BorderBetweenFn only returns instances \nof Border, which is disjoint with Relation; thus the open NAT \n`(BorderBetweenFn ?ARG1 ?ARG2)' couldn't possibly have a Relation as its \nsemantic value, no matter what values were assigned to the variables `?ARG1' \nand `?ARG2'.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLGAFAssertion', "A CycLExpressionType and a specialization of both CycLAtomicAssertion and CycLClosedAtomicSentence (qq.v.).  This is the collection of all and only the closed atomic CycL sentences that have been asserted to the Knowledge Base or deduced there by the inference engine.  GAF assertions typically express particular facts (as opposed to general rules) about the world.  The acronym `GAF' stands for \"ground atomic formula\"; see CycLClosedAtomicSentence.\n<p>\nAt the epistemological level (see ELExpression), a GAF assertion contains no free variables and is thus (at least) \"ground\".  At the heuristic level (see HLExpression), however, the HLAssertion(s) representing the GAF assertion -- the sentence(s) that are actually stored in the KB -- contain no variables whatsoever and are thus \"_fully_ ground\" (see CycLFullyGroundAtomicSentence).  For example, if the ground atomic sentence\n<p>\n(isa (TheSetOf ?X (objectHasColor ?X GreenColor)) Thing)\n<p>\nwere asserted it would be a GAF assertion, and it would be represented in the KB by some fully ground atomic sentence(s) containing no variables at all.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLFormulaicSentence', "A subcollection of syntactically well-formed sentences of the CycL language. Each instance of CycLFormulaicSentence consists of a CycL expression denoting an instance of TruthFunction (e.g., an instance of Predicate or SententialRelation) followed by one or more CycL terms (see CycLTerm), with the entire sequence enclosed in parentheses. For example, (isa Collection Thing) and (genls ?FOO SpatialThing) are both formulaic CycL sentences. The only two CycL sentences that are not formulaic are True and False. Note that CycLFormulaicSentences need not obey arity constraints (see arity) or other semantic constraints (such as argument type constraints ; see ArgTypePredicate). CycLFormulaicSentences are also called \"logical formulas\", and are to be distinguished from \"denotational formulas\" (which are also known as \"NAT\"s; see CycLNonAtomicTerms). Note that this notion of a formulaic CycL sentence is broader than the notion of \"sentence\" standardly used in formal logic, where a sentence is defined as a _closed_ well-formed formula: formulaic CycL sentences may be _open_ (i.e., contain free variables; see CycLOpenSentence).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'CycLFormula', "The collection of compound CycL expressions.  Each instance of CycLFormula consists of a CycL expression that denotes a relation (e.g. a Predicate, Function-Denotational, or TruthFunction) -- or at least an expression that could be interpreted as having a relation as its semantic value (see CycLGenericRelationFormula) -- followed by one or more CycL terms (see CycLTerm), with the entire sequence enclosed in parentheses.  For example, (isa Muffet Poodle) and (BirthFn Muffet) are both CycL formulas.  Two important specializations of CycLFormula are CycLNonAtomicTerm (whose instances are also called \"denotational formulas\") and CycLSentences (whose instances are also called \"logical formulas\").  Note that this notion of \"formula\" differs somewhat from that used in formal logic, where a formula is normally defined as an (atomic or non-atomic, quantificationally closed or open) sentence.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, ttExpressionType, "A collection of collections.  Each instance of CycLExpressionType is a type (i.e. a subcollection) of CycLExpression.  Note that, while CycLExpressionType is not itself a quotedCollection (q.v.), most of its reified instances are quoted-collections.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLExpression-Assertible', "A CycLExpressionType.  The collection  of all compound CycL expressions that either could themselves be asserted to the  Cyc Knowledge Base (see CycLSentence-Assertible) or could appear as denotational terms within sentences that could be so asserted (see CycLDenotationalTerm-Assertible).  More precisely, each instance of CycLExpression-Assertible is a CycL expression that is both syntactically and semantically well-formed.  By definition, any compound CycL expression is  syntactically well-formed.  To be semantically well-formed, a CycL expression  must be constructible via the syntax of CycL without violating any applicable arity or argument-type constraints (see arity and ArgTypePredicate).  A CycL expression must be semantically well-formed in order to be interpretable as having a \"semantic value\", such as a truth-value (if the expression is a sentence) or a denotation (if it's a CycLDenotationalTerm).  Note that being \"assertible\" in the present sense does not require an expression's actually being asserted in (or being a component of something asserted in) the KB.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLExpression-Askable', "The collection of CycLExpressions\nthat are either themselves askable as queries to the Cyc system (see \nCycLSentence-Askable) or could appear as non-atomic terms within \nsentences that could be so asked (see CycLNonAtomicTerm-Askable). \nMore precisely, each instance of CycLExpression-Askable is a CycL \nexpression that is constructible via the syntax of CycL without \nviolating any applicable arity constraints (see arity).  Note that \naskable CycL expressions do not necesarily obey other semantic \nconstraints beyond arity, such as argument-type constraints (see \nArgTypePredicate); thus they are not always semantically \nwell-formed in the fullest sense (cf. CycLExpression-Assertible).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLExpression', "The collection of all (and only) expressions in the CycL language.  This includes all constants, variables, and formulas (i.e. non-atomic terms and sentences).  Each CycL expression is, trivially, a <i>syntactically</i> well-formed expression of CycL; but note that it might or might not be \"<i>semantically</i> well-formed\" (see CycLExpression-Assertible).  Also note that, since the CycL syntax allows any CycL expression to be used as a term, CycLExpression is coextensional with CycLTerm (q.v.).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLDenotationalTerm-Assertible', "A CycLExpressionType and a specialization of both CycLDenotationalTerm and CycLExpression-Assertible (qq.v.).  This is the collection of all CycL denotational terms that could appear within a sentence that could be asserted to the Cyc Knowledge Base.  More precisely, each instance of CycLDenotationalTerm-Assertible is a denotational (i.e. non-logical) term that is both syntactically and semantically well-formed.  By definition, any CycL term is syntactically well-formed.  To be semantically well-formed, denotational term sentence must be either be atomic (see CycLAtomicTerm) or constructible via the syntax of CycL (see CycLNonAtomicTerm-Assertible) without violating any applicable arity or argument-type constraints (see arity and ArgTypePredicate).  A CycL term must be semantically well-formed in order to be interpretable as having a \"semantic value\", which for denotational terms means having a denotation.  Note that being \"assertible\" in the present sense does not require a sentence's actually being asserted in the KB.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLDenotationalTerm', "The collection of all CycL terms that are not sentences (cf. CycLSentence), and thus are either CycLAtomicTerms (such as constants or variables) or CycLNonAtomicTerms (also known as \"NAT\"s).   CycLDenotationalTerms are so-called, not because they all have denotations (not all of them do), but because they are in a certain sense the right kind of term for having a denotation.  That is, an instance of CycLDenotationalTerm -- if it is semantically well-formed and closed (i.e. contains no free variables) -- might denote something in the universe of discourse.  (Even so, it will not _necessarily_ denote something, considering (e.g.) the fact that a function need not be defined for every (sequence of) thing(s) satisfying its argument type constraints; see PartialFunction.)  But note that neither semantic well-formedness nor being closed is a requirement for being a CycL denotational term: `(JuvenileFn isa ?X genls JuvenileFn)', for example, is a NAT and thus a denotational term.  Other examples of denotational terms are the expressions: `Muffet', `?X', `(JuvenileFn ?X)', `(TheSetOf ?X (objectHasColor ?X GreenColor))', and `212'.  Note also that, like most instances of CycLExpressionType, CycLDenotationalTerm is a quotedCollection (q.v.).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLDeducedAssertion', "The subcollection of semantically well-formed CycLAssertions that are supported by at least one argument which is a deduction by Cyc's inference engine, as opposed to having been explicitly asserted to Cyc. A given assertion can have more than one argument, and can therefore be both a CycLAssertedAssertion and a CycLDeducedAssertion.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLConstant', "The collection of all constants in the CycL language. CycLConstant has as instances all CycLAtomicTerms other than CycLVariables and SubLAtomicTerms (qq.v.).  Orthographically, CycL constants are those atomic terms (i.e. terms not constructable from other terms via CycL syntax) that are prefixed by '' in their printed (as opposed to their HTML-displayed) representations.  For example, 'Dog' and 'isa' are CycL constants, while other CycL terms like '?X', '42', and  '(GovernmentFn France)' are not.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLClosedSentence', "A specialization of both CycLSentence and CycLClosedExpression.  The collection of CycL sentences that contain no free variables.  Note that those CycL sentences that are treated (in the context of representing assertions in the Cyc Knowledge Base) as implicitly containing universal quantifiers are <i>not</i> closed sentences (cf. CycLOpenSentence).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLClosedNonAtomicTerm', "The collection of closed, non-atomic denotational terms of the CycL language.  Each instance of CycLClosedNonAtomicTerm is a CycL term that contains no free variables, is constructible from other CycL terms via the syntax of CycL, and can have a denotatum (this last requirement excludes closed CycL sentences from CycLClosedNonAtomicTerm).  Examples: `(JuvenileFn Platypus)', `(JuvenileFn isa genls)', and `(TheSetOf ?X (objectHasColor ?X GreenColor))'.  Non-example: `(JuvenileFn ?X)'.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLClosedFormula', "A specialization of both CycLFormula and CycLClosedExpression.  The collection of compound expressions of CycL that contain no free variables.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLClosedExpression', "The collection of CycLExpressions that contain no free variables.  (A variable VAR occurs _free_ in an expression EXPR if and only if there is an occurrence of VAR in EXPR that is not bound by a quantifier or other ScopingRelation (q.v.) in EXPR.)  Note that those CycL sentences that are treated (in the context of representing assertions in the Cyc Knowledge Base) as implicitly containing universal quantifiers are _not_ closed expressions (see CycLClosedSentence). Also cf. CycLOpenExpression.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLClosedDenotationalTerm', "The collection of all closed denotational terms in the CycL language.  An expression is said to be \"closed\" if it contains no free variables (see CycLClosedExpression).  A CycL term is said to be \"denotational\" if it is the right sort of term to have a denotation (or value) in the universe of discourse (see CycLDenotationalTerm).  CycL sentences, while terms of CycL, are not considered denotational terms.  Each instance of CycLClosedDenotationalTerm is either a CycLClosedAtomicTerm (i.e. a CycLConstant or SubLAtomicTerm) or a CycLClosedNonAtomicTerm (i.e. a \"NAT\" with no free variables).  Examples of closed denotational terms include `Muffet', `(JuvenileFn Dog)', `(TheSetOf ?X (objectHasColor ?X GreenColor))', and `212'.  Note that these are also examples: `(BorderBetweenFn Canada Mexico)' (despite the fact that it fails actually to denote anything) and `(JuvenileFn isa genls JuvenileFn)'\n(despite the fact that it is not semantically well-formed).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLClosedAtomicTerm', "The collection of all closed CycLAtomicTerms.  \"Closed\" here means not containing any free (i.e. unbound) variables.  Since a variable itself is the only type of _atomic_ term that contains a variable (and contains it _free_, moreover, as a single occurrence of a variable can't bind itself), CycLClosedAtomicTerm has as instances all CycLAtomicTerms except CycLVariables.  Like all CycL atomic terms, Cycl closed atomic terms are \"denotational\" (see CycLDenotationalTerm).  Note that this collection, like most instances of CycLExpressionType, is \"quoted\" (see quotedCollection).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLClosedAtomicSentence', "A CycLExpressionType and a specialization of both CycLAtomicSentence and CycLClosedSentence (qq.v.).  This is the collection of all and only the syntactically well-formed atomic sentences in the CycL language that contain no free variables.  Syntactically, each instance of CycLClosedAtomicSentence consists of a CycL expression denoting a Predicate followed by one or more (closed) CycL terms, with the entire sequence enclosed in parentheses.  Such sentences are sometimes called \"GAFs\" (an acronym for \"ground atomic formulas\"); see also the specialization CycLFullyGroundAtomicSentence.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLAtomicTerm', "The collection of all atomic CycLDenotationalTerms (q.v.).  \"Atomic\" here means not constructible  from other CycL terms via the syntax of CycL.  Thus, subcollections  of CycLAtomicTerm include CycLConstant, CycLVariable, and SubLAtomicTerm.  Note that CycLAtomicTerm, like most instances of CycLExpressionType, is \"quoted\" (see quotedCollection).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLAtomicSentence', "The collection of syntactically well-formed atomic sentences in the CycL language. Each instance of CycLAtomicSentence consists of a CycL constant denoting a Predicate followed by one or more (closed or open) CycL terms, with the entire sequence enclosed in parentheses.  Thus CycL atomic sentences never contain other sentences as truth-functional components (see TruthFunction).  Note that \"atomic\" as used here specifically in connection with _sentences_, has a less strict meaning than it does when applied to terms generally, where it means \"not constructible from other terms via CycL syntax\" (see CycLAtomicTerm).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLAtomicAssertion', "A specialization of CycLAtomicSentence.  An instance ATOM of CycLAtomicSentence is also an instance of CycLAtomicAssertion just in case ATOM has been explicitly asserted to the Cyc Knowledge Base (see CycLAssertedAssertion), or deduced in the Knowledge Base by the Cyc inference engine (see CycLDeducedAssertion).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLAssertionDirection', "The collection of possible inference \"directions\" that a CycLAssertion\ncan have.  A given CycL assertion's direction (see assertionDirection) \nindicates something about how and when the assertion can be used in inferences\nby the Cyc system.  More precisely: Backward-AssertionDirection indicates\nthat the assertion can only be used in inferences carried out when a query\nis asked; Forward-AssertionDirection indicates that the assertion can be used \nin inferences carried out at the time the assertion is added to the Knowledge \nBase as well as those carried out at ask-time; and Code-AssertionDirection\nindicates that the assertion itself cannot be used in either backward \n(ask-time) or forward (assert-time) inferences, but is instead implemented \nin the underlying code of the Cyc system.  Each CycL assertion has exactly \none of the above three directions; the default direction is Forward for \nground atomic assertions (see CycLClosedAtomicSentence) and Backward for \nrule assertions.  Note that a CycL sentence is given a direction at the time \nof its assertion to the system, and this fact _need_not_ be reflected in \nanother, assertionDirection assertion's being added to the system (as\nthat would of course lead to an infinite regress).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'CycLAssertion', "The collection of semantically well-formed CycLSentences asserted to the Cyc Knowledge Base.  Each instance of CycLAssertion is either (1) an HL assertion, i.e. a CycL sentence that corresponds to a data structure actually in the Cyc KB), or (2) an EL assertion : an Epistemological Level CycL sentence that can be canonicalized into one or more already extant HL assertions.  CycLAssertion is used as a quoted argument type constraint for certain meta-predicates, such as overrides.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycLAssertedAssertion', "A specialization of CycLAssertion.  An instance ASSERT of CycLAssertion is also an instance of CycLAssertedAssertion  just in case ASSERT was explicitly asserted to the Cyc Knowledge Base by one of its users (see the collection Cyclist), as opposed to having been deduced by Cyc's inference engine (in which case it would be an instance of CycLDeducedAssertion (q.v.)).  Note that since a single assertion can be both explicitly asserted to the knowledge base and also deduced by the inference engine, the collections CycLAssertedAssertion and CycLDeducedAssertion are not disjoint.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycInferenceBindingsDataStructure', "A specialization of CycInferenceDataStructure.  Each\ninstance of CycInferenceBindingsDataStructure is a component of one\nor more CycInferenceAnswers, and encodes an assignment of bindings\nto the free variables in the query which yielded that answer\n(i.e., the query which triggered the CycInference of which that\nanswer is a part).  If the triggering query is closed, the binding\nlist value is NIL.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'CycInferenceAnswerJustification', "A specialization of CycInferenceDataStructure.  Each\ninstance of CycInferenceAnswerJustification is a component of one or\nmore CycInferenceAnswers, and, in each case, encodes a complete set\nof supports (cf., CycSupportDatastructure) for that answer's binding\nlist.  See also CycInferenceBindingsDataStructure.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'CycInferenceAnswer', "A specialization of CycInferenceDataStructure.  Each\ninstance of CycInferenceAnswer is a complex data structure that is a\ncomponent of one or more CycInferences (specifically, of certain\ninferences whose root problem is proven).  A CycInferenceAnswer has\ntwo components: an assigment of bindings to query variables and sets of justifications for those bindings.  For information about the components, see the predicates inferenceAnswerBindings and inferenceAnswerJustification.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'CycHLTruthValue', "The truth/strength combinations used in the Cyc HL implementation of CycLAssertions and arguments.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'CycHLSupportDatastructure', "A specialization of both CycHLDatastructure and\nCycSupportDatastructure (qq.v.) instances of which\nare Cyc HL datastructures that can be used as supports\nwithin a CycDeductionDatastructure (q.v.).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CycAdministrator', "This constant is for use by Cyc administrators responsible for installation, setup and maintenance of Cyc images.", 'BaseKB', vStrMon).
exactlyAssertedEL_next(comment, 'CurrentWorldDataCollectorMt-NonHomocentric', "The Microtheory which collects together all of the instances of GeneralMicrotheory (including instances of DataMicrotheory) as genlMts (excepting HomoCentricNaturalismMt), so that any scenario or project microtheory which needs wide access to the KB but needs to accept either non-human Persons or supernatural things can use this as a genlMt and be assured that all generally defined terms are available.  If no need exists to access instances of TemporalThing, WorldLikeOursCollectorMt-NonHomocentric should be used instead.  If for the purposes of the project all persons are human and no supernatural things are being reasoned about use the CollectorMicrotheory CurrentWorldDataCollectorMt or WorldLikeOursCollectorMt.", 'BaseKB', vStrMon).
exactlyAssertedEL_next(comment, 'CoreCycLMt', "This is a microtheory which contains only the assertions required to represent useful logical truths in CycL.  It extends the LogicalTruthMt with additional assertions which are so useful as to be considered `core' to the CycL language.", 'BaseKB', vStrMon).
exactlyAssertedEL_next(comment, 'CoreCycLImplementationMt', "This is a microtheory which contains only the `core' assertions required for the Cyc theorem prover and its underlying HL representation of the EL to conclude useful inferences.  It extends the LogicalTruthImplementationMt with assertions necessary for Cyc's implementation to make use of the terms defined in the CoreCycLMt.", 'BaseKB', vStrMon).
exactlyAssertedEL_next(comment, 'CommutativeRelation', "An instance of RelationTypeByLogicalFeature (q.v.) and a specialization of AtLeastPartiallyCommutativeRelation (q.v.).  Each instance of CommutativeRelation <code>COMRELN</code> is a predicate or function that is commutative in all of its argument-places.  That is, if <code>COMRELN</code> is a predicate (function) that holds among (has a value <code>VAL</code> for) a given sequence of arguments, then <code>COMRELN</code> also holds among (has the same value <code>VAL</code> for) any permutation of that  sequence.  \n<p>\nExamples of commutative relations include PlusFn, or, bordersOn, temporallyIntersects, and teammates.  Specialization include SymmetricBinaryPredicate.  \n<p>\nNote that most relations are <i>not</i> commutative.  Cf. the disjoint collection  PartiallyCommutativeRelation.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'CollectionRuleTemplateFn', "(CollectionRuleTemplateFn COL) denotes the rule template unique to collection COL.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'CollectionDenotingFunction', "The subcollection of Function-Denotational whose instances return instances of Collection.  Examples include SwimmingEventFn, GroupFn, and MoleculeFn.  For example, (MoleculeFn Oxygen) denotes the collection of all oxygen molecules.  See also the collections IndividualDenotingFunction and SetDenotingFunction.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, tCol, "A specialization of SetOrCollection (q.v.).  This is the collection of all collections of things.  Each Collection is a kind or type of thing whose instances share a certain property, attribute, or feature.  For example, Cat is the collection of all and only cats, and BinaryFunction is the collection of all and only functions taking two arguments.\n<p>\nThe notion of collection is fundamental to the Cyc ontology, and is thus difficult to define in a precise and substantive way.  But it is instructive to compare it to the mathematical notion of a set (see Set-Mathematical).  Like a set, a collection is an AbstractThing (i.e. aspatial and atemporal) that is not an Individual (cf.), but instead has elements (see elementOf).  Unlike a set, however, the elements or \"instances\" (see isa) of a given collection can vary from context to context, and it is possible for distinct collections to have exactly the same elements (i.e. to have the same extent) with respect to a given context. For example, the (non-reified) collections \"Chordate\" and \"Renate\" are co-extensional in the context of the present-day actual world, but have differring extents with respect to hypothetical contexts in which there exist creatures having hearts but not kidneys.  This difference is sometimes summarized by saying that sets are \"extensional\" things and collections are \"intensional\" things.\n<p>\nMany, though by no means all, of the collections reified in the Cyc ontology correspond to natural kinds or classes.  It is particulary useful to reify collections that are difficult to define precisely, but about which there are many common-sense rules and other things to state.  For example, it would not be worthwile to introduce a constant 'WhiteCat', both because it's easy to define the collection of white cats in terms of more general, already-reified notions (e.g. '(CollectionIntersection2Fn Cat WhiteColor)'), and because there's not much to say about that particular collection.  WhiteCollarWorker, on the other hand, is a good collection to have reified, as it is hard to define precisely, yet is a collection about which there are many things to say.\n<p>\nSome of the many reified specializations of Collection are FirstOrderCollection, TimeDependentCollection, and ObjectType.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'Code-AssertionDirection', "An instance of CycLAssertionDirection (q.v.).  A CycL assertion that\nhas the Code-AssertionDirection cannot itself be used in either \nbackward (ask-time) or forward (assert-time) inferences, but is instead \nimplemented in the underlying code of the Cyc system.  Contrast with \nBackward-AssertionDirection and Forward-AssertionDirection.  Also \nsee assertionDirection.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'CharacterString', "A specialization of AbstractInformationStructure.  Each instance of CharacterString is a string of characters or an abstract sequence of symbols.  Note that an instance of CharacterString is <i>not</i> any particular physical, tangible representation, since different encodings may represent the same string of characters.  An instance of CharacterString is a list (see the collection List) of characters (instances of Character-Abstract) from some fixed character set. An instance of CharacterString may be any finite length, including zero (the zero-length string is the empty string, which has no characters).  Notable specializations of CharacterString include EMailAddress, AreaCode, PhoneNumber, and TelephoneCountryCode.  Note that a CharacterString is ordered formally as a List (rather than physically left-to-right or top-to-bottom); thus the 'first' character in the CharacterString for an Arabic word happens to be the rightmost (first pronounced) character, not the leftmost character, due to the letter-order and word-order convention for Arabic writing.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'CanonicalizerDirective', "A specialization of AspatialInformationStore.  Instances  of CanonicalizerDirective are directives (or \"commands\") that can be  given to the CycCanonicalizer (via certain CanonicalizerDirectivePredicates) in order to control its behavior in certain ways during asserts and queries.   Examples include AllowGenericArgVariables and LeaveSomeTermsAtEL. See e.g. the directive predicate canonicalizerDirectiveForArg for more  information on how to use these directives.", 'CoreCycLImplementationMt', vStrMon).
exactlyAssertedEL_next(comment, 'BroadMicrotheory', "The collection of those microtheories that contain so many assertions that they are not useful for `relevance' focusing during inference.  (A BroadMicrotheory is not used internally in Cyc's indexing scheme during inference.)  Examples: BaseKB and EnglishMt.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'BookkeepingPredicate', "A PredicateType whose instances are predicates used to make assertions about the reification (or \"creation\") and internal representation of particular CycL terms (usually constants) in the Cyc system.  Bookkeeping predicates neither specify nor constrain the semantics of CycL terms.  Examples include  myCreator, myCreationTime, termOfUnit, and defnSufficient.  Many (but not all) bookkeeping predicates are also MetaKnowledgePredicates (q.v.).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'BookkeepingMt', "A Microtheory for stating basic bookkeeping information regarding the Cyc Knowledge Base, such as assertions using myCreator or myCreationTime.", 'BaseKB', vStrDef).
exactlyAssertedEL_next(comment, 'BinaryRelation', "The collection of all fixed-arity relations of arity 2 (see arity).  The most notable specializations of BinaryRelation are BinaryPredicate and BinaryFunction (qq.v.).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'BinaryPredicate', "A specialization of both BinaryRelation and Predicate.  BinaryPredicate is the collection of all predicates whose arity (see arity) is 2.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'BinaryFunction', "A specialization of both BinaryRelation and Function-Denotational.  An instance of Function-Denotational FUNC is an instance of BinaryFunction if and only if FUNC has an arity of 2.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'BaseKB', "BaseKB is the most general Microtheory currently in use.  Assertions in this context are `accessible' from any other Microtheory via the genlMt relation.  In the partial order of microtheories, all microtheories have access to BaseKB.  An assertion which is true here will by default be true in every context.  The `content' of BaseKB consists of very general assertions which are expected to be usable in most or all applications of Cyc, as well as Cyc's most fundamental assertions that it uses in inference, and all completely universal, timeless truths.", 'BaseKB', vStrDef).
exactlyAssertedEL_next(comment, 'Backward-AssertionDirection', "An instance of CycLAssertionDirection (q.v.).  A CycL assertion that\nhas the Backward-AssertionDirection can only be used in inferences that \nare carried out when a query is asked. This is the default direction for \nrule assertions.  Contrast with Forward-AssertionDirection and Code-AssertionDirection.  Also see assertionDirection.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'Average', "Computes the average of the function values over all elements in the Set.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'August', "The collection of all Augusts,\n the eighth month of the year in the GregorianCalendar.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'AtemporalNecessarilyEssentialCollectionType', "A collection of collections.  Each instance <code>COL</code> of AtemporalNecessarilyEssentialCollectionType (<i>ANECT</i>) is a collection satisfying three conditions: (1) <code>COL</code> is disjoint with (see disjointWith) TemporalThing, (2) every instance <code>INST</code> of <code>COL</code> is an instance of <code>COL</code> essentially (i.e. <code>INST</code> is an instance of <code>COL</code>, and could not exist without being an instance of <code>COL</code>), and (3) condition (2) is a necessary truth about <code>COL</code>.\n<p>\nPositive examples of ANECTs include Collection, Integer, and Relation (each of which is a collection of atemporals and is such that, necessarily, all of its instances are in it essentially).  Negative examples include SpatialThing (though arguably it is necessary that all of its instances are essentially instances of it, it is not disjoint with TemporalThing) and UniqueAnatomicalPartType (which, though disjoint with TemporalThing, has instances, such as Heart, that could exist even if they weren't instances of it; e.g. it might have been the case that every creature with a heart had at least two hearts).  There are no known examples of Cyc-reified collections satisfying conditions (1) and (2) but not (3), but one can be contrived.  Suppose that all of today's winning lottery numbers were primes.  Now consider the collection:\n<p>\n (CollectionUnionFn \n   (TheSet PrimeNumber <i>TodaysWinningLotteryNumbers</i>))\n<p>\nThis collection is clearly disjoint with TemporalThing and, by hypothesis, all of its instances are in it essentially (as each prime number is essentially a prime number).  But this last fact is not <i>necessarily</i> true of this collection: the collection might have had instances that belonged to it only contingently (i.e. not essentially), as it might have been the case that one of today's winning lottery numbers was non-prime, and no number is such that it is essentially one of today's winning lottery numbers.\n<p>\nWhen asserting that something is an instance or specialization of a given instance of ANECT, it is appropriate to do so in the UniversalVocabularyMt (q.v.).  Indeed, ANECT was specially defined to facilitate the movement of appropriate assertions to that microtheory.\n<p>\nCf. PragmaticallyDecontextualizedCollection.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'AsymmetricBinaryPredicate', "An instance of BinaryPredicateTypeByLogicalFeature and a specialization of AntiSymmetricBinaryPredicate (q.v.).  A binary predicate <code>BINPRED</code> is an instance of AsymmetricBinaryPredicate if and only if (i) for any <code>THING1</code> and <code>THING2</code>, <code>(BINPRED THING1 THING2)</code> implies <code>(not (BINPRED THING2 THING1))</code> and (ii) the single-argument argument type (i.e. argIsa and argGenl) constraints on <code>BINPRED</code>'s two respective argument-places are \"co-satisfiable\" (see cosatisfiableInArgs and NoteOnArgumentCosatisfiabilityRequirement).\n<p>\nExamples of asymmetric binary predicates include northOf, children, greaterThan, and overrides.  Cf. SymmetricBinaryPredicate.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'AssociativeRelation', "The collection of polyadic Relations having the property of <i>associativity</i>.  Roughly speaking, a relation is associative if certain different sequences of recursive applications of it lead to the same final result.\n<p>\nMore precisely:  If <b>RELN</b> is binary, it is an instance of AssociativeRelation if and only if (for any appropriate arguments <b>A</b>, <b>B</b>, and <b>C</b>) the corresponding formulas <b>(RELN A (RELN B C))</b> and <b>(RELN (RELN A B) C)</b> are (extensionally) equivalent: if <b>RELN</b> is a Function-Denotational both formulas have the same denotatum (or both have no denotatum), while if <b>RELN</b> is a Predicate or LogicalConnective both formulas have the same truth value.  If <b>RELN</b> has a higher arity than two, the definition is similar, but with the relevant formula schemata appropriately rewritten.  If <b>RELN</b> is variable-arity (see VariableArityRelation), it is an AssociativeRelation if and only of it behaves associatively with respect to each of the particular arities it subsumes (its arityMin to arityMax).  No unary relation is associative. \n<p>\nIt follows from the above definition that that each argument-place of an associative relation must admit exactly the same class of arguments (see admittedArgument), and that its results must also be of that same class (so that it can be applied recursively).\n<p>\nExamples of associative relations include PlusFn, TimesFn, JoinListsFn, SpatialSumFn, or, and and.\n<p>\nNote that, while many AssociativeRelations are CommutativeRelations (q.v.), this is not always the case.  Consider for example ConcatenateStringsFn.  Since it is associative, (('c'^'a')^'t') = ('c'^('a'^'t')) = 'cat'.  But it is certainly <i>not</i> commutative: 'cat' =/ 'act'.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'assertionUtility-1', "A CycInferenceHeuristicRelevancePredicate. (assertionUtility ASSERTION NUM) states that the CycLAssertion ASSERTION should be heuristically considered of utility NUM to inferences made in the current Microtheory. NUM should be a RealNumber between 1 and -1, with 1 indicating maximum utility, -1 indicating minimum utility, and 0 being agnostic with respect to utility.  (assertionUtility ASSERTION 1) is equivalent to (highlyRelevantAssertion ASSERTION). (assertionUtility ASSERTION -1) is equivalent to (irrelevantAssertion ASSERTION).  See also other instances of CycInferenceHeuristicRelevancePredicate.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'ArgTypeTernaryPredicate', "Those instances of both TernaryPredicate and ArgTypePredicate used to specify the required isa or genls or quotedIsa of an argument of a Relation; the arg1 is the Relation; the arg2 is the argument constrained; the arg3 is the required type: a Collection.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'ArgTypePredicate', "The collection of ArgConstraintPredicates used to put semantic well-formedness constraints on the type of argument(s) appropriate for a given argument-place (or -places) of a given relation.  A \"type\" of argument can be specified in terms of isa or genls; see the various specializations of ArgTypePredicate for more detail. Violation of such a constraint results in an expression that is semantically malformed.  For a general explanation of semantic well-formedness, see CycLExpression-Assertible and its specializations.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'ArgTypeBinaryPredicate', "Those instances of both BinaryPredicate and ArgTypePredicate used to specify the required isa or genls or quotedIsa of an argument of a Relation; the arg1 is the Relation; the arg2 is the required type, a Collection.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'ArgSometimesIsaPredicate', "The collection of ArgTypePredicates (q.v.) that specify argument-types\ndirectly (by referencing certain collections) and impose constraints that\nrequire an argument of a predicate being an instance of a SubLExpressionType\ncollection at some time.  More precisely, each instance\nof ArgSometimesIsaPredicate PRED takes a Relation RELN as its first argument (or\n\"arg1\"), and has at least one other argument-place (say the Mth) for\nspecifying an argument-type for one of RELN's argument-places (say the\nNth). (The value of N might be fixed or might be given by yet another of PRED's\narguments.) Suppose M=2 and N=1. PRED then takes a SubLExpressionType Collection\nas its second argument, and a closed atomic sentence (or \"GAF\") of the form\n(PRED RELN COL ..) puts a \"sometimes isa\" constraint on RELN's first\nargument-place that is based on COL. If PRED is a \"single-argument\" constraint\npredicate, the GAF entails that a closed formula of the form (RELN ARG1 ..) is\nsemantically well-formed only if ARG1 is an instance of \nSubLExpressionType COL in some time interval\n(including Always-TimeInterval).", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'ArgQuotedIsaTernaryPredicate', "A specialization of ArgQuotedIsaPredicate (q.v.). Each instance of ArgQuotedIsaTernaryPredicate. is a ternary predicate used to place an \"quoted isa\" constraint on (and thereby specify an argument-type for) one or more argument-places of a relation. To be more precise, each instance PRED of ArgQuotedIsaTernaryPredicate takes a Relation RELN as its first argument, a NonNegativeInteger N as its second argument, and a SubLExpressionType collection COL as its third argument. PRED places an \"quoted isa\" constraint on RELN's Nth argument-place that is based on COL, so that a ground atomic sentence (GAF) of the form (RELN ARG1..ARGN..) is semantically well-formed only if ARGN is a quoted instance of COL. (Note that if N = 0 then this same constraint is placed on _all_ of RELN's argument-places. An important instance of ArgQuotedIsaTernaryPredicate is argQuotedIsa.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'ArgQuotedIsaPredicate', "The collection of ArgTypePredicates (q.v.) that specify argument-types directly (by referencing certain collections) and impose constraints that require a thing's being an instance of a SubLExpressionType collection thus specified. More precisely, each instance of ArgQuotedIsaPredicate PRED takes a Relation RELN as its first argument (or \"arg1\"), and has at least one other argument-place (say the Mth) for specifying an argument-type for one of RELN's argument-places (say the Nth). (The value of N might be fixed or might be given by yet another of PRED's arguments.) Suppose M=2 and N=1. PRED then takes a SubLExpressionType Collection as its second argument, and a closed atomic sentence (or \"GAF\") of the form (PRED RELN COL ..) puts an \"quoted isa\" constraint on RELN's first argument-place that is based on COL. If PRED is a \"single-argument\" constraint predicate, the GAF entails that a closed formula of the form (RELN ARG1 ..) is semantically well-formed only if ARG1 is an instance of (i.e. quotedIsa) SubLExpressionType COL.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'ArgQuotedIsaBinaryPredicate', "A specialization of ArgQuotedIsaPredicate . Each instance of ArgQuotedIsaBinaryPredicate takes a Relation RELN as its first argument, and a SubLExpressionType Collection COL as its second argument, and places a constraint based on COL on at least one of the argument-places of RELN. To be more precise, suppose that PRED is an ArgIsaBinaryPredicate that specifies an argument-type for the Nth argument-place of RELN. Then a sentence of the form (PRED RELN COL) entails that a closed formula of the form (RELN ... ARGN ...) is semantically well-formed only if ARGN is an instance (i.e. quotedIsa) of COL.", 'UniversalVocabularyMt', vStrMon).
exactlyAssertedEL_next(comment, 'ArgIsaTernaryPredicate', "A specialization of both ArgTypeTernaryPredicate and ArgIsaPredicate (q.v.).  Each instance of ArgIsaTernaryPredicate is a ternary predicate used to place an \"isa\" constraint on (and thereby specify an argument-type for) one or more argument-places of a relation.  To be more precise, each instance PRED of ArgIsaTernaryPredicate takes a Relation RELN as its first argument, a NonNegativeInteger N as its second argument, and a Collection COL as its third argument.  PRED places an \"isa\" constraint on RELN's Nth argument-place that is based on COL, so that a ground atomic sentence (GAF) of the form (RELN ARG1..ARGN..) is semantically well-formed only if ARGN is an instance of COL. (Note that (i) if N = 0 then this same constraint is placed on _all_ of RELN's argument-places and (ii) if PRED is argAndRestIsa then this constraint is placed on all of RELN's argument-places whose ordinal positions are greater than or equal to the Nth.)  An important instance of ArgIsaTernaryPredicate is argIsa.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'ArgIsaPredicate', "The collection of ArgTypePredicates (q.v.) that specify argument-types directly (by referencing certain collections) and impose constraints that require a thing's being an instance of a collection thus specified.  More precisely, each instance of ArgIsaPredicate PRED takes a Relation RELN as its first argument (or \"arg1\"), and has at least one other argument-place (say the Mth) for specifying an argument-type for one of RELN's argument-places (say the Nth).  (The value of N might be fixed or might be given by yet another of PRED's arguments.)  Suppose M=2 and N=1.  PRED then takes a Collection as its second argument, and a closed atomic sentence (or \"GAF\") of the form (PRED RELN COL ..) puts an \"isa\" constraint on RELN's first argument-place that is based on COL.  If PRED is a \"single-argument\" constraint predicate, the GAF entails that a closed formula of the form (RELN ARG1 ..) is semantically well-formed only if ARG1 is an instance of (i.e. isa) COL.  If PRED is an \"inter-argument\" constraint predicate, the GAF expresses a slightly more complicated, conditional isa constraint on a pair of RELN's argument-places (see InterArgIsaPredicate).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'ArgIsaBinaryPredicate', "A specialization of both ArgTypeBinaryPredicate and ArgIsaPredicate.  Each instance of ArgIsaBinaryPredicate takes a Relation RELN as its first argument, and a Collection COL as its second argument, and places a constraint based on COL on at least one of the argument-places of RELN.  To be more precise, suppose that PRED is an ArgIsaBinaryPredicate that specifies an argument-type for the Nth argument-place of RELN.  Then a sentence of the form (PRED RELN COL) entails that a closed formula of the form (RELN ... ARGN ...) is semantically well-formed only if  ARGN is an instance of COL.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'ArgGenlTernaryPredicate', "A specialization of ArgTypeTernaryPredicate and ArgGenlPredicate.  Each instance of ArgGenlTernaryPredicate is used to specify that a certain collection is required to stand in the genls relation to anything that is acceptable in a particular argument slot of a given instance of Relation.  With each instance of ArgGenlTernaryPredicate, the first argument is the relation constrained; the second argument is the argument constrained; and the third argument is the required collection that the relation's specified argument is required to be a specialization of.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'ArgGenlQuantityTernaryPredicate', "A specialization of both ArgTypeTernaryPredicate and ArgGenlAttributePredicate.  Each instance of ArgGenlAttributeTernaryPredicate is a ternary predicate used to place a \"quantitySubsumes\" constraint on (and thereby specify an argument-type for) one or more argument-places of a relation.  To be more precise, each instance PRED of ArgGenlAttributeTernaryPredicate takes a Relation RELN as its first argument, a NonNegativeInteger N as its second argument, and an Quantity QUANT as its third argument. PRED places a \"quantitySubsumes\" constraint on RELN's Nth argument-place that is based on QUANT, so that a ground atomic sentence (GAF) of the form (RELN ARG1..ARGN..) is semantically well-formed only if ARGN is subsumed by QUANT (in the sense that (quantitySubsumes QUANT ARGN) holds).  An important instance of ArgGenlAttributeTernaryPredicate is argGenlAttribute.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'ArgGenlQuantityBinaryPredicate', "Those instances of both ArgTypeBinaryPredicate and ArgGenlAttributePredicate used to specify the required quantity of an argument of Relation.  Each instance PRED of this collection is a binary predicate with the following properties: ARG1 is an instance of Relation, and ARG2 is an instance of Quantity.  (PRED ARG1 ARG2) means that some argument of ARG1 is constrained to be subsumed by (via quantitySubsumes) ARG2, where PRED determines the argument place in question.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'ArgGenlBinaryPredicate', "Those instances of both BinaryPredicate and ArgGenlPredicate used to specify the required genls of an argument of a Relation; the arg1 is the Relation; the arg2 is the required genls Collection.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'ArgConstraintPredicate', "The collection of MetaRelations whose instances are used to put semantic well-formedness or entry-format constraints on one or more argument-places of a given Relation.  Such a constraint might concern an argument's <i>type</i>, an argument-place's Format (q.v.), a conditional relationship between two argument(-place)s' types or formats, or some other sort of relationship between two arguments.  For a fuller account, see the various specializations of ArgConstraintPredicate.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'April', "The collection of all Aprils, \nthe fourth month of the year in the GregorianCalendar.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'AntiTransitiveBinaryPredicate', "A BinaryPredicateTypeByLogicalFeature and a specialization of  IrreflexiveBinaryPredicate (q.v.).  A binary predicate PRED is an instance of  AntiTransitiveBinaryPredicate only if it has this property: for any THING1, THING2, and THING3 such that both (PRED THING1 THING2) and (PRED THING2 THING3) hold, (not (PRED THING1 THING3)) holds.  Equivalently: for every X, Y, and Z that satisfy the (single-argument) argument-type constraints  (see admittedArgument) for the relevant argument positions of PRED,  (not (and (PRED X Y)(PRED Y Z)(PRED X Z))) holds.  Note that  PRED's two agument-positions must also be \"co-satisfiable\" with respect to their type constraints; see cosatisfiableInArgs and NoteOnArgumentCosatisfiabilityRequirement.\n<p>\nFor example, divorcedFrom is an instance of AntiTransitiveBinaryPredicate.\n<p>\nNote also that, while not strictly disjoint with TransitiveBinaryPredicate (q.v.), in practice few if any reified predicates should be instances of both of these collections. An important specialization of AntiTransitiveBinaryPredicate is DirectBinaryPredicate (q.v.).", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'AntiSymmetricBinaryPredicate', "A BinaryPredicateTypeByLogicalFeature and thus a specialization of BinaryPredicate.  A binary predicate <code>PRED</code> is an AntiSymmetricBinaryPredicate if and only if it has the following two properties.  (i) For any <code>THING1</code> and <code>THING2</code> such that both <code>(PRED THING1 THING2)</code> and <code>(PRED THING2 THING1)</code> hold, <code>THING1</code>  = <code>THING2</code>.  (ii) <code>PRED</code>'s two argument-places must be \"co-satisfiable\" with respect to their (single-argument) type constraints (see cosatisfiableInArgs and NoteOnArgumentCosatisfiabilityRequirement).\n<p>\nInstances of AntiSymmetricBinaryPredicate include greaterThanOrEqualTo, parts, and subEvents.  See also the specialization AsymmetricBinaryPredicate; and cf. SymmetricBinaryPredicate.", 'UniversalVocabularyMt', vStrDef).
exactlyAssertedEL_next(comment, 'AllowKeywordVariables', "A CanonicalizerDirective (q.v.)  that is a specialization (see genlCanonicalizerDirectives) of  AllowGenericArgVariables.  AllowKeywordVariables directs the  CycCanonicalizer to allow all \"keyword variables\" (e.g. `:NOUN'  and `:ARG1') to appear in CycL assertions and to treat them as if they  were CycLVariables.", 'CoreCycLImplementationMt', vStrDef).
exactlyAssertedEL_next(comment, 'AllowGenericArgVariables', "A CanonicalizerDirective (q.v.) that directs the CycCanonicalizer to allow \"generic argument keyword variables\" (e.g. `:ARG1' and `:ARG2') to appear in CycL assertions and  to treat them as if they were CycLVariables.  For a specialization (see genlCanonicalizerDirectives) of this directive that is used to  direct the canonicalizer to allow _all_ keyword variables, see AllowKeywordVariables.", 'CoreCycLImplementationMt', vStrDef).
exactlyAssertedEL_next(comment, 'AbsoluteValueFn', "AbsoluteValueFn is the unary mathematical function that returns the absolute value of its argument; e.g., (AbsoluteValueFn -2) returns 2, and (AbsoluteValueFn 2) returns 2.", 'UniversalVocabularyMt', vStrDef).
